	(2, 'ecozones', 1, 'Environment Canada', 'Environnement Canada', 'Ecozones of Canada', 'Écozones du Canada', 'Ecozones of Canada, forming part of the Terrestrial Ecological Stratification of Canada ', 'Écozones du Canada, faisant partie de la cadre national écologique pour le Canada', NULL, NULL),
	(3, 'ecoprovinces', 2, 'Environment Canada', 'Environnement Canada', 'Ecoprovinces of Canada', 'Écoprovinces du Canada', 'Ecoprovinces of Canada, forming part of the Terrestrial Ecological Stratification of Canada. ', 'Écoprovinces du Canada, faisant partie du Cadre national écologique pour le Canada', NULL, '2012-02-10 15:49:34'),
	(4, 'ecoregions', 3, 'Environment Canada', 'Environnement Canada', 'Ecoregions of Canada', 'Écorégions du Canada', 'Ecoregions of Canada, forming part of the Terrestrial Ecological Stratification of Canada. ', 'Écorégions du Canada, faisant partie du Cadre national écologique pour le Canada.', NULL, '2012-02-10 15:50:18'),
	(5, 'ecodistricts', 4, 'Environment Canada', 'Environnement Canada', 'Ecodistricts of Canada', 'Écodistricts du Canada', 'Ecodistricts of Canada, forming part of the Terrestrial Ecological Stratification of Canada.', 'Écodistricts du Canada, faisant partie du Cadre national écologique pour le Canada.', NULL, '2012-02-10 15:51:20'),
	(8, 'slc', 5, 'Agriculture and Agri-Food Canada', 'Agriculture et Agroalimentaire Canada', 'Soil Landscapes of Canada', 'Pédo-paysages du Canada', 'The Soil Landscapes of Canada (SLC) is a series of GIS coverages that show the major characteristics of soil and land for the whole country. SLCs were compiled at a scale of 1:1 million, and information is organized according to a uniform national set of soil and landscape criteria based on permanent natural attributes.', 'Les pédo-paysages du Canada (PPC) sont une série de couvertures pour le SIG qui présentent les principales caractéristiques des sols et des terres pour l\'ensemble du pays. Les PPC ont été compilés selon une échelle à 1/1 million et l\'information est réunie d\'après un ensemble uniforme de critères relatifs aux pédo-paysages qui reposent sur les caractéristiques naturelles permanentes.', NULL, NULL),
	(9, 'dss', 6, 'Agriculture and Agri-Food Canada', 'Agriculture et Agroalimentaire Canada', 'Detailed Soil Surveys', 'Levés pédologiques détaillés', 'Detailed Soil Surveys', 'Levés pédologiques détaillés', '2012-02-02 21:03:27', '2012-02-10 16:17:16'),
	(10, 'surveyindex', 7, 'Agriculture and Agri-Food Canada', 'Agriculture et Agroalimentaire Canada', 'Detailed Soil Survey Map Index', 'Index des cartes détaillé du pédologie', 'The index of detailed soil surveys shows the mapped area of all soil survey reports in Canada.', 'L\'indice des levés détaillés des sols montre la zone cartographiée de tous les rapports d\'enquête du sol au Canada.', NULL, '2012-02-03 21:06:01');
