	(10, 'slc', 'v2r2', 1, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2', 'Agriculture and Agri-Food Canada', 'Agriculture et Agroalimentaire Canada', 'Soil Landscapes of Canada version 2.2', 'Pédo-paysages du Canada version 2.2', 'The Soil Landscapes of Canada (SLC) is a series of GIS coverages that show the major characteristics of soil and land for the whole country. SLCs were compiled at a scale of 1:1 million, and information is organized according to a uniform national set of soil and landscape criteria based on permanent natural attributes.', 'Les pédo-paysages du Canada (PPC) sont une série de couvertures pour le SIG qui présentent les principales caractéristiques des sols et des terres pour l\'ensemble du pays. Les PPC ont été compilés selon une échelle à 1/1 million et l\'information est réunie d\'après un ensemble uniforme de critères relatifs aux pédo-paysages qui reposent sur les caractéristiques naturelles permanentes.', NULL, '1996-12-31', '2.2', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/', 'sl', 'integer', 6, 0, 10, 43, -145, 90, -50, 'true', NULL, NULL),
