	(101, 'surveyindex', 'v1', 1, 'http://sis.agr.gc.ca/cansis/nsdb/dss/index', 'Agriculture and Agri-Food Canada', 'Agriculture et Agroalimentaire Canada', 'Detailed Soil Survey Map Index', 'Index des cartes détaillé du pédologie', 'The index of detailed soil surveys shows the mapped area of all soil survey reports in Canada.', 'L\'indice des levés détaillés des sols montre la zone cartographiée de tous les rapports d\'enquête du sol au Canada.', '', '1999-01-01', '1', '', '', 'index_id', 'integer', 9, 0, 50, 43, -145, 90, -50, 'false', NULL, '2012-02-03 21:06:01'),
