INSERT INTO `data3datasets` (`id`, `dataseturi`, `frameworkuri`, `dataset_name`, `shapefilename_obsolete`, `organization_en`, `organization_fr`, `title_en`, `title_fr`, `abstract_en`, `abstract_fr`, `relationships_en`, `relationships_fr`, `usage_en`, `usage_fr`, `limitations_en`, `limitations_fr`, `origin_en`, `origin_fr`, `startdate`, `referencedate`, `version`, `documentation_en`, `documentation_fr`, `frameworkkey`, `keytype`, `keylength`, `keydecimals`, `keyrelationship`, `keycomplete`, `publish`, `sortation`, `created_at`, `updated_at`) VALUES
	(1, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/prt', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2', 'slc_v3r2_canada_prt', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Polygon Ratings Table (PRT)', 'Table d\'evaluation de polygone', '<p>The Polygon Ratings Table (PRT) contains attributes that apply to the entire SLC polygon.</p>', '<p> La table des notations polygone (PRT) contient les attributs qui s\'appliquent à l\'ensemble des polygones des PPC. </ p>', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2009-12-01', '3.2', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/prt/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.2/prt/intro.html', 'poly_id', 'integer', '7', '0', 'one', 'true', 'true', 8, NULL, NULL),
	(2, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/crt', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2', 'slc_v3r2_canada_crt', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Component Rating Table (CRT)', 'Table de classification des composantes', '<p>The Component Rating Table (CRT) contains soil and landform suitability ratings that apply to individual components within a polygon.  These ratings are generated from the contents of the <a href="/cansis/nsdb/soil/v2/snt/index.html">Soil Names Table</a> (SNT) and <a href="/cansis/nsdb/soil/v2/slt/index.html">Soil Layers Table</a> (SLT).</p>', '<p>La table de classification des composantes (CRT) renferme les classes d\'aptitude du sol et du relief qui s\'appliquent á chaque composante d\'un polygone. Ces classes sont établies á partir du contenu du tableau des noms (SNT) et du tableau des couches de sol (SLT).</p>', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2009-12-01', '3.2', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/crt/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.2/crt/intro.html', 'poly_id', 'integer', '7', '0', 'many', 'true', 'true', 3, NULL, NULL),
	(3, 'http://sis.agr.gc.ca/cansis/nsdb/ecoregions/v1/names', 'http://sis.agr.gc.ca/cansis/nsdb/ecoregions/v1', 'ecoregions_v1_canada_names', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Ecoregion Names', 'Table des noms des écorégions', '<p>This table contains attributes which apply to entire <a href="/cansis/nsdb/ecostrat/1999report/framework.html"><u>EcoRegions</u></a>.</p>', '<p>Cette table contient les attributs qui s\'appliquent à l\'ensemble <a href="/siscan/nsdb/ecostrat/1999report/framework.html"> <u> écorégions </u></a>.</p>', '<ul>\n <li>A record in this file is unique with respect to Ecoregion.</li>\n</ul>', '<ul>\n <li>Un enregistrement dans ce fichier est unique à l\'égard de l\'écorégion. </li>\n</ul>', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '1999-09-16', '1', NULL, NULL, 'ecoregion', 'integer', '3', '0', 'one', 'true', 'true', NULL, NULL, NULL),
	(4, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2/snt', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2', 'soil_name_REGION_v2', 'region_soil_name_v2', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Soil Name Table (SNT)', 'Table de nom de sol (SNT)', '<p>The Soil Name Table (SNT) describes the general physical and chemical characteristics for all of the soils identified in a geographic region.  \r\nSoil Order, Great Group and Subgroup are listed, along with attributes such as mode of deposition, and drainage class.</p>\r\n\r\n<p>The latest version is <a href="/cansis/nsdb/soil/v2/download.html">available here</a>.</p>', '<p>Cette table décrit les caractéristiques physiques et chimiques générales pour tous les sols identifiés dans une région géographique.</p>\r\n\r\n<p>La version la plus récente est <a href="/siscan/nsdb/soil/v2/download.html">disponible ici</a>.</p>', '<ul>\r\n <li>There is one Soil Name Table for all of Canada.</li>\r\n <li>A record in this table is unique with respect to SOIL_ID.</li>\r\n <li>This file is linked to the <a href="/cansis/nsdb/soil/v2/slt/index.html">Soil Layer Table</a> by SOIL_ID.</li>\r\n</ul>', '<ul>\r\n <li>Il y a une table SNT pour tout le Canada.</li>\r\n <li>Chaque enregistrement dans ce fichier possède un champ SOIL_ID unique.</li>\r\n <li>Ce fichier est lié à la table <a href="/siscan/nsdb/soil/v2/slt/index.html">SLT</a> selon le champ SOIL_ID.</li>\r\n</ul>', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', '', '2009-12-01', '2', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v3/names/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.2/names/intro.html', 'soil_id', 'integer', '9', '0', 'many', 'true', 'true', 4, NULL, '2014-04-17 20:26:11'),
	(5, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2/slt', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2', 'soil_layer_REGION_v2', 'region_soil_layer_v2', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Soil Layer Table (SLT)', 'Table de couche de sol (SLT)', '<p>The Soil Layer Table (SLT) contains information which varies in a vertical direction, for all soils in the NSDB.  Data in this table is based upon real measurements where available, but the majority of values are estimates provided by experienced pedologists.  The data in the SLT can be considered to represent modal information for each attribute in isolation.  As such it is appropriate for mapping and land suitability interpretations.  It should not be treated as real pedons for environmental modelling purposes because the recorded combination of measurements may never actually be present for any pedon in the field.  Measurements for real pedons are stored in the Pedon database.</p>\r\n\r\n<p>The latest version of the SLT is <a href="/cansis/nsdb/soil/v2/download.html">available here</a>.</p>', '<p>Le fichier sur les couches de sol est conçu pour traiter les attributs qui varient dans le sens vertical.  Les données de ce tableau sont basées sur des mesures réelles lorsqu\'elles sont disponibles, mais la plupart des valeurs sont des estimations fournies par les pédologues expérimentés. Les données de la SLT peuvent être considérées comme représentant des informations modal pour chaque attribut dans l\'isolement. Comme tel, elles conviennent pour la cartographie et les interprétations de l’aptitude des terres. Elles ne doivent pas être traitées comme de véritables pédons à des fins de modélisation environnementale parce que la combinaison enregistrée des mesures peut ne jamais être présent pour tout pédon dans le domaine. Les mesures pour les vrais pédons sont stockés dans la base de données pédon.</p>\r\n\r\n<p>La version la plus récente est <a href="/siscan/nsdb/soil/v2/download.html">disponible ici</a>.</p>', '<ul>\r\n <li>A record in this file is unique with respect to SOIL_ID + LAYER_NO.</li>\r\n <li>This file can be linked to the CMP and SNT files via the SOIL_ID field.</li>\r\n</ul>', '<ul>\r\n <li>Chaque enregistrement dans ce fichier poss&egrave;de un champ SOIL_ID + LAYER_NO unique.</li>\r\n <li>Ce  fichier peut &ecirc;tre reli&eacute; aux fichiers CMP et SNT par l\'entremise du champ SOIL_ID.</li>\r\n</ul>', 'n/a', 'n/a', '<p>A comprehensive set of validation checks were run on the values found in this table to eliminate gross errors and ensure that the data are complete and internally consistent.  These checks were not performed on records where the value of the KIND field in the SNT was U or N (Unclassified or Non soil).  As a result, there may be inconsistencies in the amount and type of SLT data recorded for these soils.  Some “non soil” components may have no SLT data, others may have records with “-9” in most fields, and some may have SLT records with attribute values that some interpretation programs can use.  For example, bedrock may have no SLT records at all, or it may have just a single SLT layer, with HZN_MAS = “R  “, TSAND, TSILT, TCLAY = “-9”, BD = 3.0 or -9, etc.</p>', '<p>Un ensemble complet de contrôles de validation a été effectué sur les valeurs trouvées dans ce tableau pour éliminer les erreurs grossières et de s\'assurer que les données sont complètes et cohérentes. Ces contrôles n\'ont pas été effectués sur les enregistrements où la valeur du champ de genre dans le SNT était U ou N (sol non classifié ou non). En conséquence, il peut y avoir des incohérences dans la quantité et le type de données enregistrées SLT pour ces sols. Certains composants "non" du sol peuvent avoir aucune donnée SLT, d\'autres peuvent avoir des dossiers avec "-9" dans la plupart des domaines, et certains peuvent avoir des enregistrements de SLT avec des valeurs d\'attributs que certains programmes d\'interprétation peuvent utiliser. Par exemple, le substratum rocheux peut avoir aucun enregistrement de SLT (delete: à tous), ou il peut avoir juste une couche de SLT unique, avec HZN_MAS = "R", TSAND, TSILT, TCLAY = "-9", BD = 3.0 ou -9, etc.</p>', 'n/a', 'n/a', '', '2009-12-01', '2', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v3/layers/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/soils/v3/layers/intro.html', 'layer_id', 'integer', '7', '0', 'many', 'true', 'true', 3, NULL, '2014-04-28 17:12:58'),
	(6, 'http://sis.agr.gc.ca/cansis/nsdb/pedon/v2/sites', 'http://sis.agr.gc.ca/cansis/nsdb/pedon/v2', 'pedon_v2_sites', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Pedon Sites Table (PST)', 'tbd', 'The Pedon Site Table describes the locations of all pedons in the NSDB.', 'tbd', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2009-12-01', '2', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v3/sites/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/soil/v3/sites/intro.html', 'pedon_id', NULL, NULL, '0', 'many', 'true', 'false', NULL, NULL, NULL),
	(7, 'http://sis.agr.gc.ca/cansis/nsdb/pedon/v2/physical', 'http://sis.agr.gc.ca/cansis/nsdb/pedon/v2', 'pedon_v2_physical_OBSOLETE', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Pedon Physical Properties Table (PPT)', 'tbd', 'The Pedon Physical Properties Table describes the physical properties for all pedons in the NSDB.', 'tbd', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2009-12-01', '2', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v3/physical/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/soil/v3/physical/intro.html', 'player_id', NULL, NULL, '0', 'many', 'true', 'false', NULL, NULL, NULL),
	(8, 'http://sis.agr.gc.ca/cansis/nsdb/pedon/v2/chemical', 'http://sis.agr.gc.ca/cansis/nsdb/pedon/v2', 'pedon_v2_chemical_OBSOLETE', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Pedon Chemical Properties Table (PCT)', 'tbd', 'The Pedon Chemical Properties Table describes the chemical properties for all pedons in the NSDB.', 'tbd', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2009-12-01', '2', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v3/chemical/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/soil/v3/chemical/intro.html', 'player_id', NULL, NULL, '0', 'many', 'true', 'false', NULL, NULL, NULL),
	(9, 'http://sis.agr.gc.ca/cansis/nsdb/ecoprovinces/v1/names', 'http://sis.agr.gc.ca/cansis/nsdb/ecoprovinces/v1', 'ecoprovinces_v1_canada_names', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Ecoprovince Names', 'Table des noms des écoprovinces', '<p>This table contains attributes which apply to entire <a href="/cansis/nsdb/ecostrat/1999report/framework.html"><u>EcoProvinces</u></a>.</p>', '<p> Ce table contient les attributs qui s\'appliquent à l\'ensemble <a href="/siscan/nsdb/ecostrat/1999report/framework.html"> <u> écoprovinces </u> </a>. </p>', '<ul>\n <li>A record in this file is unique with respect to Ecoprovince.</li>\n</ul>', '<ul>\n <li>Un enregistrement dans ce fichier est unique à l\'égard de l\'écoprovince. </li>\n</ul>', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '1999-09-16', '1', NULL, NULL, 'ecoprov', 'string', '4', '1', 'one', 'true', 'true', NULL, NULL, NULL),
	(10, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/cmp', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2', 'slc_v3r2_canada_cmp', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Component Table (CMP)', 'Table des composantes', '<p>The Component Table describes each of the individual soil and landscape features which comprise the polygon (i.e. the components of the polygon).   \r\nEach component includes its estimated extent, slope, stoniness, and local surface form class, as well as a link to the soil attributes provided in the \r\n<a href="/cansis/nsdb/soil/v2/snt/index.html">Soil Name</a> and \r\n<a href="/cansis/nsdb/soil/v2/slt/index.html">Soil Layer</a> tables.</p>\r\n<p>Note that components apply to only the land and wetland portion of the polygon.  The existence of true water bodies is described in the \r\n<a href="/cansis/nsdb/slc/v3.2/lat/index.html">Land Area Table</a> (LAT).</p>', '<p>La table des composantes d&eacute;crit les sols et paysages qui sont les composantes d&rsquo;un polygone.  Noter que les composantes ne  d&eacute;crivent que la portion terre du polygone.</p>', '<ul> \r\n <li>A record in this file is unique with respect to POLY_ID and CMP.</li> \r\n <li>SOIL_ID is used to relate (N:1) to the Soil Name Table (SNT).</li> \r\n</ul> \r\n<p>The proportion of the polygon occupied by each separate component is identified. However, their location within the polygon is not defined. While the data model does not restrict the number of components or the proportion of the polygon that they occupy, restrictions have been recommended from a subject matter/organization standpoint. </p> \r\n<p>Note that the dominant component for some polygons will be a non-soil (e.g. ice or rock). Analyses involving dominant soil components should take this fact into account. </p>', '<ul>\r\n <li>Chaque enregistrement de ce fichier pr&eacute;sente un code POLY_ID et un code CMP unique.</li>\r\n <li>SOIL_ID est requis pour &eacute;tablir la relation (N:1) &agrave; la table des noms de sol.</li>\r\n</ul>\r\n<p>La proportion du polygone qui est occup&eacute; par chaque composante individuelle est identifi&eacute;e.&nbsp; Toutefois, leur emplacement n&rsquo;est pas d&eacute;fini &agrave; l&rsquo;int&eacute;rieur du polygone.M&ecirc;me si le mod&egrave;le des donn&eacute;es ne place pas de limite sur le nombre de composantes, ni sur la proportion du polygone qu&rsquo;elles occupent, on a recommand&eacute; des restrictions du point de vue du sujet et de l&rsquo;organisation.</p>\r\n<p>Noter que l&rsquo;&eacute;l&eacute;ment dominant de certains polygones sera un non-sol (c.&agrave; d. de la glace ou de la roche).&nbsp; Les analyses qui invoquent les composantes dominantes des sols devront en tenir compte.</p>', 'n/a', 'n/a', 'n/a', 'n/a', '<p>The Soil Landscape Component Table was updated for version 3.2 to meet the requirements of a number of AAFC initiatives including the National Greenhouse Gas and Carbon Accounting Validation System (NGCAVS), and the National Agri-Environmental Health Assessment and Reporting Program (NAHARP). It is based on the SLC version 2.2 component table, but has been updated to reflect new knowledge in the agricultural areas of the country. It has been compiled for all map coverages in Canada. It is a generalized version of the information that can be found in the detailed soil surveys. </p>', 'n/a', '', '2009-12-01', '3.2', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/cmp/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.2/cmp/intro.html', 'poly_id', 'integer', '7', '0', 'many', 'true', 'true', 2, NULL, '2012-11-26 21:55:44'),
	(11, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/pat', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3', 'dss_v3_REGION_pat', 'region_subregion_soil_v3.dbf', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Polygon Attribute Table (PAT)', 'Table de polygone', '<p>The Polygon Attribute Table (PAT) provides the linkage between geographic locations (polygons) and soil attributes in the associated database tables.</p>', '<p>Cette table fournit le lien entre les emplacements géographiques (polygones) et les attributs de sol dans les bases de données associées.</p>', '<ol>\r\n <li>A record in this file is unique with respect to <a href="poly_id.html">POLY_ID</a>.</li>\r\n <li>The <a href="poly_id.html">POLY_ID</a> field is used to relate (1:N) to the <a href="/cansis/nsdb/dss/v3/cmp/index.html">CMP</a>\r\ntable.</li>\r\n</ol>\r\n<p>Notes:</p>\r\n<ol>\r\n<li><a href="poly_id.html">POLY_ID</a> numbers may not be unique within a coverage.</li>\r\n<li>The first 6 characters of <a href="poly_id.html">POLY_ID</a> will be identical for all records that originated from a single source coverage.</li>\r\n</ol>', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', '', '2009-12-01', '2', '(NULL)', '(NULL)', 'poly_id', 'string', '11', '0', 'one', 'true', 'true', 1, NULL, '2012-12-11 19:39:44'),
	(12, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/cmp', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3', 'dss_v3_REGION_cmp', 'region_subregion_soil_v3_cmp.dbf', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Component Table (CMP)', 'Table des composantes', '<p>The Component Table describes each of the individual soil landscapes which comprise the polygon (i.e. the components of the polygon).  Note that components apply to only to the land and wetland portion of the polygon.</p>', '<p>Cette table d&eacute;crit les p&eacute;do-paysages du sol qui sont les composantes d&rsquo;un polygone.  Noter que les composantes ne  d&eacute;crivent que la portion terre du polygone.</p>', '<ul>\r\n <li>A record in this file is unique with respect to <a href="poly_id.html">POLY_ID</a> &amp; <a href="cmp.html">CMP</a>.</li>\r\n <li><a href="soil_id.html">SOIL_ID</a> is required to relate (N:1) to the <a href="/cansis/nsdb/soil/v2/snt/index.html">SNT</a>.</li>\r\n <li><a href="cmp_id.html">CMP_ID</a> is required to relate (1:1) to the <a href="/cansis/nsdb/dss/v3/crt/index.html">CRT</a>.</li>\r\n</ul>\r\n<p>The proportion of the polygon occupied by each separate component is identified. However, their location within the polygon is not defined. While the data model does not restrict the number of components or the proportion of the polygon that they occupy, restrictions have been recommended from a subject matter/organization standpoint. </p>\r\n<p>Note that the dominant component for some polygons will be a non-soil (e.g. ice or rock). Analyses involving dominant soil components should take this fact into account. </p>', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', '', '2009-12-01', '2', '(NULL)', '(NULL)', 'poly_id', 'string', '14', '0', 'many', 'true', 'true', 2, NULL, '2012-12-11 19:48:14'),
	(13, 'http://sis.agr.gc.ca/cansis/nsdb/ecoregions/v1/egdd1961x1990', 'http://sis.agr.gc.ca/cansis/nsdb/ecoregions/v1', 'ecoregions_v1_canada_egdd1961x1990', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Effective Growing Degree Days 1961-1990', 'degrés-jours de croissance effectifs 1961-1990', NULL, NULL, 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '1999-09-16', '1', NULL, NULL, 'ecoregion', 'integer', '3', '0', 'one', 'true', 'true', NULL, NULL, NULL),
	(14, 'http://sis.agr.gc.ca/cansis/nsdb/ecodistricts/v1/names', 'http://sis.agr.gc.ca/cansis/nsdb/ecodistricts/v1', 'ecodistricts_v1_canada_names', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Ecodistrict Names', 'Noms du Écodistrict', NULL, NULL, 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2011-01-05', '1', NULL, NULL, 'ecodistrict', 'integer', '4', '0', 'one', 'true', 'true', NULL, NULL, NULL),
	(15, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/prt', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3', 'dss_v3_REGION_prt', 'region_subregion_soil_v3_prt.dbf', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Polygon Rating Table (PRT)', 'Table d\'evaluation de polygone', '<p>The Polygon Ratings Table (PRT) contains attributes that apply to the entire soil polygon.</p>', '<p> La table des notations polygone (PRT) contient les attributs qui s\'appliquent à l\'ensemble des polygones. </ p>', '<ul> <li>A record in this file is unique with respect to <a href="poly_id.html">POLY_ID</a>.</li> <li><a href="poly_id.html">POLY_ID</a> is used to join this table to the <a href="/cansis/nsdb/dss/v3/pat/index.html">PAT</a>.</li> </ul>', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', '', '2009-12-01', '2', '(NULL)', '(NULL)', 'poly_id', 'string', '11', '0', 'one', 'true', 'true', 3, NULL, '2012-12-11 19:39:07'),
	(16, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/crt', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3', 'dss_v3_REGION_crt', 'region_subregion_soil_v3_crt.dbf', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Component Rating Table (CRT)', 'Table d\'evaluation des composantes', '<p>The Component Rating Table, if present,  provides interpretive ratings for each of the individual soils which are found in the polygon (i.e. the components of the polygon). The content of this table varies by province.</p>', 'TBD', '<ul>\r\n <li>A record in this file is unique with respect to <a href="cmp_id.html">CMP_ID</a>.</li>\r\n <li><a href="cmp_id.html">CMP_ID</a> is used to join this table to the  <a href="/cansis/nsdb/dss/v3/cmp/index.html">CMP</a>.</li>\r\n</ul>', 'TBD', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', '', '2009-12-01', '2', '(NULL)', '(NULL)', 'poly_id', 'string', '14', '0', 'many', 'true', 'true', 3, NULL, '2012-12-11 19:50:11'),
	(17, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/lat', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2', 'slc_v3r2_canada_lat', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Landscape Area Table (LAT)', 'Table des superficies du paysage', '<p>The Land Area Table (LAT) contains attributes of the polygon, and attributes which apply to the entire landscape represented by that polygon.  \nArea values for the SLC polygons were calculated using the HYDRO coverage.  When unioned with the SLC coverage, it provides land, fresh water and ocean water values for each landscape polygon. All values are in hectares.</p>', '<p>La table de paysage (LAT) contient les attributs du polygone, ainsi que les attributs qui s\'appliquent au paysage entier représenté par ce polygone. Toutes les superficies sont exprimées en hectares.</p>\n<p>Les valeurs de superficie des polygones des PPC ont été calculées en utilisant la couverture HYDRO. Lorsqu\'on les combine à la couverture PPC, on obtient les valeurs concernant les terres, les eaux douces et les océans pour chaque polygone du paysage. </p>', '<ul>\n <li>A record in this file is unique with respect to POLY_ID.</li>\n <li>The POLY_ID field is used to relate to the PAT.</li>\n</ul>', '<ul>\n  <li>Chaque enregistrement dans ce fichier pr&eacute;sente un champ POLY_ID unique. </li>\n  <li>Le champ POLY_ID est utilis&eacute; pour la mise en relation avec la table des attributs de polygone (PAT).</li>\n</ul>', 'n/a', 'n/a', 'n/a', 'n/a', '<p>The Land Area Table was developed to simplify the calculation of land and water areas for the SLC polygons, and remove ambiguities in the way water was represented in previous versions. This table was derived from the SLC and HYDRO coverages.</p>', '<p>La table des attributs  de paysage a &eacute;t&eacute; &eacute;labor&eacute;e dans le but de simplifier les calculs des superficies  des terres et de l\'eau pour les polygones du PPC et pour &eacute;liminer les  ambig&uuml;it&eacute;s dans la fa&ccedil;on dont l\'eau est repr&eacute;sent&eacute;e dans les versions  ant&eacute;rieures. Cette table a &eacute;t&eacute; d&eacute;riv&eacute;e des couvertures PPC et HYDRO.<br />', NULL, '2009-12-01', '3.2', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/landarea/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.2/landarea/intro.html', 'poly_id', 'integer', '7', '0', 'one', 'true', 'true', 4, NULL, NULL),
	(18, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1', 'soil_layer_REGION_v1', 'region_soil_layer_v1', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Soil Layer Table (SLT)', 'Table de couche de sol (SLT)', '<p>The Soil Layer Table (SLT) is designed to handle attributes which vary in a vertical direction in the soil profile.</p>', '<p>Cette table est conçu pour traiter les attributs qui varient dans le sens vertical.</p>', '<ul>\n <li>A record in this file is unique with respect to SOILKEY.</li>\n <li>This file can be linked to the CMP and SNT files via the SOILKEY field.</li>\n</ul>', '<ul>\n <li>Chaque enregistrement dans ce fichier poss&egrave;de un champ SOILKEY unique.</li>\n <li>Ce  fichier peut &ecirc;tre reli&eacute; aux fichiers CMP et SNT par l\'entremise du champ SOILKEY.</li>\n</ul>', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '1999-12-01', '1', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/prt/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.2/prt/intro.html', 'layer', 'integer', '7', '0', 'many', 'true', 'false', NULL, NULL, NULL),
	(19, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1', 'soil_name_REGION_v1', 'region_soil_name_v1', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Soil Name Table (SNT)', 'Table de nom de sol (SNT)', '<p>The Soil Name Table (SNT) contains general information for all soils in the NSDB.</p>', '<p>Cette table contient des renseignements généraux pour tous les sols dans la BNDS.</p>', '<ul>\r\n <li>There is one SNT table per province.</li>\r\n <li>A record in this file is unique with respect to SOILKEY.</li>\r\n <li>This file is linked to the SLT table by SOILKEY.</li>\r\n <li>The link to the SLT table can be altered using the LU field.</li>\r\n</ul>', '<ul>\r\n <li>Il y a une table SNT par province.</li>\r\n <li>Chaque enregistrement dans ce fichier possède un champ SOILKEY unique.</li>\r\n <li>Ce fichier est lié à la table SLT selon le champ SOILKEY.</li>\r\n <li>Le lien à la table SLT peut être modifié en utilisant le champ LU.</li>\r\n</ul>', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', '', '1999-12-01', '1', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v3/names/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.2/names/intro.html', 'soilkey', 'integer', '9', '0', 'many', 'true', 'false', NULL, NULL, '2012-02-28 21:48:53'),
	(20, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/lst', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2', 'slc_v3r2_canada_lst', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Landscape Segmentation Table (LST)', 'Table du segmentation du paysage', '<p>The national SLCv3.2 coverage includes a new Landscape Segmentation Table for the agricultural portion of Canada, which identifies the main landform and slope combinations within each SLC polygon, and the representative soils found within each of the associated landform positions (landscape segments).</p>\r\n<p>Each national SLCv3.2 polygon with soil data has a dominant landform, and some complex SLC polygons many also have a second and third significant landform.  The landscape segment is identified by the LFS_ID field, while the estimated extent of the landscape segment within the SLC polygon is shown in the PERCENT field.  SLC polygons with a single landscape segment have PERCENT = 100.</p>\r\n<p>The structure of the SLCv3.2 Landscape Segmentation Table is shown below. </p>', '<p>La couverture nationale de la version 3.2 du PPC comprend également une nouvelle table des segments du paysage pour la portion agricole du Canada, laquelle indique les principaux reliefs trouvé à l\'intérieur de chaque polygones du PPC, ainsi que les composantes des sols que l\'on s\'attend de trouver dans chacun des quatre segments de relief.  Chaque polygone national de la version 3.2 du PPC associé à des données sur le sol a un relief dominant, et certains polygones complexes du PPC peuvent aussi avoir un deuxième ou un troisième relief important.</p>', '<ul>\r\n <li>A record in this file is unique with respect to POLY_ID, LF_TYPE, LF_SLOPE, LF_SEGMENT, and SOIL_ID.</li>\r\n <li>LF_ID is required to relate (N:1) to the <a href="/cansis/nsdb/slc/v3.2/let/index.html">Landform Extent Table</a>.</li>\r\n <li>LFS_ID is required to relate (N:1) to the <a href="/cansis/nsdb/slc/v3.2/ldt/index.html">Landform Definition Table</a>.</li>\r\n <li>SOIL_ID is required to relate (N:1) to the <a href="/cansis/nsdb/soil/v2/snt/index.html">Soil Name Table</a>.</li>\r\n</ul>\r\n<p>Note:  The Landscape Segmentation Table identifies a named soil for each specific segment of each landform. \r\nThe soil associated with each landscape segment is specified by a sequence of four fields (PROVINCE + SOIL_CODE + MODIFIER + PROFILE). \r\nMany of these soils have two alternative sets of soil attribute records in the <a href="/cansis/nsdb/soil/v2/snt/index.html">Soil Name</a> and <a href="/cansis/nsdb/soil/v2/slt/index.html">Soil Layer<a/> tables, representing agricultural and native soil conditions. \r\nMost agricultural modeling applications use the agricultural version of each soil, when both are available. \r\nBoth the PROFILE field and the concatenated SOIL_ID field incorporate this "agricultural bias".  </p>', '<ul>\r\n <li>Dans ce fichier, chaque dossier est unique en ce qui concerne les champs POLY_ID, LF_TYPE, LF_SLOPE, LF_EXTENT et SOIL_ID.</li>\r\n <li>Le champ LF_ID est requis pour mettre (N:1) en relation avec le table des reliefs.</li>\r\n <li>Le champ LFS_ID est requis pour mettre (N:1) en relation avec le table des segments du reliefs.</li>\r\n <li>Le champ NAME_ID est requis pour mettre (N:1) en relation avec le table des noms de sol (SNT).</li>\r\n</ul>\r\n<p>La table du relief comporte un dossier distinct pour chaque code de sol, à l\'intérieur de chaque segment particulier de chaque relief. Le sol associé à chaque segment de relief compris dans les reliefs du PPC est précisé par la séquence des champs, y compris les champs PROVINCE + SOIL_CODE + MODIFIER + PROFILE. Bon nombre de ces sols présentent deux ensembles possibles de dossiers d\'attributs des sols dans les tables des noms de sol et des couches de sol, représentant les profils du sol agricole et du sol non cultivé. La plupart des applications de modélisation utilisent la forme agricole de chaque sol, lorsque les deux sont accessibles. Les champs PROFILE et NAME_ID intègre cette information en tant que « biais agricole » et permet d\'établir un lien 1:1 vers les attributs du sol qui figurent dans les tables nationales des noms de sol et des couches de sol de la version 3.2 du PPC.</p>', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', '', '2009-12-01', '3.2', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/lfm/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.2/lfm/intro.html', 'poly_id', 'integer', '7', '0', 'many', 'true', 'true', 21, NULL, '2012-07-12 17:19:42'),
	(21, 'http://sis.agr.gc.ca/cansis/nsdb/ecodistricts/v1/zprd', 'http://sis.agr.gc.ca/cansis/nsdb/ecodistricts/v1', 'ecodistricts_v1_canada_zprd', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Ecodistrict Relationships', 'relations des Écodistrict', '<p>This table contains attributes which apply to entire <a href="/cansis/nsdb/ecostrat/1999report/framework.html">EcoDistricts</a>.</p>', '<p>Cette table contient les attributs qui s\'appliquent à l\'ensemble <a href="/siscan/nsdb/ecostrat/1999report/framework.html"> écodistricts </a>.</p>', '<ul>\n <li>A record in this file is unique with respect to Ecodistrict.</li>\n</ul>', '<ul>\n <li>Un enregistrement dans ce fichier est unique à l\'égard de l\'écodistrict. </li>\n</ul>', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '1999-09-16', '1', NULL, NULL, 'district', 'integer', '4', '0', 'one', 'true', 'true', NULL, NULL, NULL),
	(22, 'http://sis.agr.gc.ca/cansis/nsdb/detailed/index', 'http://sis.agr.gc.ca/cansis/nsdb/detailed/index', 'SOIL_SURVEY_INDEX', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Status', 'État', '<p>This table shows the status of the soil survey reports in Canada.</p>', '<p>Ce tableau montre l\'état des rapports d\'enquête des sols au Canada.</p>', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', '', '1999-01-01', '1', '', '', 'index_id', 'string', '9', '0', 'one', 'true', 'true', 1, NULL, '2011-12-13 14:49:42'),
	(23, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/ldt', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2', 'slc_v3r2_canada_ldt', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Landform Definition Table (LDT)', 'Table des définitions du relief', '<p>This table defines a set of 84 landscape segments; four segments for each of 21 landform types.  Each segment in each of the 21 landforms has a characteristic slope, slope length, and relative extent within the landform.  The structure of this table is shown below.</p>', '<p>La table de segmentation du relief (LST) de la version 3.2 du PPC contient des valeurs prédéfinies concernant la pente, la longueur de la pente et l\'étendue relative de chaque segment pour chacun des 21 types de reliefs actuellement définis. D\'autres recherches permettraient de préciser les attributs actuels des segments de relief et d\'accroître le nombre de types de reliefs. Le format actuel de la LST permet l\'application de ces éventuelles mises à jour sous forme de colonnes ou de dossiers supplémentaires.</p>', '<ul>\r\n <li>A record in this file is unique with respect to LFS_ID.</li>\r\n <li>LFS_ID is used to join this table to the <a href="/cansis/nsdb/slc/v3.2/lst/index.html">Landscape Segmentation Table (LST)</a></li>\r\n</ul>', '<ul>\r\n <li>Dans ce fichier, chaque dossier est unique en ce qui concerne le champ LFS_ID.</li>\r\n <li>LFS_ID est requis pour &eacute;tablir un lien avec la table du segmentation du paysage (SEG).</li>\r\n</ul>', 'n/a', 'n/a', 'n/a', 'n/a', '<p>A national set of 21 landform types have been established, based on field observations of representative sites in Alberta <sup>1</sup>. Each landform is defined as having four segments, representing the upper slope, mid slope, lower slope and depression positions (U, M, L, D).</p>\r\n<p><sup>1</sup> MacMillan, R.A., Pettapiece, W.W., and Brierley, J.A. 2005. An expert system for allocating soils to landforms through the application of soil survey tacit knowledge. Can. J. Soil Sci. 85: 103-112.</p>', '<p>Un ensemble national de 21&nbsp;types de reliefs a &eacute;t&eacute;  &eacute;tabli. Il est fond&eacute; sur les observations faites sur des sites repr&eacute;sentatifs  en Alberta <sup>1</sup>. Chaque relief est d&eacute;fini comme comportant quatre  segments, repr&eacute;sentant les positions de pente sup&eacute;rieure (U), de pente  interm&eacute;diaire (M), de pente inf&eacute;rieure (L) et de d&eacute;pression (D).</p>\r\n<p><sup>1</sup> MacMillan, R.A.,  Pettapiece, W.W. et Brierley, J.A. 2005. An expert system for allocating soils  to landforms through the application of soil survey tacit knowledge. Can. J. Soil  Sci. 85: 103-112.</p>', '', '2009-12-01', '3.2', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/lst/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.2/lst/intro.html', 'n/a', '', '', '0', 'many', 'true', 'true', 23, NULL, '2012-07-12 17:16:24'),
	(24, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/let', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2', 'slc_v3r2_canada_let', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Landform Extent Table (LET)', 'Table des superficies du relief', '<p>This table identifies the predominant landforms found within each SLC polygon, and the percentage of the polygon occupied by each landform. </p>', '<p>Cette table identifie les reliefs prédominants au sein de chaque polygone des PPC, et le pourcentage du polygone occupée par chaque relief.</p>', '<ul>\r\n <li>A record in this file is often unique with respect to LF_ID.  Duplicate LF_ID values are an artifact of the database construction that will be addressed in future versions of this table.</li>\r\n</ul>', '<ul>\r\n <li>Dans ce fichier, chaque dossier est unique en ce qui concerne les champs LF_ID.</li>\r\n</ul>', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', '', '2009-12-01', '3.2', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/lst/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.2/lst/intro.html', 'poly_id', 'integer', '7', '0', 'many', 'true', 'true', 22, NULL, '2012-02-16 18:20:59'),
	(25, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/pat', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2', 'slc_v2r2_canada_pat', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Polygon Table', 'Table de polygone', 'The Polygon Attribute Table (PAT) provides the linkage between geographic locations (polygons) and soil landscape attributes in the associated database tables.', 'La table des attributs de polygone (PAT) fournit le lien entre les emplacements géographiques (polygones) et les attributs de Pédo-paysage dans les bases de données associées. ', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '1996-12-31', '2.2', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/pat/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/pat/intro.html', 'sl', 'integer', '7', '0', 'one', 'true', 'false', 1, NULL, NULL),
	(26, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/lat', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2', 'slc_v2r2_canada_lat', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Landscape Table', 'Table de paysage', 'The Landscape Table (LAT) contains attributes of the polygon, and attributes which apply to the entire landscape represented by that polygon. All areas are in hectares.', 'La table des attributs de paysage (LAT) contient les attributs du polygone, ainsi que les attributs qui s\'appliquent au paysage entier représenté par ce polygone. Toutes les superficies sont exprimées en hectares.', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '1996-12-31', '2.2', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/lat/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/lat/intro.html', 'sl', 'integer', '7', '0', 'one', 'true', 'false', 4, NULL, NULL),
	(27, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/component', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2', 'slc_v2r2_canada_cmp', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Component Table', 'Table des composantes', 'The Component Table describes the different soil landscapes which are found in a polygon.  Note that components describe only the land area portion of the polygon.', 'La table des composantes décrit les pédo-paysages du sol qui sont les composantes d\'un polygone.  Noter que les composantes ne décrivent que la portion terre du polygone.', '<ul>\r\n <li>A record in this file is unique with respect to SL and CMP.</li>\r\n <li>SNF and SOILCODE and MODIFIER are required to relate (N:1) to the <a href="/cansis/nsdb/soil/v2/snt/index.html">Soil Name Table</a>.</li> <li>The <a href= "/cansis/nsdb/slc/v2.2/lat/index.html">LAT</a> contains information about water bodies (information which previously was found in this file).</li> <li>A set of associated documentation tables are included as INFO files in these datasets. The naming convention is {covername}.CMP_{field name} where {field name} is the name of the field in the component file.</li> </ul> The proportion of the polygon occupied by each separate component is identified. However, their location within the polygon is not defined. While the data model does not restrict the number of components or the proportion of the polygon that they occupy, restrictions have been recommended from a subject matter/organization standpoint. <p>Note that the dominant component for some polygons will be a non-soil (e.g. ice or rock). Analyses involving dominant soil components should take this fact into account.</p>', '<ul>\r\n <li>Chaque enregistrement de ce fichier pr&eacute;sente un code SL et un code CMP unique.</li>\r\n<li>Les codes SNF, SOILCODE et MODIFIER sont n&eacute;cessaires pour &eacute;tablir la relation (N:1) avec la table des noms des sols &nbsp;<a href="/siscan/nsdb/soil/v2/snt/index.html">Soil Name Table</a>.</li> <li>La variable <a href="/siscan/nsdb/slc/v2.2/lat/index.html">LAT</a> contient de l\'information sur les &eacute;tendues d\'eau (de l\'information qui &eacute;tait auparavant contenu dans ce fichier).</li> </UL> \r\n<p>La proportion du polygone qui est occupé par chaque composante individuelle est identifiée. Toutefois, leur emplacement n\'est pas défini à l\'intérieur du polygone. Même si le modèle des données ne place pas de limite sur le nombre de composantes, ni sur la proportion du polygone qu\'elles occupent, on a recommandé des restrictions du point de vue du sujet et de l\'organisation. </p> \r\n<p>Noter que l\'élément dominant de certains polygones sera un non-sol (c.à d. de la glace ou de la roche). Les analyses qui invoquent les composantes dominantes des sols devront en tenir compte. </p>', '<ul> \r\n<li><a href="/cansis/procedures/mapping_cmp_attributes.html">How to map Component Table attributes</a></li> \r\n<li><a href="/cansis/procedures/area_cmp.html">How to calculate areas of Soil Landscape components</a></li> \r\n</ul>', '<ul>\r\n<li><a href="/siscan/procedures/mapping_cmp_attributes.html">Comment cartographier les attributs du tableau des composantes P&eacute;do-paysages du Canada</a></li>\r\n<li><a href="/siscan/procedures/area_cmp.html">Comment calculer les surfaces attribu&eacute;es aux composantes de p&eacute;do-paysages du sol</a></li>\r\n</ul>', 'n/a', 'n/a', '<p>The Soil Landscape Component Table was developed in response to the requirements of the Soil Carbon Data Base. It has been compiled for all map coverages in Canada and is beneficial to all other applications because it consists of major attributes important to plant growth and land management. The attribute list of the component file consists of a subset of those in the original dominant and subdominant files compiled for the provincial map coverages. However, the component file allows for more than two soil landscapes per polygon, and provides explicit descriptions of inclusions.</p>', '<p>La table des composantes des pédo-paysages a été élaborée pour répondre aux exigences de la «Base de données sur le carbone organique du sol». Il a été compilé pour toutes les couvertures cartographiques du Canada et toutes les autres applications en profitent parce qu\'il contient des attributs importants pour la croissance des plantes et pour l\'utilisation des sols. La liste des attributs du fichier des composantes contient un sous-ensemble des attributs contenus dans les fichiers originaux d\'attributs dominants et sous-dominants qui ont été compilés pour les cartes provinciales. Toutefois, le fichier des composantes permet d\'indiquer plus de 2 pédopaysages par polygone et fournit les descriptions détaillées des inclusions.</p>', '', '1996-12-31', '2.2', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/component/index.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/component/index.html', 'sl', 'integer', '7', '0', 'many', 'true', 'false', 2, NULL, '2013-09-03 19:12:44'),
	(28, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2', 'slc_v2r2_canada_domsub', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Domsub Table', 'fichier dominant/sous-dominant', '<p>The DOMSUB file describes aspects of soil landscapes which had been described in version 1.1, but not carried forward into the Component / Carbon Layer Table structure. </p>', 'Le fichier DOMSUB décrit les aspects des pédo-paysages qui ont été décrits dans la version 1.1, mais qui n\'ont pas été reportés dans la structure de la table des composantes/de la couche de carbone. ', '<ul>\r\n<li>A record in this file is unique with respect to SL.</li>\r\n<li>SL is required to relate (1:1) to the <a href=\r\n"/cansis/nsdb/slc/v2.2/pat/index.html">PAT</a>.</li>\r\n</ul>\r\n<p>The proportion of the polygon occupied by the dominant and\r\nsubdominant soil landscapes is identified. However, their location\r\nwithin the polygon is not defined.</p>\r\n<p>Note that the dominant component for some polygons will be\r\na non-soil (e.g. ice or rock). Analyses involving dominant soil\r\ncomponents should take this fact into account.</p>', '<ul>\r\n<li>Chaque enregistrement dans ce fichier présente un champ SL unique.</li>\r\n<li>Le champ SL est nécessaire pour faire la relation (1:1) avec la table des attributs de polygone (<a href=\r\n"/siscan/nsdb/slc/v2.2/pat/index.html">PAT</a>).</li>\r\n</ul>\r\n<p>La proportion du polygone occupée par les pédo-paysages dominants et sous-dominants est indiquée. Cependant, leur emplacement dans le polygone n\'est pas défini.</p>\r\n<p>À noter que la composante dominante de certains polygones sera un non-sol (c.-à-d., de la glace ou de la roche). Les analyses portant sur les composantes pédologiques dominantes devraient en tenir compte.</p>\r\n\r\n', '<p>The DOMSUB file is not included with the <a href=\r\n"/cansis/nsdb/slc/v2.2/download_slc.html">SLC version 2.2 datasets\r\navailable on this website</a>.  It must be <a href=\r\n"slc22domsub.dbf">downloaded separately</a>.</p>\r\n<ul>\r\n<li><a href="/cansis/procedures/area_cmp.html">How to calculate\r\nareas of Soil Landscape components</a></li>\r\n</ul>', '<p>Le fichier DOMSUB n\'est pas inclus dans les <a href=\r\n"/siscan/nsdb/slc/v2.2/download_slc.html">séries de données de la version 2.2 des PPC disponibles sur ce site web</a>.  Il doit être <a href=\r\n"slc22domsub.dbf">téléchargé séparément</a>.</p>\r\n<ul>\r\n<li><a href="/siscan/procedures/area_cmp.html">Comment calculer les superficies des composantes de pédo-paysage</a></li>\r\n</ul>\r\n', '<ul>\r\n<li>The SLCs have seen quite a few updates and boundary changes\r\nsince version 1.1, but the DOMSUB data has not been validated or\r\nupgraded. Consequently, the reliability of this information may be\r\npoorer than the data found in the Component Table.</li>\r\n</ul>', '<ul>\r\n<li>Les PPC ont subi pas mal de mises à jour et de changements dans les limites depuis la version 1.1, mais les données DOMSUB n\'ont pas été validées ni mises à jour. Par conséquent, cette information pourrait être moins fiable que les données dans la table des composantes.</li>\r\n</ul>', '<p>The DOMSUB file was extracted from the original dominant and\r\nsubdominant files found in SLC version 1.1, in response to\r\ncontinuing requirements for pH and other attributes found only in\r\nthese files. It was compiled from all existing 1.1 GIS coverages by\r\nintersecting those polygons with the more current version 2.2\r\npolygons, and linking the version 2.2 polygon to the most dominant\r\nversion 1.1 data.</p>', '<p>Le fichier DOMSUB a été extrait des fichiers dominant et sous-dominant originaux dans la version 1.1 des PPC, en réponse aux demandes continues d\'information sur le pH et d\'autres attributs que l\'on trouve uniquement dans ces fichiers. Le fichier a été compilé à partir de toutes les couvertures SIG de la version 1.1 existantes par recoupement de ces polygones et de ceux plus à jour de la version 2.2, et par mise en relation des polygones de la version 2.2 et des données prépondérantes dans la version 1.1.</p>', '', '1996-12-31', '2.2', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/intro.html', 'sl', 'integer', '7', '0', 'one', 'true', 'false', 3, NULL, '2013-05-06 19:22:52'),
	(29, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/pat', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1', 'slc_v3r1r1_canada_pat', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Polygon Attribute Table (PAT)', 'Table de polygone', 'The Polygon Attribute Table (PAT) provides the linkage between geographic locations (polygons) and soil landscape attributes in the associated database tables.', '<p>La table des attributs de polygone (PAT) fournit le lien entre les emplacements géographiques (polygones) et les attributs de pédo-paysage dans les bases de données associées.</p>', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2004-02-02', '3.1.1', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/pat/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.1.1/pat/intro.html', 'sl', 'integer', '7', '0', 'one', 'true', 'false', 1, NULL, NULL),
	(30, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/lat', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1', 'slc_v3r1r1_canada_lat', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Landscape Table', 'Table de paysage', 'The Landscape Table (LAT) contains attributes of the polygon, and attributes which apply to the entire landscape represented by that polygon. All values are in hectares.', 'La table de paysage (LAT) contient les attributs du polygone, ainsi que les attributs qui s\'appliquent au paysage entier représenté par ce polygone. Toutes les superficies sont exprimées en hectares.', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2004-02-02', '3.1.1', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/landarea/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.1.1/landarea/intro.html', 'sl', 'integer', '7', '0', 'one', 'true', 'false', 3, NULL, NULL),
	(31, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1', 'slc_v3r1r1_canada_cmp', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Component Table', 'Table des composantes', 'The Component Table describes the different soil landscapes which are found in a polygon.  Note that components describe only the land area portion of the polygon.', 'La table des composantes décrit les Pédo-paysages du sol qui sont les composantes déun polygone.é Noter que les composantes ne décrivent que la portion terre du polygone.', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2004-02-02', '3.1.1', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.1.1/component/intro.html', 'sl', 'integer', '7', '0', 'many', 'true', 'false', 2, NULL, NULL),
	(32, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/name', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1', 'slc_v3r1r1_canada_name', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Name Table', 'Table des noms de sol', 'The Soil Name Table contains information that applies to the entire soil.', 'La table des noms de sol contient de l\'information qui s\'applique au sol en entier.', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2004-02-02', '3.1.1', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/name/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.1.1/name/intro.html', 'soiltype', 'string', '9', '0', 'many', 'true', 'false', 4, NULL, NULL),
	(33, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/layer', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1', 'slc_v3r1r1_canada_layer', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Layer Table', 'Table des couches de sol', 'The Soil Layer Table is designed to handle attributes which vary in a vertical direction.', 'Le fichier sur les couches de sol est conçu pour traiter les attributs qui varient dans le sens vertical.', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2004-02-02', '3.1.1', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/layer/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.1.1/layer/intro.html', 'soiltype', 'string', '9', '0', 'many', 'true', 'false', 5, NULL, NULL),
	(34, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/names', 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1', 'ecozones_v1_canada_names', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Ecozone Names', 'Table des noms des écozones', '<p>This table contains attributes which apply to entire <a href="/cansis/nsdb/ecostrat/1999report/framework.html"><u>EcoZones</u></a>.</p>', '<p> Cette table contient les attributs qui s\'appliquent à l\'ensemble <a href="/siscan/nsdb/ecostrat/1999report/framework.html"> écozones </a>. </ p>', '<ul>\n <li>A record in this file is unique with respect to ECOZONE.</li>\n</ul>', '<ul>\n <li>Un enregistrement dans ce fichier est unique à l\'égard de l\'écozone. </li>\n</ul>', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '1999-09-16', '1', NULL, NULL, 'ecozone', 'integer', '2', '0', 'one', 'true', 'true', NULL, NULL, NULL),
	(35, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/lat', 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1', 'ecozones_v1_canada_lat', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Landscape Areas', 'superficies ', 'Land and water area values (in hectares) for terrestrial ecozones of Canada.  Land and freshwater bounded by coastline are included. Bodies of freshwater shared by Canada and the USA, such as the Great Lakes and the St. Lawrence River are included to the international boundary. The mouth of the St. Lawrence River to the western tip of Anticosti Island is considered freshwater, as well as Bras d\'Or Lake on Cape Breton Island, Nova Scotia. Lake Melville in Labrador is considered marine water.', 'Les superficies (en ha) du terre et d\'eau des écozones terrestres du Canada.  Les terres et les plans d\'eau douce délimités par des littoraux sont inclus. Les plans d\'eau dont une partie se trouve au Canada et l\'autre, aux États-Unis (p. ex. Grands Lacs et fleuve Saint-Laurent), sont inclus dans la frontière internationale. Le Saint-Laurent, depuis son embouchure jusqu\'à l\'extrémité ouest de l\'île d\'Anticosti, de même que le lac Bras d\'Or sur l\'île du Cap-Breton (Nouvelle-Écosse), sont considéré', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '1999-09-16', '1', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/area.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/area.html', 'ecozone', 'integer', '2', '0', 'one', 'true', 'true', NULL, NULL, NULL),
	(36, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/latpr', 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1', 'ecozones_v1_canada_latpr', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Landscape Areas by Province', 'Superficies par province', 'Land and water area values (in hectares) by province for terrestrial ecozones of Canada.  Land and freshwater bounded by coastline are included. Bodies of freshwater shared by Canada and the USA, such as the Great Lakes and the St. Lawrence River are included to the international boundary. The mouth of the St. Lawrence River to the western tip of Anticosti Island is considered freshwater, as well as Bras d\'Or Lake on Cape Breton Island, Nova Scotia. Lake Melville in Labrador is considered marine water.', 'Les superficies (en ha) par province des valeurs terrestres et des plans d\'eau des écozones du Canada.  Les terres et les plans d\'eau douce délimités par des littoraux sont inclus. Les plans d\'eau dont une partie se trouve au Canada et l\'autre aux États-Unis (p. ex. les Grands Lacs et le fleuve Saint-Laurent), sont inclus dans la frontière internationale. Le Saint-Laurent, depuis son embouchure jusqu\'à l\'extrémité ouest de l\'île d\'Anticosti sont considérés comme de l\'eau douce, de même que le lac Bras d\'Or sur l\'île du Cap-Breton (Nouvelle-Écosse), tandis que le Lac Melville au Labrador est considéré comme de l\'eau salée. ', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', '', '1999-09-16', '1', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/area.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/area.html', 'ecozone', 'integer', '2', '0', 'one', 'true', 'true', NULL, NULL, '2012-02-13 20:39:38'),
