	(59, 'http://sis.agr.gc.ca/cansis/nsdb/ecoprovinces/v1/permafrost', 'http://sis.agr.gc.ca/cansis/nsdb/ecoprovinces/v1', 'ecoprovinces_v1_canada_permafrost', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Permafrost', 'pergélisol', 'The extent and nature of permafrost, including estimated ice content and typical ground ice forms.', 'L\'étendue et la nature du pergélisol, y compris sa teneur estimée en glace et les formes de glace de sol typiques.', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '1999-09-16', '1', NULL, NULL, 'ecoprovinc', 'string', '4', '1', 'many', 'true', 'true', NULL, NULL, NULL),
	(60, 'http://sis.agr.gc.ca/cansis/nsdb/ecoprovinces/v1/surficialgeology', 'http://sis.agr.gc.ca/cansis/nsdb/ecoprovinces/v1', 'ecoprovinces_v1_canada_sfgeology', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Surficial Geology', 'matériaux superficiels', 'The extent and nature of the surficial materials in this database are derived from the Surficial Materials Map of Canada (Fulton, 1996).', 'L\'étendue et la nature des matériaux superrficiels dans cette base de données sont dérivées de la carte Matériaux superficiels du Canada (Fulton, 1996).', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '1999-09-16', '1', NULL, NULL, 'ecoprov', 'string', '4', '1', 'many', 'true', 'true', NULL, NULL, NULL),
	(61, 'http://sis.agr.gc.ca/cansis/nsdb/ecoprovinces/v1/temp1961x1990', 'http://sis.agr.gc.ca/cansis/nsdb/ecoprovinces/v1', 'ecoprovinces_v1_canada_temp1961x1990', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Temperature Normals 1961-1990', 'normales de température 1961-1990', '<p>The 1961-1990 data for temperature and precipitation included only stations with averages based on more than 19 years of data (Appendix 1). Data from additional stations which had temperature and precipitation normals for the 1951-1980 period were also used to provide maximum station density, but these normals were first adjusted to the 1961-1990 period by comparison with nearby stations.</p>\r\n<p>TMAX, TMIN, TMEAN, RAIN, SNOW and TOTALP were interpolated using the Thiessen polygon method. The Thiessen  polygons were overlayed with Ecodistrict polygons, and an area-weighted value generated for each Ecodistrict Area-weighted polygon to polygon overlays were done using ARCINFO GIS based methods developed by AAFC and Pole Star Geomatics called PARS. Data from stations which were more than 350 metres above the lowest elevation of each Ecodistrict were eliminated from the weighting procedure to avoid using stations at high elevations in mountainous terrain (e.g. in British Columbia) which were not considered to be representative of valleys and plateaus where agricultural activities are present. Separate Thiessen coverages were developed for temperature and for precipitation for each month to make use of all available station data.</p>', '<p>Les données de température et de précipitation couvrant les années 1961 à 1990 incluaient seulement les stations avec des moyennes basées sur plus de 19 années de données (Annexe 1). Les données de d\'autres stations qui avaient des températures et des précipitations normales pour la période 1951-1980 ont également été utilisées pour fournir le maximum de densité des stations, mais ces normales ont tout d\'abord été ajustées à la période 1961-1990 en comparaison avec des stations à proximité.</p>\r\n<p>Les variables mensuelles de la température de l\'air et des précipitations (TMAX, TMIN, TMEAN, RAIN, SNOW et TOTALP) ont été interpolées à l\'aide de la méthode des polygones de Thiessen. Les polygones des écodistricts ont été superposés aux polygones de Thiessen, et l\'on a généré une valeur à pondération surfacique pour chaque écodistrict. Les superpositions de polygones à pondération surfacique ont été faites au moyen de méthodes basées sur le SIG ARCINFO développées par AAC et Pole Star Geomatics et appelées PARS. On a éliminé de la procédure de pondération les données des stations situées à plus de 350 m au-dessus du point le plus bas de chaque écodistrict, pour éviter d\'utiliser les données de stations de montagne (comme en Colombie-Britannique) qui n\'étaient pas jugées représentatives des terres agricoles. Afin d\'utiliser toutes les données de stations disponibles, chaque mois des couvertures de Thiessen distinctes ont été faites pour la température et les précipitations.</p>', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '1999-09-16', '1', NULL, NULL, 'province', 'string', '4', '1', 'one', 'true', 'true', NULL, NULL, NULL),
	(62, 'http://sis.agr.gc.ca/cansis/nsdb/ecoprovinces/v1/precip1961x1990', 'http://sis.agr.gc.ca/cansis/nsdb/ecoprovinces/v1', 'ecoprovinces_v1_canada_precip1961x1990', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Precipitation Normals 1961-1990', 'normales de précipitations 1961-1990', '<p>The 1961-1990 data for temperature and precipitation included only stations with averages based on more than 19 years of data (Appendix 1). Data from additional stations which had temperature and precipitation normals for the 1951-1980 period were also used to provide maximum station density, but these normals were first adjusted to the 1961-1990 period by comparison with nearby stations.</p>\r\n<p>TMAX, TMIN, TMEAN, RAIN, SNOW and TOTALP were interpolated using the Thiessen polygon method. The Thiessen  polygons were overlayed with Ecodistrict polygons, and an area-weighted value generated for each Ecodistrict Area-weighted polygon to polygon overlays were done using ARCINFO GIS based methods developed by AAFC and Pole Star Geomatics called PARS. Data from stations which were more than 350 metres above the lowest elevation of each Ecodistrict were eliminated from the weighting procedure to avoid using stations at high elevations in mountainous terrain (e.g. in British Columbia) which were not considered to be representative of valleys and plateaus where agricultural activities are present. Separate Thiessen coverages were developed for temperature and for precipitation for each month to make use of all available station data.</p>', '<p>Les données de température et de précipitation couvrant les années 1961 à 1990 incluaient seulement les stations avec des moyennes basées sur plus de 19 années de données (Annexe 1). Les données de d\'autres stations qui avaient des températures et des précipitations normales pour la période 1951-1980 ont également été utilisées pour fournir le maximum de densité des stations, mais ces normales ont tout d\'abord été ajustées à la période 1961-1990 en comparaison avec des stations à proximité.</p>\r\n<p>Les variables mensuelles de la température de l\'air et des précipitations (TMAX, TMIN, TMEAN, RAIN, SNOW et TOTALP) ont été interpolées à l\'aide de la méthode des polygones de Thiessen. Les polygones des écodistricts ont été superposés aux polygones de Thiessen, et l\'on a généré une valeur à pondération surfacique pour chaque écodistrict. Les superpositions de polygones à pondération surfacique ont été faites au moyen de méthodes basées sur le SIG ARCINFO développées par AAC et Pole Star Geomatics et appelées PARS. On a éliminé de la procédure de pondération les données des stations situées à plus de 350 m au-dessus du point le plus bas de chaque écodistrict, pour éviter d\'utiliser les données de stations de montagne (comme en Colombie-Britannique) qui n\'étaient pas jugées représentatives des terres agricoles. Afin d\'utiliser toutes les données de stations disponibles, chaque mois des couvertures de Thiessen distinctes ont été faites pour la température et les précipitations.</p>', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '1999-09-16', '1', NULL, NULL, 'province', 'string', '4', '1', 'one', 'true', 'true', NULL, NULL, NULL),
