	(99, 'http://sis.agr.gc.ca/cansis/nsdb/ecodistricts/v1/gdd_1961x1990', 'http://sis.agr.gc.ca/cansis/nsdb/ecodistricts/v1', 'ecodistricts_v1_canada_gdd1961x1990', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Growing Season and Growing Degree Days Normals 1961-1990', 'normales du durée de la saison de croissance et degrés-jours 1961-1990', NULL, NULL, 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '1999-09-16', '1', NULL, NULL, 'district', 'integer', '4', '0', 'one', 'true', 'true', NULL, NULL, NULL),
	(100, 'http://sis.agr.gc.ca/cansis/nsdb/ecodistricts/v1/egdd1961x1990', 'http://sis.agr.gc.ca/cansis/nsdb/ecodistricts/v1', 'ecodistricts_v1_canada_egdd1961x1990', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Effective Growing Degree Days Normals 1961-1990', 'normales du degrés-jours de croissance effectifs', NULL, NULL, 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '1999-09-16', '1', NULL, NULL, 'ecodistric', 'integer', '4', '0', 'one', 'true', 'true', NULL, NULL, NULL),
	(101, 'http://sis.agr.gc.ca/cansis/nsdb/ecodistricts/v1/vapp1961x1990', 'http://sis.agr.gc.ca/cansis/nsdb/ecodistricts/v1', 'ecodistricts_v1_canada_vapp1961x1990', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Vapor Pressure Normals 1961-1990', 'normales du pression de vapeur 1961-1990', NULL, NULL, 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '1999-09-16', '1', NULL, NULL, 'district', 'integer', '4', '0', 'one', 'true', 'true', NULL, NULL, NULL),
	(102, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/pat', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2', 'slc_v3r2_canada_pat', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Polygon Attribute Table (PAT)', 'Table des attributs de polygone', '<p>The Polygon Attribute Table (PAT) provides the linkage between geographic locations (polygons) and soil landscape attributes in the associated database tables.</p>', '<p>La table des attributs de polygone (PAT) fournit le lien entre les emplacements géographiques (polygones) et les attributs de pédo-paysage dans les bases de données associées.</p>', '<ul>\n <li>The POLY_ID field is used to relate to the soil and landscapes databases.</li>\n</ul>', '<ul>\n<li>Le champ POLY_ID est utilis&eacute; pour faire le lien avec les bases de donn&eacute;es sur les sols et les paysages.</li>\n</ul>', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2009-12-01', '3.2', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/pat/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.2/pat/intro.html', 'poly_id', 'integer', '7', '0', 'one', 'true', 'true', 1, NULL, NULL),
	(103, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2/pat', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2', 'dss_v2_REGION_pat', 'soil.dbf', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Polygon Attribute Table (PAT)', 'Table de polygone', '<p>The Polygon Attribute Table (PAT) provides the linkage between geographic locations (polygons) and soil attributes in the associated database tables.</p>', '<p>Cette table fournit le lien entre les emplacements géographiques (polygones) et les attributs de sol dans les bases de données associées.</p>', '<ol>\n<li>A record in this file is unique with respect to <a href="/cansis/nsdb/dss/v2/pat/pat-num.html">SOIL#</a>.</li>\n<li>The <a href="mapunit.html">MAPUNIT</a> field is used to relate to the <a href="/cansis/nsdb/dss/v2/cmp/index.html">CMP</a>\ntable.</li>\n</ol>\n<p>Notes:</p>\n<ol>\n<li><a href="mapunit.html">MAPUNIT</a> numbers are not always unique within a coverage.</li>\n<li>The first 8 characters of <a href="mapunit.html">MAPUNIT</a> will be identical for all records within a coverage.</li>\n</ol>', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', '', '2009-12-01', '2', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2/pat/index.html', 'http://sis.agr.gc.ca/siscan/nsdb/soils/v2/pat/index.html', 'mapunit', 'string', '68', '0', 'one', 'true', 'true', 1, NULL, '2012-02-28 21:43:39'),
	(104, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v1/smuf', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v1', 'dss_v1_REGION_smuf', 'n/a', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Soil Map Unit File (SMUF)', '', '<p>The Soil Map Unit File identifies the soil codes and landscape phases which are components of a polygon. In later versions this file was converted into the CMP and MAPUNIT tables. </p>', '', '<ul>\r\n<li>A record in this file is unique with respect to <a href=\r\n"/cansis/nsdb/dss/snt/province.html">PROVINCE</a>\r\n&amp; <a href="mapunitnom.html">MAPUNITNOM</a>.</li>\r\n\r\n<li><a href="mapunitnom.html">MAPUNITNOM</a> is required to relate\r\n(1:N) to the <a href=\r\n"/cansis/nsdb/dss/pat/index.html">PAT</a>.</li>\r\n<li><a href=\r\n"/cansis/nsdb/dss/snt/province.html">PROVINCE</a> +\r\n<a href="soil_code.html">SOIL_CODE*</a> + <a href=\r\n"modifier.html">MODIFIER*</a> are required to relate (1:N) to the\r\n<a href="/cansis/nsdb/dss/snt/index.html">SNF</a>\r\n\r\nand <a href=\r\n"/cansis/nsdb/dss/slt/index.html">SLF</a>.</li>\r\n<li>In the past, this file was often merged with the <a href=\r\n"/cansis/nsdb/dss/pat/index.html">PAT</a>.</li>\r\n</ul>', '', 'n/a', 'n/a', '<p>The proportion of the polygon occupied by each separate component of a map unit is identified. However, their location within any polygon is not defined. The data model limits the number of components to a maximum of three, even though more may have been recognized in the field.</p>\r\n\r\n<p>Note that the dominant component for some map units will be a non-soil (i.e. water, rock, or ice). Analyses involving dominant soil components should take this fact into account.</p>', '', 'n/a', 'n/a', '', '1999-12-01', '1', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v3/layers/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/soils/v3/layers/intro.html', 'mapunitnom', 'string', '60', '0', 'many', 'true', 'true', 2, NULL, '2012-02-29 15:16:24'),
	(105, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v1/pat', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v1', 'dss_v1_REGION_pat', 'n/a', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Polygon Attribute Table (PAT)', 'Table de polygone', '<p>The Polygon Attribute Table (PAT) provides the linkage between geographic locations (polygons) and soil attributes in the associated database tables.</p>', '<p>Cette table fournit le lien entre les emplacements géographiques (polygones) et les attributs de sol dans les bases de données associées.</p>', '<ol>\n<li>A record in this file is unique with respect to <a href="/cansis/nsdb/dss/v1/pat/pat-num.html">SOIL#</a>.</li>\n<li>The <a href="mapunitnom.html">MAPUNITNOM</a> field is used to relate to the <a href="/cansis/nsdb/dss/v1/smuf/index.html">SMUF</a>\ntable.</li>\n</ol>\n<p>Notes:</p>\n<ol>\n<li><a href="mapunitnom.html">MAPUNITNOM</a> numbers are not always unique within a coverage.</li>\n<li>The first 8 characters of <a href="mapunitnom.html">MAPUNITNOM</a> will be identical for all records within a coverage.</li>\n</ol>', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', '', '2009-12-01', '1', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/pat/index.html', 'http://sis.agr.gc.ca/siscan/nsdb/soils/v/pat/index.html', 'mapunitnom', 'string', '60', '0', 'one', 'true', 'true', 1, NULL, '2012-02-28 21:43:39'),
	(106, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2/cmp', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2', 'dss_v2_REGION_cmp', 'cmp.dbf', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Component Table (CMP)', 'Table des composantes', '<p>The Component Table identifies the soils which are components of a\r\nSoil Map Unit.</p>', '<p>La table des composantes énumère les sols qui sont\r\ndes composantes de l\'unité cartographique de sols.</p>', '<ul>\r\n<li>A record in this file is unique with respect to&nbsp; <a href=\r\n"/cansis/nsdb/dss/v2/pat/mapunit.html">MAPUNIT</a>&nbsp; &amp;\r\n<a href="cmp.html">CMP</a>.</li>\r\n<li><a href="/cansis/nsdb/dss/v2/pat/mapunit.html">MAPUNIT</a> is\r\nrequired to relate (1:N) to the <a href=\r\n"/cansis/nsdb/dss/v2/pat/index.html">PAT</a>.</li>\r\n<li><a href="/cansis/nsdb/dss/v2/cmp/soiltype.html">SOILTYPE</a>\r\nis required to relate (1:N) to the <a href=\r\n"/cansis/nsdb/soil/v1/index.html">NAME</a> and <a href=\r\n"/cansis/nsdb/soil/v1/slt/index.html">LAYER</a> tables.&nbsp;\r\nWithout changes to the last character of the <a href=\r\n"/cansis/nsdb/dss/v2/cmp/soiltype.html">SOILTYPE</a> field,\r\nlinkages to the <a href=\r\n"/cansis/nsdb/soil/v1/index.html">NAME</a> and <a href=\r\n"/cansis/nsdb/soil/v1/slt/index.html">LAYER</a> tables will\r\nfollow the assumption that land use is agricultural.&nbsp; For more\r\ninformation, see the documentation for the <a href=\r\n"/cansis/nsdb/soil/v1/snt/lu.html">LU</a> field in the <a href=\r\n"/cansis/nsdb/soil/v1/index.html">NAME</a> table.</li>\r\n<li>Attributes which apply to the entire Soil Map Unit are found in\r\nthe <a href="/cansis/nsdb/dss/v2/pat/mapunit.html">Map Unit\r\nTable</a></li>\r\n</ul>', '<ul>\r\n<li>Chaque enregistrement dans le fichier présente des\r\nchamps&nbsp; <a href=\r\n"/siscan/nsdb/dss/v2/pat/mapunit.html">MAPUNIT</a> et <a href=\r\n"cmp.html">CMP</a> uniques.</li>\r\n<li>Le champ <a href=\r\n"/siscan/nsdb/dss/v2/pat/mapunit.html">MAPUNIT</a> est\r\nnécessaire pour établir la relation (1:N) avec la\r\ntable des attributs de polygone <a href=\r\n"/siscan/nsdb/dss/v2/pat/index.html">PAT</a>.</li>\r\n<li>Le champ <a href=\r\n"/siscan/nsdb/dss/v2/cmp/soiltype.html">SOILTYPE</a> est\r\nnécessaire pour établir la relation (1:N) avec les\r\ntables <a href="/siscan/nsdb/soil/v1/index.html">NAME</a> et\r\n<a href="/siscan/nsdb/soil/v1/slt/index.html">LAYER</a>.&nbsp;\r\nSans changement au dernier caractère dans le champ <a href=\r\n"/siscan/nsdb/dss/v2/cmp/soiltype.html">SOILTYPE</a>, les liens\r\navec les tables <a href=\r\n"/siscan/nsdb/soil/v1/index.html">NAME</a> et <a href=\r\n"/siscan/nsdb/soil/v1/slt/index.html">LAYER</a> reposeront sur\r\nl\'hypothèse qu\'il s\'agit de terres agricoles.&nbsp; Pour en\r\nsavoir plus, prière de consulter la documentation sur le\r\nchamp <a href="/siscan/nsdb/soil/v1/snt/lu.html">LU</a> dans la table\r\n<a href="/siscan/nsdb/soil/v1/index.html">NAME</a>.</li>\r\n<li>Les attributs qui s\'appliquent à l\'unité\r\ncartographique de sols au complet se trouvent dans la <a href=\r\n"/siscan/nsdb/dss/v2/pat/mapunit.html">table des unités\r\ncartographiques</a>.</li>\r\n</ul>', 'n/a', 'n/a', '<p>The proportion of the Soil Map Unit occupied by each separate\r\ncomponent is identified. However, their location within the Soil\r\nMap Unit is not defined. While the data model does not restrict the\r\nnumber of components or the proportion of the Soil Map Unit that\r\nthey occupy, restrictions have been recommended from a subject\r\nmatter/organization standpoint.</p>\r\n\r\n<p>Note that the dominant component for some Soil Map Units\r\nwill be a non-soil (i.e. water, ice or rock). Analyses involving\r\ndominant soil components should take this fact into account.</p>', '<p>La proportion de l\'unité cartographique de sols\r\noccupée par chaque composante séparée est\r\nindiquée. Cependant, l\'emplacement des composantes dans\r\nl\'unité cartographique de sols n\'est pas défini.\r\nAlors que le modèle de données ne restreint pas le\r\nnombre de composantes ni la proportion de l\'unité\r\ncartographique de sols occupée par ces dernières, des\r\nrestrictions ont été recommandées sur le plan\r\ndu sujet et de l\'organisation.</p>\r\n\r\n<p>&Agrave; noter que la composante dominante pour certaines\r\nunités cartographiques de sols sera un non-sol\r\n(c.-à-d. de l\'eau, de la glace ou de la roche). Les analyses\r\nsur les composantes pédologiques dominantes devraient en\r\ntenir compte.</p>', '<p>Soil Map Unit Tables were created starting in 1998 from information\r\nin the original <a href="/cansis/nsdb/detailed/owner_view/smuf/index.html">SMUF</a> files.</p>\r\n\r\n<p>The <a href="cmp.html">CMP</a> number was mapped directly from the\r\nnumber following items of the same name in the original <a href="/cansis/nsdb/dss/v1/smuf/index.html">SMUF</a> structure (i.e. <a href="/cansis/nsdb/dss/v1/smuf/soil_code.html">SOIL_CODE1</a> became <a href="cmp.html">CMP</a> #1).</p>', '<p>Des tables d\'unités cartographiques de sols ont été créées en 1998 à partir de l\'information contenue dans les fichiers <a href="/siscan/nsdb/dss/v1/smuf/index.html">SMUF</a> originaux. Le numéro de <a href="cmp.html">CMP</a> a été cartographié directement à partir du numéro suivant les articles du m&ecirc;me nom dans la structure originale des fichiers <a href="/siscan/nsdb/dss/v1/smuf/index.html">SMUF</a>\r\n(c.-à-d. <a href="/siscan/nsdb/dss/v1/smuf/soil_code.html">SOIL_CODE1</a>\r\nest devenu <a href="cmp.html">CMP</a> #1).</p>', '', '2009-12-01', '2', '(NULL)', '(NULL)', 'poly_id', 'string', '68', '0', 'many', 'true', 'true', 2, NULL, '2012-03-26 20:52:49'),
	(107, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2/mapunit', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2', 'dss_v2_REGION_mapunit', 'mapunit.dbf', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Map Unit Table (MAPUNIT)', 'Table des unités de cartographie', '<p>This table contains non-standard attributes which apply to the entire Soil Map Unit (i.e. polygon(s)), and thus could not be placed in the <a href="/cansis/nsdb/dss/v2/cmp/index.html">Component Table</a>.</p>', '<p>Cette table contient les attributs qui s\'appliquent &agrave;\r\nl\'unit&eacute; de cartographie p&eacute;dologique compl&egrave;te\r\n(c.-&agrave;-d. au(x) polygone(s)), et ainsi ne pouvaient pas\r\n&ecirc;tre plac&eacute;s dans la <a href="/siscan/nsdb/dss/v2/cmp/index.html">table des composantes</a>.</p>', '<ul>\r\n<li>A record in this file is unique with respect to <a href="pat/mapunit.html">MAPUNIT</a>.</li>\r\n<li><a href="/cansis/nsdb/dss/v2/mapunit/index.html">MAPUNIT</a> is required to relate (1:N) to the <a href="/cansis/nsdb/dss/v2/pat/index.html">PAT</a>.</li>\r\n</ul>', '<ul>\r\n<li>Chaque enregistrement dans ce fichier a un code <a href="/siscan/nsdb/dss/v2/mapunit/index.html">MAPUNIT</a> unique.</li>\r\n<li>Le champ <a href="pat/mapunit.html">MAPUNIT</a> est\r\nn&eacute;cessaire pour faire la relation (1:N) avec <a href="/siscan/nsdb/dss/v2/pat/index.html">PAT</a>.</li>\r\n</ul>', 'n/a', 'n/a', '<p>The proportion of the polygon occupied by each separate component of a map unit is identified. However, their location within any polygon is not defined. The data model limits the number of components to a maximum of three, even though more may have been recognized in the field.</p>\r\n\r\n<p>Note that the dominant component for some map units will be a non-soil (i.e. water, rock, or ice). Analyses involving dominant soil components should take this fact into account.</p>', '<p>La proportion du polygone occup&eacute;e par chaque composante\r\ndistincte est indiqu&eacute;e. Cependant, l\'emplacement de ces\r\ncomposantes &agrave; l\'int&eacute;rieur du polygone n\'est pas\r\nd&eacute;fini. Alors que le mod&egrave;le de donn&eacute;es ne\r\nrestreint pas le nombre de composantes ni la proportion du polygone\r\nqu\'elles occupent, des restrictions ont &eacute;t&eacute;\r\nrecommand&eacute;es sur le plan du sujet de l\'organisation.</p>\r\n\r\n<p>&nbsp;&Agrave; noter que la composante dominante pour certains\r\npolygones sera un non-sol (c.-&agrave;-d., de l\'eau, de la glace ou\r\nde la roche). Les analyses sur les composantes p&eacute;dologiques\r\ndominantes devraient en tenir compte.</p>', 'n/a', 'n/a', '', '1999-12-01', '1', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2/mapunit/index.html', 'http://sis.agr.gc.ca/siscan/nsdb/dss/v2/mapunit/index.html', 'mapunit', 'string', '68', '0', 'many', 'true', 'true', 3, NULL, '2012-03-22 18:56:24'),
	(108, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/pat', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0', 'slc_v3r0_canada_pat', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Polygon Attribute Table (PAT)', 'Table de polygone', 'The Polygon Attribute Table (PAT) provides the linkage between geographic locations (polygons) and soil landscape attributes in the associated database tables.', '<p>La table des attributs de polygone (PAT) fournit le lien entre les emplacements géographiques (polygones) et les attributs de pédo-paysage dans les bases de données associées.</p>', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2004-02-02', '3.0', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/pat/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/pat/intro.html', 'sl', 'integer', '7', '0', 'one', 'true', 'false', 1, NULL, NULL),
	(109, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0', 'slc_v3r0_canada_cmp', '', 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'Component Table', 'Table des composantes', 'The Component Table describes the different soil landscapes which are found in a polygon.  Note that components describe only the land area portion of the polygon.', 'La table des composantes décrit les Pédo-paysages du sol qui sont les composantes déun polygone.é Noter que les composantes ne décrivent que la portion terre du polygone.', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2004-02-02', '3.0', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/intro.html', 'sl', 'integer', '7', '0', 'many', 'true', 'false', 2, '2013-05-23 10:48:57', '2013-05-23 10:48:59'),
	(112, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/ecoregion', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2', 'slc_v2r2_canada_ecoregion', NULL, 'Agriculture and Agri-Food Canada', 'Agriculture et Agro-Alimentaire Canada', 'EcoRegion Table', 'Table des écorégions', 'The EcoRegion Table contains attributes which apply to entire EcoRegions.', 'La table des écorégions contient les attributs qui s\'appliquent à toutes les écorégions.', '<ul> <li> The ECOREGION field is used to relate (1:N) to the EcoDistrict Table </li> <li> The ECOZONE field is used to relate (N:1) to the EcoZone Table.</li> </ul>', '<ul> <li>Le champ ECOREGION est utilisé pour faire la relation (1:N) avec la table des écodistricts.</li> <li> Le champ ECOZONE permet de faire la relation (1:N) avec la table la écorégions</li> </ul>', '', '', '', '', '', '', '', '1996-12-31', '2.2', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/ecoregion/intro.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/ecoregion/intro.html', 'sl', 'integer', '7', '0', 'one', 'true', 'false', NULL, '2014-04-10 19:25:35', '2014-04-11 15:07:17'),
