	(1, 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/v1/name_fr', 'Name (French)', 'Nom (en français)', 'Name (French)', 'Nom (français)', 'n/a', 'n/a', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/names', NULL, '2012-03-27 16:04:49'),
	(2, 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/v1/elevation/min', 'Minimum Elevation', 'Altitude minimale', 'Lowest elevation above sea level found in the polygon.', 'L\'altitude minimale au-dessus du niveau de la mer dans le polygone.', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/elevation.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/elevation.html', 'Measure', 'Y', 'm', 'm', 'meters', 'mètres', 'n/a', NULL, '2012-03-27 14:54:46'),
	(3, 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/v1/elevation/mean', 'Mean Elevation', 'Altitude moyenne', 'Average elevation above sea level of the polygon.', 'L\'altitude moyenne au dessus du niveau de la mer du polygone.', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/elevation.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/elevation.html', 'Measure', 'Y', 'm', 'm', 'meters', 'mètres', 'n/a', NULL, '2012-03-27 14:51:04'),
	(4, 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/v1/elevation/max', 'Maximum Elevation', 'Altitude maximale', 'Highest elevation above sea level found in the polygon.', 'La plus haute altitude au dessus du niveau de la mer dans le polygone.', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/elevation.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/elevation.html', 'Measure', 'Y', 'm', 'm', 'meters', 'mètres', 'n/a', NULL, '2012-03-27 14:48:31'),
	(5, 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/v1/elevation/diff', 'Elevation Difference', 'Différence d\'altitude', 'Difference in height between the lowest and highest point in the polygon.', 'Différence d\'altitude entre le point le plus bas et celui le plus haut dans le polygone.', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/elevation.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/elevation.html', 'Measure', 'Y', 'm', 'm', 'meters', 'mètres', 'n/a', NULL, '2012-03-27 14:47:08'),
	(6, 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/v1/landcover', 'Land Cover', 'Couverture végétale', '<p>The land cover classes are based on the digital land and hard copy land cover maps of Canada produced by the Manitoba Remote Sensing Centre (MRSC) of the Surveys and mapping Branch, Department of natural resources in 1992.</p>', '<p>Les classes de couverture végétale sont fondées sur les cartes numériques et les cartes sur support papier des types de couverture végétale du Canada élaborées en 1992 par le Centre manitobain de télédétection (CMT) de la Direction des levés et de la cartographie, Ministère des Ressources naturelles.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/land_cover.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/land_cover.html', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/landcover/landcover', NULL, '2012-03-27 15:59:36'),
	(7, 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/v1/landform', 'Landform', 'Forme de terrain régionale', '<p>These data are presented as a set of components within each polygon.</p>', '<p>Ces données sont présentées comme un ensemble de composantes dans chaque polygone.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/landform.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/landform.html', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/landform/landform', NULL, '2012-03-27 16:02:12'),
	(8, 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/v1/surface_form', 'Surface Form', 'Modelé de surface', '<p>Descriptions define classes of local physical surface forms (assemblage of slopes) or recurring patterns of forms which occur at the earth\'s surface.</p>', '<p>Les descriptions permettent de déterminer des classes de modelés de la surface (assemblage de pentes) au niveau local ou de formes qui se répètent çà et là à la surface terrestre.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/surface_form.html', '', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surface_form/surface', NULL, '2012-03-28 14:04:39'),
	(9, 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/v1/surface_material', 'Surface Material', 'Matériaux de surface', 'Surface material includes the abiotic material at the earth\'s surface. ', 'Les matériaux de surface incluent les matériaux abiotiques qui se trouvent à la surface du sol.', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/surface_material.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/surface_material.html', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surface_material/material', NULL, '2012-03-28 16:56:38'),
	(10, 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/v1/texture', 'Texture', 'Texture', 'Soil texture indicates the relative proportions of the various soil separates (sand, silt, clay).', 'La texture du sol indique les proportions relatives des diverses fractions d\'un sol (sable, limon, argile).', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/texture.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/texture.html', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/texture/texture', NULL, '2012-03-28 17:10:52'),
	(11, 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/v1/devel', 'Soil Development', 'Développement du sol', '<p>This data is presented as a set of components within each polygon.</p>', '<p>Ces données sont présentées comme un ensemble de composantes dans chaque polygone.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/1999report/soil.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/soil.html', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', NULL, '2012-03-28 18:16:06'),
