	(70, 'http://sis.agr.gc.ca/cansis/nsdb/percent', 'Percent of polygon occupied by the component', 'Pourcentage du polygone occupé par la composante', '<p>Percentage of the land area of the polygon which is occupied by the component.</p>', '<p>Pourcentage de la superficie terrestre du polygone occupé par la composante.</p>', '', '', 'Measure', 'Y', '%', '%', 'percent', 'pourcentage', 'n/a', NULL, '2012-03-28 18:13:45'),
	(71, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/component/kindmat', 'Kind of Surface Material', 'Sorte de matériau à la surface', 'Kind of soil, rock outcrop or other material at the surface.', 'Sorte de sol, roche, ou autre matériau à la surface.', '', '', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/kindmat', NULL, '2012-03-28 18:49:08'),
	(72, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/component/veget', 'Vegetation Cover and/or Land Use', 'Couverture végétale et/ou utilisation des terres', '<p>Vegetation cover or land use, or both (<em>ref:</em> <a href= "/cansis/references/1987nw_a.html">NWWG, 1987</a> ; <a href= "/cansis/references/1988ps_a.html">PS, 1988</a>).</p>', '<p>Couverture végétale et utilisation des terres, ou les deux (<em>ref:</em> <a href= "/siscan/references/1987nw_a.html">NWWG, 1987</a> ; <a href= "/siscan/references/1988ps_a.html">PS, 1988</a>).</p> ', '', '', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget', NULL, '2012-03-28 19:16:06'),
	(73, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/component/pmdep', 'Parent Material Mode of Deposition', 'Mode de dépôt du matériau parental', '<p>The mode of deposition of mineral materials and undifferentiated organic materials is shown by a single alpha code whereas the origin of specified organic material is given by a numeric, two-digit code (<em>ref:</em> <a href="http://sis.agr.gc.ca/cansis/references/1984tc_a.html">Tarnocai, 1984</a>; ECSS, 1987; <a href= "http://sis.agr.gc.ca/cansis/references/1987nw_a.html">NWWG, 1987</a>).</p>', '<p>Le mode d\'accumulation des matériaux minéraux et des matériaux organiques non différenciés est illustré par un code alpha unique et l\'origine des matériaux organiques précisés est donnée par un code numérique à deux unités.  (<em>Références</em>: <a href= "/siscan/references/1984tc_a.html">Tarnocai, 1984</a>; Comité d\'experts sur la prospection pédologique d\'Agriculture Canada, 1987;  <a href="/siscan/references/1987nw_a.html">Groupe national de travail sur les terres humides, 1987</a>.</p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', NULL, '2012-03-28 18:55:30'),
	(74, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/component/cfrag', 'Coarse Fragment Content of the Control Section', 'Teneur en fragments grossiers de la section témoin', '<p>Rounded, subrounded, flat, angular or irregular rock fragments from 0.2 to 60 cm or more in size expressed in percent by volume. (<em>ref:</em> ECSS, 1982</p>', '<p>Fragment rocheux arrondi, subarrondi, plat, anguleux et irrégulier dont la taille varie de 0,2 à 60 cm ou plus (Référence: Comité d\'experts sur la prospection pédologique, 1982.</p>', '', '', 'Ordinal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/cfrag', NULL, '2012-03-28 18:47:59'),
	(75, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/component/rootdp', 'Rooting Depth, unrestricted', 'Profondeur des racines, sans limites', '<p>The depth to which plant roots can penetrate without encountering a cemented layer or bedrock.</p>', '<p>La profondeur à laquelle les racines des plantes peuvent pénétrer sans rencontrer une couche cimentée ou le substratum rocheux.</p>', '', '', 'Ordinal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/component/rootdp', NULL, '2012-03-28 18:57:51'),
	(76, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/component/drain', 'Drainage Class', 'Classe de drainage', 'Drainage Class', 'Classe de drainage', '', '', 'Ordinal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/drain', NULL, '2012-03-28 18:48:47'),
