	(79, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/component/locsf', 'Local Surface Form', 'Modelé de la surface locale', 'Local Surface Form.', 'Modelé de la surface locale.', '', '', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', NULL, '2012-03-28 18:49:27'),
	(80, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/component/slope', 'Slope Gradient', 'Inclinaison de la pente', '<p>Slope gradient, in percent, of low end of range.</p>', '<p>Inclinaison de la pente, en pourcentage, limite inférieure de l\'échelle.</p> ', '', '', 'Ordinal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/slope', NULL, '2012-03-28 19:01:11'),
	(82, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/component/soilcode', 'Soil Code', 'Code de sol ', '<p>A soil code used as part of the link to a representative soil in the CanSIS NAMES and LAYERs tables.  The "#" symbol is used to denote non-applicable for areas where no soil name is established.</p>', '<p>Code de sol faisant partie du lien vers un sol représentatif dans les tables NAMES et LAYERS de SISCan. Le symbole « # » est utilisé pour désigner les champs non applicables pour les zones où aucun nom de sol n\'est défini.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-28 19:13:06'),
	(83, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/component/modifier', 'Soil Modifier Code', 'Modificateur de code du sol', '<p>The modifier code is used to indicate a particular assemblage of characteristics related to a soil code. A soil modifier code is used as part of the link to a representative soil in the CanSIS NAMES and LAYERS tables.</p>', '<p>Ce code sert à indiquer un regroupement particulier de caractéristiques liées à un code de sol. Un code de modificateur de sol est utilisé comme partie du lien vers un sol représentatif dans les tables NAMES et LAYERS de SISCan.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-28 18:50:04'),
	(84, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/area/land', 'Area of land (applicable to the component table)', 'Superficie des terres (applicable à la table des composantes)', '<p>This is the total area of land in the SLC polygon.</p>', '<p>C\'est la superficie totale des terres dans le polygone PPC.</p>', '', '', 'Count', 'Y', 'ha', 'ha', 'hectares', 'hectares', 'n/a', NULL, '2012-03-28 18:32:56'),
	(85, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/area/polygon', 'Area of the entire polygon', 'Superficie du polygone entier', '<p>This is the total area, including land, fresh water, and ocean, of the entire SLC polygon.</p>', '<p>C\'est la superficie totale, y compris les terres, les eaux douces et l\'océan dans l\'ensemble du polygone PPC.</ p>', '', '', 'Count', 'Y', 'ha', 'ha', 'hectares', 'hectares', 'n/a', NULL, '2012-03-28 18:32:40'),
	(86, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/area/water_total', 'Area of Total Water (Fresh and Ocean)', 'Superficie totale d\'eaux (eaux douces et océans)', '<p>This is the total area of ocean and fresh water in the entire SLC polygon.</p>', '<p>C\'est la superficie totale des plans d\'eau doux et océanique dans l\'ensemble du polygone PPC.</p>', '', '', 'Count', 'Y', 'ha', 'ha', 'hectares', 'hectares', 'n/a', NULL, '2012-03-28 18:46:27'),
	(87, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/area/water_fresh', 'Area of Fresh Water', 'Superficie totale d\'eaux douces', '<p>This is the total area of fresh water in the entire SLC polygon.</p>', '<p>C\'est la superficie totale des plans d\'eau doux dans l\'ensemble du polygone PPC.</p>', '', '', 'Count', 'Y', 'ha', 'ha', 'hectares', 'hectares', 'n/a', NULL, '2012-03-28 18:44:45'),
	(88, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/area/hydro_ocean', 'Area of Ocean Water shown on the HYDRO coverage', 'Superficie des océans indiquée dans la couverture HYDRO', '<p>This is the total area of the SLC polygon that forms part of an ocean.</p>', '<p>C\'est la superficie totale des plans d\'eau océaniques dans l\'ensemble du polygone PPC.</p>', '', '', 'Count', 'Y', 'ha', 'ha', 'hectares', 'hectares', 'n/a', NULL, '2012-03-28 18:31:22'),
	(89, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/area/hydro_fresh', 'Area of Fresh Water shown on the HYDRO coverage', 'Superficie de l\'eau douce illustrée dans la couverture HYDRO', '', '', '', '', 'Count', 'Y', 'ha', 'ha', 'hectares', 'hectares', 'n/a', NULL, '2012-03-28 18:30:54'),
	(90, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/area/small_water', 'Area of Small Water Bodies (not shown on the SLC hydro coverage)', 'Superficie des petits plans d\'eau non illustrée dans la couverture HYDRO', '<p>This is the total area of small freshwater lakes in the the entire SLC polygon. Small lakes are perrenial water bodies which are too small to be shown on the hydro coverage.</p>', '<p>Il s\'agit de la superficie totale des petits lacs d\'eau douce dans l\'ensemble du polygone PPC. Les petits lacs sont des plans d\'eau pérennes qui sont trop petits pour être illustrés sur la couverture HYDRO.</p>', '', '', 'Count', 'Y', 'ha', 'ha', 'hectares', 'hectares', 'n/a', NULL, '2012-03-28 18:45:46'),
	(91, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/area/small_land', 'Area of Small Land not part of the HYDRO coverage', 'Superficie des petites îles non illustrée dans la couverture HYDRO', '<p>This is the total area of small islands in the the entire SLC polygon. These islands are too small to depict at the 1:1,000,000 scale of the HYDRO coverage, and are classified as water in that coverage.</p>', '<p>Il s\'agit de la superficie totale des petites îles dans l\'ensemble du polygone PPC. Ces îles sont trop petites pour être dépeintes à l\'échelle de 1/1 000 000 de la couverture HYDRO et sont classées comme étant de l\'eau dans cette couverture.</p>', '', '', 'Count', 'Y', 'ha', 'ha', 'hectares', 'hectares', 'n/a', NULL, '2012-03-28 18:45:13'),
	(92, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/stone', 'Surface Stoniness', 'Pierrosité de surface', '<p>This field indicates the stoniness of the soil surface. Surface stoniness will impact a soil\'s agricultural capabilities. First used in SLC 3.0.</p>', '<p>Ce champ indique la pierrosité de la surface du sol. La pierrosité de la surface a un impact sur le potentiel agricole d\'un sol. Utilisé pour la première fois dans les PPC 3.0.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/stone.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.1.1/component/stone.html', 'Ordinal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/stone', NULL, '2012-03-29 14:09:33'),
	(93, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/kind', 'Kind of Surface Material', 'Type de matériel de surface', '<p>Identifies the kind of surface soil, rock outcrop or other material (feature). First used in SLC 3.0.</p>', '<p>Indique le type de sol en surface, d\'affleurement rocheux ou d\'autre matériau (caractéristique). Utilisé pour la première fois dans les PPC 3.0.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/snf/kind.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.1.1/snf/kind.html', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/kind', NULL, '2012-03-29 13:34:22'),
	(94, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/s_group3', 'Soil Subgroup ', 'Sous-groupe de sol', '<p>Identifies the soil subgroup according to the Canadian System of Soil Classification 3rd edition.</p>', '<p>Indique le sous-groupe des sols selon le Système canadien de classification des sols, troisième édition.</p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-29 14:12:19'),
	(95, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/mdep1', 'Mode of Deposition 1', 'Mode de déposition du matériau originel le plus élevé ', '<p>The mode of deposition of the upper parent material. First used in SLC 3.0.</p>', '<p>Mode de déposition du matériau originel le plus élevé. Utilisé pour la première fois dans les PPC 3.0.</p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', NULL, '2012-03-29 13:38:36'),
	(96, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/pmtex1', 'Texture Class 1', 'Classe de texture du matériau originel le plus élevé', '<p>The texture class of the uppermost parent material. First used in SLC 3.0.</p>', '<p>Classe de texture le plus élevé du matériau originel, se servant des classes du triangle texture du sol Utilisé pour la première fois dans les PPC 3.0.</p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-29 14:00:03'),
	(97, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/cfrag1', 'Coarse Fragment 1', 'Teneur en fragments grossiers de la section témoin', '<p>CFRAG1 is the average coarse fragment content of the soil profile, from 0cm to 50cm (or to a root restricting layer < 50cm). First used in SLC 1.0.</p>', '<p>C\'est la teneur moyenne en fragments grossiers du profil pédologique, de 0 cm à 50 cm (ou jusqu\'à une couche qui restreint les racines < 50 cm). Utilisé pour la première fois dans les PPC 1.0.</p>', '', '', 'Ordinal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/cfrag', NULL, '2012-03-29 13:30:24'),
	(98, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/cfrag2', 'Coarse Fragment 2', 'Teneur en fragments grossiers de la section témoin', '<p>CFRAG2 is an average coarse fragment content of the soil profile, from 50cm to 100cm (or to a root restricting layer > 50cm). First used in SLC 1.0.</p>', '<p>C\'est la teneur moyenne en fragments grossiers du profil pédologique, de 50 cm à 100 cm (ou jusqu\'à une couche qui restreint les racines > 50 cm). Utilisé pour la première fois dans les PPC 1.0.</p>', '', '', 'Ordinal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/cfrag', NULL, '2012-03-29 13:31:19'),
	(99, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/restr_type', 'Kind of Compacted, Consolidated, or Root-restricting Layer', 'Genre compact, consolider, ou la couche restreinte des racines', '<p>The kind of compacted, consolidated or root-restricting layer.</p>', '<p>Type de couche compactée, consolidée ou restreignant les racines.</p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/restr_type', NULL, '2012-03-29 14:01:52'),
	(100, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/awhc', 'Available Water Holding Capacity', 'L\'eau disponible du sol de retention de la classe de capacité', '<p>Indicates the soils available water holding capacity class. First used in SLC 3.0.</p>', '<p>Indique la classe de la capacité de rétention d\'eau disponible dans le sol. Utilisé pour la première fois dans les PPC 3.0.</p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/awhc', NULL, '2012-03-29 13:27:40'),
	(101, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/lu', 'Land Use', 'Utilisation des terres', '<p>Indicates the type of soil profile (agricultural or native).  Used as part of the linkage key to the NAMES (SNT) and LAYERS (SLT) tables.</p>', '<p>Indique le type de profil pédologique (agricole ou natif). Utilisé comme partie de la clé de liaison vers les tables NAMES (SNT) et LAYERS (SLT).</p>', '', '', 'Ordinal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/lu', NULL, '2012-03-29 13:38:09'),
	(102, 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/v1/ecozone', 'Ecozone Identifier', 'Identificateur de l\'écozone', '<p>Ecozone identifier.  Ecozones are the highest level of the ecological framework of Canada.</p>', '<p>Identificateur de l\'écozone. L\'écoprovince est le deuxième niveau du cadre écologique du Canada. Elle est subdivisée en écozones et contient un regroupement d\'écorégions.</ p>', 'n/a', 'n/a', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-27 14:36:25'),
	(103, 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/v1/name_en', 'Name (English)', 'Nom (en anglais)', 'Name (English)', 'Nom (anglais)', 'n/a', 'n/a', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/names', NULL, '2012-03-27 16:03:41'),
	(104, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/locsf', 'Local Surface Form', 'Forme de surface local', '<p>Identifies the local surface form of a polygon component. Descriptions define classes of local physical surface forms (assemblage of slopes) or recurring patterns of forms which occur at the earth\'s surface. When applied to consolidated materials, form refers to the product of their modification by geological processes. (ref: ECSS, 1987; NWWG, 1987).</p>', '<p>Indique la forme de la surface locale d\'une composante du polygone. Les descriptions définissent les classes de formes des surfaces physiques locales (assemblage de pentes) ou des modèles récurrents de formes à la surface de la Terre. Appliquée aux matériaux consolidés, la forme désigne le résultat de leur modification par des processus géologiques (réf. : ECSS, 1987; NWWG, 1987).</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.1.1/component/locsf.html', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', NULL, '2012-03-29 13:37:24'),
	(105, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2/snt/pmchem1', 'Parent material chemical property - first (uppermost)', 'Propriété chimique de matériau originel - premier', '<p>The chemical composition class of the upper layer parent material.</p> ', '<p>Classe de composition chimique du matériau parent sous-jacent.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2/snt/pmchem', NULL, '2012-03-30 14:55:36'),
	(106, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/s_group3', 'Soil Subgroup (3rd edition)', 'Sous-groupe de sols (troisième édition)', '<p>Identifies the soil subgroup according to the Canadian System of Soil Classification, 3rd edition.  Subgroup codes are used in conjunction with great group codes.</p>', '<p>Indique le sous-groupe des sols selon le Système canadien de classification des sols, troisième édition. Les codes de sous-groupe sont utilisés en union avec les grands groupes de sols.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/s_group3', NULL, '2012-03-30 14:53:17'),
	(107, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/soilname', 'Soil Name', 'Nom de sol', '<p>Complete soil name, without abbreviations.  There may be multiple records in the SNT for any given SOILNAME.</p>', '<p>Nom du sol au complet, sans abréviation. Il peut y avoir plus d\'un enregistrement dans la table SNT pour chaque SOILNAME unique.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2014-01-08 18:38:29'),
	(108, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/landform_segment/lf_slope', 'Landform Slope Class', 'Classe de pente de relief', '<p>This field contains categorized slope gradient (in percent) of polygon components for the low end of range (Shields, 1982). First used in SLC 3.0. Identical class definitions to version 1.0 but "Not Applicable" code is not included.</p>', '<p>Ce champ indique la catégorie de gradient de pente (en pourcentage) des composantes du polygone pour la limite inférieure de l\'échelle (Shields, 1982). Utilisé pour la première fois dans les PPC 3.0. Les définitions des classes sont identiques à celles de la version 1.0, mais le code « sans objet » est absent.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/slope.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.1.1/component/slope.html', 'Ordinal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/segment_factor/lf_slope', NULL, '2012-03-29 14:55:27'),
	(109, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2/snt/soil_id', 'Soil Name Identifier', 'Identificateur de nom du sol', '<p>This field is normally used to join the Soil Names Table (SNT) to other tables such as the Component Table (CMP).  There is only one record in the SNT for any given SOIL_ID.  This field is a concatenation of the PROVINCE + SOIL_CODE + MODIFIER + PROFILE fields.</p>', '<p>Ce champ est normalement utilisé pour joindre la table des noms de sol (SNT) aux autres tables comme la table des composantes (CMP). Il n\'y aura qu\'un seul enregistrement dans la table SNT pour chaque SOIL_ID unique. Ce champ est une concaténation de l\'identificateur de la province, du code de sol, du modificateur de code de sol, et du type de profil.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-30 14:59:34'),
	(110, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/pmcalc1', 'Calcareous Class of the Uppermost Parent Material ', 'Classe calcaire du matériau originel le plus élevé ', '<p>The calcareous class of the uppermost parent material. First used in SLC 3.0.</p>', '<p>Classe calcaire du matériau originel le plus élevé. Utilisé pour la première fois dans les PPC 3.0.</p>', '', '', 'Ordinal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/pmcalc', NULL, '2012-03-29 13:49:45'),
	(111, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/landform_segment/lf_type', 'Landform Type Class', 'Classe de type de relief', '<p>This one character code identifies the type of landform.</p>', '<p>Ce code d\'un caractère identifie le type de relief.</p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/segment_factor/lf_type', NULL, '2012-03-29 14:59:17'),
	(112, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/component/profile', 'Soil Profile Type', 'Type de profil du sol', '<p>Indicates the type of soil profile (agricultural or native).  Used as part of the linkage key to the NAMES (SNT) and LAYERS (SLT) tables.</p>', '<p>Indique le type de profil pédologique (agricole ou natif). Utilisé comme partie de la clé de liaison vers les tables NAMES (SNT) et LAYERS (SLT).</p>', '', '', 'Ordinal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/lu', NULL, '2012-03-29 14:21:58'),
	(113, 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/v1/ecoregionpolygon', 'Ecoregion Polygon Identifier', 'Identificateur de polygon de l\'écorégion', '<p>Ecoregion polygon identifier. A number of ecoregions consist of more than one polygon.</p>', '<p>Identificateur de polygone de l\'écorégion.  Un certain nombre d\'écorégions sont composées de plus d\'un polygone.</p>', 'n/a', 'n/a', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-27 14:33:39'),
	(114, 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/v1/wind_speed/mean', 'Mean Hourly Wind Speed (Mean)', 'Vitesse horaire moyenne du vent (moyenne)', 'Mean Hourly Wind Speed (polygon mean).', 'Vitesse horaire moyenne du vent (moyenne du polygone).', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/1999report/climate_normals_1961-90.html#vapour', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/climate_normals_1961-90.html#vapour', 'Measure', 'Y', 'km/h', 'km/h', 'kilometers / hour', 'kilomètres / heure', 'n/a', NULL, '2012-03-28 18:11:11'),
	(115, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/component/sl', 'Soil Landscape Identifier', 'Identificateur de polygone de pédo-paysage', '<p>This polygon identifier is used to link the digital map data to attribute data in soil landscape files and other associated files.  The identifier is comprised of the ecodistrict number (1 to 4 digits) always followed by a 3 digit SLC polygon number starting at 001 within each ecodistrict.</p>', '<p>Cet identificateur de polygone est utilisé pour faire le lien entre les données des cartes numérisées et les données sur les attributs dans les fichiers des pédo-paysages et d\'autres fichiers connexes. L\'identificateur comprend le numéro de l\'écodistrict (de 1 à 4 caractères), toujours suivi de trois chiffres pour le numéro du polygone PPC qui débute à 001 dans chaque écodistrict.</p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-28 18:59:03'),
	(116, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/drainage', 'Soil Profile Drainage', 'Drainage de profile de sol', '<p>The DRAINAGE code is used to indicate the type of drainage found within a soil profile. First used in SLC 3.0. Identical classes to drainage in SLC 1.0, but codes differ.</p>', '<p>Ce champ indique le type de drainage que l\'on retrouve dans un profil de sol. Utilisé pour la première fois dans les PPC 3.0. Identique à la classe de drainage dans les PPC 1.0, mais les codes diffèrent.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/snf/drainage.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.1.1/snf/drainage.html', 'Ordinal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-29 14:00:45'),
	(117, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/mdep2', 'Mode of Deposition 2', 'Mode de déposition du matériau originel sous-jacent', '<p>The mode of deposition of the underlying parent material. First used in SLC 3.0</p>', '<p>Mode de déposition du matériau originel sous-jacent. Utilisé pour la première fois dans les PPC 3.0.</p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', NULL, '2012-03-29 13:39:05'),
	(118, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/pmtex2', 'Texture Class 2', 'Texture de matériau originel - deuxième', '<p>The texture class of the underlying parent material. First used in SLC 3.0.</p>', '<p>Classe de texture du deuxième matériau parent sous-jacent  Utilisé pour la première fois dans les PPC 3.0.</p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-29 13:56:31'),
	(119, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/slope', 'Slope Gradient', 'Inclinaison de la pente', '<p>SLOPE contains categorized slope gradient (in percent) of polygon components for the low end of range (Shields, 1982). First used in SLC 3.0. Identical class definitions to version 1.0 but "Not Applicable" code differs.</p>', '<p>Ce champ indique la catégorie de gradient de pente (en pourcentage) des composantes du polygone pour la limite inférieure de l\'échelle (Shields, 1982). Utilisé pour la première fois dans les PPC 3.0. Les définitions des classes sont identiques à celles de la version 1.0, mais le code « sans objet » diffère.</ p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/slope.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.1.1/component/slope.html', 'Ordinal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/slope', NULL, '2012-03-29 14:05:54'),
	(120, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/pmcalc2', 'Calcareous Class of the Underlying Parent Material ', 'Classe calcaire du matériau originel sous-jacent ', '<p>The calcareous class of the underlying parent material. First used in SLC 3.0.</p>', '<p>Classe calcaire du matériau originel sous-jacent. Utilisé pour la première fois dans les PPC 3.0.</p>', '', '', 'Ordinal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/pmcalc', NULL, '2012-03-29 13:50:19'),
	(121, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/pat/survey_id', 'Survey Identifier', 'Identificateur de levé', '<p>Identification of survey in the NSDB.</p>', '<p>Identificateur de levé dans la BNDS.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-26 19:09:24'),
	(122, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/pat/feature_id', 'Feature Identifier', 'Identificateur de caractéristique', '<p>Identifier for this feature assigned in the original soil survey.  This may be either a map unit identifer or a unique polygon identifier.</p>', '<p>L\'identificateur pour cette caractéristique fut assignée à l\'étude pédologique d\'origine. Cela peut être soit un identificateur d\'unité de cartographie ou un identificateur de polygone unique.</p>\r\n', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-26 18:02:35'),
	(123, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/pat/poly_id', 'Polygon Identifier', 'Identificateur de polygone', '<p>This polygon identifier is used to join attribute datasets (such as the CMP) to the Polygon Attribute Table (PAT).  More than one polygon in the spatial dataset may share the same POLY_ID.   This field is a concatenation of the survey identifier (6 characters) and a 6 character feature identifier.  </p>', '<p>Cet identificateur de polygone est utilisé pour joindre des ensembles de données d\'attributs (tels que le CMP) à la table des attributs de polygone (PAT). Plusieurs polygones dans la couverture des PPC peuvent partager le même identificateur POLY_ID. Ce champ est une concaténation du l\'identificateur de l\'étude (6 caractères) et un identificateur de caractéristiques de 6 caractères. </p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-12-11 19:16:28'),
	(124, 'http://sis.agr.gc.ca/cansis/nsdb/dss/mapunitnom', 'Map Unit Symbol', 'Symbole de l\'unité de cartographie', '<p>Soil Map Unit Symbol as shown on the original paper map.</p>', '<p>Symbole de l\'unité de cartographie pédologique tel qu\'illustré sur la carte originale imprimée.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-12-07 22:33:41'),
	(125, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/rootrestri', 'Soil layer that restricts root growth', 'Couche de sol bloquant le passage aux racines', '<p>Indicates the soil layer that restricts root growth. "-" indicates "not applicable". Layers are numbered 0 if no restricting layer is present. Numbers 1-9 indicate that the layer is restrictive and this number can be linked to the LAYER_NO field in the SLT.</p>', '<p>Indique la couche du sol qui restreint la croissance des racines. « - » signifie « sans objet » ou « non applicable ».  Le numéro 0 indique qu\'il n\'y a aucune couche restrictive. Les numéros 1 à 9 indiquent la couche qui restreint la croissance des racines, et ce numéro peut être relié au champ de LAYER_NO dans la table SLT.</p>', '', '', 'Ordinal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/rootrestri', NULL, '2012-04-04 18:28:02'),
	(126, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2/snt/kind', 'Kind of Surface Material', 'Type de matériel de surface ', '<p>Identifies the kind of surface soil, rock outcrop or other material (feature). First used in SLC 3.0.</p>', '<p>Indique le type de sol en surface, d\'affleurement rocheux ou d\'autre matériau (caractéristique). Utilisé pour la première fois dans les PPC 3.0.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-30 14:55:08'),
	(127, 'http://sis.agr.gc.ca/cansis/nsdb/cmp', 'Component Number', 'Numéro de la composante', '<p>A number that uniquely identifies a constituent part of a polygon.</p>', '<p>Un nombre identifiant de manière unique un élément fondamental d\'un polygone.</p>', '', '', 'Ordinal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-13 18:35:54'),
	(128, 'http://sis.agr.gc.ca/cansis/nsdb/polygon_', 'Internal field', 'Champ interne', '', '', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-28 18:23:17'),
	(129, 'http://sis.agr.gc.ca/cansis/nsdb/perimeter', 'Internal field', 'Champ interne', '', '', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-28 18:22:30'),
	(130, 'http://sis.agr.gc.ca/cansis/nsdb/polygon_id', 'Internal field', 'Champ interne', '', '', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-28 18:27:01'),
	(131, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/component/pmchem1', 'Parent Material Chemical 1', 'Classe calcaire du matériau originel le plus élevé ', '<p>The chemical composition class of the uppermost parent material. First used in SLC 3.0. </p> ', '<p>Classe calcaire du matériau originel le plus élevé. Utilisé pour la première fois dans les PPC 3.0.</p>', '', '', 'Ordinal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/pmcalc', NULL, '2012-03-29 14:15:24'),
	(132, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/component/pmchem2', 'Parent Material Chemical 2', 'Classe calcaire du matériau originel sous-jacent ', '<p>The chemical compostion class of the underlying, 2nd layer, parent material. First used in SLC 3.0.</p>', '<p>Classe calcaire du matériau originel sous-jacent. Utilisé pour la première fois dans les PPC 3.0.</p>', '', '', 'Ordinal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/pmcalc', NULL, '2012-03-29 14:18:54'),
	(133, 'http://sis.agr.gc.ca/cansis/nsdb/detailed/index/index_id', 'Index map identifier', 'Index d\'identificateurs de carte', '', '', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-02-10 16:57:58'),
	(134, 'http://sis.agr.gc.ca/cansis/nsdb/detailed/index/report', 'Report identifier', 'Identifiant de rapport', '', '', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-26 16:18:42'),
	(135, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/landform/lf_id', 'Landform Identifier', 'Identificateur de relief', '<p>This key uniquely identifies each landform within the SLC polygon coverage.  It is concatenated from POLY_ID + LF_TYPE + LF_SLOPE.</p>', '<p>Cette clé identifie de façon unique chaque relief de chaque polygone de la couverture des PPC.  Il est concaténée de POLY_ID + LF_TYPE + LF_SLOPE.</p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-29 14:41:37'),
	(136, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/landform_segment/lf_segment', 'Landform Segment Class (Position)', 'Code du segment de relief (position)', '<p>Each landform is defined as having four segments, representing the upper slope, mid slope, lower slope and depression positions. This code identifies the position of the landform segment.</p>', '<p>Chaque forme de relief est définie comme ayant quatre segments, représentant la position de la pente supérieure, de la mi-pente, de la pente inférieure et de la dépression. Ce code indique la position du segment de la forme de relief.</p>', '', '', 'Ordinal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/lft/lfs_pos', NULL, '2012-03-29 14:53:33'),
	(137, 'http://sis.agr.gc.ca/cansis/nsdb/detailed/index/water', 'Water identifier', 'Identificateur de l\'eau', '', '', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-26 16:27:28'),
	(138, 'http://sis.agr.gc.ca/cansis/nsdb/detailed/index/status', 'Soil Survey Status', 'État de levé pédologique', 'Soil Survey status to be mapped.', 'État de levé pédologique à cartographier.', '', '', 'Ordinal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/detailed/index/status', NULL, '2012-03-26 18:08:45'),
	(139, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/landform_segment/lfs_name', 'Name of Landform Segment', 'Nom du segment de relief', '<p>Landform segment name (landform type, slope class and toposequence position/segment).</p>', '<p>Nom du segment de forme de relief (type de forme de relief, classe de pente et position/segment de la toposéquence).</p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-29 14:51:43'),
	(140, 'http://sis.agr.gc.ca/cansis/nsdb/province1996', 'Province Code', 'Code province', '<p>A two-character province code used as part of a link to the CanSIS NAMES and LAYERS tables.</p> ', '<p>Code de province à deux caractères utilisé pour associer les tables NAMES et LAYERS de SISCan.</p>', 'n/a', 'n/a', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/province1996', NULL, '2012-03-28 18:27:52'),
	(141, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/segmentation/cropped', 'Crop Production Likelihood Class', 'Utilisation des cultures agricoles', '<p>Likelihood of the soil is used for agricultural crop production.</p>', '<p>Probabilité que le sol serve à des fins agricoles.</p>', '', '', 'Ordinal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/lft/cropped', NULL, '2012-03-29 15:02:05'),
	(142, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/landform_segment/lfs_extent', 'Percent of Landform in this Segment', 'Pourcentage du relief trouvé dans ce segment', '<p>Extent of this landform segment within the landform (in percent).</p>', '<p>Étendue de ce segment du relief dans la forme de relief, en pourcentage.</p>', '', '', 'Measure', 'Y', '%', '%', 'percent', 'pourcentage', 'n/a', NULL, '2012-03-29 14:44:00'),
	(143, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/landform_segment/lfs_slope', 'Slope of Landform Segment', 'Pente du segment de relief', '<p>The typical percent slope for this landform segment.</p>', '<p>Pente type pour cette forme du relief, en pourcentage.</p>', '', '', 'Measure', 'Y', '%', '%', 'percent', 'pourcentage', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/numeric/missing', NULL, '2012-03-29 14:52:24'),
	(144, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/landform_segment/lfs_length', 'Slope Length of Landform Segment', 'Longueur de pente du relief', '<p>The typical length in meters of the landform segment.</p>', '<p>Longueur type pour cette forme du relief, en mètres.</p>', '', '', 'Measure', 'Y', 'm', 'm', 'meters', 'meters', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/numeric/missing', NULL, '2012-03-29 14:50:26'),
	(145, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/soil_code', 'Soil Code', 'Code de sol', '<p>Soil code used as part of the link to a representative soil in the CanSIS NAMES and LAYERs tables.  The "#" symbol is used to denote non-applicable for areas where no soil name is established.</p>', '<p>Code de sol faisant partie du lien vers un sol représentatif dans les tables NAMES et LAYERS de SISCan. Le symbole « # » est utilisé pour désigner les champs non applicables pour les zones où aucun nom de sol n\'est défini.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-30 14:42:05'),
	(146, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/modifier', 'Soil Code Modifier', 'Modificateur de code du sol', '<p>The modifier code is used to indicate a particular assemblage of characteristics related to a soil code. A soil modifier code is used as part of the link to a representative soil in the Soil Name and Soil Layer tables.</p> <p>The soil_code + modifier are unique within each Province or Territory for all soils (mineral or organic), nonsoils, and unclassified areas.</p>', '<p>Ce code sert à indiquer un regroupement particulier de caractéristiques liées à un code de sol. Le code de modificateur de sol est utilisé comme partie du lien vers un sol représentatif dans les tables NAME et LAYER de SISCan.</p> <p>La combinaison soil_code + modifier est unique dans une province ou un territoire donné pour tous les sols (minéraux ou organiques), les non-sols et les superficies non classées.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2013-04-25 16:50:22'),
	(147, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/kind', 'Kind of Surface Material', 'Type de matériel de surface ', '<p>Identifies the kind of surface soil, rock outcrop or other material (feature). First used in SLC 3.0.</p>', '<p>Indique le type de sol en surface, d\'affleurement rocheux ou d\'autre matériau (caractéristique). Utilisé pour la première fois dans les PPC 3.0.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/kind', NULL, '2012-03-30 13:35:00'),
	(148, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/watertbl', 'Water Table Characteristics', 'Caractéristiques de la nappe phréatique', '<p>Indicates the presence of a water table at a depth of 100cm, and identifies its temporal characteristics.</p>', '<p>Indique la présence d\'une nappe phréatique à une profondeur de 100cm, ainsi que ses caractéristiques temporelles.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/watertbl', NULL, '2012-07-18 13:42:01'),
	(149, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/restr_type', 'Type of root restricting layer', 'Type de couche bloquant le passage aux racines', '<p>Indicates the type of soil in the root restricting layer.</p>', '<p>Type de couche compactée, consolidée ou restreignant les racines.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/restr_type', NULL, '2012-03-30 14:13:51'),
	(150, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/pmtex2', 'Parent material texture - second', 'Texture de matériau originel - deuxième', '<p>The texture class of the second underlying parent material. First used in SLC 3.0.</p>', '<p>Classe de texture du deuxième matériau parent sous-jacent (le cas échéant), déterminée d\'après les classes figurant dans le triangle des textures. Utilisé pour la première fois dans les PPC 3.0.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/pmtex', NULL, '2012-03-30 14:00:04'),
	(151, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/pmtex3', 'Parent material texture - third', 'Texture de matériau originel - troisième', '<p>The texture class of the third underlying parent material. First used in SLC 3.0.</p>', '<p>Classe de texture du troisième matériau parent sous-jacent (le cas échéant), déterminée d\'après les classes figurant dans le triangle des textures. Utilisé pour la première fois dans les PPC 3.0.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/pmtex', NULL, '2012-03-30 14:01:15'),
	(152, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2/snt/pmchem2', 'Parent material chemical property - second ', 'Propriété chimique de matériau originel - deuxième', '<p>The chemical composition class of the second underlying parent material if present.</p> ', '<p>Classe de composition chimique du deuxième matériau parent sous-jacent.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2/snt/pmchem', NULL, '2012-03-30 14:56:14'),
	(153, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2/snt/pmchem3', 'Parent material chemical property - third ', 'Propriété chimique de matériau originel - troisième', '<p>The chemical composition class of the third, underlying parent material if present.</p> ', '<p>Classe de composition chimique du troisième matériau parent sous-jacent.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2/snt/pmchem', NULL, '2012-03-30 14:56:46'),
	(154, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep1', 'Mode of deposition - first (uppermost)', 'Mode de dépôt - premier (le plus élevé)', '<p>The mode of deposition of the uppermost underlying parent material. First used in SLC 3.0</p>', '<p>« Mécanisme de dépôt » du matériau parent sous-jacent. Utilisé pour la première fois dans les PPC 3.0.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', NULL, '2012-03-30 13:38:06'),
	(155, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep3', 'Mode of deposition - third', 'Mode de dépôt - troisième', '<p>The mode of deposition of the third underlying parent material. First used in SLC 3.0</p>', '<p>« Mode de dépôt » du troisième matériau parent sous-jacent. Utilisé pour la première fois dans les PPC 3.0.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', NULL, '2012-03-30 13:41:30'),
	(156, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/g_group', 'Soil Great Group (2nd edition)', 'Grand groupe de sols (deuxième édition)', '<p>Identifies the soil great group according to the Canadian System of Soil Classification 2nd edition</p>', '<p>Indique le grand groupe des sols selon le Système canadien de classification des sols, seconde édition.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-30 13:33:39'),
	(157, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/profile', 'Linkage key to the Detail II (pedon) File', 'Clé de mise en relation au fichier Detail II', '<p>Header from Detail II File.</p>', '<p>En-tête figurant au fichier Detail II.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-30 14:13:18'),
	(158, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/ldepth', 'Lower Depth', 'Profondeur de l\'horizon inférieur', '<p>Indicates the depth of the bottom of the horizon.  For mineral soils the top of the mineral material is chosen as depth zero, and for any organic layers that are present (such as LFH) the values of both UDEPTH and LDEPTH will be negative.</p>', '<p>Indique la profondeur la plus basse de l\'horizon.  Pour les sols minéraux, la partie supérieure de la matière minérale est choisie comme une profondeur de zéro, et pour toutes les couches organiques qui sont présentes (comme LFH) les valeurs sont négatives pour tous les deux UDEPTH et LDEPTH.</p>', '', '', 'Nominal', 'n/a', 'cm', 'cm', 'centimeters', 'centimètres', 'n/a', NULL, '2014-04-28 17:14:14'),
	(159, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_suf', 'Horizon Suffix', 'Suffixe de l\'horizon', '<p>Identifies the horizon suffix, as per <a href="/cansis/taxa/cssc3/chpt02_a.html#soilhorizons">Chapter 2</a> of the <a href="/cansis/taxa/cssc3/index.html">Canadian System of Soil Classification, third edition</a>.</p>', '<p>Indique le suffixe d\'horizon de sol selon le <a href="/siscan/taxa/cssc3/chpt02_a.html#horizonsdusol">Chapitre 2</a> du <a href="/siscan/taxa/cssc3/index.html">Système Canadien de classification des Sols, 3ième éditions</a>.</ p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-29 15:53:51'),
	(160, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mod', 'Horizon Modifier', 'Modificateur de l\'horizon', '<p>Identifies any soil horizon modifier that may be present.</p> ', '<p>Indique tout modificateur d\'horizon de sol qui peut être présent.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-29 15:49:27'),
	(161, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/cofrag', 'Coarse Fragments', 'Fragments grossiers', '<p>Indicates the coarse fragments as a percentage of volume.</p>', '<p>Indique les fragments grossiers en pourcentage du volume.</p>', '', '', 'Measure', 'Y', '%', '%', 'percent', 'pourcentage', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/numeric/notapplicable', NULL, '2013-07-18 14:24:40'),
	(162, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/domsand', 'Dominant Sand Fraction', 'Fraction de sable dominante', '<p>Identifies the dominant sand fraction.</p>', '<p>Indique la fraction de sable dominante.</p>', '', '', 'Measure', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/domsand', NULL, '2012-03-29 15:22:34'),
	(163, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/vfsand', 'Very Fine Sand', 'Sable très fin', '<p>Indicates the percentage of very fine sand, by weight.</p>', '<p>Indique en pourcentage le poids de sable très fin.</ p>', '', '', 'Measure', 'Y', '%', '%', 'percent', 'pourcentage', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/numeric/notapplicable', NULL, '2012-03-29 16:42:21'),
	(164, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/tsand', 'Total Sand', 'Sable total', '<p>Indicates the percentage of total sand, by weight.</p>', '<p>Indique en pourcentage la pesanteur de la totalité du sable.</p>', '', '', 'Measure', 'Y', '%', '%', 'percent', 'pourcentage', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/numeric/notapplicable', NULL, '2012-03-29 16:30:37'),
	(165, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/ph2', 'pH as per project report', 'pH figurant dans le rapport sur le projet', '<p>Indicates the pH as specified in the project report.</p> ', '<p>Indique le pH mentionné dans le rapport de projet.</p>', '', '', 'Measure', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/numeric/notapplicable', NULL, '2012-03-29 16:10:46'),
	(166, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/cec', 'Cation Exchange Capacity', 'Capacité d\'échange cationique', '<p>Identifes the cation exchange capacity.</p>', '<p>Indique la capacité d\'échange cationique, en méq/100 g.</p>', '', '', 'Measure', 'Y', 'Meq/100g', 'Meq/100g', 'milliequivalents per 100 g', 'milliéquivalents par 100 g', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/numeric/notapplicable', NULL, '2012-03-29 15:07:04'),
	(167, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/ksat', 'Saturated Hydraulic Conductivity', 'Conductivité hydraulique en milieu saturé', '<p>Indicates the saturated hydraulic conductivity, cm/h.</p>  ', '<p>Indique la conductivité hydraulique en milieu saturé, cm/h.</p>', '', '', 'Measure', 'Y', 'cm/h', 'cm/h', 'centimeters per hour', 'centimètres per heure', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/numeric/notapplicable', NULL, '2012-03-29 16:04:23'),
	(168, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/kp33', 'Water Retention at 33 kP', 'Rétention d\'eau à 33 kP', '<p>Idenfifies water retention at 33 kP, in percent by total soil volume.</p>', '<p>Indique en pourcentage la rétention d\'eau à 33 kP du volume total du sol.</p>', '', '', 'Measure', 'Y', '%', '%', 'percent', 'pourcentage', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/numeric/notapplicable', NULL, '2012-03-29 16:01:49'),
	(169, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/bd', 'Bulk Density', 'Densité apparente', '<p>Identifies the bulk density. Values are for the fine earth fraction (excluding coarse fragment content).</p>', '<p>Indique la densité apparente. Les valeurs sont pour la fraction de terre fine (exclusion faite du contenu en fragments grossiers).</p>', '', '', 'Measure', 'Y', 'g/cm3', 'g/cm3', 'g/cm3', 'g/cm3', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/numeric/notapplicable', NULL, '2012-03-29 15:04:16'),
	(170, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/ec', 'Electrical Conductivity', 'Conductivité électrique', '<p>Identifies the electrical conductivity.</p>', '<p>Indique la conductivité électrique.</p>', '', '', 'Measure', 'Y', 'dS/m', 'dS/m', 'decisiemens per meter', 'decisiemens par mètre', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/numeric/notapplicable', NULL, '2012-03-29 15:24:25'),
	(171, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/vonpost', 'Von Post', 'Estimation de Von Post de la décomposition', '<p>Indicates the class of decomposition using the Von Post estimate of decomposition.</p>', '<p>Indique la classe de décomposition selon l\'estimation de Von Post de la décomposition.</p>', '', '', 'Ordinal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/vonpost', NULL, '2012-11-05 18:24:39'),
	(172, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/pat/poly_id', 'SLC Polygon Identifier', 'Identificateur de polygone du PPC', '<p>This field identifies the SLC polygon.  It is used to join to data in the SLC attribute datasets (LAT, CMP, and LST).  More than one polygon in the spatial framework may share the same SLC polygon identifier.  This field is comprised of the ecodistrict number (1 to 4 digits), followed by a 3 digit SLC polygon number starting at 001 within each ecodistrict.</p>', '<p>Cet identificateur de polygone sert à relier cette table aux données dans les tables LAT, CMP, et LST du PPC.  Plusieurs polygones dans la couverture des PPC peuvent partager le même identificateur de polygone du PPC. L\'identificateur est composé du numéro de l\'écodistrict (1 à 4 chiffres), suivi du numéro du polygone PPC à 3 chiffres et qui débute à 001 dans chaque écodistrict.</p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-10-18 15:44:12'),
	(173, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/tclay', 'Total Clay', 'Argile totale', '<p>Indicates the percentage of total clay, by weight.</p>', '<p>Indique en pourcentage la pesanteur de la totalité d\'argile.</p>', '', '', 'Measure', 'n/a', '%', '%', 'percent', 'pourcentage', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/numeric/notapplicable', NULL, '2012-03-29 16:29:11'),
	(174, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/crt/cfrag1', 'Coarse Fragment 1', 'Teneur en fragments grossiers de la section témoin (1)', '<p>CFRAG1 is the average coarse fragment content of the soil profile, from 0cm to 50cm (or to a root restricting layer < 50cm). First used in SLC 1.0.</p>', '<p>C\'est la teneur moyenne en fragments grossiers du profil pédologique, de 0 cm à 50 cm (ou jusqu\'à une couche qui restreint les racines < 50 cm). Utilisé pour la première fois dans les PPC 1.0.</p>', '', '', 'Ordinal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/crt/cfrag', NULL, '2012-03-29 14:33:43'),
	(175, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/crt/cfrag2', 'Coarse Fragment 2', 'Teneur en fragments grossiers de la section témoin (2)', '<p>CFRAG2 is an average coarse fragment content of the soil profile, from 50cm to 100cm (or to a root restricting layer > 50cm). First used in SLC 1.0.</p>', '<p>C\'est la teneur moyenne en fragments grossiers du profil pédologique, de 50 cm à 100 cm (ou jusqu\'à une couche qui restreint les racines > 50 cm). Utilisé pour la première fois dans les PPC1.0.</p>', '', '', 'Ordinal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/crt/cfrag', NULL, '2012-03-29 14:34:07'),
	(176, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/kp10', 'Water Retention at 10 kP', 'Rétention d\'eau à 10 kP', '<p>Identifies water retention at 10 kP, in percent by total soil volume.</p>', '<p>Indique en pourcentage la rétention d\'eau à 10 kP du volume total du sol.</p>', '', '', 'Measure', 'Y', '%', '%', 'percent', 'pourcentage', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/numeric/notapplicable', NULL, '2012-03-29 16:03:02'),
	(177, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/layer_no', 'Layer Number', 'Numéro de l\'horizon', '<p>Indicates the horizon number.</p>', '<p>Indique le numéro de l\'horizon.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-29 16:05:16'),
	(178, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/phca', 'pH in calcium chloride', 'pH mesuré dans le chlorure de calcium', '<p>Indicates the pH in calcium chloride.</p>', '<p>Indique le pH du chlorure de calcium.</p>', '', '', 'Measure', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/numeric/notapplicable', NULL, '2012-03-29 16:19:37'),
	(179, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/udepth', 'Upper Depth', 'Profondeur de l\'horizon supérieur', '<p>Indicates the depth to the top of the horizon.  For mineral soils the top of the mineral material is chosen as depth zero, and for any organic layers that are present (such as LFH) the values of both UDEPTH and LDEPTH will be negative.</p>', '<p>Indique la plus haute profondeur de l\'horizon.  Pour les sols minéraux, la partie supérieure de la matière minérale est choisie comme une profondeur de zéro, et pour toutes les couches organiques qui sont présentes (comme LFH) les valeurs sont négatives pour tous les deux UDEPTH et LDEPTH.</p>', '', '', 'Nominal', 'n/a', 'cm', 'cm', 'centimeters', 'centimètres', 'n/a', NULL, '2014-04-28 17:13:57'),
	(180, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/wood', 'Woody Material', 'Matériaux ligneux', '<p>Indicates the volume of woody material in percent.</p>', '<p>Indique le volume de matière ligneuse en pourcentage.</p>', '', '', 'Ordinal', 'n/a', '%', '%', 'percent', 'pourcentage', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/numeric/notapplicable', NULL, '2012-03-30 13:11:57'),
	(181, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/s_group', 'Soil Subgroup (2nd edition)', 'Sous-groupe de sols (deuxième édition)', '<p>Identifies the soil subgroup according to the Canadian System of Soil Classification, 2nd edition.</p>', '<p>Indique le sous-groupe des sols selon le Système canadien de classification des sols, seconde édition.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-30 14:43:18'),
	(182, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/order', 'Soil Order (2nd edition)', 'Ordre de sols (deuxième édition)', '<p>Identifies the soil order according to the Canadian System of Soil Classification 2nd edition.</p>', '<p>Indique l\'ordre du sol selon le Système canadien de classification des sols, seconde édition.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-30 13:56:34'),
	(183, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2/snt/profile', 'Type of soil profile', 'Type de profil de sol', '<p>Indicates the type of soil profile (agricultural or native).  Used as part of the linkage key to the NAMES (SNT) and LAYERS (SLT) tables.  The linkage is made to an agricultural model of each soil profile, where it is available (PROFILE = A).  This  “agricultural bias” is useful for agricultural interpretive modeling.   True land use information should be consulted to determine the current land use in a  particular soil map polygon.</p>', '<p>Indique le type de profil pédologique (agricole ou natif). Utilisé comme partie de la clé de liaison vers les tables NAMES (SNT) et LAYERS (SLT).  Le lien est fait à un modèle agricole de chaque profil de sol, où il est disponible (PROFIL = A). Ce «biais agricole" est utile pour la modélisation d\'interprétation agricole. Vrai information sur l\'utilisation des terres devrait être consulté afin de déterminer l\'utilisation actuelle des terres dans les polygones de sol individuels.</p>', '', '', 'Ordinal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2/snt/profile', NULL, '2013-07-15 20:52:08'),
	(184, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_lit', 'Horizon Lithological Discontinuity', 'Horizon à discontinuité lithologique', '<p>Identifies the presence of lithological discontinuity horizons. When present, this field identifies the number of the lithological discontinuity, and can take a value from "2" to "5".</p>', '<p>Indique la présence d\'horizons à discontinuité lithologique. Lorsqu\'il est présent, ce champ identifie le numéro de la discontinuité lithologique, et peut prendre une valeur de "2" à "5".</p>', '', '', 'Ordinal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-29 15:28:43'),
	(185, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/base', 'Base Saturation', 'Saturation de la base', '<p>Indicates the base saturation in percent.</p>', '<p>Indique la saturation de la base en pourcentage.</p>', '', '', 'Measure', 'Y', '%', '%', 'percent', 'pourcentage', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/numeric/notapplicable', NULL, '2012-03-29 15:03:02'),
	(186, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/kp1500', 'Water Retention at 1500 kP', 'Rétention d\'eau à 1 500 kP', '<p>Identifies water retention at 1500 kP, in percent by total soil volume.</p> ', '<p>Indique en pourcentage la rétention d\'eau à 1 500 kP du volume total du sol.</p>', '', '', 'Measure', 'Y', '%', '%', 'percent', 'pourcentage', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/numeric/notapplicable', NULL, '2012-03-29 16:03:31'),
	(187, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/soiltype', 'Soil Name Identifier', 'Identificateur de nom du sol', '<p>Linkage key filled with # as spacer filler.</p>', '<p>Clé de liaison remplie du symbole "#" pour combler les espaces.</p> ', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-30 14:42:33'),
	(188, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/lu', 'Land Use flag', 'Indicateur de l\'utilisation des terres', '<p>Flag indicating the types of land uses identified in the NAME and LAYER tables.</p>', '<p>Il s\'agit de l\'indicateur des types d\'utilisation des terres énumérés dans les tables NAME et LAYER.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-30 13:37:19'),
	(189, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/cmp/cmp_id', 'Polygon Component Identifier', 'Identificateur de composantes de polygone', '<p>This field uniquely identifies a spatial component of the polygon within the dataset. It is a concatenation of the polygon identifier (POLY_ID) and the component identifier (CMP).</p>', '<p>Ce champ indique de façon unique une composante spatiale du polygone dans l\'ensemble de données. C\'est une concaténation de l\'identificateur de polygone (POLY_ID) et de l\'identificateur de composante (CMP).</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-29 14:14:35'),
	(190, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep2', 'Mode of deposition - second', 'Mode de dépôt - deuxième', '<p>The mode of deposition of the second underlying parent material. First used in SLC 3.0</p>', '<p>« Mode de dépôt » du deuxième matériau parent sous-jacent. Utilisé pour la première fois dans les PPC 3.0.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', NULL, '2012-03-30 13:40:55'),
	(191, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/depth', 'Depth to Bedrock or Root-restricting Layer', 'Profondeur à l\'assise rocheuse ou la couche restreinte des racines', '<p>Depth to Bedrock or Root-restricting Layer. First used in SLC 3.0.</p>', '<p>Profondeur jusqu\'au substratum ou à la couche qui restreint les racines. Utilisé pour la première fois dans les PPC 3.0.</p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/depth', NULL, '2012-03-29 13:31:58'),
	(192, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/cmp/slope', 'Slope Steepness', 'Raideur de la pente', '<p>Predominant slope of the landscape.</p>\r\n\r\n<table border="1">\r\n<tr align="center">\r\n<th scope="col">Slope (%)</th>\r\n<th scope="col">Approximate degrees</th>\r\n<th scope="col">Terminology</th>\r\n</tr>\r\n<tr>\r\n<td align="center">0 - 0.5</td>\r\n<td align="center">0</td>\r\n<td>Level</td>\r\n</tr>\r\n<tr>\r\n<td align="center">0.5 - 2</td>\r\n<td align="center">0.3 - 1.1</td>\r\n<td>Nearly level</td>\r\n</tr>\r\n<tr>\r\n<td align="center">2 - 5</td>\r\n<td align="center">1.1 - 3</td>\r\n<td>Very gentle slopes</td>\r\n</tr>\r\n<tr>\r\n<td align="center">5 - 9</td>\r\n<td align="center">3 - 5</td>\r\n<td>Gentle slopes</td>\r\n</tr>\r\n<tr>\r\n<td align="center">9 - 15</td>\r\n<td align="center">5 - 8.5</td>\r\n<td>Moderate slopes</td>\r\n</tr>\r\n<tr>\r\n<td align="center">15 - 30</td>\r\n<td align="center">8.5 - 16.5</td>\r\n<td>Strong slopes</td>\r\n</tr>\r\n<tr>\r\n<td align="center">30 - 45</td>\r\n<td align="center">16.5 - 24</td>\r\n<td>Very strong slopes</td>\r\n</tr>\r\n<tr>\r\n<td align="center">45 - 70</td>\r\n<td align="center">24 - 35</td>\r\n<td>Extreme slopes</td>\r\n</tr>\r\n<tr>\r\n<td align="center">70 - 100</td>\r\n<td align="center">35 - 45</td>\r\n<td>Steep slopes</td>\r\n</tr>\r\n<tr>\r\n<td align="center">&gt; 100</td>\r\n<td align="center">&gt; 45</td>\r\n<td>Very steep slopes</td>\r\n</tr>\r\n<tr>\r\n<td align="center">-9</td>\r\n<td align="center">n/a</td>\r\n<td>Unknown or not applicable</td>\r\n</tr>\r\n</table>\r\n\r\nWhile this is a numeric field, the values will often be the mid point of the traditional slope classes described in the table above.', '<p>Pente prédominante du paysage. </p>\r\n\r\n<table border="1">\r\n<tr align="center">\r\n<th scope="col">Pente (%)</th>\r\n<th scope="col">Degrés approximatifs</th>\r\n<th scope="col">Terminologie</th>\r\n</tr>\r\n<tr>\r\n<td align="center">0 - 0,5</td>\r\n<td align="center">0</td>\r\n<td>Pente nulle</td>\r\n</tr>\r\n\r\n<tr>\r\n<td align="center">0,5 - 2</td>\r\n<td align="center">0,3 - 1,1</td>\r\n<td>Pente presque nulle</td>\r\n</tr>\r\n<tr>\r\n<td align="center">2 - 5</td>\r\n<td align="center">1,1 - 3</td>\r\n<td>Pente très douce</td>\r\n</tr>\r\n<tr>\r\n\r\n<td align="center">5 - 9</td>\r\n<td align="center">3 - 5</td>\r\n<td>Pente douce</td>\r\n</tr>\r\n<tr>\r\n<td align="center">9 - 15</td>\r\n<td align="center">5 - 8,5</td>\r\n<td>Pente modérée</td>\r\n</tr>\r\n<tr>\r\n<td align="center">15 - 30</td>\r\n\r\n<td align="center">8,5 - 16,5</td>\r\n<td>Pente forte</td>\r\n</tr>\r\n<tr>\r\n<td align="center">30 - 45</td>\r\n<td align="center">16,5 - 24</td>\r\n<td>Pente très forte</td>\r\n</tr>\r\n<tr>\r\n<td align="center">45 - 70</td>\r\n<td align="center">24 - 35</td>\r\n\r\n<td>Pente extr&ecirc;me</td>\r\n</tr>\r\n<tr>\r\n<td align="center">70 - 100</td>\r\n<td align="center">35 - 45</td>\r\n<td>Pente abrupte</td>\r\n</tr>\r\n<tr>\r\n<td align="center">&gt; 100</td>\r\n<td align="center">&gt; 45</td>\r\n<td>Pente très abrupte</td>\r\n</tr>\r\n<tr>\r\n<td align="center">-9</td>\r\n<td align="center">n/a</td>\r\n<td>Inconnu ou non applicable</td>\r\n</tr>\r\n</table>\r\n\r\nBien que ce soit un champ numérique, les valeurs seront souvent le point médian des classes de pente traditionnelles décrites dans le tableau ci-dessus.', '', '', 'Measure', 'Y', '%', '%', 'percent', 'pourcentage', 'n/a', NULL, '2013-07-15 19:23:22'),
	(193, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/soilkey', 'Soil Identifier', 'Clé de mise en relation', '<p>The soil key is a concatenated linkage key used to relate between the CMP and the SNT and SLT tables. The soilkey field is concatenated from the PROVINCE, SOIL_CODE, MODIFIER and LU fields in the SNT table.</p>', '<p>Ce champ contient une clé de relation concaténée servant à associer le champ CMP aux tables SNT et SLT. Le champ SOILKEY est concaténé à partir des champs PROVINCE, SOIL_CODE, MODIFIER et LU dans la table SNT.</p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-29 14:08:22'),
	(194, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/cmp/stoniness', 'Surface Stoniness Class', 'Classe de pierrosité', '<p>Rock fragments on the surface of a soil or those protruding above ground have important effects on soil use and management. The limitations they impose are related to their number, size, and spacing at the surface.</p>\r\n<p>The terminology that follows is further defined in the <a href="/cansis/publications/manuals/1982-forms/index.html">CanSIS Manual for Describing Soils in the Field.</p>', '<p>Les fragments de roche sur la surface ou ceux en saillie au dessus du sol ont des effets importants sur l\'utilisation et la gestion des sols. Les limitations qu\'elles imposent sont liés à leur nombre, leur taille et l\'espacement à la surface.</p>\r\n<p>La terminologie qui suit est définie plus amplement dans le <a href="/siscan/publications/manuals/1982-forms/index.html">Manuel de description des sols sur le terrain : révision 1982 de SISCan.</a></p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.1.1/component/stone.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.1.1/component/stone.html', 'Ordinal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/cmp/stoniness', NULL, '2012-03-26 17:02:03'),
	(195, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/landform/lf_extent', 'Landform Percent of Polygon', 'Pourcentage du polygone couverts par le relief', '<p>The estimated extent of the landform within a SLC polygon, in percent. SLC polygons with a single landform have a value of 100%.</p>', '<p>Étendue estimée de la forme de relief dans un polygone PPC, en pourcentage. Les polygones PPC avec une seule forme de relief ont une valeur de 100 %.</p>', '', '', 'Measure', 'Y', '%', '%', 'percent', 'pourcentage', 'n/a', NULL, '2012-03-29 14:36:03'),
	(196, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/landform_segment/lfs_id', 'Landform Segment Identifier', 'Identificateur de segment de relief', '<p>This code identifies landform segments and their positions.  It is concatenated from the LF_TYPE + LF_SLOPE + LF_SEGMENT fields, and is used to link to the Landform Segment Table.</p>', '<p>Ce code indique les segments de forme de relief et leurs positions. Il est concaténée à partir des champs LF_TYPE + LF_SLOPE + LF_SEGMENT.  Ce champ est recommandé comme lien à la table des formes de relief (LFS).</p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-29 14:49:42'),
	(197, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/caco3', 'Calcium Carbonate Equivalent', 'Équivalent en carbonate de calcium', '<p>Indicates the calcium carbonate equivalent in percent.</p>', '<p>Indique l\'équivalent en carbonate de calcium, en pourcentage.</p>', '', '', 'Measure', 'Y', '%', '%', 'percent', 'pourcentage', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/numeric/notapplicable', NULL, '2012-03-29 15:05:38'),
	(198, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas', 'Horizon Master Code', 'Horizon principal', '<p>Identifies the master horizon, as per <a href="/cansis/taxa/cssc3/chpt02_a.html#soilhorizons">Chapter 2</a> of the <a href="/cansis/taxa/cssc3/index.html">Canadian System of Soil Classification, third edition</a>.</p>', '<p>Indique l\'horizon maître selon le <a href="/siscan/taxa/cssc3/chpt02_a.html#horizonsdusol">Chapitre 2</a> du <a href="/siscan/taxa/cssc3/index.html">Système Canadien de classification des Sols, 3ième éditions</a>.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas', NULL, '2012-03-29 15:45:49'),
	(199, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/kp0', 'Water Retention at 0 kP', 'Rétention d\'eau à 0 kP', '<p>Identifies water retention at 0 kP, in percent by total soil volume.</p>', '<p>Indique en pourcentage la rétention d\'eau à 0 kP  du volume total du sol.</p>', '', '', 'Measure', 'Y', '%', '%', 'percent', 'pourcentage', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/numeric/notapplicable', NULL, '2012-03-29 16:02:32'),
	(200, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/orgcarb', 'Organic Carbon', 'Carbone organique', '<p>Indicates the percentage of organic carbon, by weight.</p>', '<p>Indique le pourcentage de carbone organique, en poids.</p>', '', '', 'Measure', 'Y', '%', '%', 'percent', 'pourcentage', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/numeric/notapplicable', NULL, '2012-03-29 16:09:09'),
	(201, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/tsilt', 'Total Silt', 'Limon total', '<p>Indicates the percentage of total silt, by weight.</p>', '<p>Indique en pourcentage la pesanteur de la totalité de limon.</ p>', '', '', 'Measure', 'Y', '%', '%', 'percent', 'pourcentage', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/numeric/notapplicable', NULL, '2012-03-29 16:32:57'),
	(202, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/drainage', 'Soil Drainage Class', 'Classe de drainage du sol', '<p>Indicates the type of drainage found within a soil profile. First used in SLC 3.0. Identical classes to drainage in SLC 1.0, but codes differ.</p>', '<p>Ce champ indique le type de drainage que l\'on retrouve dans un profil de sol. Utilisé pour la première fois dans les PPC 3.0. Identique à la classe de drainage des PPC v1.0, mais les codes diffèrent.</p>', '', '', 'Ordinal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/drainage', NULL, '2012-03-30 13:23:09'),
	(203, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/g_group3', 'Soil Great Group (3rd edition)', 'Grand groupe de sols (troisième édition)', '<p>Identifies the soil great group according to the Canadian System of Soil Classification 3rd edition</p>', '<p>Indique le grand groupe des sols selon le Système canadien de classification des sols, troisième édition.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/g_group3', NULL, '2012-03-30 13:34:14'),
	(204, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/order3', 'Soil Order (3rd edition)', 'Ordre de sols (troisième édition)', '<p>Identifies the soil order according to the Canadian System of Soil Classification 3rd edition.</p>', '<p>Indique l\'ordre du sol selon le Système canadien de classification des sols, troisième édition.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/order3', NULL, '2012-03-30 13:57:13'),
	(205, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/pmtex1', 'Parent material texture - first (uppermost)', 'Texture de matériau originel - premier', '<p>The texture class of the underlying parent material. First used in SLC 3.0.</p>', '<p>Classe de texture du matériau parent sous-jacent, déterminée d\'après les classes figurant dans le triangle des textures. Utilisé pour la première fois dans les PPC 3.0.</p>', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/pmtex', NULL, '2012-03-30 14:00:28'),
	(206, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v1/smuf/date', 'Date', 'Date', '<p>Date of last revision for each record in the file. Format \'YY.MM.DD\'</p>', '<p>Date de la dernière révision apportée à chaque enregistrement dans le fichier.  Format \'YY.MM.DD\'</p>', 'n/a', 'n/a', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', '2012-02-29 18:26:29', '2012-03-01 20:46:44'),
	(207, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2/area/land', 'Area of land (applicable to the component table)', 'Superficie des terres (applicable à la table des composantes)', '<p>This is the total area of land in the soil polygon.</p>', '<p>Superficie totale des terres d\'un polygone.</ p>', '', '', 'Count', 'Y', 'ha', 'ha', 'hectares', 'hectares', 'n/a', NULL, '2012-03-26 18:10:55'),
	(208, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2/area/polygon', 'Total area of the polygon', 'Superficie du polygone entier', '<p>This is the total area, including land and fresh water, of the entire soil polygon.</p>', '<p>Superficie totale, y compris les terres et les eaux douces dans l\'ensemble d\'un polygone.</p>', '', '', 'Count', 'Y', 'ha', 'ha', 'hectares', 'hectares', 'n/a', NULL, '2012-03-26 18:12:53'),
	(209, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2/area/water', 'Area of Fresh Water', 'Zone d\'eau douce', '<p>This is the total area of fresh water in the soil polygon.</p>', '<p>Superficie totale des plans d\'eau douce dans l\'ensemble du polygone.</p>', '', '', 'Count', 'Y', 'ha', 'ha', 'hectares', 'hectares', 'n/a', NULL, '2012-03-26 18:14:43'),
	(210, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2/mapunit', 'Map Unit Identifier', 'Identificateur de polygone', '<p>Polygon identifier used to relate between the <a href=\r\n"/cansis/nsdb/dss/v2/pat/index.html">PAT</a> and the <a href="/cansis/nsdb/dss/v2/cmp/index.html">CMP</a> tables.<p>\r\n\r\n<p>The MAPUNIT field was generated for each polygon by appending\r\nthe PROVINCE and <a href="/cansis/nsdb/nsdb-ids.html">NSDB-ID</a>\r\ncodes with the map unit symbol that identifed that polygon on the original printed soil map.&nbsp; The MAPUNIT usually encodes meaningful information\r\nabout the soil type and topography; the same information which is\r\nfound in the <a href="/cansis/nsdb/dss/v2/cmp/index.html">CMP</a>\r\ntable.  Within any one survey, a group of polygons with\r\nsimilar properties may be coded with the same MAPUNIT.</p>', '<p>L\'identificateur de polygone est utilis&eacute; pour faire le lien entre les tables <a href="/siscan/nsdb/dss/v2/pat/index.html">PAT</a> et <a href="/siscan/nsdb/dss/v2/cmp/index.html">CMP</a>.</p>\r\n\r\n<p>Le champ MAPUNIT a &eacute;t&eacute; g&eacute;n&eacute;r&eacute; pour chaque polygone par l\'ajonction des codes PROVINCE et <a href="/siscan/nsdb/nsdb-ids.html">NSDB-ID</a> au symbole de l\'unit&eacute; de\r\ncartographie qui a identifi&eacute; ce polygone sur la carte p&eacute;dologique imprim&eacute;e d\'origine.  Le\r\nchamp MAPUNIT contient g&eacute;n&eacute;ralement de l\'information importante sur le type de sol et la topographie; soit la m&ecirc;me information qui se trouve dans la table <a href="/siscan/nsdb/dss/v2/cmp/index.html">CMP</a>. Dans n\'importe quel\r\nlev&eacute;, un groupe de polygones ayant des propri&eacute;t&eacute;s semblables peut &ecirc;tre cod&eacute; avec le m&ecirc;me\r\nMAPUNIT.</p>\r\n', '', '', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', NULL, '2012-03-26 18:19:24'),
	(211, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2/cmp/rockiness', 'Rockiness Class', 'Classe de roccosité', '<p>Occurrence of rock outcrops at the surface of the soil.</p>', '<p>Présence d\'affleurements rocheux à la surface du sol.</p>', '', '', 'Ordinal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2/cmp/rockiness', NULL, '2012-03-26 16:44:13'),
	(212, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/reliability', 'Reliability class of polygon', 'Classe de fiabilité du polygone', '<p>Reliability of generalized maps is required to provide an\r\nindication of the confidence that can be placed in derivative\r\ninterpretations and to assist in assigning priorities for future\r\nfield-mapping projects. Four levels of map reliability have been\r\nestablished in relation to inspection intensity and publication\r\nscale of source documents and whether aerial photographs are used\r\nduring field mapping.</p>\r\n\r\n<em>Notes</em>\r\n\r\n<ol>\r\n<li>Reliability infomation was found in the PAT as well as the DOM\r\nand SUBDOM files. The lowest of the three values for any given\r\npolygon was used for this version.</li>\r\n<li>For areas of the country where this field was left blank in\r\nversion 1.0, a value of "V" was assigned.</li>\r\n</ol>\r\n\r\n<em>Source</em>\r\n\r\n<p>This information was originally found in SLC verson 1.0. It was\r\ntranslated to version 2.2 using a polygon intersection approach.</p>', '<p>Il est nécessaire de connaître la fiabilité des cartes généralisées afin de savoir avec quel niveau de confiance on peut utiliser les interprétations qui en sont dérivées et afin d\'aider à établir des priorités pour des projets futurs de cartographie sur le terrain. Quatre niveaux de fiabilité des cartes ont été déterminés en fonction de l\'intensité des inspections et de l\'échelle de publication des documents de référence; de plus, on a tenu compte de l\'utilisation ou non de photographies aériennes au cours de l\'étape de cartographie sur le terrain.</p>\r\n\r\n<em>Notes</em>\r\n\r\n<ol>\r\n<li>L\'information sur la fiabilité se trouvait dans la table des attributs de polygone (PAT), de même que dans les fichiers DOM et SUBDOM. La plus faible des trois valeurs pour tout polygone donné a été utilisée pour cette version.</li>\r\n<li>Dans le cas des régions du pays pour lesquels ce champ avait été laissé en blanc dans la version 1.0, la valeur « V » a été attribuée.</li>\r\n</ol>\r\n\r\n<em>Source</em>\r\n<p>Cette information se trouvait à l\'origine dans la version 1.0 des PPC. Elle a été transposée dans la version 2.2 à partir d\'une méthode basée sur le recoupement de polygones.</p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/reliability', NULL, '2012-03-29 13:23:47'),
	(213, 'tbd', 'tbd', 'tbd', 'tbd', 'tbd', NULL, NULL, 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'tbd', NULL, NULL),
	(214, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/distr', 'Percentage of the polygon', 'Pourcentage du polygone', '<p>Percentage of the polygon with these characteristics.</p>\r\n\r\n<p>For areas of the country not mapped in version 1.0, a value of 0 was assigned.</p>\r\n\r\n<p>This information was originally found in SLC verson 1.0. It was translated to version 2.2 using a polygon intersection approach.</p>', '<p>Pourcentage du polygone avec les charactéristiques suivantes : </p>\r\n\r\n<p>Dans le cas des secteurs du pays non cartographiés dans la version 1.0, la valeur de 0 a été attribuée.</p>\r\n\r\n<p>Cette information se trouvait à l\'origine dans la version 1.0 des PPC. Elle a été transposée dans la version 2.2 à partir d\'une méthode basée sur le recoupement de polygones.</p>', 'n/a', 'n/a', 'Nominal', 'Y', '%', '%', 'percent', 'pourcentage', 'n/a', '2012-03-06 22:56:53', '2012-03-28 19:28:18'),
	(215, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/complexity', 'Complexity class of polygon', 'Classe de complexité du polygone', '<p>Complexity of soil landscape attribute classes is determined from information provided on source maps and the accompanying soil reports. The concept of complexity provides an indication of attribute variability within a polygon, particularly with respect to the classes of parent material deposition modes and soil development. Three levels of complexity have been established. They provide a warning of variability to anyone interpreting the information.</p>\r\n\r\n<em>Notes</em>\r\n\r\n<ol>\r\n<li>Complexity infomation was found in both the DOM and SUBDOM files for any given polygon. The highest of the two values was used for this version.</li>\r\n<li>For areas of the country not mapped in version 1.0, a value of "-" was assigned.</li>\r\n</ol>\r\n\r\n<em>Source</em>\r\n\r\n<p>This information was originally found in SLC verson 1.0. It was\r\ntranslated to version 2.2 using a polygon intersection approach.</p>', '<p>La complexité des classes d\'attributs de pédo-paysage est déterminée en fonction des renseignements que fournissent les cartes de référence et les rapports pédologiques connexes. Le degré de complexité reflète la variabilité des attributs dans un polygone donné, en particulier en ce qui concerne les classes de mode de déposition du matériau parental et de développement du sol. Trois niveaux de complexité ont été établis. Ils constituent pour quiconque interprète l\'information un indice de la variabilité.</p>\r\n\r\n<em>Notes</em>\r\n\r\n<ol>\r\n<li>L\'information sur la complexité se trouvait à la fois dans les fichiers DOM et SUBDOM pour tout polygone donné. La plus élevée des deux valeurs a été utilisée pour cette version. </li>\r\n<li>Pour les secteurs du pays non cartographiés dans la version 1.0, la valeur « - » a été attribuée.</li>\r\n</ol>\r\n\r\n<em>Source</em>\r\n<p>Cette information se trouvait &agrave; l\'origine dans la version\r\n1.0 des PPC. Elle a &eacute;t&eacute; transpos&eacute;e dans la\r\nversion 2.2 &agrave; partir d\'une m&eacute;thode bas&eacute;e sur\r\nle recoupement de polygones.</p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/complexity', NULL, '2012-03-28 19:24:00'),
	(216, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/regfm', 'Regional Landform', 'Forme de terrain régionale', '<p>General physical description.</p>\r\n\r\n<p>For areas of the country not mapped in version 1.0, a value of \'-\' was assigned.</p>\r\n\r\n<p>This information was originally found in SLC verson 1.0. It was translated to version 2.2 using a polygon intersection approach.</p>', '<p>Description physique générale</p>\r\n\r\n<p>Dans le cas des secteurs du pays non cartographiés dans la version 1.0, la valeur de « - » a été attribuée.</p>\r\n\r\n<p>Cette information se trouvait à l\'origine dans la version 1.0 des PPC. Elle a été transposée dans la version 2.2 à partir d\'une méthode basée sur le recoupement de polygones.</p>', 'n/a', 'n/a', 'Nominal', 'Y', 'n/a', 'n/a', '', '', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/regfm', '2012-03-06 22:56:53', '2012-03-07 15:31:12'),
	(217, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/cmplr', 'Kind of compacted, consolidated, or contrasting layer', 'Nature de la couche tassée, consolidée ou contrastante', '<p>This information was originally found in SLC verson 1.0. It was translated to version 2.2 using a polygon intersection approach.</p>', '<p>Cette information se trouvait à l\'origine dans la version 1.0 des PPC. Elle a été traduite à la version 2.2 en utilisant une méthode d\'intersection des polygones.</p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', '', '', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/cmplr', '2012-03-07 15:58:20', '2012-03-28 19:22:18'),
	(218, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/cmpdp', 'Depth to compacted, consolidated, or contrasting layer', 'Profondeur de la couche tassée, consolidée ou contrastante', '<p>Depth to compacted, consolidated, or contrasting layer.</p>\r\n\r\n<p>This information was originally found in SLC verson 1.0. It was translated to version 2.2 using a polygon intersection approach.</p>', '<p>Profondeur de la couche tassée, consolidée ou contrastante.</p>\r\n\r\n<p>Cette information se trouvait à l\'origine dans la version 1.0 des PPC. Elle a été traduite à la version 2.2 en utilisant une méthode d\'intersection des polygones.</p>', '', '', 'Ordinal', 'Y', 'n/a', 'n/a', '', '', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/cmpdp', '2012-03-07 18:54:50', '2012-03-28 19:21:21'),
	(219, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/avwat', 'Available water capacity in upper 120 cm', 'Capacité de rétention d\'eau dans les 120 premiers cm', '<p>That portion of water in a soil that can be readily absorbed by plant roots; most workers consider it to be the water held in the soil between field capacity and a pressure of up to about 15 bars.</p>', '<p>Portion d\'eau dans un sol qui peut être facilement absorbée par les racines des végétaux; selon la plupart des chercheurs, il s\'agit de l\'eau que contient un sol entre la capacité au champ et une pression atteignant environ 15 barres.</p>', '', '', 'Ordinal', 'Y', 'n/a', 'n/a', '', '', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/avwat', '2012-03-07 19:48:09', '2012-03-07 20:07:25'),
	(220, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/watab', 'Average depth to water table', 'Profondeur moyenne de la nappe d\'eau', '<p>This information was originally found in SLC version 1.0. It was translated to version 2.2 using a polygon intersection approach.</p>', '<p>Cette information se trouvait à l\'origine dans la version 1.0 des PPC. Elle a été transposée dans la version 2.2 à partir d\'une méthode basée sur le recoupement de polygones.</p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', '', '', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/watab', '2012-03-07 20:09:38', '2012-03-29 13:25:57'),
	(221, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/phcal', 'pH of upper 15 cm of soil measured in CaCl2', 'pH des 15 premiers cm de sol mesuré dans le CaCl2', '<p>For areas of the country not mapped in version 1.0, a value of "-8.0" was assigned.</p>', '<p>Pour les secteurs du pays non cartographiés dans la version 1.0, la valeur « 8,0 » a été attribuée.</p>', '', '', 'Ordinal', 'Y', 'pH', 'pH', 'pH', 'pH', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/numeric/notapplicable8', '2012-03-07 20:32:11', '2012-03-28 19:32:37'),
	(222, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/cmp/slope_len', 'Slope Length', 'Longueur de la pente', '<p>Average slope length from crest to depression.</p>', '<p>Longueur de la pente moyenne de la crête à la dépression.</p>', '', '', 'Measure', 'Y', 'm', 'm', 'meters', 'mètres', 'n/a', NULL, '2013-01-17 20:05:00'),
	(223, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/phwat', 'pH of upper 15 cm of soil measured in water', 'pH des 15 premiers cm de sol, mesuré dans l\'eau', '<p>pH of upper 15 cm of soil measured in water</p>', '<p>pH des 15 premiers cm de sol, mesuré dans l\'eau</p>', '', '', 'Nominal', 'Y', 'pH', 'pH', 'pH', 'pH', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/numeric/notapplicable8', '2013-05-06 19:29:24', '2013-05-06 19:44:30'),
	(224, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/nitro', 'Nitrogen content', 'Teneur en azote', '<p>Nitrogen content of upper 15 cm of soil</p>\r\n\r\n<p>For areas of the country not mapped in version 1.0, a value of "-" was assigned. </p>', '<p>Teneur en azote des 15 premiers cm de sol</p>\r\n\r\n<p>Pour les secteurs du pays non cartographiés dans la version 1.0, la valeur « - » a été attribuée. </p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', '', '', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/nitro', '2013-05-06 19:54:54', '2013-05-06 20:08:51'),
	(225, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/watbd', 'Water bodies', 'Plans d\'eau', '<p>Water bodies estimated from LANDSAT imagery, which are wholly contained within the polygon, in percentage coverage of entire polygon.</p>\r\n\r\n<ul>\r\n<li>Lakes and water bodies whose shorelines form polygon boundaries\r\nare not included.</li>\r\n<li>For areas of the country not mapped in version 1.0, a value of\r\n"-" was assigned.</li>\r\n</ul>', '<p>Plans d\'eau évalués à partir d\'images LANDSAT, entièrement contenus dans le polygone (superficie en pourcentage du polygone). </p>\r\n\r\n<ul>\r\n<li>Les lacs et les plans d\'eau dont les rivages forment des\r\nlimites de polygone ne sont pas inclus.</li>\r\n<li>Pour les secteurs du pays non cartographi&eacute;s dans la\r\nversion 1.0, la valeur &laquo; - &raquo; a &eacute;t&eacute;\r\nattribu&eacute;e.</li>\r\n</ul>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', '', '', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/watbd', '2013-05-06 21:04:17', '2013-05-06 21:05:06'),
	(226, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/soilname', 'soil name code', 'Code de nom de sol', '<p>Provision has been made for a maximum of two soil name codes each for the dominant and subdominant soils. Soil name 1 is considered to be most representative of each soil landscape. Soil name 2 may be used to signify a codominant combination of two soils or an important, closely associated soil in the landscape. Caution is recommended when using soil name 2 in area calculations particularly for subdominant landscapes.</p>\r\n\r\n<p>Soil name codes (and modifiers when present) are included in this detailed legend to provide a link to the national CanSIS soil names and soil layer files. Data in the soil layer file is required for agricultural and nonagricultural use interpretations, simulation modelling, and general land evaluation studies.</p>', '<p>On a prévu au maximum deux codes de nom de sol pour chacun des sols dominant ou sous-dominant. Le nom de sol 1 est considéré comme étant le plus représentatif de chaque pédo-paysage. Le nom de sol 2 peut être utilisé pour indiquer que deux sols sont codominants ou pour désigner un sol important, étroitement associé au paysage. Il est recommandé d\'utiliser avec prudence le nom de sol 2 pour les calculs de superficie, notamment dans le cas des paysages sous-dominants.</p>\r\n\r\n<p>Les codes de nom de sol (et les modificateurs, le cas échéant) sont inclus dans la légende détaillée pour permettre aux utilisateurs d\'établir un lien avec les fichiers sur les couches de sol et les noms de sol utilisés dans le système national SISCan. Les données dans le fichier sur les couches de sol sont nécessaires aux interprétations de l\'utilisation agricole et non agricole, pour les modèles de simulation et les études générales d\'évaluation des terres.</p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', '', '', 'n/a', '2013-05-06 21:17:56', '2013-05-06 21:24:31'),
	(227, 'http://sis.agr.gc.ca/cansis/nsdb/province2011', 'Province Code', 'Code province', '<p>A two-character province code used as part of a link to the CanSIS NAMES and LAYERS tables.</p> ', '<p>Code de province à deux caractères utilisé pour associer les tables NAMES et LAYERS de SISCan.</p>', 'n/a', 'n/a', 'Nominal', 'n/a', 'n/a', 'n/a', 'n/a', 'n/a', 'http://sis.agr.gc.ca/cansis/nsdb/province2011', NULL, '2012-03-28 18:27:52'),
	(228, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/prt/mapumod', 'Soil variation (SK)', '', '<p>Three character code used when soil mapping to show soil variations. MAPUMOD refers to the associated Soil Association(s) in field MAPUNIT_SK.</p>', '<p></p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', '', '', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/prt/mapumod', '2013-10-08 19:42:33', '2013-10-08 19:45:50'),
	(229, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/prt/slope_rg', 'Slope class (SK)', '', '<p>Slope class or a range of two slope classes for a soil polygon.</p>', '<p></p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', '', '', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/prt/slope_rg/sk', '2013-10-09 15:00:39', '2013-10-11 13:12:57'),
	(230, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/prt/surfex', 'Surface Expression (SK)', '', '<p>Code used to indicate the surface expression of the landscape. A single character erosional modifier code (c, d , g) may be used with mineral soils where applicable. Two or three codes may be used to describe complex landscapes.</p>', '<p></p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', '', '', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/prt/surfex/sk', '2013-10-09 15:00:59', '2013-10-11 13:11:56'),
	(231, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/prt/slpl', 'Slope length (SK)', '', '<p>The dominant slope length occurring within the polygon measured from the crest to the base of the slope. More than one slope length may be expressed for complex landscapes.</p>', '<p></p>', '', '', 'Ordinal', 'Y', 'n/a', 'n/a', '', '', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/prt/slpl/sk', '2013-10-09 15:01:15', '2013-10-11 12:57:54'),
	(232, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/prt/salsym', 'Soil salinity rating (SK)', '', '<p>Soil salinity rating for entire soil polygon. A salinity rating that consists of a single numeric character indicates that it is a derived rating (not field mapped) and shows extent only; salinity degree for such ratings is considered moderate (4 - 8 dS/m).</p>', '<p></p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', '', '', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/prt/salsym/sk', '2013-10-09 15:01:33', '2013-10-09 15:01:33'),
	(233, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/prt/wind', 'Wind erosion rating (SK)', '', '<p>Wind erosion susceptibility class for soil, for entire soil polygon. Assumption is bare soil.</p>', '<p></p>', '', '', 'Ordinal', 'Y', 'n/a', 'n/a', '', '', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/prt/wind/sk', '2013-10-09 15:01:49', '2013-10-09 15:01:49'),
	(234, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/prt/water', 'Water erosion rating (SK)', '', '<p>Water erosion susceptibility class for soil landscape, for entire soil polygon. If polygon was observed to be dissected (D) (dissections being shallow water runs that can be crossed with farm implements) or gullied (G) (gullies being deep ravines that cannot be crossed with implements), a D or G symbol was added to the specific erosion class symbol to indicate that higher rates of erosion may occur in these landscapes.</p>', '<p></p>', '', '', 'Ordinal', 'Y', 'n/a', 'n/a', '', '', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/prt/water/sk', '2013-10-09 15:01:57', '2013-10-09 15:01:57'),
	(235, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/prt/irrig', 'Irrigation suitability rating (SK)', '', '<p>Initial Irrigation suitability rating for a soil landscape, for entire soil polygon.  Undocumented field.</p>', '<p></p>', '', '', 'Ordinal', 'Y', 'n/a', 'n/a', '', '', 'n/a', '2013-10-09 15:02:08', '2013-10-09 15:02:08'),
	(236, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/prt/nonsoil', 'Name of nonsoil feature (SK)', '', '<p>Names of lakes and rivers, urban centers, man-made features (e.g. mine spoils).</p>', '<p></p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', '', '', 'n/a', '2013-10-09 15:02:22', '2013-10-09 15:02:22'),
	(237, 'httphttp://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/ecozone/ecozone', '', '', '<p></p>', '<p></p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', '', '', 'tbd', '2014-04-11 18:06:43', '2014-04-11 18:06:43'),
	(238, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/ecozone/zone_name', '', '', '<p></p>', '<p></p>', '', '', 'Nominal', 'Y', 'n/a', 'n/a', '', '', 'tbd', '2014-04-11 18:15:51', '2014-04-11 18:15:51');
