	(140, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/prt/wind/sk', 'none', '', '', '', '', 1, '2013-10-10 19:32:50', '2013-10-10 19:32:50'),
	(141, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/prt/water/sk', 'column1', 'water erosion risk', '', '', '', 1, '2013-10-10 19:32:50', '2013-10-10 19:32:50'),
