INSERT INTO `data8values` (`id`, `classesuri`, `attribute_name`, `valuegroup`, `identifier`, `nullvalue`, `color`, `title_en`, `title_fr`, `abstract_en`, `abstract_fr`, `documentation_en`, `documentation_fr`, `rank`, `created_at`, `updated_at`, `updated_by`) VALUES
	(1, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'G', 'false', 'ffaaaa', 'Brown Solonetzic', 'Solonetz Brun', '<p>May be dominantly Brown Solonetzic, Brown Solodized Solonetzic, or Brown Solod subgroups with inclusions of these subgroups (e.g. dominantly Brown Solodized Solonetzic with inclusions of Brown Solod).</p>', '<p>Les sous-groupes solonetz brun, solonetz solodisé brun ou solod brun peuvent être dominants et comporter des inclusions de ces sous-groupes, c\'est-à-dire, dominance de solonetz solodisé brun avec inclusions de solod brun.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 7, NULL, '2014-01-06 19:31:09', NULL),
	(2, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'H', 'false', 'ff5656', 'Dark Brown Solonetzic', 'Solonetz Brun Foncé', '<p>May be dominantly Dark Brown Solonetzic, Dark Brown Solodized Solonetzic, or Dark Brown Solod subgroups with inclusions of these subgroups.</p>', '<p>Les sous-groupes solonetz brun foncé ou solonetz solodisé brun foncé ou solod brun foncé peuvent être dominants et comporter des inclusions de ces sous-groupes.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 8, NULL, '2014-01-06 19:31:23', NULL),
	(3, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'I', 'false', 'bf5f00', 'Brunisolic Gray Luvisolic', 'Luvisol Gris Brunisolique ', '<p>Dominantly Brunisolic Gray Luvisolic subgroup with inclusions of its gleyed subgroup.</p>', '<p>Le sous-groupe luvisol gris brunisolique est dominant; inclusions de ses sous-groupes gleyifiés.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 9, NULL, '2014-01-06 19:32:17', NULL),
	(4, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'J', 'false', 'ff0000', 'Black Solonetzic', 'Solonetz Noir', '<p>May be dominantly Black Solonetzic, Black Solodized Solonetzic, or Black Solod subgroups with inclusions of these subgroups and their gleyed subgroups.</p>', '<p>Les sous-groupes solonetz noir ou solonetz solodisé noir ou solod noir peuvent être dominants et comporter des inclusions de ces sous-groupes ainsi que les variantes gleyifiées.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 10, NULL, '2014-01-06 19:32:30', NULL),
	(5, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'K', 'false', 'bf0000', 'Gray Solonetzic', 'Solonetz Gris', '<p>Dominantly Gray Solodized Solonetzic or Gray Solod subgroups with inclusions of their gleyed subgroups.</p>', '<p>Les sous-groupes solonetz solodisé gris ou solod gris sont dominants; inclusions de leurs sous-groupes gleyifiés.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 11, NULL, '2014-01-06 19:36:50', NULL),
	(6, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'L', 'false', '003f7f', 'Melanic Brunisolic', 'Brunisol Mélanique', '<p>Dominantly Melanic Brunisolic great group.</p>', '<p>Le grand groupe brunisol mélanique est dominant.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 12, NULL, '2014-01-06 19:33:04', NULL),
	(7, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'M', 'false', '56aaff', 'Eutric Brunisolic', 'Brunisol Eutrique', '<p>Dominantly Eutric Brunisolic great group.</p>', '<p>Le grand groupe brunisol eutrique est dominant.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 13, NULL, '2014-01-06 19:33:28', NULL),
	(8, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'N', 'false', 'aad4ff', 'Sombric Brunisolic', 'Brunisol Sombrique', '<p>Dominantly Sombric Brunisolic great group.</p>', '<p>Le grand groupe brunisol sombrique est dominant.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 14, NULL, '2014-01-06 19:33:46', NULL),
	(9, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'O', 'false', '7f007f', 'Organic Cryosolic', 'Cryosol Organique', '<p>Dominantly Organic Cryosolic great group.</p>', '<p>Le grand groupe cryosol organique est dominant.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 15, NULL, '2014-01-06 19:48:52', NULL),
	(10, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'P', 'false', '007fff', 'Dystric Brunisolic ', 'Brunisol Dystrique', '<p>Dominantly Dystric Brunisolic great group.</p>', '<p>Le grand groupe brunisol dystrique est dominant.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 16, NULL, '2014-01-06 19:34:23', NULL),
	(11, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'Q', 'false', '007f00', 'Humic Podzolic', 'Podzol Humique', '<p>Dominantly Humic Podzolic great group.</p>', '<p>Le grand groupe podzol humique est dominant.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 17, NULL, '2014-01-06 19:34:48', NULL),
	(12, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'R', 'false', '7f003f', 'Regosolic', 'Régosolique', '<p>Dominantly Regosolic order.</p>', '<p>L\'ordre régosolique est dominant.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 18, NULL, '2014-01-06 19:35:05', NULL),
	(13, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'S', 'false', 'ff007f', 'Static Cryosolic ', 'Cryosol Statique', '<p>Dominantly Static Cryosolic great group.</p>', '<p>Le grand groupe cryosol statique est dominant.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 19, NULL, '2014-01-06 19:46:34', NULL),
	(14, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'T', 'false', '7f00ff', 'Turbic Cryosolic', 'Cryosol Turbique', '<p>Dominantly Turbic Cryosolic great group.</p>', '<p>Le grand groupe cryosol turbique est dominant.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 20, NULL, '2014-01-06 19:35:46', NULL),
	(15, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'U', 'false', '00bfbf', 'Gleysolic', 'Gleysolique', '<p>Dominantly Gleysolic order.</p>', '<p>L\'ordre gleysolique est dominant.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 21, NULL, '2014-01-06 19:36:07', NULL),
	(16, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'V', 'false', '56ff56', 'Ferro-Humic Podzolic', 'Podzol Ferro-Humique', '<p>Dominantly Ferro-humic Podzolic great group.</p>', '<p>Le grand groupe podzol ferro-humique est dominant.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 22, NULL, '2014-01-06 19:36:28', NULL),
	(17, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'W', 'false', '00bf00', 'Humo-Ferric Podzolic', 'Podzol Humo-Ferrique', '<p>Dominantly Humo-Ferric Podzolic great group.</p>', '<p>Le grand groupe podzol humo-ferrique est dominant.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 23, NULL, '2014-01-06 19:40:07', NULL),
	(18, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'X', 'false', 'ffaaff', 'Fibrisol', 'Fibrisol', '<p>Dominantly Fibrisol great group.</p>', '<p>Le grand groupe fibrisol est dominant.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 24, NULL, '2014-01-06 19:51:56', NULL),
	(19, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'Y', 'false', 'ff56ff', 'Mesisol', 'Mésisol', '<p>Dominantly Mesisol great group.</p>', '<p>Le grand groupe mésisol est dominant.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 25, NULL, '2014-01-06 19:40:38', NULL),
	(20, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget', 'veget', 'none', 'H', 'false', 'aad4ff', 'Arctic desert', 'Désert arctique', '<p>Unvegetated areas in the High Arctic; may be caused by either climatic (too cold or too dry) or edaphic (low soil nutrients or toxic substrates such as salt) factors, or a combination of both.</p>', '<p>Zones sans végétation du désert polaire du Haut-Arctique; peut être causé par des facteurs climatiques (trop froid ou trop sec) ou édaphiques (faible teneur en éléments nutritifs ou substratum toxique), ou par les deux à la fois.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/veget.html', 7, NULL, '2014-01-06 20:30:46', NULL),
	(21, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget', 'veget', 'none', 'L', 'false', 'ffaaaa', 'Lichen', 'Lichen', '<p>Dominated by lichens with significant amounts of mosses and usually including low to medium ericaceous shrubs.</p>', '<p>Dominé par les lichens avec des quantités importantes de mousses et incluant habituellement des buissons peu ou moyennement éricacés.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/veget.html', 8, NULL, '2014-01-06 20:30:23', NULL),
	(22, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget', 'veget', 'none', 'M', 'false', '00ff00', 'Mixed forest', 'Forêt mixte', '<p>Composed of both coniferous and deciduous tree species (refer to codes C and D).</p>', '<p>Former de conifères et de feuillus (voir codes C et D).</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/veget.html', 9, NULL, '2014-01-06 20:27:21', NULL),
	(23, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget', 'veget', 'none', 'P', 'false', 'bfbf00', 'Parkland', 'Prairie-parc', '<p>A forest - grassland transition consisting of a mosaic of trembling aspen stands interspersed with patches of cropland, grassland, and meadow.</p>', '<p>Transition forêt-prairie composée d\'une mosaique de tremblaies associées à des cultures, des prairies et des prairies herbeuses.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/veget.html', 10, NULL, '2014-01-06 20:31:42', NULL),
	(24, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget', 'veget', 'none', 'R', 'false', 'bf5f00', 'Marshland', 'Terres marécageuses', '<p>A mosaic surface pattern composed of pools or channels interspersed with clumps of emergent sedges, grasses, rushes, and reeds, and bordered by grassy meadows and peripheral bands of shrubs or trees; submerged and floating aquatics flourish in open water areas.</p>', '<p>Configuration superficielle en mosaique composée de cuvettes ou de chenaux intercalés à des touffes émergées de cypéracées, de graminées, de joncs et de roseaux, bordant des prairies herbeuses et des bandes périphériques d\'arbustes ou d\'arbres; les plantes aquatiques submergées et flottantes sont abondantes dans les zones d\'eau libre.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/veget.html', 11, NULL, '2014-01-06 20:32:06', NULL),
	(25, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget', 'veget', 'none', 'S', 'false', 'bf0000', 'Shrubland', 'Arbustaies', '<p>Dominated by shrub species.</p>', '<p>Dominées par des espèces arbustives.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/veget.html', 12, NULL, '2014-01-06 20:33:20', NULL),
	(26, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget', 'veget', 'none', 'SP', 'false', 'd4ffaa', 'Sedge peat', 'Tourbe de carex', '<p>Dominated by Carex spp. and generally moderately decomposed and matted; the sedge leaves are readily identifiable to the naked eye.</p>', '<p>Dominée par le Carex spp. et d\'ordinaire à décomposition et développement du tapis végétal moyens; les feuilles de carex sont facilement identifiables à l\'oeil nu.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/veget.html', 13, NULL, '2014-01-06 20:33:40', NULL),
	(27, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget', 'veget', 'none', 'TA', 'false', '3f007f', 'Tundra, alpine', 'Toundra alpine', '<p>Treeless terrain occurring at high altitudes, immediately above the forest zone and the upper altitudinal timberline; vegetation consists of lichens, mosses, sedges, grasses, forbs, and low shrubs (&lt;20 cm) such as heath, dwarf willows, and birches.</p>', '<p>Terrain sans arbre qui se trouve en hautes altitudes immédiatement au-dessus de la zone forestière et de la limite forestière altitudinale; la végétation de toundra comprend les lichens, les mousses, les cypéracées, les graminées, les plantes herbacées dicotylédones et les arbustes bas (20 cm ou moins) y compris les éricacées, les saules nains et les bouleaux.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/veget.html', 14, NULL, '2014-01-06 20:29:19', NULL),
	(28, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget', 'veget', 'none', 'TH', 'false', '7f00ff', 'Tundra, high shrub', 'Toundra d\'arbustes hauts ', '<p>Dominated by 20-60 cm high shrubs occurring in the Low Arctic Ecoclimatic Region.</p>', '<p>Dominé par des arbustes de 20 à 60 cm de haut qui poussent dans la région basse écoclimatique de l\'Arctique.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/veget.html', 15, NULL, '2014-01-06 20:28:56', NULL),
	(29, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget', 'veget', 'none', 'TM', 'false', '5656ff', 'Tundra, medium shrub ', 'Toundra d\'arbustes moyens', '<p>Dominated by 10 - 20 cm high shrubs occurring in the Mid-Arctic Ecoclimatic Region.</p>', '<p>Semblable à la toundra à arbuste bas (voir code TL), sauf que les arbustes y sont de taille moyenne (>20 cm).</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/veget.html', 16, NULL, '2014-01-06 20:28:43', NULL),
	(30, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget', 'veget', 'none', 'TL', 'false', '56ffff', 'Tundra, low shrub', 'Toundra d\'arbustes bas', '<p>Ground without tree found at high latitudes and especially in the area immediately north of the boreal forest, including parts of the ecozone treeless forest - tundra adjacent to the treeline, tundra vegetation consists of lichens, mosses, sedges, grasses, forbs and low shrubs (20 cm or less) including heath, dwarf willows and birches.</p>\r\n', '<p>Terrain sans arbre qui se trouve en haute latitude et surtout dans la zone immédiatement au nord de la forêt boréale, y compris les parties sans arbres de l\'écozone forêt--toundra adjacent à la limite forestière; la végétation de toundra comprend les lichens, les mousses, les cypéracées, les graminées, les plantes herbacées dicotylédones et les arbustes bas (20 cm ou moins) y compris les éricacées, les saules nains et les bouleaux.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/veget.html', 17, NULL, '2014-01-06 20:28:29', NULL),
	(31, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'Z', 'false', 'ff00ff', 'Humisol', 'Humisol', '<p>Dominantly Humisol great group.</p>', '<p>Le grand groupe humisol est dominant.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 26, NULL, '2014-01-06 19:40:50', NULL),
	(32, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', '2', 'false', 'bf00bf', 'Folisol', 'Folisol', '<p>Dominantly Folisol great group.</p>', '<p>Le grand groupe folisol est dominant.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 27, NULL, '2014-01-06 19:41:06', NULL),
	(33, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', '3', 'false', '7f3f00', 'Podzolic Gray Luvisolic', 'Luvisol Gris-Podzolique', '<p>Podzolic Gray Luvisolic subgroup (only occurs as subdominant soil).</p>', '<p>Le sous-groupe luvisol gris podzolique est toujours un sol sous-dominant.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 28, NULL, '2014-01-06 19:42:19', NULL),
