	(43, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget', 'veget', 'none', 'A', 'false', 'ffffaa', 'Agricultural crops', 'Cultures', '<p>Cultivated field crops.</p>', '<p>Grandes cultures annuelles.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/veget.html', 1, NULL, '2014-01-06 20:25:31', NULL),
	(44, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget', 'veget', 'none', 'B', 'false', 'ffaa56', 'Bog', 'Bog', '<p>Bogs may be treed or treeless and are usually covered with Sphagnum spp. and ericaceous shrubs.</p>', '<p>Des arbres peuvent pousser ou non sur les bogs qui sont généralement recouverts de Sphagnum spp. et de plantes éricacées buissonneuses.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/veget.html', 2, NULL, '2014-01-06 20:34:41', NULL),
	(45, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget', 'veget', 'none', 'C', 'false', '007f00', 'Coniferous forest', 'Forêt de conifères', '<p>Dominated by needle-leaved, cone-bearing species. In the Subarctic Ecoclimatic Regions this refers to an open lichen coniferous forest; in the Boreal Ecoclimatic Regions this refers to a closed canopy coniferous forest.</p>', '<p>Dominée par des espèces à aiguilles et à cône. Dans les régions à régime écoclimatique subarctique, ceci fait référence à une forêt de conifères ouverte à lichen; dans les régions à régimes écoclimatiques boréales ceci fait référence à une forêt de conifères à couvert fermé.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/veget.html', 3, NULL, '2014-01-06 20:26:20', NULL),
	(46, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget', 'veget', 'none', 'D', 'false', '7f3f00', 'Deciduous forest', 'Forêt de feuillus', '<p>Dominated by broadleaf species.</p>', '<p>Dominée par des espèces latifoliées (à grandes feuilles).</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/veget.html', 4, NULL, '2014-01-06 20:27:00', NULL),
	(47, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget', 'veget', 'none', 'F', 'false', 'ffd4aa', 'Fen', 'Fen', '<p>Dominated by sedges, grasses, reeds, and brown mosses with some shrubs and, at times, a sparse tree layer.</p>', '<p>Dominé par des cypéracées, des graminées, des roseaux et des mousses brunes avec quelques arbustes et, parfois, une couverture éparse d\'arbres.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/veget.html', 5, NULL, '2014-01-06 20:31:02', NULL),
	(48, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget', 'veget', 'none', 'G', 'false', 'ffffaa', 'Grassland', 'Prairie ', '<p>Perennial native grassland or improved pasture.</p>', '<p>Prairie autochtone pérenne ou pâturage bonifié.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/veget.html', 6, NULL, '2014-01-06 20:25:53', NULL),
