	(71, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/kindmat', 'kindmat', 'none', 'UR', 'false', '7f7f7f', 'Urban', 'Zone urbaine', '<p>Urban areas. Note that only a few major urban area polygons are included on maps, therefore, do not use for tabulating total urban coverage.</p>', '<p>Zones urbaines. Note : seuls quelques-uns des principaux polygones de zones urbaines sont illustrés sur les cartes; ne pas utiliser pour la tabulation des zones urbaines.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/kindmat.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/kindmat.html', 8, NULL, '2012-07-17 16:49:09', NULL),
	(72, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/kindmat', 'kindmat', 'none', 'F', 'false', 'aa56ff', 'Rock field', 'Champ pierreux', '<p>Frost-heaved bedrock, rock slides and talus material.</p>', '<p>Soubassement soulevé par le gel, glissements de rochers et matériau de talus.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/kindmat.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/kindmat.html', 7, NULL, '2012-07-17 16:49:23', NULL),
	(73, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/component/rootdp', 'rootdp', 'none', 'A', 'false', 'dddd44', '< 20 cm', '< 20 cm', '<p>Rooting depth < 20 cm.</p>', '<p>Profondeur des racines <20 cm.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/component/rootdp.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/component/rootdp.html', 1, NULL, '2012-11-27 18:12:19', NULL),
	(74, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/component/rootdp', 'rootdp', 'none', 'B', 'false', 'ffaa56', '20 - 75 cm', '20 - 75 cm', '<p>Rooting depth at 20 - 75 cm.</p>', '<p>Profondeur des racines à 20 - 75 cm.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/component/rootdp.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/component/rootdp.html', 2, NULL, '2012-11-27 18:12:43', NULL),
	(75, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/component/rootdp', 'rootdp', 'none', 'C', 'false', 'ba6a25', '> 75-150 cm', '> 75-150 cm', '<p>Rooting depth at > 75-150 cm.</p>', '<p>Profondeur des racines à > 75-150 cm.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/component/rootdp.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/component/rootdp.html', 3, NULL, '2012-11-27 18:14:31', NULL),
	(76, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/component/rootdp', 'rootdp', 'none', 'D', 'false', '8c521c', '> 150 cm', '> 150 cm', '<p>Rooting depth of >150 cm.</p>', '<p>Profondeur des racines à > 150 cm.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/component/rootdp.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/component/rootdp.html', 4, NULL, '2012-11-27 18:14:53', NULL),
	(77, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/component/rootdp', 'rootdp', 'none', '#', 'true', 'cccccc', 'Not applicable', 'Ne s\'applique pas', '<p>Non-applicable (e.g. rock, ice).</p>', '<p>Ne s\'applique pas (roche, glace).</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/component/rootdp.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/component/rootdp.html', 5, NULL, '2012-11-27 18:13:58', NULL),
	(78, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/calc', 'calc', 'none', '0', 'false', 'a6ddc8', 'Noncalcareous', 'Non calcaire', '<p>No CaCO3 detectable with dilute HCl.</p>', '<p>Aucun CaCO3 détectable avec du HCl dilué.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/calc.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/calc.html', 1, NULL, '2012-07-17 16:16:44', NULL),
	(79, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/calc', 'calc', 'none', '1', 'false', '7cb7a0', 'Weakly', 'Faiblement calcaire', '<p>1-5% CaCO3 equivalents (weak effervescence with dilute HCl).</p>', '<p>1-5 % en équivalents de CaCO3 (faible effervescence avec HCl dilué).</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/calc.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/calc.html', 2, NULL, '2012-07-17 16:17:19', NULL),
	(80, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/calc', 'calc', 'none', '2', 'false', '668e7f', 'Strongly ', 'Fortement calcaire', '<p>6-40% CaCO3 equivalents (moderate to strong effervescence with dilute HCl).</p>', '<p>6-40 % en équivalents de CaCO3 (effervescence moyenne à marquée avec HCl dilué).</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/calc.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/calc.html', 3, NULL, '2012-07-17 16:18:15', NULL),
	(81, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/calc', 'calc', 'none', '3', 'false', '49685c', 'Extremely ', 'Extrêmement calcaire', '<p>>40% CaCO3 equivalents (very strong effervescence with dilute HCl).</p>', '<p>>40 % en équivalents de CaCO3 (effervescence très forte avec HCl dilué).</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/calc.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/calc.html', 4, NULL, '2012-07-17 16:17:48', NULL),
	(82, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/calc', 'calc', 'none', '#', 'true', 'cccccc', 'Not applicable', 'Ne s\'applique pas', '<p>Not applicable (water, rock, ice).</p>', '<p>Ne s\'applique pas (eau, roche, glace).</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/calc.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/calc.html', 5, NULL, '2012-07-17 15:28:33', NULL),
	(83, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'A', 'false', 'ffffaa', 'Brown Chernozemic', 'Brun Chernozémique', '<p>Dominantly Orthic Brown subgroup with inclusions of other subgroups within the Brown great group.</p>', '<p>Le sous-groupe brun orthique est dominant; inclusions d\'autres sous-groupes du grand groupe brun.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 1, NULL, '2014-01-06 19:29:37', NULL),
	(84, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'B', 'false', 'ffff00', 'Dark Brown Chernozemic ', 'Brun Foncé Chernozémique', '<p>Dominantly Orthic Dark Brown subgroup with inclusions of other subgroups within the Dark Brown great group.</p>', '<p>Le sous-groupe brun foncé orthique est dominant; inclusions d\'autres sous-groupes du grand groupe brun foncé.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 2, NULL, '2014-01-06 19:29:59', NULL),
	(85, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'C', 'false', 'bfbf00', 'Black Chernozemic', 'Noir Chernozémique', '<p>Dominantly Orthic Black subgroup with inclusions of other subgroups within the Black great group.</p>', '<p>Le sous-groupe noir orthique est dominant; inclusions d\'autres sous-groupes du grand groupe noir.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 3, NULL, '2014-01-06 19:30:16', NULL),
	(86, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'D', 'false', '7f7f00', 'Dark Gray Chernozemic or Dark Gray Luvisolic', 'Gris Foncé Chernozémique', '<p>Dominantly Orthic Dark Gray Chernozemic subgroup or Dark Gray Luvisolic subgroup with inclusions of other subgroups within the Dark Gray great group or of the gleyed Dark Gray Luvisolic subgroup.</p>', '<p>Le sous-groupe gris foncé orthique ou luvisol gris foncé chernozémique ou le sous-groupe luvisol gris foncé est dominant; inclusions d\'autres sous-groupes du grand groupe gris foncé ou du sous-groupe luvisol gris foncé gleyifié.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 4, NULL, '2014-01-06 19:30:27', NULL),
	(87, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'E', 'false', 'ffaa56', 'Gray Brown Luvisolic', 'Luvisol Brun Gris', '<p>Dominantly Orthic Gray Brown Luvisolic subgroup group with inclusions of other subgroups within the Gray Brown Luvisolic great group.</p>', '<p>Le sous-groupe luvisol gris orthique est dominant; inclusions d\'autres sous-groupes du grand groupe luvisol brun gris.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 5, NULL, '2014-01-06 19:30:41', NULL),
	(88, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel', 'devel', 'none', 'F', 'false', 'ff7f00', 'Gray Luvisolic', 'Luvisol Gris', '<p>Dominantly Orthic Gray Luvisolic subgroup with inclusions of other Gray Luvisolic subgroups.</p>', '<p>Le sous-groupe luvisol gris orthique est dominant; inclusions d\'autres sous-groupes luvisol gris.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/devel.html', 6, NULL, '2014-01-06 19:30:57', NULL),
	(89, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/drain', 'drain', 'none', 'E', 'false', 'FFFF99', 'Excessive', 'Excessif', '<p>Water is removed from the soil very rapidly in relation to supply; excess water flows downward very rapidly if underlying material is pervious; subsurface flow may be very rapid during heavy rainfall provided the gradient is steep; source of water is precipitation.</p>', '<p>L\'eau s\'écoule du sol beaucoup plus rapidement qu\'elle n\'y pénètre; le surplus d\'eau descend très rapidement dans les cas où le matériau sous-jacent est perméable; l\'écoulement souterrain peut être très rapide lorsque les pluies sont intenses là où le gradient est abrupt; l\'eau provient des précipitations.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/drain.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/drain.html', 1, NULL, '2012-03-14 16:13:16', NULL),
	(90, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/drain', 'drain', 'none', 'R', 'false', 'CCFF99', 'Rapid', 'Rapide', '<p>Water is removed from the soil rapidly in relation to supply; excess water flows downward if underlying material is pervious; subsurface flow may occur on steep gradients during heavy rainfall; source of water is precipitation.</p>', '<p>L\'eau s\'écoule du sol plus rapidement qu\'elle n\'y pénètre; le surplus d\'eau descend vers le bas dans les cas où le matériau sous-jacent est perméable; il peut se produire un écoulement souterrain sur les gradients abrupts lors des pluies intenses; l\'eau provient des précipitations.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/drain.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/drain.html', 2, NULL, '2012-03-14 16:14:02', NULL),
	(91, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/drain', 'drain', 'none', 'W', 'false', '33CC33', 'Well', 'Bon', '<p>Water is removed from the soil readily but not rapidly; excess water flows downward into underlying pervious material or laterally as subsurface flow. These soils commonly retain optimum amounts of moisture for plant growth after rains or addition of irrigation water.</p>', '<p>L\'eau s\'écoule du sol aisément mais non rapidement; le surplus d\'eau descend facilement dans le matériau sous-jacent perméable ou migre latéralement sous forme d\'écoulement souterrain; ces matériaux retiennent fréquemment de fortes quantités d\'humidité permettant la croissance des plantes après les pluies ou à la suite d\'irrigations.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/drain.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/drain.html', 3, NULL, '2012-03-14 16:16:13', NULL),
	(92, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/drain', 'drain', 'none', 'M', 'false', '33CC99', 'Moderately well', 'Moyen', '<p>Water is removed from the soil somewhat slowly in relation to supply due to low perviousness, a shallow water table, lack of gradient, or a combination of these factors; precipitation is the dominant source of water in medium to fine textured soils; precipitation and significant additions by subsurface flow are necessary in coarse-textured soils.</p>', '<p>L\'eau s\'écoule du sol un peu plus lentement qu\'elle n\'y pénètre; le surplus d\'eau s\'écoule un peu lentement à cause de la faible perméabilité, de la surface de saturation élevée, du faible gradient ou d\'une combinaison de ces facteurs; l\'eau provient essentiellement des précipitations dans les sols à texture moyenne à fine; dans les sols à texture grossière, des volumes importants d\'écoulement souterrain s\'ajoutent aux précipitations.</p>\r\n', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/drain.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/drain.html', 4, NULL, '2012-03-14 16:21:27', NULL),
	(93, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/drain', 'drain', 'none', 'I', 'false', '33CCCC', 'Imperfect', 'Imparfait', '<p>Water is removed from the soil sufficiently slowly in relation to supply leaving the soil wet for a significant part of the growing season; excess water moves slowly downward if precipitation is the major supply; if subsurface water, groundwater, or both are the main source the flow rate may vary.</p>', '<p>L\'eau s\'écoule du sol suffisamment lentement (par rapport à l\'apport d\'eau) pour que le sol reste humide durant une grande partie de la saison de croissance des plantes; le surplus d\'eau descend lentement vers le bas là où les précipitations constituent le principal apport; dans les cas où les eaux souterraines ou subsuperficielles, ou les deux, constituent la principale source, le taux d\'écoulement peut varier, mais le sol demeure humide durant une importante partie de la saison de croissance des plantes.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/drain.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/drain.html', 5, NULL, '2012-03-14 16:48:47', NULL),
	(94, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/drain', 'drain', 'none', 'P', 'false', '336699', 'Poor', 'Failble', '<p>Water is removed so slowly in relation to supply that the soil remains wet for a comparatively large part of the time that the soil is not frozen; excess water is evident in the soil for much of the time; subsurface flow, groundwater flow, or both, in addition to precipitation, are the main sources of water; a perched water table may also be present.</p>', '<p>Étant donné que l\'eau s\'écoule beaucoup plus lentement qu\'elle y est apportée, le sol demeure humide durant une grande partie de la période où le sol n\'est pas gelé; il y a la plupart du temps un surplus d\'eau dans le sol; l\'écoulement superficiel ou souterrain, ou les deux, s\'ajoute aux précipitations comme principale source d\'eau; il peut y avoir aussi une nappe d\'eau suspendue.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/drain.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/drain.html', 6, NULL, '2012-03-14 16:49:39', NULL),
	(95, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget', 'veget', 'none', 'TB', 'false', 'aaffff', 'Tundra, broken herb - low shrub', 'Toundra, herbes brisé - arbustes bas', '<p>Dwarf shrubs, Dryas and willows are important components of the vegetation. Other vascular plants are present but have low total coverage. Crustose lichens are common on the ground surface. Ground cover ranges from 10-20%.</p>', '<p>Les arbustes nains, les Dryas et les saules sont des composantes importantes de la végétation. Il y a d\'autres plantes vasculaires, mais leur couvert végétal est faible. Les lichens crustacés sont très répandus sur le sol de surface. Le couvert végétal est de 10 à 20 %.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/veget.html', 18, NULL, '2014-01-06 20:28:16', NULL),
	(96, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget', 'veget', 'none', 'U', 'false', '4c4c4c', 'Unvegetated surface', 'Surface sans végétation', '<p>Rock and Other Unvegetated Surfaces</p>\r\n', '<p>Roc et autres surfaces dénudées, surface sans végétation.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/veget.html', 19, NULL, '2014-01-06 20:29:44', NULL),
	(97, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget', 'veget', 'none', 'W', 'false', '56ffaa', 'Meadow, wet', 'Pré, humide', '<p>Dominated by sedges and cotton grass, with \'wet\' mosses (e.g., Mnium spp., Sphagnum spp.) and occasional herbs.</p>', '<p>Dominé par les carex et les herbes cotonneuses avec des mousses humides (ex. Mnium spp., Sphagnum spp.) et des herbes occasionnelles.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/veget.html', 20, NULL, '2014-01-06 20:27:47', NULL),
	(98, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget', 'veget', 'none', '#', 'true', 'cccccc', 'Not applicable', 'Ne s\'applique pas', '<p>Not applicable</p>', '<p>Ne s\'applique pas</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/veget.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/veget.html', 21, NULL, '2014-01-06 20:29:54', NULL),
	(99, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'mineral', 'A', 'false', '', 'Alluvial', 'Alluvions', '<p>Sediment, generally consisting of gravel and sand with a minor fraction of silt and clay. The gravels are typically rounded and contain interstitial sand; alluvial sediments are moderately to well sorted and display stratification. Examples are channel deposits, overbank deposits, terraces, alluvial fans, and deltas.</p>', '<p>Sédiment généralement composé de gravier et de sable et comportant une fraction secondaire de limon et d\'argile; les graviers sont généralement arrondis et contiennent du sable interstitiel; les sédiments alluviaux sont en général moyennement à bien triés et présentent une stratification; ex., accumulations dans les chenaux, dépôts alluviaux d\'inondation, terrasses, cônes alluviaux et deltas.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 1, NULL, '2012-03-13 17:14:59', NULL),
	(100, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'mineral', 'B', 'false', '', 'Bog', 'Bog', '<p>Bogs consist of unspecified organic materials formed in an ombrotrophic (nutrient-poor) environment caused by the slightly elevated nature of the bog which dissociates it from nutrient-rich ground water or surrounding mineral soils. Near the surface, materials are usually undecomposed (fibric), yellowish to pale brown, loose and spongy in consistence, and entire sphagnum plants are readily identified. These materials are extremely acid, with low bulk density and high fibre content; at lower depths they become darker, compacted, and somewhat layered. Bogs are associated with slopes or depressions on topography with a water table at or near the surface in the spring and slightly below it during the rest of the year. They are usually covered with sphagnum mosses, but sedges may also grow on them. Bogs may be treed or treeless and many are characterized by a layer of ericaceous shrubs.</p>', '<p>Les bogs se composent de matériaux organiques non précisés associés à un milieu ombrotrophe; parce que le bog est légèrement élevé, il n\'est pas en contact avec les eaux souterraines riches en éléments nutritifs ou avec les sols minéraux adjacents; près de la surface, les matériaux sont généralement non décomposés (fibriques), jaunes à brun clair, peu denses et spongieux, et contiennent des plantes entières de sphagnum facilement identifiables; ces matériaux sont extrêmement acides, ont une faible densité apparente et ont une teneur en fibres élevée; en profondeur, ils sont plus foncés et compactés et sont constitués de couches mal définies; les bogs sont associés à des pentes ou des dépressions dans un milieu où la surface de saturation affleure au printemps et est légèrement plus basse durant le reste de l\'année; les bogs sont généralement couverts de mousse de sphaignes, mais les cypéracées peuvent également y pousser; les bogs peuvent avoir des arbres ou non et nombre d\'entre eux sont caractérisés par une couche d\'éricacées buissonneux.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 2, NULL, '2012-03-13 17:19:38', NULL),
	(101, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'mineral', 'C', 'false', '', 'Colluvial', 'Colluvions', '<p>Massive to moderately-well stratified, nonsorted to poorly sorted sediments with any range of particle sizes from clay to boulders that have reached their present position only by direct, gravity-induced movement (except snow avalanches). Processes include slow displacements such as creep and solifluction and rapid movements such as earth flows.</p>', '<p>Sédiments massifs à moyennement bien stratifiés, non triés à mal triés, à granulométrie variable (des argiles ou blocs qui ont atteint leur position actuelle par mouvement direct engendré par la gravité - mis à part le cas des avalanches de neige); il y a des déplacements lents comme le creep et la solifluction ainsi que des mouvements rapides comme les coulées boueuses.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 3, NULL, '2012-03-13 17:20:31', NULL),
	(102, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'mineral', 'D', 'false', '', 'Residual', 'Sédiments résiduels', '<p>Unconsolidated, weathered, or partly weathered mineral soil material that accumulates by in situ disintegration of bedrock.</p>', '<p>Matériau de sol minéral non consolidé, météorisé ou partiellement altéré qui s\'accumule par désintégration sur place du substratum rocheux.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 4, NULL, '2012-03-13 17:21:14', NULL),
	(103, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'mineral', 'E', 'false', '', 'Eolian', 'Sédiments éoliens', '<p>Sediment, generally consisting of medium to fine sand and coarse silt particles, which is well sorted and poorly compacted. It may be massive, or show internal structures such as cross bedding or ripple laminae. Individual grains may be rounded and show signs of frosting. These materials have been transported and deposited by wind action. Examples are dunes, shallow deposits of sand and coarse silt, and loess.</p>', '<p>Sédiment, dont la taille varie généralement de sable moyen à fin jusqu\'au limon grossier, bien trié, mal compacté et ayant des structures internes comme une stratification entrecroisée ou des lamelles ou être massif; les grains individuels peuvent être arrondis et présenter des signes de "givrage"; ces matériaux ont été transportés et déposés par le vent; ex., dunes, dépôts peu épais de sable et de limon grossier, loess (mais pas les tuffs).</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 5, NULL, '2012-03-13 17:22:55', NULL),
	(104, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'mineral', 'F', 'false', '', 'Fluvioglacial', 'Matériaux fluvio-glaciaires', '<p>Material moved by glaciers and subsequently sorted and deposited by streams flowing from the melting ice. Deposits are stratified and may occur in the form of outwash plains, deltas, kames, eskers, and kame terraces.</p>', '<p>Matériau déplacé par les glaciers, puis triés et déposés par les cours d\'eau formés par la glace en fonte; les dépôts sont stratifiés et peuvent prendre la forme de plaines d\'épandage fluvio-glaciaires, de deltas, de kames, d\'eskers et de terrasses de kame.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 6, NULL, '2012-03-13 17:14:28', NULL),
	(105, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'mineral', 'H', 'false', '', 'Marsh', 'Marais', '<p>Mineral wetland or peatland that is periodically inundated by standing or slow-moving water. Surface water levels may fluctuate seasonally, with declining levels exposing drawdown zones of matted vegetation or mudflats. Waters are rich in nutrients, varying from fresh to highly saline. Substratum usually consists of mineral material, although in some places it consists of well-decomposed peat. Soils are predominantly Gleysols, with some Humisols and Mesisols. Marshes characteristically show zonal or mosaic surface patterns composed of pools or channels interspersed with clumps of emergent sedges, grasses, rushes, and reeds, and are bordered by grassy meadows and peripheral bands of shrubs or trees. Submerged and floating aquatics flourish where open-water areas occur.</p>', '<p>Tourbière ou terre humide minérale périodiquement inondée par de l\'eau stagnante ou à écoulement lent; les niveaux de l\'eau de surface peuvent fluctuer selon les saisons, les baisses de niveau exposant les zones de rabattement de la végétation en touffes ou vasière; les eaux sont riches en éléments nutritifs et varient de douces à très salées; le substrat se compose généralement de matériau minéral, bien que par endroits il s\'agisse de tourbe bien décomposée; les sols sont essentiellement des gleysols, avec quelques humisols et mésisols; les marais ont de façon caractéristique des configurations superficielles en mosaique ou en zone, composées de cuvettes ou de chenaux intercalés à des touffes émergées de cypéracées, de graminées, de joncs et de roseaux, bordant des prairies herbeuses et des bandes périphériques d\'arbustes ou d\'arbres; les plantes aquatiques submergées et flottantes sont abondantes dans les zones d\'eau libre.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 7, NULL, '2012-03-13 17:25:27', NULL),
	(106, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'mineral', 'I', 'false', '', 'Folic', 'Folic', '<p>Upland organic material.</p>', '<p>Materiau organique de hautes terres.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 8, NULL, '2012-03-13 17:26:06', NULL),
	(107, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'mineral', 'L', 'false', '', 'Lacustrine', 'Sédiments lacustres', '<p>Sediment, generally consisting of either stratified fine sand, silt, and clay deposited on the lake bed, or moderately-well sorted, stratified sand and coarse materials that consist of near lake shore or beach deposits. These materials have either settled from suspension in bodies of standing fresh water or accumulated at their margins through wave action.</p>', '<p>Sédiment composé généralement d\'argile, de limon et de sable fin stratifiés et déposés au fond du lac ou de sable stratifié et moyennement bien trié et de matériaux plus grossiers qui ont été transportés et déposés par les vagues sur la plage ou dans la zone littorale; il s\'agit de matériaux en suspension qui ont été déposés dans des masses d\'eau douce ou se sont accumulés à leurs marges sous l\'effet des vagues; ex., sédiments lacustres et plages.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 9, NULL, '2012-03-13 17:26:47', NULL),
	(108, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'mineral', 'M', 'false', '', 'Morainal', 'Moraines', '<p>Sediment, generally consisting of well-compacted material that is nonstratified and contains a heterogeneous mixture of sand, silt, and clay particles and coarse fragments in a mixture that has been transported beneath, beside, on, within, or in front of a glacier but not modified by any intermediate agent. Examples are basal till (ground moraine), lateral and terminal moraines, rubbly moraines of cirque glaciers, hummocky ice-disintegration moraines, and pre-existing, unconsolidated sediments reworked by a glacier so that their original character is largely or completely destroyed.</p>', '<p>Sédiment composé généralement de matériaux bien compactés, non stratifiés et contenant un mélange hétérogène de particules de la taille des sables, des limons et des argiles ainsi que des fragments grossiers qui a subi le transport glaciaire (sous le glacier, à côté de lui, sur lui, à l\'intérieur de lui ou devant lui) et n\'a été modifié par aucun agent intermédiaire; ex., till (moraine) de fond, moraines latérales et terminales, moraines caillouteuses des glaciers de cirque, moraines mammelonnées de désagrégation de la glace et sédiments préexistants non consolidés, refaçonnés par un glacier de telle sorte que les caractéristiques d\'origine sont complètement ou largement détruites.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 10, NULL, '2012-03-13 17:28:17', NULL),
	(109, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'mineral', 'N', 'false', '', 'Fen', 'Fen', '<p>Fens consist of unspecified organic materials formed in a minerotrophic environment due to the close association of the material with mineral-rich waters. The material is usually moderately-well to well decomposed, dark brown to black, with fine- to medium-sized fibres; decomposition often becomes greater at lower depths. The materials are covered with a dominant component of sedges, but grasses and reeds may be associated in local pools.</p>', '<p>Les fens se composent de matériaux organiques non précisés formés en milieu minérotrophe à cause de leur étroite association avec des eaux riches en minéraux; les fens sont généralement bien à moyennement bien décomposées, ont une couleur qui varie de brun foncé à noir et comportent des fibres de taille fine à moyenne; la décomposition est souvent plus importante en profondeur; les matériaux sont recouverts essentiellement de cypéracées, mais des graminées et des roseaux peuvent croître ensemble dans les cuvettes.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 11, NULL, '2012-03-13 17:29:15', NULL),
	(110, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'mineral', 'O', 'false', '', 'Organic', 'Sédiments organiques, non différenciés', '<p>A layered sequence of more than three undifferentiated types of organic material (>30% organic matter by weight).</p>', '<p>Série de couches comportant plus de trois types de matériaux organiques (>30 % de matière organique en poids).</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 12, NULL, '2012-03-13 17:30:34', NULL),
	(111, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'mineral', 'R', 'false', '', 'Rock', 'Roche', '<p>A consolidated bedrock layer that is too hard to break with the hands (>3 on Mohs\' scale) or to dig with a spade when moist.</p>', '<p>Substratum rocheux consolidé trop dur pour pouvoir être cassé avec les mains (>3 sur l\'échelle de dureté de Mohs) ou pour être creusé avec une pelle à l\'état humide.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 13, NULL, '2012-03-13 17:41:28', NULL),
	(112, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'mineral', 'S', 'false', '', 'Swamp', 'Marécage', '<p>Minerotrophic wetlands with the water table at or above the peat surface. The dominant unspecified organic materials are forest and fen peat formed in a eutrophic (nutrient-rich) environment due to strong water movement from the margins or other mineral sources. The material is usually moderately well to well decomposed and has a dark brown to reddish brown matrix; the more decomposed materials are black. It has an amorphous or very fine-fibred structure containing a random distribution of woody fragments and trunks of coniferous tree species. The vegetation cover may consist of coniferous or deciduous trees, tall shrubs, herbs, and mosses; in some regions sphagnum mosses are abundant.</p>', '<p>Terres humides minérotrophes où la surface de saturation se trouve au niveau de la surface tourbeuse ou au-dessus de celle-ci; les principaux matériaux organiques non précisés sont la tourbe de forêt et la tourbe de fen, formées en milieu eutrophe sous l\'effet des forts écoulements d\'eau provenant des marges ou d\'autres sources minérales; le marécage est généralement moyennement bien à bien décomposé et a une matrice qui va du brun foncé au brun rougeâtre; les matériaux les plus décomposés sont noirs; la tourbe a une structure amorphe à fibres très fines contenant une distribution aléatoire de fragments ligneux et de troncs d\'espèces de conifères; le couvert végétal peut être constitué de conifères ou de feuillus, de grands arbustes, de plantes herbacées et de mousses; dans certaines régions les mousses de sphaignes abondent.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 14, NULL, '2012-03-13 17:44:13', NULL),
	(113, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'mineral', 'T', 'false', '', 'Anthropogenic', 'Matériaux anthropiques', '<p>Materials modified by people,including those associated with mineral exploitation and waste disposal. They include materials deposited as a result of human activities or geological materials modified artificially so that their physical properties (structure, cohesion, compaction) have been drastically altered. Examples are areas of landfill, spoil heaps, open-pit mines and levelled irrigated areas.</p>', '<p>Matériaux modifiés par l\'homme, y compris ceux qui sont associés à l\'exploitation minière et à l\'élimination des déchets; ils comprennent les accumulations de matériaux qui proviennent de l\'activité humaine et les matériaux géologiques modifiés artificiellement de telle sorte que leurs propriétés physiques (structure, cohésion, compaction) ont été considérablement altérées; ex., décharges, tas de déblais, mines à ciel ouvert, zones nivelées et irriguées.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 15, NULL, '2012-03-13 17:46:13', NULL),
	(114, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'mineral', 'U', 'false', '', 'Undifferentiated', 'Sédiments non différenciés', '<p>A sequence of more than three types of genetic mineral materials outcropping on a steep erosional escarpment. This complex class is to be used where units relating to individual genetic materials cannot be delimited separately at the scale of mapping. It may include colluvium derived from the various genetic materials and resting upon the scarp slope.</p>', '<p>Série de plus de trois types de matériaux minéraux génétiques qui affleurent sur un escarpement d\'érosion; cette classe complexe doit être utilisée dans les cas où les unités se rapportant aux matériaux génétiques individuels ne peuvent être délimitées séparément à cause de l\'échelle utilisée; ces matériaux comportent le colluvion qui provient de divers matériaux génétiques et qui repose sur la pente de l\'escarpement.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 16, NULL, '2012-03-13 17:47:07', NULL),
	(115, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'mineral', 'V', 'false', '', 'Volcanic', 'Matériaux volcaniques', '<p>Volcanic pumice and ash.</p>', '<p>Cendre et ponce volcaniques.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 17, NULL, '2012-03-13 17:48:11', NULL),
	(116, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'mineral', 'W', 'false', '', 'Marine', 'Dépôts marins', '<p>Unconsolidated deposits of clay, silt, sand, or gravel that are well to moderately well sorted and well to moderately well stratified (in some places containing shells). The deposits have settled from suspension in salt or brackish water bodies or have accumulated at their margins through shoreline processes such as wave action and longshore drift. Nonfossiliferous deposits may be judged marine if they are located in an area that may reasonably be considered to have contained salt water at the time the deposits were formed.</p>', '<p>Dépôts non consolidés d\'argile, de limon, de sable ou de gravier, bien à moyennement bien triés et bien à moyennement bien stratifiés (renfermant par endroits des coquillages); ces matériaux d\'abord en suspension, se sont déposés dans des masses d\'eau salée ou saumâtre ou se sont accumulés à la lisière de celles-ci sous l\'effet de phénomènes littoraux comme l\'action des vagues et de la dérive littorale; les dépôts non fossilifères peuvent être considérés comme des dépôts marins s\'ils sont situés en un endroit que l\'on peut raisonnablement considérer comme ayant été recouvert d\'eau salée à l\'époque où ces dépôts se sont formés.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 18, NULL, '2012-03-13 17:49:20', NULL),
	(117, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'organic', '11', 'false', '', 'Fibric sphagnum', 'Sphaigne fibrique', '<p>Sphagnum organic material having a fibric (slight) degree of decomposition in which the fibric materials are readily identifiable as to botanical origin. The peat is usually undecomposed (or fibric), light yellowish brown to pale brown, and loose and spongy in consistency with the entire sphagnum plant being readily identifiable.</p>', '<p>Matériau organique de Sphagnum en état fibrique de décomposition, c\'est-à-dire que l\'on peut reconnaître facilement l\'origine botanique des fibres qu\'il contient; la tourbe est généralement non décomposée (ou fibrique), brun jaunâtre pâle à brun pâle et peu dense et spongieux, toute la plante Sphagnum étant facilement reconnaissable.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 1, NULL, '2012-03-13 17:51:28', NULL),
	(118, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'organic', '20', 'false', '', 'Fibric sedge and moss ', 'Carex fibrique', '<p>Sedge and brown moss organic material having a fibric (slight) degree of decomposition. The peat is composed dominantly of sedge (Carex spp.) and brown mosses (Depranocladus spp.). It is usually slightly decomposed and brown to dark brown; consistency is variable and ranges from loose to matted. The material commonly contains large amounts of very fine sedge roots.</p>', '<p>Dominé par le carex et le matériau organique de mousse brune et mousse ayant un faible degré fibrique de décomposition. La tourbe est principalement composée de carex (Carex spp.). C\'est habituellement légèrement décomposé et d\'une couleur allant du brun à brun foncé; la consistence varie de meuble à compacte. Le matériau contient généralement de grandes quantités de très fines racines decarex.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 2, NULL, '2012-03-13 17:52:48', NULL),
	(119, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'organic', '21', 'false', '', 'Mesic sedge', 'Carex mésique', '<p>Sedge organic material having a mesic (intermediate) degree of decomposition. The peat is composed dominantly of sedge (Carex spp.) and is moderately decomposed and matted. The sedge leaves are readily identifiable by the naked eye. This material commonly contains large amounts of very fine roots of the above species.</p>', '<p>Matériaux organiques de cypéracées en état mésique (ou intermédiaire) de décomposition; la tourbe se compose essentiellement de Carex (Carex spp.), est en général moyennement décomposée et sous forme de tapis; les feuilles de Carex sont facilement identifiables à l\'oeil nu; ce matériau contient fréquemment de grandes quantités de racines très fines des espèces précitées.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 3, NULL, '2012-03-13 17:55:29', NULL),
	(120, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'organic', '22', 'false', '', 'Mesic woody sedge', 'Carex ligneux mésique', '<p>Woody sedge organic material having a mesic(intermediate) degree of decomposition. The peat is composed dominantly of sedge peat (see Mesic sedge) with subdominant amounts of woody materials.</p>', '<p>Matériau organique de Carex ligneux en état mésique (ou intermédiaire) de décomposition; la tourbe se compose surtout de tourbe à Carex (voir le code 21) et de quantités sous-dominantes de matériaux ligneux.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 4, NULL, '2012-03-13 17:56:06', NULL),
	(121, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'organic', '23', 'false', '', 'Mesic woody forest', 'Forêt ligneuse mésique', '<p>Woody forest organic material having a mesic(intermediate) degree of decomposition. The peat contains significant amounts of woody materials derived from both coniferous and deciduous tree species. In general, wood fragments are easily identifiable in this peat.</p>', '<p>Matériau organique de forêt ligneuse en état mésique (ou intermédiaire) de décomposition; la tourbe se compose essentiellement (>50 %) de matériaux ligneux qui proviennent d\'espèces de conifères et de feuillus; en général, les fragments ligneux sont facilement reconnaissables dans la tourbe.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 5, NULL, '2012-03-13 18:00:58', NULL),
	(122, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'organic', '25', 'false', '', 'Mesic sphagnum', 'Sphaigne mésique', '<p>Sphagnum organic material having a mesic (intermediate) degree of decomposition.</p>', '<p>Matériau organique de sphaigne en état mésique (ou intermédiaire) de décomposition.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 6, NULL, '2012-03-13 18:01:32', NULL),
	(123, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'organic', '31', 'false', '', 'Humic sedge', 'Carex humique', '<p>Sedge organic material having a humic (most advanced) degree of decomposition in which most of the material is humified and there are few recognizable fibres.</p>', '<p>Matériau organique de Carex en état humique (ou le plus avancé) de décomposition dans lequel la majeure partie du matériel est humifiée; peu de fibres sont encore reconnaissables.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 7, NULL, '2012-03-13 18:02:12', NULL),
	(124, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep', 'pmdep', 'organic', '#', 'true', '', 'Not applicable', 'Ne s\'applique pas', '<p>Not applicable</p>', '<p>Ne s\'applique pas</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/pmdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/pmdep.html', 8, NULL, '2012-03-13 18:03:16', NULL),
	(125, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/stone', 'stone', 'none', 'N', 'false', '007f00', 'None', 'Non pierreux', '<p>The soil surface  is nonstony.</p>', '<p>La surface du sol est non pierreux.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/stone.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/stone.html', 1, NULL, '2012-03-16 14:46:55', NULL),
	(126, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/stone', 'stone', 'none', 'S', 'false', '2ca02c', 'Slightly Stony', 'Légèrement pierreux', '<p>The soil surface is slightly to moderately stony.</p>', '<p>La surface du sol est de légèrement à modérément pierreux.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/stone.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/stone.html', 2, NULL, '2012-03-16 14:47:58', NULL),
	(127, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/stone', 'stone', 'none', 'V', 'false', 'fc9535', 'Very Stony', 'Très pierreux', '<p>The soil surface is very to excessively stony.</p>', '<p>La surface du sol est de très à excessivement pierreux.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/stone.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/stone.html', 3, NULL, '2012-03-16 14:48:49', NULL),
	(128, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/stone', 'stone', 'none', 'U', 'true', 'cccccc', 'Unknown', 'Inconnu', '<p>The soil surface stoniness is either unknown or not applicable.</p>', '<p>La surface du sol est de pierrosité inconnu ou ne s\'applique pas.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/stone.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/stone.html', 4, NULL, '2012-03-16 14:51:08', NULL),
	(129, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'mineral', 'D', 'false', '737300', 'Dissected', 'Disséqué', '<p>A dissected (or gullied) pattern providing external drainage for an area.</p>', '<p>Terrain disséqué (ou raviné) assurant un drainage vers l\'extérieur d\'une zone donnée.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 1, NULL, '2014-01-17 23:06:20', 'schutp'),
	(130, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'mineral', 'H', 'false', 'e6e600', 'Hummocky (or irregular)', 'Bosselé (ou irrégulier)', '<p>A very complex sequence of slopes extending from somewhat rounded concavities (or swales) of various sizes to irregular conical knolls (or knobs) and short discontinuous ridges; there is a general lack of concordance between knolls and swales. Slopes are generally 4-70%. Examples are hummocky moraines and hummocky fluvioglacial landforms.</p>', '<p>Série très complexe de pentes dont les toits varient de concavités légèrement arrondies (ou dépressions) de diverses tailles à des collines coniques irrégulières (ou buttes) et à de courtes crêtes discontinues; il y a généralement manque de concordance entre les creux et les bosses; les pentes varient de 4-70 %; exemples : moraine mammelonnée, dépôt fluvio-glaciaire mammelonné.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 2, NULL, '2014-01-17 23:05:58', 'schutp'),
	(131, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'mineral', 'I', 'false', '', 'Inclined', 'Incliné', '<p>A sloping, unidirectional surface with a generally constant slope unbroken by marked irregularity or gullies; a weakly developed dissected pattern provides external drainage for the local area. Slopes are 2-70%; the form of inclined slopes is not related to the initial mode of origin of the underlying material.</p>', '<p>Surface unidirectionnelle à inclinaison généralement constante, non brisée par des ravins ou des irrégularités marquées; terrain peu marqué, permet le drainage vers l\'extérieur de la région; les pentes varient de 2-70 %; la forme des versants n\'est pas liée à l\'origine du matériau sous-jacent.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 3, NULL, '2012-03-14 17:05:28', NULL),
	(132, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'mineral', 'K', 'false', '', 'Knoll and kettle', 'En bosses et creux', '<p>A chaotic sequence of knolls and kettles (or sloughs), which occupies 15-20% of an area and has no external drainage. Slopes are generally &gt;3%. Examples are morainal plains and hill lands.</p>', '<p>Série très chaotique de bosses et de creux (ou dépressions) qui occupent 15-20% d\'une région, n\'a pas de drainage vers l\'extérieur; les pentes sont généralement >3 %; ex., plaines morainiques et collines.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 4, NULL, '2012-03-14 17:05:58', NULL),
	(133, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'mineral', 'L', 'false', '', 'Level', 'Plan', '<p>A flat or very gently sloping, unidirectional surface with a generally constant slope unbroken by marked elevations and depressions. Slopes are generally <2%. Examples are floodplains and lake plains.</p>', '<p>Surface unidirectionnelle plane ou légèrement en pente à inclinaison généralement constante, non brisée par des élévations et des dépressions marquées; les pentes sont généralement <2 % (c\'est-à-dire 1 %); ex., plaine inondable, plaine lacustre.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 5, NULL, '2012-03-14 17:06:53', NULL),
	(134, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'mineral', 'M', 'false', 'd7b09e', 'Rolling', 'Valonné', '<p>A very regular sequence of moderate slopes extending from rounded and, in some places, confined concave depressions to broad, rounded convexities producing a wavelike pattern of moderate relief. Slope gradients are generally >5% but may be less. This surface form is usually controlled by the underlying bedrock.</p>', '<p>Séquence très régulière de pentes moyennes qui s\'étirent entre des dépressions arrondies et, par endroit, confinées et concaves, et de larges convexités arrondies, ce qui confère au paysage une allure de vagues de hauteur moyenne; les gradients de pentes sont généralement >5 %, mais peuvent y être inférieurs; ce modelé est généralement maîtrisé par le substratum rocheux sous-jacent.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 6, NULL, '2014-01-17 23:06:49', 'schutp'),
	(135, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'mineral', 'R', 'false', 'f57a7a', 'Ridged', 'À crêtes', '<p>A long, narrow elevation of the surface, usually sharp crested with steep sides; ridges may be parallel, subparallel, or intersecting. Examples are eskers, crevasse fillings, washboard moraines and some drumlins.</p>', '<p>Longue et étroite élévation de la surface à crête nettement pointue et versants abrupts; les crêtes peuvent être parallèles, quasi parallèles ou se croiser; ex., eskers, remplissages de crevasses, moraines bosselées, certains drumlins.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 7, NULL, '2014-01-17 23:03:40', 'schutp'),
	(136, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'mineral', 'S', 'false', '', 'Steep ', 'Escarpé', '<p>Erosional slopes of greater than 70% (35°), present on both consolidated and unconsolidated materials.  The form of a steep erosional slope on unconsolidated materials is not related to the initial mode of origin of the underlying material.  An example is an escarpment.</p>', '<p>Pentes d\'érosion de plus de 70 % (35°), se trouvent sur des matériaux consolidés ou non consolidés; la forme d\'une pente d\'érosion escarpée sur matériaux non consolidés n\'est pas liée à l\'origine des matériaux sous-jacents; ex., escarpements.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 8, NULL, '2012-03-14 17:12:18', NULL),
	(137, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'mineral', 'T', 'false', '', 'Terraced', 'En terrasses', '<p>Scarp face and the horizontal or gently inclined surface (or tread) above it. An example is an alluvial terrace.</p>', '<p>Paroi de l\'escarpement et surface horizontale ou légèrement inclinée qui se trouve au-dessus; ex., terrasse alluviale.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 9, NULL, '2012-03-14 17:12:49', NULL),
	(138, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'mineral', 'U', 'false', '', 'Undulating', 'Ondulé', '<p>A very regular sequence of gentle slopes that extends from rounded and, in some places, confined concavities to broad, rounded convexities producing a wavelike pattern of low local relief. Slope length is generally less than 0.8 km and the dominant gradient of slopes is usually 2-5%. The terrain lacks an external drainage pattern. Examples are some ground moraines and lacustrine material of varying textures.</p>', '<p>Séquence très régulière de pentes douces qui s\'étirent entre des concavités arrondies et, par endroits confinées, et de grandes convexités arrondies, ce qui produit un paysage peu accidenté, en vagues; la longueur des pentes est généralement de moins de 0,8 km et le gradient dominant des pentes est généralement de 2-5 % (de 1 à 3°); aucune configuration de drainage externe; ex., certaines moraines de fond, matériau lacustre de diverses textures.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 10, NULL, '2012-03-14 17:13:56', NULL),
	(139, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'wetland', 'B04', 'false', '', 'Domed bog', 'Bog bombé', '<p>A large bog (diameter usually >500 m) with a convex surface rising several metres above the surrounding terrain. The centre usually drains in all directions; small crescentic pools commonly form around the highest point; a concentric pattern is formed if the highest point is in the centre, while an eccentric pattern is formed if the highest point is off-centre. Peat development is usually >3 m.</p>', '<p>Bog important (diamètre généralement >500 m) à surface convexe qui s\'élève de plusieurs mètres au-dessus du terrain avoisinant; le drainage en surface rayonne à partir du centre dans toutes les directions; de petits étangs en forme de croissant se forment généralement près du point le plus haut; si le point le plus élevé est au centre, les étangs forment une configuration concentrique ou, dans le cas contraire, excentrique; l\'épaisseur du dépôt de tourbe est généralement >3 m.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 1, NULL, '2012-03-14 17:15:59', NULL),
	(140, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'wetland', 'B05', 'false', '', 'Polygonal peat plateau bog ', 'Bog polygonal de plateau tourbeux', '<p>A perennially frozen bog rising approximately 1 m above the surrounding fen. The surface is relatively flat, scored by a polygonal pattern of trenches that developed over ice wedges. The permafrost and ice wedges developed in peat originally deposited in a nonpermafrost environment.</p>', '<p>Bog gelé en permanence s\'élevant d\'environ 1 m au-dessus du fen avoisinant; la surface est relativement plane et marquée par une structure polygonale de tranchées qui se sont formées au-dessus des coins de glace; le pergélisol et les coins de glace se sont formés dans une tourbe qui s\'est accumulée dans un milieu qui n\'était pas gelé en permanence.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 2, NULL, '2012-03-14 17:17:52', NULL),
	(141, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'wetland', 'B07', 'false', '', 'Peat plateau bog', 'Bog de plateau tourbeux', '<p>A bog composed of perennially frozen peat rising abruptly about 1 m from the surrounding unfrozen fen. The surface is relatively flat and even, and commonly covers large areas. The peat was originally deposited in a nonpermafrost environment and is associated in many places with collapse scar bogs or fens.</p>', '<p>Bog composé de tourbe gelée en permanence qui s\'élève de façon abrupte d\'environ 1 m au-dessus du fen adjacent non gelé; la surface est relativement plane et régulière et couvre généralement de vastes étendues; la tourbe a été déposée à l\'origine en milieu non pergélisolé et est associée à de nombreux endroits à des bogs ou des fens effondrés.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 3, NULL, '2012-03-14 17:19:30', NULL),
	(142, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'wetland', 'B09', 'false', '', 'Atlantic plateau bog', 'Bog de plateau de l\'Atlantique', '<p>A bog with a flat to undulating surface raised above the surrounding terrain. The bog edges commonly slope steeply downwards to the mineral soil terrain. Large pools scattered on the bog reach depths of 2-4 m.</p>', '<p>Bog à surface plane à ondulée qui domine le terrain adjacent, les bordures du bog descendent en général en pente abrupte vers le terrain à sol minéral; de larges étangs qui parsèment le bog atteignent une profondeur de 2-4 m.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 4, NULL, '2012-03-14 17:20:39', NULL),
	(143, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'wetland', 'B13', 'false', '', 'Basin bog', 'Bog de bassin', '<p>A bog situated in a basin with essentially closed drainage which receives water from precipitation and runoff from the immediate surroundings. The surface of the bog is flat with peat generally deepest at the centre.</p>', '<p>Bog situé dans un bassin dont le drainage est essentiellement fermé; il est alimenté en eau par les précipitations et le ruissellement des environs immédiats; la surface du bog est plane, mais la tourbe est généralement la plus épaisse au centre.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 5, NULL, '2012-03-14 17:21:17', NULL),
	(144, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'wetland', 'B14', 'false', '', 'Flat bog', 'Bog plat', '<p>A bog having a flat, featureless surface and occurring in broad, poorly defined depressions. The depth of peat is generally uniform.</p>', '<p>Bog à surface plane et sans relief qui apparaît dans de vastes dépressions mal définies; la profondeur des dépôts de tourbe est généralement uniforme.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 6, NULL, '2012-03-14 17:21:55', NULL),
	(145, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'wetland', 'B15', 'false', '', 'String bog', 'Bog structuré', '<p>A pattern of narrow (2-3 m wide), low (<1 m high) ridges oriented at right angles to the direction of drainage; wet depressions or pools occur between the ridges. The water and peat are very low in nutrients because the water has been derived from other ombrotrophic wetlands. The peat thickness is >1 m.</p>', '<p>Configuration d\'étroites (2-3 m de largeur) crêtes basses (<1 m) orientées à angle droit par rapport à la direction du drainage; des dépressions humides ou des étangs s\'observent entre les crêtes; l\'eau et la tourbe sont très faibles en éléments nutritifs puisque l\'eau provient d\'autres terres humides ombrotrophes; l\'épaisseur du dépôt tourbeux est >1 m.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 7, NULL, '2012-03-14 17:22:58', NULL),
	(146, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'wetland', 'B16', 'false', '', 'Blanket bog', 'Bog en couverture', '<p>A bog consisting of extensive peat deposits that occur more or less uniformly over gently sloping hills and valleys. The peat thickness is usually < 2 m.</p>', '<p>Bog composé de dépôts tourbeux considérables recouvrant à peu près uniformément des collines et des vallées à pentes douces; l\'épaisseur de la tourbe est généralement <2 m.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 8, NULL, '2012-03-14 17:24:00', NULL),
	(147, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'wetland', 'B18', 'false', '', 'Slope bog', 'Bog incliné', '<p>A bog occurring in areas of high rainfall on appreciably sloping land surfaces. The bog is fed by rainwater and by water draining from other nutrient-poor peatlands. The peat may exceed 1 m in thickness.</p>', '<p>Bog apparaissant dans les régions à précipitation élevée sur des pentes assez abruptes, et qui est alimenté par les eaux de pluie et l\'eau provenant d\'autres tourbières pauvres en éléments nutritifs; l\'épaisseur de la tourbe peut dépasser 1 m.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 9, NULL, '2012-03-14 17:25:12', NULL),
	(148, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'wetland', 'B19', 'false', '', 'Veneer bog', 'Bog en plaqué ', '<p>A bog occurring on gently sloping terrain underlain by generally discontinuous permafrost. Although drainage is predominantly below the surface, overland flow occurs in poorly defined drainways during peak runoff. Peat thickness is usually <1.5 m.</p>', '<p>Bog se formant sur un terrain en pente douce recouvrant du pergélisol généralement discontinu; bien que le drainage soit essentiellement souterrain, l\'écoulement superficiel a lieu dans des chenaux mal définis au cours du ruissellement de pointe; l\'épaisseur de la tourbe est généralement <1,5 m.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 10, NULL, '2012-03-14 17:26:08', NULL),
	(149, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'wetland', 'B20', 'false', '', 'Lowland polygon bog', 'Bog de polygone de basse terre ', '<p>A bog with flat-topped or convex peat surfaces (often referred to as \'high-centre polygons\') separated by trenches over ice wedges that form a polygonal pattern when viewed from above. The peat was deposited in a permafrost environment as shown by internal structures.</p>', '<p>Bog à surface tourbeuses convexes ou planes séparées par des tranchées correspondant à des coins de glace qui forment une figuration polygonale en surface; la tourbe a été déposée à l\'origine en milieu non pergélisolé.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 11, NULL, '2012-03-14 17:45:43', NULL),
	(150, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'wetland', 'F01', 'false', '', 'Northern ribbed fen', 'Fen côtelé du nord ', '<p>A fen with parallel, low peat ridges (\'strings\') alternating with wet hollows or shallow pools, oriented across the major slope at right angles to water movement. The depth of peat is >1 m.</p>', '<p>Fen ayant de basses crêtes tourbeuses parallèles (\'côtes\') qui alternent avec des dépressions humides ou des étangs peu profonds, orientés en travers de la pente principale, à angle droit par rapport au mouvement de l\'eau; l\'épaisseur de la tourbe est >1 m.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 12, NULL, '2012-03-14 17:46:36', NULL),
	(151, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'wetland', 'F07', 'false', '', 'Shore fen', 'Fen de rivage ', '<p>A fen with an anchored surface mat that forms the shore of a pond or lake. The rooting zone is affected by the water of the lake at both normal and flood levels.</p>', '<p>Fen ayant un tapis superficiel ancré qui forme la rive d\'un étang ou d\'un lac; la zone d\'enracinement est touchée par les eaux du lac au niveau normal ou de crue.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 13, NULL, '2012-03-14 17:47:08', NULL),
	(152, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'wetland', 'F11', 'false', '', 'Slope fen', 'Fen incliné ', '<p>A fen occurring mainly on slow-draining, nutrient-enriched seepage slopes. Pools are usually absent, but wet seepage tracks may occur. Peat thickness is usually <2 m.</p>', '<p>Fen se trouvant essentiellement sur des pentes d\'infiltration à drainage lent, enrichies en éléments nutritifs; il n\'y a généralement pas d\'étangs, mais parfois des traces d\'infiltration; l\'épaisseur du dépôt de tourbe est généralement <2 m.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 14, NULL, '2012-03-14 17:51:09', NULL),
	(153, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'wetland', 'F13', 'false', '', 'Horizontal fen', 'Fen horizontal ', '<p>A fen with a gently sloping, featureless surface. This fen occupies broad, often ill-defined depressions and may interconnect with other fens. Peat accumulation is generally uniform.</p>', '<p>Fen ayant une surface à pente très légère, sans accident de terrain; ce fen occupe le fond de vastes dépressions souvent mal définies et peut être relié à d\'autres fens; l\'accumulation de tourbe est généralement uniforme.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 15, NULL, '2012-03-14 17:52:23', NULL),
	(154, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'wetland', 'S01', 'false', '', 'Stream swamp', 'Marécage de ruisseau ', '<p>A swamp occurring along the banks of permanent or semipermanent streams. The high water table is maintained by the level of water in the stream. The swamp is seasonally inundated with subsequent sediment deposition.</p>', '<p>Marécage qui se trouvent le long des rives de cours d\'eau permanents ou semi-permanents; la surface de saturation reste élevée sous l\'effet du niveau des eaux dans le cours d\'eau; le marécage est inondé en saison et subit donc des accumulations régulières de sédiments.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 16, NULL, '2012-03-14 18:15:07', NULL),
	(155, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'wetland', 'S04', 'false', '', 'Basin swamp', 'Marécage de bassin ', '<p>A swamp developed in a topographically defined basin where water derived locally may be augmented by drainage from other parts of the watershed. Accumulation of well-decomposed peat is shallow (<0.5 m) at the edge but may reach 2 m at the centre.</p>', '<p>Marécage confiné à des bassins définis par la topographie où les eaux du drainage provenant d\'autres portions du bassin versant peuvent s\'ajouter à l\'eau de provenance locale; l\'accumulation de tourbes bien décomposées est peu épaisse (<0,5 m) aux extrémités et peut atteindre 2 m au centre.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 17, NULL, '2012-03-14 18:16:33', NULL),
	(156, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'wetland', 'M06', 'false', '', 'Stream marsh', 'Marais de ruisseau ', '<p>A marsh occupying shorelines, bars, stream beds, or islands in continuously flowing watercourses. The marsh is subject to prolonged annual flooding and is commonly covered by thick layers of sediments.</p>', '<p>Marais occupant les rivages, les cordons littoraux, le lit des cours d\'eau ou des îles situées dans les cours d\'eau à écoulement continu; le marais est sujet à des inondations annuelles prolongées et est souvent couvert d\'épaisses couches de sédiments.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 18, NULL, '2012-03-14 18:17:21', NULL),
	(157, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'wetland', 'M11', 'false', '', 'Shallow basin marsh', 'Marais de bassin peu profond ', '<p>A marsh occurring in a uniformly shallow marsh depression or swale, having a gradual gradient from the edge to the deepest portion; the marsh edge may be poorly defined. Water levels fluctuate rapidly.</p>', '<p>Marais qui se trouve dans une dépression ou un creux uniformément peu profond, à pente graduelle entre le rebord de la dépression et sa partie la plus profonde; la lisière du marais peut être mal délimitée; les niveaux d\'eau fluctuent rapidement.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 19, NULL, '2012-03-14 18:18:02', NULL),
	(158, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf', 'locsf', 'wetland', 'M14', 'false', '', 'Shore marsh', 'Marais de rivage ', '<p>A marsh occupying the contact zone between high and low water marks bordering semipermanent or permanent lakes. The marsh,usually found along protected shorelines, behind barrier beaches in lagoons, on islands, or in embayments, is subject to flooding by a rise in lake levels, wind waves, or surface runoff.</p>', '<p>Marais occupant la zone de contact entre les laisses de haute mer et de basse mer en bordure de lacs permanents ou semi-permanents; on retrouve habituellement ce type de marais le long des rives abritées, dans des lagunes derrière les cordons littoraux, sur des îles ou dans des baies; le marais est sujet à des inondations causées par la hausse des niveaux des lacs, par des vagues, par le vent ou par le ruissellement de surface.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/locsf.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/locsf.html', 20, NULL, '2012-03-14 18:18:51', NULL),
	(159, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/kind', 'kind', 'none', 'M', 'false', '007f00', 'Mineral Soil', 'Sol Minéral', '<p>Predominantly mineral particles; contains <30% organic matter as measured by weight.</p>', '<p>Particules minérals prédominante; contient <30% de matière organique comme poids de mesure.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/kind.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/kind.html', 1, NULL, '2012-03-15 19:15:12', NULL),
	(160, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/kind', 'kind', 'none', 'O', 'false', '73FF26', 'Organic Soil', 'Sol Organique', '<p>Contains >30% organic matter as measured by weight.</p>', '<p>Contient >30% de matière organique comme poids de mesure.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/kind.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/kind.html', 2, NULL, '2012-03-15 19:15:52', NULL),
	(161, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/kind', 'kind', 'none', 'N', 'false', '7373FF', 'Non-soil  ', 'Non-sol', '<p>Rockland, quarry, unclassified, not surveyed, etc.</p>', '<p>Terrain rocheux, carrière, non classé, non arpenté, autre.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/kind.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/kind.html', 3, NULL, '2012-03-15 19:20:40', NULL),
	(162, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/kind', 'kind', 'none', 'U', 'false', 'FF7373', 'Urban', 'Urbain ', '<p>Urban areas, airports, and other man-made features.</p>', '<p>Régions urbaines, aéroports et autres emplacements fait par l\'homme.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/kind.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/kind.html', 4, NULL, '2012-03-15 19:24:04', NULL),
