	(269, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/s_group3', 's_group3', 'DYB', 'O', 'false', '', 'Orthic Dystric Brunisol ', 'Brunisol dystrique orthique  ', '<p>Orthic Dystric Brunisol </p>', '<p>Brunisol dystrique orthique  </p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/s_group3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/s_group3.html', 414, NULL, NULL, NULL),
	(270, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/s_group3', 's_group3', 'DYB', 'E', 'false', '', 'Eluviated Dystric Brunisol ', 'Brunisol dystrique éluvial  ', '<p>Eluviated Dystric Brunisol </p>', '<p>Brunisol dystrique éluvial  </p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/s_group3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/s_group3.html', 415, NULL, NULL, NULL),
	(271, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/s_group3', 's_group3', 'DYB', 'DU', 'false', '', 'Duric Dystric Brunisol ', 'Brunisol dystrique durique  ', '<p>Duric Dystric Brunisol </p>', '<p>Brunisol dystrique durique  </p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/s_group3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/s_group3.html', 416, NULL, NULL, NULL),
	(272, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/drain', 'drain', 'none', 'V', 'false', '9966FF', 'Very poor', 'Très faible', '<p>Water is removed from the soil so slowly that the water table remains at or on the surface for a majority of the time the soil is not frozen; groundwater flow and subsurface flow are the major sources of water; precipitation is less important except where there is a perched water table.</p>', '<p>L\'eau s\'écoule tellement lentement que la surface de saturation affleure à la surface durant une large part de la période où le sol n\'est pas gelé; l\'écoulement de la nappe souterraine et l\'écoulement souterrain constituent les principales sources d\'eau; les précipitations jouent un rôle moins grand, sauf là où il y a une nappe d\'eau suspendue.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/drain.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/drain.html', 7, NULL, '2012-03-14 16:50:51', NULL),
	(273, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/drain', 'drain', 'none', '#', 'true', 'CCCCCC', 'Not applicable', 'Ne s\'applique pas', '<p>Drainage not applicable (rock, ice, etc).</p>', '<p>Drainage ne s\'applique pas (roche, glace, etc).</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v1.0/component/drain.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v1.0/component/drain.html', 8, NULL, '2012-03-14 16:51:38', NULL),
	(274, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/drainage', 'drainage', 'none', 'VR', 'false', 'FFFF99', 'Very rapidly drained', 'Drainage très rapide', '<p>Water is removed from the soil very rapidly in relation to supply. Excess water flows downward very rapidly if underlying material is pervious. There may be very rapid subsurface flow during heavy rainfall provided there is a steep gradient. Soils have very low available water storage capacity (usually less than 2.5 cm) within the control section and are usually coarse textured, or shallow, or both. Water source is precipitation.</p>', '<p>L\'eau s\'écoule du sol beaucoup plus rapidement qu\'elle n\'y pénètre.  Le surplus d\'eau descend très rapidement dans le cas où  le matériel sous-jacent est perméable.  L\'écoulement souterrain peut-être très rapide lorsque les pluies sont intenses là où le gradient est abrupt.  Les sols ont une capacité de storage très basse (normallement moins de 2.5 cm) dans la section contrôlée et sont d¿une texture grossière, ou peu profond, ou les deux. L¿eau provient des précipitations.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/drainage.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/drainage.html', 1, NULL, NULL, NULL),
	(275, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/drainage', 'drainage', 'none', 'R', 'false', 'CCFF99', 'Rapidly drained', 'Drainage rapide', '<p>Water is removed from the soil rapidly in relation to supply. Excess water flows downward if underlying material is pervious. Subsurface flow may occur on steep gradients during heavy rainfall. Soils have low available water storage capacity (2.5-4 cm) within the control section, and are usually coarse textured, or shallow, or both. Water source is precipitation.</p>', '<p>L\'eau s\'écoule du sol plus rapidement qu\'elle n\'y pénètre.  Le surplus d\'eau descend vers le bas dans le cas où le matériel sous-jacent est perméable.  Il peut se produire un écoulement souterrain sur les gradients abrupts lors des pluies intenses.  Les sols ont une capacité de storage basse (2.5-4 cm) dans la section contrôlée et sont d¿une texture grossière, ou peu profond, ou les deux. L\'eau provient des précipitations.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/drainage.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/drainage.html', 2, NULL, NULL, NULL),
	(276, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/drainage', 'drainage', 'none', 'W', 'false', '33CC33', 'Well drained', 'Drainage bon', '<p>Water is removed from the soil readily but not rapidly. Excess water flows downward readily into underlying pervious material or laterally as subsurface flow. Soils have intermediate available water storage capacity (4-5 cm) within the control section, and are generally intermediate in texture and depth. Water source is precipitation. On slopes subsurface flow may occur for short durations, but additions are equaled by losses.</p>', '<p>L\'eau s\'écoule du sol aisément mais non rapidement.  Le surplus d\'eau descend facilement dans le matériel sous-jacent perméable ou migre latéralement sous forme d\'écoulement souterrain.  Les sols ont une capacité de storage intermédiaire (4-5 cm) dans la section contrôlée, et sont d\'une texture et profondeur intermédiaire.  L\'eau provient des précipitations.  Sur des inclinaisons dans le sous-sol la descente d\'eau peut se produire pour un temp court mais des surplus sont égaux au pertes.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/drainage.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/drainage.html', 3, NULL, NULL, NULL),
	(277, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/drainage', 'drainage', 'none', 'MW', 'false', '33CC99', 'Moderately well drained', 'Drainage modérément bon', '<p>Water is removed from the soil somewhat slowly in relation to supply. Excess water is removed somewhat slowly due to low perviousness, shallow water table, lack of gradient, or some combination of these. Soils have intermediate to high water storage capacity (5-6 cm) within the control section and are usually medium to fined textured. Precipitation is the dominant water source in medium to fine textured soils; precipitation and significant additions by subsurface flow are necessary in coarse textured soils.</p>', '<p>L\'eau s\'écoule du sol un peu plus lentement qu\'elle n\'y pénètre.  Le surplus d\'eau s\'écoule un peu lentement à cause de la faible perméabilité, de la surface de saturation élevée, du faible gradient ou d¿une combinaison de ces facteurs.  Les sols ont une capacité de teneur en eau de l¿intermédiaire à élevée (5-6 cm) dans la section contrôlée et sont à texture moyenne à fine.  La source d\'eau dominante est la précipitation dans les sols à texture moyenne à fine.  Dans les sols à texture grossière, des volumes importants d\'écoulement souterrain s\'ajoutent aux précipitations.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/drainage.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/drainage.html', 4, NULL, NULL, NULL),
	(278, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/drainage', 'drainage', 'none', 'I', 'false', '33CCCC', 'Imperfectly drained', 'Drainage imparfait', '<p>Water is removed from the soil sufficiently slowly in relation to supply, to keep the soil wet for a significant part of the growing season. Excess water moves slowly downward if precipitation is the major supply. If subsurface water or groundwater, or both, is the main source, the flow rate may vary but the soil remains wet for a significant part of the growing season. Precipitation is the main source if available water storage capacity is high; contribution by subsurface flow or groundwater flow, or both, increases as available water storage capacity decreases. Soils have a wide range in available water supply, texture, and depth, and are gleyed phases of well drained subgroups.</p>', '<p>L\'eau s\'écoule du sol suffisamment lentement par rapport à l\'apport d\'eau pour que le sol reste humide durant une grande partie de la saison de croissance.  Le surplus d\'eau descend lentement vers le bas là où les précipitations constituent le principal apport.  Dans les cas où les eaux souterraines ou sub-superficielles, ou les deux, constituent la principale source, le taux d\'écoulement peut varier, mais le sol demeure humide durant une importante partie de la saison de croissance.  La source principale est la précipitation quand la capacité est élevée en teneur d¿eau. La contribution d\'écoulement superficiel ou souterrain, ou les deux, augmente à chaque fois que la capacitée de teneur en eau disponible diminue. Les sols ont une grande capacitée en provision d\'eau, texture et profondeur, et ont des phases gleyifié de sous-groupe à drainage bon.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/drainage.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/drainage.html', 5, NULL, NULL, NULL),
	(279, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/drainage', 'drainage', 'none', 'P', 'false', '336699', 'Poorly drained', 'Drainage pauvre', '<p>Water is removed so slowly in relation to supply that the soil remains wet for a comparatively large part of the time the soil is not frozen. Excess water is evident in the soil for a large part of the time. Subsurface flow or groundwater flow, or both, in addition to precipitation are the main water sources; there may also be a perched water table, with precipitation exceeding evapotranspiration. Soils have a wide range in available water storage capacity, texture, and depth, and are gleyed subgroups, Gleysols, and Organic soils.</p>', '<p>Étant donné que l\'eau s\'écoule beaucoup plus lentement qu\'elle y est apportée, le sol demeure humide durant une grande partie de la période où le sol n\'est pas gelé.  Il y a la plupart du temps un surplus d\'eau dans le sol.  L\'écoulement superficiel ou souterrain, ou les deux, s\'ajoute aux précipitations comme principale source d\'eau ; il peut y avoir aussi une nappe d\'eau perchée, quand les précipitations sont plus importantes que l\'évapotranspiration. La capacité de rétention d\'eau, la texture et la profondeur des sols varient fortement. Ces sols appartiennent aux sous-groupe gleyifiés, aux gleysols ou aux sols organiques.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/drainage.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/drainage.html', 6, NULL, NULL, NULL),
	(280, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/drainage', 'drainage', 'none', 'VP', 'false', '9966FF', 'Very poorly drained', 'Drainage très pauvre', '<p>Water is removed from the soil so slowly that the water table remains at or on the surface for the greater part of the time the soil is not frozen. Excess water is present in the soil for the greater part of the time. Groundwater flow and subsurface flow are the major water sources. Precipitation is less important except where there is a perched water table with precipitation exceeding evapotranspiration. Soils have a wide range in available water storage capacity, texture, and depth, and are either Gleysolic or Organic.</p>', '<p>L\'eau s\'écoule tellement lentement que la surface de saturation affleure à la surface durant une large partie de la période où le sol n\'est pas gelé.  L\'excès d\'eau est présente dans le sol durant une grande partie du temps.  L\'écoulement de la nappe souterraine et l\'écoulement souterrain constituent les principales sources d\'eau.  Les précipitations jouent un rôle moins important, sauf là où il y a une nappe d\'eau perchée et où les précipitations excèdent l\'évapotranspiration. La capacité de rétention d\'eau, la texture et la profondeur de ces sols varient fortement et ces derniers sont gleysoliques ou organiques.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/drainage.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/drainage.html', 7, NULL, NULL, NULL),
	(281, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/drainage', 'drainage', 'none', '-', 'true', 'CCCCCC', 'Not applicable', 'Ne s\'applique pas', '<p>Drainage not applicable (rock, ice, etc)</p>', '<p>Drainage ne s\'applique pas (roche, glace, etc)</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/drainage.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/drainage.html', 8, NULL, NULL, NULL),
	(282, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/order3', 'order3', 'none', 'BR', 'false', 'd48a6a', 'Brunisolic', 'Brunisolique', '<p>Brunisolic</p>', '<p>Brunisolique</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/order3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/order3.html', 1, NULL, '2012-11-27 16:29:24', NULL),
	(283, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/order3', 'order3', 'none', 'CH', 'false', 'f7bf54', 'Chernozemic', 'Chernozémique', '<p>Chernozemic</p>', '<p>Chernozémique</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/order3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/order3.html', 2, NULL, '2012-11-27 16:34:42', NULL),
	(284, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/order3', 'order3', 'none', 'CY', 'false', 'd4ffff', 'Cryosolic', 'Cryosolique', '<p>Cryosolic</p>', '<p>Cryosolique</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/order3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/order3.html', 3, NULL, '2012-11-27 16:33:07', NULL),
	(285, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/order3', 'order3', 'none', 'GL', 'false', 'af92c2', 'Gleysolic', 'Gleysolique', '<p>Gleysolic</p>', '<p>Gleysolique</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/order3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/order3.html', 4, NULL, '2012-11-27 16:30:04', NULL),
	(286, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/order3', 'order3', 'none', 'LU', 'false', '98c37a', 'Luvisolic', 'Luvisolique', '<p>Luvisolic</p>', '<p>Luvisolique</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/order3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/order3.html', 5, NULL, '2012-11-27 16:30:29', NULL),
	(287, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/order3', 'order3', 'none', 'OR', 'false', 'e9758f', 'Organic', 'Organique', '<p>Organic</p>', '<p>Organique</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/order3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/order3.html', 6, NULL, '2012-11-27 16:30:48', NULL),
	(288, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/order3', 'order3', 'none', 'PZ', 'false', '0099ff', 'Podzolic', 'Podzolique', '<p>Podzolic</p>', '<p>Podzolique</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/order3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/order3.html', 7, NULL, '2012-11-27 16:21:45', NULL),
	(289, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/order3', 'order3', 'none', 'RG', 'false', '878787', 'Regosolic', 'Régosolique', '<p>Regosolic</p>', '<p>Régosolique</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/order3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/order3.html', 8, NULL, '2012-11-27 16:22:46', NULL),
	(290, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/order3', 'order3', 'none', 'SZ', 'false', 'f9a08e', 'Solonetzic ', 'Solonetzique', '<p>Solonetzic </p>', '<p>Solonetzique</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/order3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/order3.html', 9, NULL, '2012-11-27 16:36:09', NULL),
	(291, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/order3', 'order3', 'none', 'VE', 'false', 'b87ef7', 'Vertisolic ', 'Vertisolique', '<p>Vertisolic </p>', '<p>Vertisolique</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/order3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/order3.html', 10, NULL, '2012-11-27 16:36:50', NULL),
	(292, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/order3', 'order3', 'none', '-', 'true', 'ffffff', 'Not applicable', 'Ne s\'applique pas', '<p>Not applicable</p>', '<p>Ne s\'applique pas</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/order3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/order3.html', 11, NULL, '2012-11-27 16:37:36', NULL),
	(293, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/s_group3', 's_group3', 'V', 'GLC', 'false', '', 'Gleysolic Vertisol ', 'Vertisol gleysolique   ', '<p>Gleysolic Vertisol </p>', '<p>Vertisol gleysolique   </p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/s_group3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/s_group3.html', 1303, NULL, NULL, NULL),
	(294, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/s_group3', 's_group3', 'HV', 'O', 'false', '', 'Orthic Humic Vertisol ', 'Vertisol humique orthique  ', '<p>Orthic Humic Vertisol </p>', '<p>Vertisol humique orthique  </p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/s_group3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/s_group3.html', 1304, NULL, NULL, NULL),
	(295, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/s_group3', 's_group3', 'HV', 'GL', 'false', '', 'Gleyed Humic Vertisol ', 'Vertisol humique gleyifié  ', '<p>Gleyed Humic Vertisol </p>', '<p>Vertisol humique gleyifié  </p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/s_group3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/s_group3.html', 1305, NULL, NULL, NULL),
	(296, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/s_group3', 's_group3', 'HV', 'GLC', 'false', '', 'Gleysolic Humic Vertisol ', 'Vertisol humique gleysolique  ', '<p>Gleysolic Humic Vertisol </p>', '<p>Vertisol humique gleysolique  </p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/s_group3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/s_group3.html', 1306, NULL, NULL, NULL),
	(297, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/s_group3', 's_group3', '-', '-', 'true', '', 'Not Applicable', 'Ne s\'applique pas  ', '<p>Not Applicable</p>', '<p>Ne s\'applique pas  </p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/s_group3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/s_group3.html', 99999, NULL, NULL, NULL),
	(298, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', 'mdep', 'deposit', 'ANTH', 'false', '', 'Anthropogenic', 'Matériaux anthropiques', '<p>Materials modified by people,including those associated with mineral exploitation and waste disposal. They include materials deposited as a result of human activities or geological materials modified artificially so that their physical properties (structure, cohesion, compaction) have been drastically altered. Examples are areas of landfill, spoil heaps, open-pit mines and levelled irrigated areas.</p>', '<p>Matériaux modifiés par l\'homme, y compris ceux qui sont associés à l\'exploitation minière et à l\'élimination des déchets; ils comprennent les accumulations de matériaux qui proviennent de l\'activité humaine et les matériaux géologiques modifiés artificiellement de telle sorte que leurs propriétés physiques (structure, cohésion, compaction) ont été considérablement altérées; ex., décharges, tas de déblais, mines à ciel ouvert, zones nivelées et irriguées.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/mdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/mdep.html', 1, NULL, '2012-03-19 18:02:01', NULL),
	(299, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', 'mdep', 'deposit', 'COLL', 'false', '', 'Colluvial', 'Colluvial', '<p>Massive to moderately-well stratified, nonsorted to poorly sorted sediments with any range of particle sizes from clay to boulders that have reached their present position only by direct, gravity-induced movement. Processes include slow displacements such as creep and solifluction and rapid movements such as earth flows.</p>', '<p>Sédiments massifs à moyennement bien stratifiés, non triés à mal triés, à granulométrie variable (des argiles ou blocs qui ont atteint leur position actuelle par mouvement direct engendré par la gravité); il y a des déplacements lents comme le creep et la solifluction ainsi que des mouvements rapides comme les coulées boueuses.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/mdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/mdep.html', 2, NULL, '2015-06-29 14:11:41', 'schutp'),
	(300, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', 'mdep', 'deposit', 'EOLI', 'false', '', 'Eolian', 'Éolien', '<p>Eolian material deposited by wind: uniform deposit of very fine sand and silt.</p>', '<p>Matériaux éoliens déposés par le vent : dépôts uniformes de sable très fin et de limon.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/mdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/mdep.html', 3, NULL, '2012-03-19 17:38:48', NULL),
	(301, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', 'mdep', 'deposit', 'FLEO', 'false', '', 'Fluvioeolian', 'Fluvio-éolien', '<p>Fluvioeolian</p>', '<p>Fluvio-éolien</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/mdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/mdep.html', 4, NULL, NULL, NULL),
	(302, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', 'mdep', 'deposit', 'FLLC', 'false', '', 'Fluviolacustrine', 'Fluvio-lacustre', '<p>Fluviolacustrine</p>', '<p>Fluvio-lacustre</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/mdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/mdep.html', 5, NULL, NULL, NULL),
	(303, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', 'mdep', 'deposit', 'FLUV', 'false', '', 'Fluvial', 'Fluviatile', '<p>These sediments generally consist of gravel and sand with a minor fraction of silt and rarely of clay. The gravels are typically rounded and contain interstitial sand.</p>', '<p>Ces sédiments sont généralement composés de gravier et de sable, avec une faible proportion de limon et rarement d\'argile. Les graviers sont typiquement arrondis et les interstices sont remplis de sable.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/mdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/mdep.html', 6, NULL, '2012-03-19 18:32:36', NULL),
	(304, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', 'mdep', 'deposit', 'FNPT', 'false', '', 'Fen Peat', 'Tourbe de carex', '<p>These deposits consist of sedge peat derived primarily from sedges with inclusions of partially decayed stems of shrubs formed in a eutrophic environment due to the close association of the material with mineral-rich waters.</p>', '<p>Ces dépôts consistent en tourbe de carex, dérivé principalement de carex avec des inclusions de tiges d\'arbustes partiellement décomposées, formés dans un environnement eutrophique dû à l\'intime association du matériau avec des eaux riches en minéraux.</p>\r\n', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/mdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/mdep.html', 7, NULL, '2012-03-19 18:35:59', NULL),
	(305, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', 'mdep', 'deposit', 'FOPT', 'false', '', 'Forest Peat', 'Tourbe de forêt    ', '<p>This class is used for forest peatcovered or forest peat-filled areas where the water table is at or above the peat surface. The dominant peat materials are shallow to deep mesic to humic forest and fen peat formed in a eutrophic environment resulting from strong water movement from the margins or other mineral sources.</p>\r\n', '<p>Cette classe est utilisée pour les étendues recouvertes de tourbe forestière ou remplies de tourbe forestière avec une nappe phréatique à la surface ou au-dessus de la surface de la tourbe. Les matériaux tourbeux dominants sont des tourbes de forêt ou de fen mésiques à humiques qui sont minces à profonds, et qui ont été formés dans un environnement eutrophique résultant d\'un fort écoulement des eaux provenant du pourtour ou d\'autres sources minérales.</p>   ', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/mdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/mdep.html', 8, NULL, '2012-03-19 18:38:09', NULL),
	(306, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', 'mdep', 'deposit', 'GLFL', 'false', '', 'Glaciofluvial', 'Glacio-fluviatile', '<p>Material moved by glaciers and subsequently sorted and deposited by streams flowing from the melting ice. The deposits are stratified and may occur in the form of outwash plains, deltas, kames eskers, and kame terraces. See also glacial drift and till.</p>', '<p>Detris transportés par les glaciers, puis triés et déposés par les cours d\'eau de fonte. Les dépôts sont stratifiés et se présentent sous forme de plaines d\'épandage fluvio glaciaire, de deltas, de kames, d\'eskers et de terrasses de harne. Voir aussi drift glaciare et till.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/mdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/mdep.html', 9, NULL, '2012-03-19 18:16:30', NULL),
	(307, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', 'mdep', 'deposit', 'GLLC', 'false', '', 'Glaciolacustrine', 'Glacio-lacustre', '<p>Used where there is evidence that the lacustrine materials were deposited in contact with glacial ice. One of the following characteristics must be present:\r\n<ul>\r\n<li>kettles or an otherwise irregular surface that is neither simply the result of normal settling and compaction in silt nor the result of piping</li>\r\n<li>slump structures resulting from loss of support caused by melting of retaining ice</li>\r\n<li>presence of numerous ice-rafted stones in the lacustrine silts.</li>\r\n</ul>\r\n</p>', '<p>Utiliser là où il est clair que les matériaux lacustres ont été déposés au contact d\'un glacier. Une des caractéristiques suivantes doit être présente : \r\n<ul>\r\n<li>Des kettles ou une surface par ailleurs irrégulière qui n\'est pas simplement le résultat de tassement et de compactage normaux dans le limon, ni le résultat de chenaux d\'écoulement\r\nsouterrain.</li>\r\n<li>Des structures d\'affaissement résultant de la perte de support due à la fonte du support de glace.</li>\r\n<li>La présence de nombreux blocs glaciels (pierres transportées par la glace flottante) dans les limons lacustres.</li>\r\n</ul></p>\r\n', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/mdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/mdep.html', 10, NULL, '2012-03-19 18:44:26', NULL),
	(308, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', 'mdep', 'deposit', 'GLMA', 'false', '', 'Glaciomarine', 'Glacio-marin', '<p>Glaciomarine</p>', '<p>Glacio-marin</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/mdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/mdep.html', 11, NULL, '2014-10-08 22:42:21', 'schutp'),
	(309, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', 'mdep', 'deposit', 'LACU', 'false', '', 'Lacustrine', 'Sédiments lacustres', '<p>Sediment, generally consisting of either stratified fine sand, silt, and clay deposited on the lake bed, or moderately-well sorted, stratified sand and coarse materials that consist of near lake shore or beach deposits. These materials have either settled from suspension in bodies of standing fresh water or accumulated at their margins through wave action.</p>', '<p>Sédiment composé généralement d\'argile, de limon et de sable fin stratifiés et déposés au fond du lac ou de sable stratifié et moyennement bien trié et de matériaux plus grossiers qui ont été transportés et déposés par les vagues sur la plage ou dans la zone littorale; il s\'agit de matériaux en suspension qui ont été déposés dans des masses d\'eau douce ou se sont accumulés à leurs marges sous l\'effet des vagues; ex., sédiments lacustres et plages.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/mdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/mdep.html', 12, NULL, '2012-03-19 17:47:44', NULL),
	(310, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', 'mdep', 'deposit', 'LATL', 'false', '', 'Lacustro-Till', 'Till lacustre', '<p>Lacustro-Till</p>', '<p>Till lacustre</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/mdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/mdep.html', 13, NULL, NULL, NULL),
	(311, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', 'mdep', 'deposit', 'MARI', 'false', '', 'Marine', 'Dépôts marins', '<p>Unconsolidated deposits of clay, silt, sand, or gravel that are well to moderately well sorted and well to moderately well stratified (in some places containing shells). The deposits have settled from suspension in salt or brackish water bodies or have accumulated at their margins through shoreline processes such as wave action and longshore drift. Nonfossiliferous deposits may be judged marine if they are located in an area that may reasonably be considered to have contained salt water at the time the deposits were formed.</p>', '<p>Dépôts non consolidés d\'argile, de limon, de sable ou de gravier, bien à moyennement bien triés et bien à moyennement bien stratifiés (renfermant par endroits des coquillages); ces matériaux d\'abord en suspension, se sont déposés dans des masses d\'eau salée ou saumâtre ou se sont accumulés à la lisière de celles-ci sous l\'effet de phénomènes littoraux comme l\'action des vagues et de la dérive littorale; les dépôts non fossilifères peuvent être considérés comme des dépôts marins s\'ils sont situés en un endroit que l\'on peut raisonnablement considérer comme ayant été recouvert d\'eau salée à l\'époque où ces dépôts se sont formés.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/mdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/mdep.html', 14, NULL, '2012-03-19 17:56:21', NULL),
	(312, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', 'mdep', 'deposit', 'RESD', 'false', '', 'Residual', 'Sédiments résiduels', '<p>Unconsolidated, weathered, or partly weathered mineral soil material that accumulates by in situ disintegration of bedrock.</p>', '<p>Matériau de sol minéral non consolidé, météorisé ou partiellement altéré qui s\'accumule par désintégration sur place du substratum rocheux.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/mdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/mdep.html', 15, NULL, '2012-03-19 17:58:23', NULL),
	(313, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', 'mdep', 'deposit', 'SAPR', 'false', '', 'Saprolite', 'Saprolithe', '<p>This material is rock and contains a high proportion of residual silts and clays formed by alteration, chiefly by chemical weathering.</p>\r\n\r\n<p>The rock remains in a coherent state, interstitial grain relationships are undisturbed, and no downhill movement due to gravity has occurred. The process is assumed to be active.\r\nExamples: rotten rock containing corestones.</p>', '<p>Ce matériau consiste en roc altéré et contient une forte proportion de limons et d\'argiles résiduels, formés par altération, principalement par l\'altération chimique.</p>\r\n\r\n<p>Le roc demeure dans un état cohérent, la relation entre les grains n\'est pas dérangée et aucun mouvement par gravité n\'apparaît. Le processus est présumé être à actif.\r\nExemple: roche pourrie à noyaux de pierre.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/mdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/mdep.html', 16, NULL, '2012-03-19 18:53:02', NULL),
	(314, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', 'mdep', 'deposit', 'SEPT', 'false', '', 'Sedimentary Peat', 'Tourbe sédimentaire', '<p>Coprogenous earth is composed of aquatic plant debris modified by aquatic animals. It makes slightly viscous water suspensions and is slightly plastic but not sticky. The material shrinks upon drying to form clods that are difficult to rewet and commonly crack along horizontal planes. It has very few or no plant fragments recognizable to the naked eye, a pyrophosphate index of 5 or more, and a dry color value of less than 5.</p>', '<p>La terre coprogène est composée de débris de plantes aquatiques modifiées par des animaux aquatiques. En suspension aqueuse, elle devient légèrement visqueuse; elle est plastique mais non collante; elle se rétracte au séchage pour former des mottes difficiles à réhumidifier et qui ont souvent tendance à se fissurer le long de plans horizontaux. Elle a peu ou pas de fragments végétaux identifiables à l\'oeil nu, un indice au pyrophosphate de 5 ou plus et une luminosité de couleur inférieure à 5 à l\'état sec.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/mdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/mdep.html', 17, NULL, '2012-03-19 19:00:03', NULL),
	(315, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', 'mdep', 'deposit', 'SPPT', 'false', '', 'Sphagnum Peat', 'Tourbe de sphaigne', '<p>These deposits consist of sphagnum or forest peat formed in an ombrotrophic environment caused by the slightly elevated nature of the bog. They tend to be disassociated from nutrient-rich ground water or surrounding mineral soils.</p>', '<p>Ces dépôts consistent en tourbe de sphaigne ou de forêt, formé sous un environnement ombrotrophique dû à la nature légèrement surélevée de la tourbière. Elles sont souvent dissociées de la nappe phréatique riche en éléments nutritifs ou des sols minéraux environnants.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/mdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/mdep.html', 18, NULL, '2012-03-19 19:07:16', NULL),
	(316, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', 'mdep', 'deposit', 'TILL', 'false', '', 'Till (Morainal)', 'Till (morainique)', '<p>Morainal material (till) deposited by glacial ice: a mixture of boulders, sand, silt, and clay.</p>', '<p>Moraine (till) déposée par la glace de l\'ère glaciaire : mélange de blocs, de sable, de limon et d\'argile.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/mdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/mdep.html', 19, NULL, '2012-03-19 17:44:04', NULL),
	(317, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', 'mdep', 'deposit', 'UNDM', 'false', '', 'Undifferentiated mineral', 'Minéral non différencié', '<p>A sequence of more than three types of genetic mineral materials outcropping on a steep erosional escarpment. This complex class is to be used where units relating to individual genetic materials cannot be delimited separately at the scale of mapping. It may include colluvium derived from the various genetic materials and resting upon the scarp slope.</p>', '<p>Série de plus de trois types de matériaux minéraux génétiques qui affleurent sur un escarpement d\'érosion; cette classe complexe doit être utilisée dans les cas où les unités se rapportant aux matériaux génétiques individuels ne peuvent être délimitées séparément à cause de l\'échelle utilisée; ces matériaux comportent le colluvion qui provient de divers matériaux génétiques et qui repose sur la pente de l\'escarpement.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/mdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/mdep.html', 20, NULL, '2012-03-19 17:53:57', NULL),
	(318, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/mdep', 'mdep', 'deposit', 'UNDO', 'false', '', 'Undifferentiated organic', 'Organique non différencié', '<p>A layered sequence of more than three undifferentiated types of organic material (>30% organic matter by weight).</p>', '<p>Série de couches comportant plus de trois types de matériaux organiques (>30 % de matière organique en poids).</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/mdep.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/mdep.html', 21, NULL, '2012-03-19 17:50:21', NULL),
	(319, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/s_group3', 's_group3', 'SC', 'BRD', 'false', '', 'Brunisolic Dystric Static Cryosol', 'Cryosol statique dystrique brunisolique ', '<p>Brunisolic Dystric Static Cryosol</p>', '<p>Cryosol statique dystrique brunisolique </p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/s_group3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/s_group3.html', 613, NULL, NULL, NULL),
	(320, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/s_group3', 's_group3', 'SC', 'L', 'false', '', 'Luvisolic Static Cryosol', 'Cryosol statique luvisolique  ', '<p>Luvisolic Static Cryosol</p>', '<p>Cryosol statique luvisolique  </p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/s_group3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/s_group3.html', 614, NULL, NULL, NULL),
	(321, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/s_group3', 's_group3', 'SC', 'R', 'false', '', 'Regosolic Static Cryosol ', 'Cryosol statique régosolique  ', '<p>Regosolic Static Cryosol </p>', '<p>Cryosol statique régosolique  </p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/s_group3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/s_group3.html', 615, NULL, NULL, NULL),
	(322, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/s_group3', 's_group3', 'SC', 'GL', 'false', '', 'Gleysolic Static Cryosol ', 'Cryosol statique gleysolique  ', '<p>Gleysolic Static Cryosol </p>', '<p>Cryosol statique gleysolique  </p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/s_group3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/s_group3.html', 616, NULL, NULL, NULL),
	(323, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/s_group3', 's_group3', 'SC', 'HE', 'false', '', 'Histic Eutric Static Cryosol', 'Cryosol statique eutrique histique ', '<p>Histic Eutric Static Cryosol</p>', '<p>Cryosol statique eutrique histique </p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/s_group3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/s_group3.html', 617, NULL, NULL, NULL),
	(324, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/s_group3', 's_group3', 'SC', 'HD', 'false', '', 'Histic Dystric Static Cryosol', 'Cryosol statique dystrique histique ', '<p>Histic Dystric Static Cryosol</p>', '<p>Cryosol statique dystrique histique </p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/s_group3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/s_group3.html', 618, NULL, NULL, NULL),
	(325, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/s_group3', 's_group3', 'SC', 'HR', 'false', '', 'Histic Regosolic Static Cryosol ', 'Cryosol statique régosolique histique ', '<p>Histic Regosolic Static Cryosol </p>', '<p>Cryosol statique régosolique histique </p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/s_group3.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/s_group3.html', 619, NULL, NULL, NULL),
