	(495, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/awhc', 'awhc', 'none', '4', 'false', '00ff00', '150 - 199 mm', '150 - 199 mm', '<p>Available Water Holding Capacity of 150 - 199 mm.</p>', '<p>L\'eau disponible du sol de retention de la classe de capacité de 150 - 199 mm.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/awhc.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/awhc.html', 4, NULL, '2012-11-27 18:22:15', NULL),
	(496, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/awhc', 'awhc', 'none', '5', 'false', '00bf00', '200 - 250 mm', '200 - 250 mm', '<p>Available Water Holding Capacity of 200 - 250 mm.</p>', '<p>L\'eau disponible du sol de retention de la classe de capacité de 200 - 250 mm.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/awhc.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/awhc.html', 5, NULL, '2012-11-27 18:21:54', NULL),
	(497, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/awhc', 'awhc', 'none', '6', 'true', 'f9a08e', 'Solonetzic or saline soils', 'Solonetziques ou sols salin', '<p>Not applicable - solonetzic or saline soils.</p>', '<p>Ne s\'applique pas - solonetziques ou sols salin.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/awhc.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/awhc.html', 6, NULL, '2013-11-04 16:50:07', NULL),
	(498, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/landcover/landcover', 'landcover', 'none', '7', 'false', 'ffaaaa', 'Sparsely Vegetated/Barren Land', 'Végétation clairsemée/terre stérile', '<p>Sparsely Vegetated/Barren Land: plant cover generally < 25%</p>', '<p>Végétation clairsemée/terre stérile : zone où la couverture végétale est généralement clairsemée (moins de 25% du terrain)</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/landcover/landcover.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/landcover/landcover.html', 7, NULL, '2012-07-17 13:55:01', NULL),
	(499, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/landcover/landcover', 'landcover', 'none', '8', 'false', 'ffffff', 'Perennial Snow or Ice', 'Glace ou neige pérenne', '<p>Perennial Snow or Ice: perennial snowfields or glaciers</p>', '<p>Glace ou neige pérenne : glaciers et champs de neige pérennes.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/landcover/landcover.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/landcover/landcover.html', 8, NULL, '2012-07-17 13:45:29', NULL),
	(500, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/landcover/landcover', 'landcover', 'none', '9', 'false', '7f4815', 'Cropland: cultivated land', 'Terre en culture', '<p>Cropland: cultivated land</p>', '<p>Terre en culture : terres cultivées</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/landcover/landcover.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/landcover/landcover.html', 9, NULL, '2012-07-17 13:59:06', NULL),
	(501, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/landcover/landcover', 'landcover', 'none', '10', 'false', 'ffff56', 'Rangeland and Pasture', 'Terrain de parcours et pâturage', '<p>Rangeland and Pasture: native vegetation with < 10% tree cover</p>', '<p>Terrain de parcours et pâturage : terrain comportant une végétation indigène, mais où la couverture d\'arbres est inférieure à 10 %</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/landcover/landcover.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/landcover/landcover.html', 10, NULL, '2012-07-17 13:58:08', NULL),
	(502, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/landcover/landcover', 'landcover', 'none', '11', 'false', '999999', 'Built-up Area', 'Zone bâtie', '<p>Built-up Area: Cities and towns</p>', '<p>Zone bâtie : villes et villages</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/landcover/landcover.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/landcover/landcover.html', 11, NULL, '2012-07-17 13:46:23', NULL),
	(503, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/landform/landform', 'landform', 'none', 'B', 'false', 'b58da0', 'Plateau (or Tableland)', 'Dominée par des hauts plateaux', '<p>Comparatively flat areas of great extent commonly bounded on at least one side by an abrupt escarpment, or may be terminated by mountains; may be dissected by deep valleys and deeply incised rivers; may be tectonic, erosional, or volcanic in origin; may be step-faulted; slopes generally < 10%, in some places 10-15%; relief generally < 50 m.</p>', '<p>Région très étendue relativement plane, généralement bornée, tout au moins d\'un côté, par un escarpement ou des montagnes; peut être disséquée par des vallées profondes et des rivières profondément encaissées; peut avoir une origine tectonique, érosive ou volcanique; peut comporter des failles en escalier; les pentes sont généralement < 10 %, par endroit 10-15 %; la variation du relief est généralement < 50 m.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/landform/landform.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/landform/landform.html', 4, NULL, '2012-07-17 14:06:34', NULL),
	(504, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/landform/landform', 'landform', 'none', 'H', 'false', 'ff7f00', 'Hilland', 'Dominée par des collines', '<p>Natural elevations rising prominently above the surrounding plain and having a recognizably denser pattern of generally higher knolls or crest lines with an irregular or chaotic surface form composed of upper surface convexity and lower concavity; includes hummocky morainal material, volcanic cones, and conical hills or lava; slopes generally 10 - 30%; relief generally < 100 m.</p>', '<p>Relief naturel s\'élevant au-dessus de la plaine avoisinante et présentant des crêtes ou des monticules légèrement plus élevés à surface irrégulière ou chaotique composée de convexités et de concavités; comprend les moraines mamelonnées, les cônes volcaniques et les collines coniques de lave; les pentes varient généralement de 10 à 30 %; la variation du relief est généralement < 100 m.</p> ', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/landform/landform.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/landform/landform.html', 6, NULL, '2012-07-17 14:04:18', NULL),
	(505, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/landform/landform', 'landform', 'none', 'M', 'false', 'ff5656', 'Mountain', 'Dominée par des montagnes', '<p>Erosional and volcanic landscapes with relief (vertical distance between higher and lower parts)>=300 m with most of the area comprising valley to summit terrain; slopes generally >30%. In general the terrain has a restricted summit area and steep sides, irregular shape and considerable bare rock surface, or very thin soil cover; occur as a single, isolated feature or in a group forming a long chain or range; major scarps are relatively steep and straight cliff-like slopes of considerable linear extent separating surfaces such as plateaus lying at different levels.</p>', '<p>Formes érosives ou volcaniques à relief (distance verticale entre les portions les plus basses et les plus élevées) >=300 m, la majeure partie de la zone étant constituée par le terrain situé entre la vallée et le sommet; les pentes sont généralement > 30 %. En général, le terrain comporte un sommet étroit et des versants abrupts, est de forme irrégulière et présente des affleurements rocheux considérables ou une couverture de sols très mince; se rencontre en relief isolé ou se présente en groupe formant une chaîne de montagnes; les principaux escarpements sont relativement marqués et de longs versants rectilignes ressemblent à des falaises qui séparent des surfaces comme des plateaux à différentes altitudes.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/landform/landform.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/landform/landform.html', 7, NULL, '2012-07-17 14:03:39', NULL),
	(506, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/landform/landform', 'landform', 'none', 'O', 'false', '83a2c1', 'Organic Wetland', 'Dominée par des terres organiques humides', '<p>Areas dominated by organic material > 40 cm thick; contains > 30% organic matter by weight; occurs in a variety of wetland surface forms.</p>', '<p>Superficies dominées par des matériaux organiques > 40 cm d\'épaisseur; renferme > 30 % de matière organique en poids; adopte une diversité de modelés de surface de terres humides.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/landform/landform.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/landform/landform.html', 1, NULL, '2012-07-17 14:02:52', NULL),
	(507, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/landform/landform', 'landform', 'none', 'P', 'false', 'aaff56', 'Plain', 'Dominée par des plaines', '<p>Flat to very gently undulating areas having few or no prominent irregularities; formed by erosional or by depositional (or constructional) processes; include broad continuous, gently sloping piedmont plains extending along and from the base of a mountain, formed by lateral coalescence of a series of separate but confluent alluvial fans; alluvial processes are mainly responsible for the sedimentation; coarse fragments are rounded by transport over relatively long distances; slopes generally < 6% relief generally < 10 m; extent generally > 5 km in one direction.</p>', '<p>Superficie plane ou très légèrement ondulée n\'ayant aucune irrégularité proéminente, ou très peu; formée par des processus d\'érosion ou d\'accumulation (ou de sédimentation); comporte de grandes plaines de piémont à pente douce qui entourent la base des montagnes, formées par la coalescence latérale d\'une série de cônes alluviaux distincts mais confluents; la sédimentation est essentiellement le fait des phénomènes alluviaux; les fragments grossiers sont arrondis par le transport sur des distances relativement longues; les pentes sont généralement < 6 %; la variation du relief est généralement < 10 m; l\'étendue est généralement > 5 km dans une même direction.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/landform/landform.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/landform/landform.html', 2, NULL, '2012-07-17 14:05:48', NULL),
	(508, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/landform/landform', 'landform', 'none', 'S', 'false', 'ffd4aa', 'Scarp', 'Dominée par des escarpements', '<p>An escarpment, cliff, or steep slope of some extent along the margin of a terrace, bench, plateau, hill, or mesa; a scarp may be of any height.</p> ', '<p>Escarpement, falaise ou versant abrupt d\'une certaine étendue en bordure d\'une terrasse, d\'un replat, d\'un plateau, d\'une colline ou d\'une mesa; aucune hauteur n\'est précisée.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/landform/landform.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/landform/landform.html', 5, NULL, '2012-07-17 14:04:31', NULL),
	(509, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/landform/landform', 'landform', 'none', 'V', 'false', '349b34', 'Valley', 'Dominée par des vallées', '<p>Terrain dominated by major spillways, drainage ways, or mountain trenches separated from surrounding landforms by a significant and abrupt break in slope; the valley profile may be V- or U-shaped with an extensive valley floor and flood plain up to about 5 km wide; valley profile may also include eroded terraces and their irregular slope segments.</p>', '<p>Terrain dominé par d\'importants déversoirs, réseaux de drainage ou tranchées montagneuses séparées des reliefs avoisinants par une importante rupture abrupte de pente; le profil de la vallée peut être en V ou en U, le fond de la vallée étant large, et la plaine d\'inondation peut atteindre environ 5 km de largeur; le profil de la vallée peut également comporter des terrasses d\'érosion accompagnées de segments irréguliers de pentes.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/landform/landform.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/landform/landform.html', 3, NULL, '2012-07-17 14:06:24', NULL),
	(510, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surface_form/surface', 'surface', 'mineral', 'D', 'false', 'cccc99', 'Dissected', 'Disséqué', '<p>A dissected (or gullied) pattern providing external drainage for an area.</p>', '<p>Terrain disséqué (ou raviné) assurant un drainage vers l\'extérieur d\'une zone donnée.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/surface.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/surface.html', 1, NULL, '2013-12-03 21:51:14', NULL),
	(511, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surface_form/surface', 'surface', 'mineral', 'H', 'false', 'ff7f00', 'Hummocky (or irregular)', 'Moutonné (ou irrégulier)', '<p>A very complex sequence of slopes extending from somewhat rounded concavities (or swales) of various sizes to irregular conical knolls (or knobs) and short discontinuous ridges; there is a general lack of concordance between knolls and swales. Slopes are generally 4-70%. Examples are hummocky moraines and hummocky fluvioglacial landforms.</p>', '<p>Suite très complexe de pentes dont les sommets varient de concavités légèrement arrondies (ou dépressions) de diverses tailles à des collines irrégulières (ou buttes) et à de courtes crêtes discontinues; il y a généralement manque de concordance entre les creux et les bosses; les pentes varient généralement de 4-70 %. Exemples : moraines et dépôts fluvio-glaciaires mamelonnés.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/surface.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/surface.html', 2, NULL, '2013-12-03 21:55:24', NULL),
	(512, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surface_form/surface', 'surface', 'mineral', 'I', 'false', '74e074', 'Inclined', 'Incliné', '<p>A sloping, unidirectional surface with a generally constant slope unbroken by marked irregularity or gullies; a weakly developed dissected pattern provides external drainage for the local area. Slopes are 2-70%; the form of inclined slopes is not related to the initial mode of origin of the underlying material.</p>', '<p>Surface unidirectionnelle à pente généralement constante, non brisée par des ravins ou des irrégularités marquées; terrain peu marqué, permettant le drainage vers l\'extérieur de la zone; les pentes varient de 2-70 %; la forme des versants n\'est pas liée à l\'origine du matériau sous-jacent.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/surface.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/surface.html', 3, NULL, '2013-12-03 21:56:23', NULL),
	(513, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surface_form/surface', 'surface', 'mineral', 'L', 'false', ' 50bf5', 'Level', 'Plat', '<p>A flat or very gently sloping, unidirectional surface with a generally constant slope unbroken by marked elevations and depressions. Slopes are generally < 2%. Examples are floodplains and lake plains.</p>', '<p>Surface unidirectionnelle plane ou légèrement en pente à inclinaison généralement constante, non brisée par des élévations et des dépressions marquées; les pentes sont généralement < 2 %. Exemples : plaines inondables, plaines lacustres.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/surface.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/surface.html', 4, NULL, '2013-12-03 21:55:56', NULL),
	(514, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surface_form/surface', 'surface', 'mineral', 'O', 'false', '99cc00', 'Rolling', 'Vallonné', '<p>A very regular sequence of moderate slopes extending from rounded and, in some places, confined concave depressions to broad, rounded convexities producing a wavelike pattern of moderate relief. Slope gradients are generally > 5% but may be less. The underlying bedrock usually controls this surface form.</p>', '<p>Séquence très régulière de pentes moyennes qui s\'étirent entre des dépressions arrondies et, par endroits, confinées et concaves, et de larges convexités arrondies, ce qui confère au paysage une allure de vagues de hauteur moyenne; les gradients de pentes sont généralement > 5 %, mais peuvent être inférieurs; ce modelé est généralement régi par le substratum rocheux sous-jacent.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/surface.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/surface.html', 5, NULL, '2013-12-03 21:58:47', NULL),
	(515, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surface_form/surface', 'surface', 'mineral', 'R', 'false', 'ffff99', 'Ridged', 'À crêtes', '<p>A long, narrow elevation of the surface, usually sharp crested with steep sides; ridges may be parallel, subparallel, or intersecting. Examples are eskers, crevasse fillings, washboard moraines and some drumlins.</p>', '<p>Longue et étroite élévation de la surface à crête nettement pointue et versants abrupts; les crêtes peuvent être parallèles, quasi parallèles ou entrecroisées. Exemples : eskers, remblais de crevasse, moraines bosselées, certains drumlins.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/surface.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/surface.html', 6, NULL, '2013-12-03 21:58:09', NULL),
	(516, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surface_form/surface', 'surface', 'mineral', 'S', 'false', 'ff5656', 'Steep', 'Escarpé', '<p>Erosional slopes of > 70%, present on both consolidated and unconsolidated materials. An example is an escarpment.</p>', '<p>Pentes d\'érosion > 70 % se trouvant sur des matériaux consolidés ou non consolidés. Exemple : escarpement.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/surface.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/surface.html', 7, NULL, '2013-12-03 21:56:55', NULL),
	(517, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surface_form/surface', 'surface', 'mineral', 'T', 'false', 'ffd4aa', 'Terraced', 'En terrasses', '<p>Scarp face and the horizontal or gently inclined surface (or tread) above it. An example is an alluvial terrace.</p>', '<p>Paroi de l\'escarpement et surface horizontale ou légèrement inclinée se trouvant au-dessus. Exemple : terrasse alluviale.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/surface.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/surface.html', 8, NULL, '2013-12-03 21:54:14', NULL),
	(518, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surface_form/surface', 'surface', 'mineral', 'U', 'false', 'cccc00', 'Undulating', 'Ondulé', '<p>A very regular sequence of gentle slopes that extends from rounded and, in some places, confined concavities to broad, rounded convexities producing a wave like pattern of low local relief. Slope length is generally < 0.8 km and the dominant gradient of slopes is usually 2-5%. The terrain lacks an external drainage pattern. Examples are some ground moraines and lacustrine material of varying textures.</p>', '<p>Séquence très régulière de pentes douces qui s\'étirent entre des concavités arrondies et, par endroits, confinées, et de grandes convexités arrondies, ce qui produit un paysage peu accidenté, en vagues; la longueur des pentes est généralement < 0,8 km, et le gradient dominant des pentes est généralement de 2-5 %; aucune configuration de drainage externe. Exemples : certaines moraines de fond, matériau lacustre de diverses textures.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/surface.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/surface.html', 9, NULL, '2013-12-03 22:01:48', NULL),
	(519, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surface_form/surface', 'surface', 'wetland', 'B', 'false', 'd4aaff', 'Bog', 'Bog', '<p>A peatland with the water table at or near the surface. The bog surface, which may be raised or level with those of the surrounding wetlands, is virtually unaffected by the nutrient rich ground waters from the surrounding mineral soils and is thus generally acidic and low in nutrients. The soils are mainly Fibrisols, Meisisols, and Organic Cryosols. The bogs may be treed or treeless, and they are usually covered with sphagnum mosses, and ericaceous shrubs.</p>', '<p>Tourbière dont la nappe phréatique se situe généralement au niveau ou près de la surface. La surface de la tourbière, qui peut être surélevée par rapport aux terres humides avoisinantes ou au même niveau que celles-ci, ne subit pratiquement aucune influence des eaux souterraines riches en éléments nutritifs provenant des sols minéraux avoisinants et est donc généralement acide et pauvre en éléments nutritifs. Les sols sont principalement des fibrisols, des mésisols et des cryosols organiques. Il y a ou non des arbres. Les bogs comportent habituellement un tapis de sphaigne et une strate arbustive dominée par les éricacées.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/surface.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/surface.html', 1, NULL, '2013-12-03 22:00:22', NULL),
	(520, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surface_form/surface', 'surface', 'wetland', 'F', 'false', 'cc99cc', 'Fen', 'Fen', '<p>A peatland with a water table usually at or above the surface. The waters are mainly nutrient-rich, minerotrophic waters from mineral soils. The soils are mainly Mesisols, Humisols, and Organic Cryosols. The vegetation consists dominantly of sedges, grasses, reeds, and brown mosses with some shrub cover and, at times, a sparse tree layer.</p>', '<p>Tourbière dont la nappe phréatique se situe généralement au niveau ou au-dessus de la surface. Généralement, les eaux sont minérotrophes et enrichies d\'éléments nutritifs provenant de sols minéraux. Les sols sont principalement des mésisols, des humisols et des cryosols organiques. La végétation est dominée par les carex, les graminées, les roseaux et les mousses brunes. Un couvert arbustif de densité variable et, parfois, quelques arbres épars sont également présents.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/surface.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/surface.html', 2, NULL, '2013-12-03 22:01:01', NULL),
	(521, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surface_form/surface', 'surface', 'wetland', 'M', 'false', '9966cc', 'Marsh', 'Marais', '<p>A mineral wetland or a peatland that is periodically inundated by standing or slowly moving waters. Surface waters may fluctuate seasonally, with declining levels exposing drawdown zones of matted vegetation or mudflats. The waters are nutrient rich. The substratum usually consists of mineral material. The soils are dominantly Gleysols, with some Humisols,and Meisisols. Marshes characteristically show zonal or surface patterns comprised of pools or channels interspersed with unconsolidated stands of emergent sedges, grasses, rushes, and reeds, bordering grassy meadows and peripheral bands of shrubs or trees.</p>', '<p>Tourbière ou terre humide minérale périodiquement submergée par de l\'eau stagnante ou s\'écoulant lentement. Le niveau de l\'eau de surface peut fluctuer selon les saisons, les baisses de niveaux exposant les zones de rabattement de la végétation en touffes ou vasières. Les eaux sont riches en éléments nutritifs. Le substrat se compose généralement de matériau minéral. Les sols sont principalement des gleysols, avec quelques humisols et mésisols. Les marais présentent de façon caractéristique des configurations zonales ou superficielles composées de cuvettes ou de chenaux intercalés à des touffes émergées de carex, de graminées, de joncs et de roseaux, bordant des prairies herbeuses et des bandes périphériques d\'arbustes ou d\'arbres.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/surface.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/surface.html', 3, NULL, '2013-12-03 22:01:25', NULL),
	(522, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surface_form/surface', 'surface', 'wetland', 'S', 'false', '6e5fdc', 'Swamp', 'Marécage', '<p>A peatland or mineral wetland with standing or gently flowing waters occuring in pools or channels. The water table is usually at or near the surface. There is pronounced water movement from the margin or other mineral sources, hence the waters are rich in nutrients. If peat is present, it is mainly well-decomposed forest peat, underlain at times by fen peat. The associated soils are Meisisols, Humisols, and Gleysols. Vegetation is characterized by a dense tree or shrub cover of deciduous or coniferous species, herbs, and some mosses.</p>', '<p>Tourbière ou terre humide minérale où l\'eau est stagnante ou s\'écoule très lentement dans des bassins et des canaux. La nappe phréatique se situe généralement au niveau ou près de la surface. Comme il se produit un important écoulement en provenance de la marge du marécage ou d\'autres zones riches en minéraux, ses eaux contiennent beaucoup d\'éléments nutritifs. S\'il y a de la tourbe, il s\'agit principalement de tourbe de forêt bien décomposée et, parfois, d\'une couche sous-jacente de tourbe de fen. Les sols sont principalement des mésisols, des humisols et des gleysols. La végétation est composée d\'une dense strate arborescente ou arbustive de feuillus ou de résineux, de graminées et de quelques mousses.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/surface.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/surface.html', 4, NULL, '2013-12-03 22:02:43', NULL),
	(523, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/permafrost/permafrost', 'permafrost', 'no', 'N', 'false', '00bf00', 'No Permafrost', 'Absence de pergélisol', '<p>No Permafrost</p>', '<p>Absence de pergélisol</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/permafrost/permafrost.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/permafrost/permafrost.html', 1, NULL, '2014-01-06 16:47:32', NULL),
	(524, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/permafrost/permafrost', 'permafrost', 'isolated', 'In', 'false', 'aaffff', 'Isolated Patches:  Nil', 'Îlots de pergélisol : nulle', '<p>Isolated Patches (0-10%) Permafrost: Nil (0%) Ground Ice</p>', '<p>Îlots de pergélisol (0-10 %) : teneur en glace de sol nulle (0 %)</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/permafrost/permafrost.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/permafrost/permafrost.html', 2, NULL, '2014-01-06 16:49:32', NULL),
	(525, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/permafrost/permafrost', 'permafrost', 'isolated', 'Inl', 'false', '56ffff', 'Isolated Patches: Low-Nil', 'Îlots de pergélisol : nulle-faible', '<p>Isolated Patches (0-10%) Permafrost: Low-Nil (0-10%) Ground Ice</p>', '<p>Îlots de pergélisol (0-10 %) : teneur en glace de sol nulle-faible (0-10 %)</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/permafrost/permafrost.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/permafrost/permafrost.html', 3, NULL, '2014-01-06 16:49:48', NULL),
	(526, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/awhc', 'awhc', 'none', '7', 'true', '9085aa', 'High water table', 'Table d\'eau élevée', '<p>Not applicable - high water table.</p>', '<p>Ne s\'applique pas - table d\'eau élevée.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/awhc.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/awhc.html', 7, NULL, '2013-11-04 16:49:39', NULL),
	(527, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/awhc', 'awhc', 'none', '8', 'true', 'd4ffff', 'Perennially frozen subsoils', 'Sous-sol gelé continuellement', '<p>Not applicable - perennially frozen subsoils.</p>', '<p>Ne s\'applique pas - sous-sol gelé continuellement.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/awhc.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/awhc.html', 8, NULL, '2013-11-04 16:48:55', NULL),
	(528, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/awhc', 'awhc', 'none', '-', 'true', 'cccccc', 'Water, ice or rock', 'Eau, roche ou glace', '<p>Not applicable - water, ice or rock.</p>', '<p>Ne s\'applique pas - l\'eau, roche ou glace.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/awhc.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/awhc.html', 9, NULL, '2013-11-04 16:48:24', NULL),
	(530, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/lu', 'profile', 'none', 'N', 'false', '47a373', 'Native soil profile', 'Profil de sol non cultivé', '<p>The soil is in native condition (undisturbed by agriculture).</p>', '<p>Le profil de sol est dans un état natif (non perturbé par l\'agriculture).</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.0/component/lu.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.0/component/lu.html', 2, NULL, '2012-12-04 21:24:49', NULL),
	(531, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/names', 'name', 'none', '1', 'false', 'ccffff', 'Arctic Cordillera', 'La cordillère arctique', '<p>The Arctic Cordillera Ecozone encompasses the northeastern fringe of Nunavut and northern Labrador, and is defined by the Arctic Cordillera Mountain Range, which spans the ecozone\'s entire area. Covering the mountain peaks and blanketing the many valleys, polar ice fields and alpine glaciers create icy scenery unique to the Arctic. The rugged landscape and harsh climate limit the diversity of plants and animals that inhabit this ecozone.</p>', '<p>La cordillère arctique comprend la frange nord-est du Nunavut et le nord du Labrador, et est définie par la chaîne de montagne de la Cordillère arctique, qui s\'étend sur toute l\'écozone. Couvrant les sommets des montagnes et de nombreuses vallées, les champs de glace polaire et les glaciers alpins crées un paysage unique de l\'Arctique. Le paysage accidenté et le climat rigoureux limitent la diversité des plantes et des animaux qui peuplent cette écozone.</p>', '', '', 1, NULL, '2012-07-17 16:36:18', NULL),
	(532, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/names', 'name', 'none', '2', 'false', '99cccc', 'Northern Arctic', 'Arctique nordique', '<p>The Northern Arctic Ecozone is the coldest and driest landscape in the Arctic. In fact, it has been called the harshest environment in Canada! This polar desert comprises the non-mountainous portions of the Arctic Islands as well as the northernmost areas of Quebec. Vegetation and wildlife are scarce as organisms must be adapted to the cold, dry, and windy climate.</p>', '</p>L\'écozone du nord est le paysage le plus froid et sec de l\'Arctique. En fait, il a été appelé le plus sévère environnement au Canada! Ce désert polaire comprend les parties non montagneuses des îles de l\'Arctique ainsi que les zones les plus septentrionales du Québec. Comme les organismes doivent s\'adapter au froid et au climat sec et venteux, la végétation et la faune y sont rares.</p>', '', '', 2, NULL, '2012-07-17 16:36:36', NULL),
	(533, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/names', 'name', 'none', '3', 'false', '0099cc', 'Southern Arctic', 'Arctique austral', '<p>The Southern Arctic Ecozone covers much of the northern mainland of Canada, from the Richardson Mountains in the Yukon Territory to northern Quebec. The Southern Arctic region is the largest of the three arctic terrestrial ecozones, and has the highest species diversity. In the summer, it is green with blooming vegetation – a far cry from the icy barrens of the Far North. The lush vegetation provides food and habitat for many wildlife species.</p>', '<p>Depuis les monts Richardson du Yukon au nord du Québec, l\'écozone du sud couvre une grande partie du nord du Canada. La région du sud de l\'Arctique est le plus grande des trois écozones terrestres arctiques, et a la plus grande diversité d\'espèces. En été, il est vert avec de la végétation florissante - bien loin des landes glacées du Grand Nord. La végétation luxuriante offre nourriture et habitat à de nombreuses espèces fauniques.</p>', '', '', 3, NULL, '2012-07-17 16:37:13', NULL),
	(534, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/names', 'name', 'none', '4', 'false', 'cccccc', 'Taiga Plain', 'Plaines Taïga', '<p>The Taiga Plains Ecozone is an area of low-lying plains centred on Canada\'s largest river, the Mackenzie, and its many tributaries. With an area of about 550 000 square kilometres, it is Canada\'s sixth largest ecozone. Approximately 90% of the Taiga Plains is located in the western Northwest Territories, with small extensions into northeastern British Columbia and northern Alberta. It is bounded to the east by Great Bear and Great Slave lakes, to the west by the rolling foothills of the Mackenzie Mountains, to the north by the Mackenzie Delta, and to the south by the spruce forest of the Boreal Plains.</p>', '<p>L\'écozone des plaines Taïga est une région de plaines basses centrés sur le plus grand fleuve et ses nombreux affluents, le Mackenzie. Avec une superficie d\'environ 550 000 kilomètres carrés, il est au sixième rang des plus grandes écozones du Canada. Environ 90% des plaines Taïga se retrouvent à l\'ouest desTerritoires du Nord-Ouest, avec de petites extensions au nord de la Colombie-Britannique et au nord de l\'Alberta. Elle est délimitée à l\'est par les lacs Great Bear and Great Slave, à l\'ouest par les contreforts vallonnés des monts Mackenzie, au nord par le delta du Mackenzie, et au sud par la forêt d\'épinettes des Plaines boréales.</p>', '', '', 4, NULL, '2012-07-17 16:37:25', NULL),
	(535, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/names', 'name', 'none', '5', 'false', '999999', 'Taiga Shield', 'Bouclier Taïga', '<p>The Taiga Shield Ecozone stretches across part of Canada\'s subarctic north. The Russian term "taiga" refers to the northern edge of the boreal coniferous forest. This is the Athapaskan "land of little sticks" that stretches from Labrador to Alaska and from Siberia to Scandinavia. In northern Canada, much of this forest rests on the Canadian Shield, the bedrock heart of the continent. With an area of over 1.3 million square kilometres, the Taiga Shield is one of Canada\'s largest ecozones. One-third of it lies in the Northwest Territories.</p>', '<p>Le bouclier Taïga s\'étend à travers une partie du subarctique nord. Le terme russe «taïga» se réfère à la lisière nord de la forêt boréale de conifères. Il s\'agit de l\'athapascane "terre des petits bâtons» qui s\'étend du Labrador à l\'Alaska et de Sibérie à la Scandinavie. Une grande partie de cette forêt repose sur le Bouclier canadien, au coeur du substratum rocheux du continent au nord du Canada. Avec une superficie de plus de 1,3 millions de kilomètres carrés, le bouclier Taïga est l\'une des plus grandes écozones du Canada. Un tiers de celle-ci réside dans les Territoires du Nord-Ouest.</p>', '', '', 5, NULL, '2012-07-17 16:37:43', NULL),
	(536, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/names', 'name', 'none', '6', 'false', '66cc66', 'Boreal Shield', 'Bouclier boréal', '<p>For generations, the blue lakes and rocky shores of the Canadian Shield have shaped our national identity and psyche. This raw and rolling landscape has left its imprint on some of Canada’s best literature, art and drama. Almost two thirds of the country lies on Shield rock. Canada’s largest ecosystem, the boreal forest, forms a continuous belt from the east coast to the Rockies. Scientists call the area where the Canadian Shield and the boreal forest overlap the Boreal Shield, the largest of Canada\'s 15 terrestrial ecozones.</p>', '<p>Les lacs bleus et les rivages rocheux du Bouclier canadien ont façonné notre identité nationale pour des générations. Ce paysage rude et ondulant a laissé son empreinte sur la littérature, l\'art et le théâtre Canadiens. Près des deux tiers du pays se retrouve sur le roc du Bouclier. Le plus grand écosystème du Canada, la forêt boréale, forme une ceinture continue de la côte Est des Rocheuses. Les scientifiques appellent la zone où le Bouclier canadien et la forêt boréale se chevauchent le bouclier boréal qui est le plus grand des 15 écozones terrestres du Canada.</p>\r\n', '', '', 6, NULL, '2012-07-17 16:38:00', NULL),
	(537, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/names', 'name', 'none', '7', 'false', '66cccc', 'Atlantic Maritime', 'Écozone maritime de l\'Atlantique', '<p>Mixed-wood Acadian forests, sand dunes stretched along seaboards, and coastal islands are some of the unique ecosystems of the Atlantic Maritime Ecozone. It extends from the Gaspé Peninsula at the mouth of the St. Lawrence River southwest through Quebec to the U.S. border south of Sherbrooke. It also includes the three maritime provinces of Prince Edward Island, Nova Scotia, and New Brunswick.</p>', '<p>Les forêts mixtes acadiennes, les dunes de sable le long des façades maritimes et des îles côtières sont quelques-uns des écosystèmes uniques de l\'écozone maritime de l\'Atlantique. Elle s\'étend de la péninsule gaspésienne à l\'embouchure du Saint-Laurent à travers le sud-ouest Québecois jusqu\'à la frontière américaine au sud de Sherbrooke. Il comprend également les trois provinces maritimes, l\'Île-du-Prince-Édouard, la Nouvelle-Écosse et le Nouveau-Brunswick.</p>', '', '', 7, NULL, '2012-07-17 16:38:16', NULL),
	(538, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/names', 'name', 'none', '8', 'false', 'cccc99', 'Mixedwood Plain', 'Plaines à forêts mixtes', '<p>An extensive system of waterways, including the St. Lawrence River and the Great Lakes, combines with surrounding rich fertile soils to create one of the most attractive and productive ecozones in Canada. The Mixedwood Plains Ecozone, encompassing a small area of 175 963 square kilometres, is bounded by three Great Lakes in southern Ontario and extends along the St. Lawrence shoreline to Quebec City. With its relatively mild climate, it represents the most populous and prosperous terrestrial ecozone.</p>', '<p>Un vaste réseau de voies, y compris le fleuve Saint-Laurent et les Grands Lacs, entouré de riches sols fertiles rassemblent l\'une des écozones les plus attrayantes et productives du Canada. Les Plaines à forêts mixtes, regroupant une petite zone de 175,963 kilomètres carrés, est bordé par trois Grands Lacs dans le sud de l\'Ontario et s\'étend le long du rivage du Saint-Laurent au Québec. Avec son climat relativement doux, elle constitue l\'écozone terrestre la plus peuplée et prospère.</p>', '', '', 8, NULL, '2012-07-17 16:38:33', NULL),
	(539, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/names', 'name', 'none', '9', 'false', 'ccffcc', 'Boreal Plains', 'Plaines boréales', '<p>The Boreal Plains Ecozone is part of the flat Interior Plains of Canada, a northern extension of the Great Plains of North America. The subdued relief consists of low-lying valleys and plains stretching across the mid portions of Manitoba and Saskatchewan, and continuing through almost two-thirds of Alberta. It covers 650 000 square kilometres, an area larger than the Yukon. The majority of the surface waters are part of three watersheds: those of the Saskatchewan River, the Beaver River, and Peace, Athabasca, and Slave rivers\' watershed.</p>', '<p>L\'écozone des plaines boréales fait partie des plaines de l\'intérieur du Canada, un prolongement vers le nord des Grandes Plaines d\'Amérique du Nord. Le relief atténué, se compose de basses vallées et de plaines qui s\'étendent sur le centre du Manitoba et de la Saskatchewan, et s\'étale sur presque les deux tiers de l\'Alberta. Il couvre 650,000 kilomètres carrés, soit une superficie supérieure à celle du Yukon. La majorité des eaux de surface font partie des trois bassins versants : ceux de la rivière Saskatchewan, la rivière Beaver, Paix et Athabasca ainsi que des bassins versants des rivières des Esclaves.</p>', '', '', 9, NULL, '2012-07-17 16:38:51', NULL),
	(540, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/names', 'name', 'none', '10', 'false', 'ffff99', 'Prairies', 'Les Prairies', '<p>The Prairies cover the south of Alberta, Manitoba and Saskatchewan. They are the northernmost branch of the Great Plains of North America and the most altered of the ecozones. The mountains to the west block much of the precipitation that would otherwise fall. That and the high winds make this ecozone very dry, although precipitation does generally increase towards the east. Huge numbers of small temporary wetlands form in years with high precipitation. Gas and oil is plentiful in the region.</p>\r\n', '<p>Les Prairies couvrent le sud de l\'Alberta, du Manitoba et de la Saskatchewan. Elles sont la branche la plus au nord et la plus altérée des écozones des Grandes Plaines d\'Amérique du Nord. Les montagnes à l\'ouest bloquent en grande partie les précipitations. C\'est ainsi que les vents forts font de cette écozone un region très sec, bien que les précipitations augmentent généralement un peu plus vers l\'est. Au cours des années, de fortes précipitations ont formées un très grand nombre de petites zones humides temporaires. Gaz et pétrole abondent dans la région.</p>', '', '', 10, NULL, '2012-07-17 16:39:08', NULL),
	(541, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/names', 'name', 'none', '11', 'false', 'cc99cc', 'Taiga  Cordillera', 'Cordillère de Taïga', '<p>The Taiga Cordillera Ecozone is a land of magnificent beauty. It is a mountain stronghold of towering peaks, untamed rivers slicing their way between sheer rock walls, broad windswept uplands dominated by alpine and arctic shrubs and flowers, plus vast wetlands and spruce-lined valleys that support many kinds of wildlife. This land hosts some of Canada\'s largest waterfalls, deepest canyons, and wildest rivers. Straddling the Yukon-Northwest Territories border, this ecozone contains the northernmost arc of the Rocky Mountain chain.</p>', '<p>L\'écozone de la cordillère de Taïga est une terre d\'une magnifique beauté. Il s\'agit d\'une forteresse de montagne avec de majestueux sommets, des rivières coulant entre des parois rocheuses abruptes, de hautes terres balayées par le vent dominé par des arbustes et des fleurs, ainsi que de vastes terres humides et de vallées peuplées d\'épinette, qui soutiennent de nombreuses espèces animales. Cette région renferme certaines des plus grandes chutes d\'eau du Canada, des plus profonds canyons, et des rivières tumultueuses. À cheval sur la frontière entre le Yukon et les Territoires du nord-ouest, cette écozone contient l\'arc le plus septentrional de la chaîne des Rocheuses.</p>', '', '', 11, NULL, '2012-07-17 16:39:26', NULL),
	(542, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/names', 'name', 'none', '12', 'false', '9966cc', 'Boreal Cordillera', 'Cordillère boréales', '<p>The Montane Cordillera Ecozone is the most diverse of Canada\'s 15 terrestrial ecozones, exhibiting some of the driest, wettest, coldest, and hottest conditions anywhere in the country. The ecosystems are variable, ranging from alpine tundra and dense conifer forests to dry sagebrush and grasslands. Much of the region is rugged and mountainous. The ecozone covers 473,000 square kilometres of Canada, stretching from north-central British Columbia south to the United States border. It encompasses the Alberta Foothills as well as the interior mountain ranges and valleys of B.C., including the Okanagan and the East Kootenay valleys.</p>', '<p>La Cordillère montagnarde est la plus diversifiée des 15 écozones terrestres canadiennes, présentant certains des plus secs, plus humides, les conditions les plus froides et les plus chaudes que partout au pays. Les écosystèmes sont variables, allant de la toundra alpine et forêts denses de conifères à armoise et des prairies sèches. Une grande partie de la région est accidentée et montagneuse. L\'écozone couvre 473,000 kilomètres carrés du Canada, qui s\'étend du nord-centre-sud de la Colombie-Britannique à la frontière des États-Unis. Elle englobe la Foothills de l\'Alberta ainsi que les chaînes de montagnes et des vallées intérieures de la Colombie-Britannique, y compris l\'Okanagan et les vallées est de Kootenay.</p>', '', '', 12, NULL, '2012-07-17 16:39:43', NULL),
	(543, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/names', 'name', 'none', '13', 'false', '006600', 'Pacific Maritime', 'Maritime du Pacifique', '<p>The Pacific Maritime Ecozone is a place of superlatives: Canada\'s tallest trees, the most rainfall, and the longest and deepest fiords. A unique maritime climate and a striking alliance between lofty mountains and the ever-changing Pacific give this ecozone its distinctive character. As the name implies, the ecozone includes the land bordering Canada\'s Pacific Coast. Covering more than 195 000 square kilometres, it includes the Coast Mountains, B.C.’s marine islands, plus a small corner of southwestern Yukon.</p>', '<p>L\'écozone maritime du Pacifique est un lieu de tous les superlatifs: les plus grands arbres du Canada, la plupart des précipitations ainsi que les plus longues et les plus profondes fjords. Qu\'est-ce qui donne à cette écozone son caractère distinctif, entre autres, un climat maritime unique et une alliance saisissante entre les hautes montagnes et l\'évolution constante du Pacifique. Comme son nom l\'indique, l\'écozone comprend le territoire canadien bordant la côte du Pacifique. Couvrant plus de 195,000 kilomètres carrés, il comprend la chaîne Côtière, les îles marines de la Colombie-Britannique additionné d\'un petit coin du sud-ouest du Yukon.</p>\r\n', '', '', 13, NULL, '2012-07-17 16:39:58', NULL),
	(544, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/names', 'name', 'none', '14', 'false', '99cc00', 'Montane Cordillera', 'Cordillère montagnarde', '<p>The Montane Cordillera Ecozone is the most diverse of Canada\'s 15 terrestrial ecozones, exhibiting some of the driest, wettest, coldest, and hottest conditions anywhere in the country. The ecosystems are variable, ranging from alpine tundra and dense conifer forests to dry sagebrush and grasslands. Much of the region is rugged and mountainous.</p>', '<p>L\'écozone de la Cordillère montagnarde est la plus diversifiée des 15 écozones terrestres du Canada, abritant certains des milieux les plus secs, les plus humides, les plus froids et les plus chauds du pays. Les écosystèmes qui s\'y trouvent varient de la toundra alpine à des forêts denses de conifères, en passant par des prairies et des arbustaies sèches d\'armoises.</p>', '', '', 14, NULL, '2012-07-17 16:40:13', NULL),
	(545, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/names', 'name', 'none', '15', 'false', 'ccff99', 'Hudson Plains', 'Plaines hudsoniennes', '<p>Wetlands are found throughout the country, but the largest are located in the Hudson Plains ecozone, a region that has its center in northern Ontario and extends into northeastern Manitoba and western Quebec.</p>', '<p>On retrouve des terres humides dans tout le pays, mais les plus vastes sont situées dans l\'écozone des plaines hudsoniennes, une région qui a son centre dans le nord de l\'Ontario et qui s\'étend dans le nord-est du Manitoba et l\'ouest du Québec.</p>\r\n', '', '', 15, NULL, '2012-07-17 16:40:29', NULL),
	(546, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/landcover/landcover', 'landcover', 'none', '1', 'false', '169616', 'Mixed Forest', 'Forêt mixte', '<p>Mixed Forest: canopy 26-75% coniferous/broadleaf trees</p>', '<p>Voûte d\'arbres composée de résineux et de feuillus dans une proportion de 26 à 75%</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/landcover/landcover.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/landcover/landcover.html', 1, NULL, '2012-07-17 13:56:52', NULL),
	(547, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/landcover/landcover', 'landcover', 'none', '2', 'false', '50bf50', 'Broadleaf Forest', 'Forêt feuillue', '<p>Broadleaf Forest: canopy > 75% broadleaf trees</p>', '<p>Voûte d\'arbres composée de feuillus dans une proportion de plus de 75%</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/landcover/landcover.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/landcover/landcover.html', 2, NULL, '2012-07-17 13:56:31', NULL),
	(548, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/landcover/landcover', 'landcover', 'none', '4', 'false', '74e074', 'Transitional Forest', 'Forêt de transition', '<p>Transitional Forest: forest land < 50% of the area</p>', '<p>Forêt de transition : terrain forestier occupant moins de 50% de la région</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/landcover/landcover.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/landcover/landcover.html', 4, NULL, '2012-07-17 13:56:10', NULL),
