	(550, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/landcover/landcover', 'landcover', 'none', '6', 'false', 'd4aaff', 'Tundra', 'Toundra', '<p>Tundra: treeless arctic and alpine vegetation</p>', '<p>Toundra : région de plantes arctiques et alpines dépourvue d\'arbres</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/landcover/landcover.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/landcover/landcover.html', 6, NULL, '2012-07-17 13:55:29', NULL),
