	(616, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/permafrost/permafrost', 'permafrost', 'continuous', 'Cl', 'false', 'd4aaff', 'Continuous Permafrost: Low', 'Pergélisol continu : faible', '<p>Continuous (>90%) Permafrost: Low (<10%) Ground Ice.</p>', '<p>Pergélisol continu (> 90 %) : teneur en glace de sol faible (< 10 %).</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/permafrost/permafrost.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/permafrost/permafrost.html', 13, NULL, '2014-01-06 16:51:27', NULL),
	(617, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/permafrost/permafrost', 'permafrost', 'continuous', 'Cml', 'false', 'aa56ff', 'Continuous Permafrost: Medium-Low', 'Pergélisol continu : faible-modérée', '<p>Continuous (>90%) Permafrost: Medium-Low (<20%) Ground Ice</p>', '<p>Pergélisol continu (> 90 %) : teneur en glace de sol faible-modérée (< 20 %)</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/permafrost/permafrost.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/permafrost/permafrost.html', 14, NULL, '2014-01-06 16:51:37', NULL),
	(618, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/permafrost/permafrost', 'permafrost', 'continuous', 'Cm', 'false', '7f00ff', 'Continuous Permafrost: Medium', 'Pergélisol continu : modérée', '<p>Continuous (>90%) Permafrost: Medium (10-20%) Ground Ice.</p>', '<p>Pergélisol continu (> 90 %) : teneur en glace de sol modérée (10-20 %)</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/permafrost/permafrost.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/permafrost/permafrost.html', 15, NULL, '2014-01-06 16:51:47', NULL),
	(619, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/permafrost/permafrost', 'permafrost', 'continuous', 'Cmh', 'false', '5f00bf', 'Continuous Permafrost: Medium-High', 'Pergélisol continu : modérée-élevée', '<p>Continuous (>90%) Permafrost: Medium-High (>10%) Ground Ice.</p>', '<p>Pergélisol continu (> 90 %) : teneur en glace de sol modérée-élevée (> 10 %)</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/permafrost/permafrost.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/permafrost/permafrost.html', 16, NULL, '2014-01-06 16:52:11', NULL),
	(620, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/permafrost/permafrost', 'permafrost', 'continuous', 'Ch', 'false', '3f007f', 'Continuous Permafrost: High', 'Pergélisol continu : élevée', '<p>Continuous (>90%) Permafrost: High (>20%) Ground Ice.</p>', '<p>Pergélisol continu (> 90 %) : teneur en glace de sol élevée (> 20 %)</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/permafrost/permafrost.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/permafrost/permafrost.html', 17, NULL, '2014-01-06 16:52:21', NULL),
	(621, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surface_material/material', 'material', 'none', 'IC', 'false', '99FFCC', 'Ice and Snow', 'Glace et neige', '<p>Glacial ice and permanent snow.</p>', '<p>Glace de l\'ère glaciaire et neige éternelle.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surface_material/material.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surface_material/material.html', 1, NULL, '2012-03-07 19:10:57', NULL),
	(622, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surface_material/material', 'material', 'none', 'OR', 'false', 'CCCC00', 'Organic Soil', 'Sol organique', '<p>Contains > 30% organic matter as measured by weight.</p>', '<p>Sol renfermant > 30 % de matière organique en poids.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surface_material/material.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surface_material/material.html', 2, NULL, '2012-03-07 19:44:05', NULL),
	(623, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surface_material/material', 'material', 'none', 'RK', 'false', 'CC99FF', 'Rock', 'Roche', '<p>Rock, undifferentiated.</p>', '<p>Roche non différenciée.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surface_material/material.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surface_material/material.html', 3, NULL, '2012-03-07 19:45:18', NULL),
	(624, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surface_material/material', 'material', 'none', 'SO', 'false', '996600', 'Mineral Soil', 'Sol minéral', '<p>Predominantly mineral particles: contains < 30% organic matter as measured by weight</p>', '<p>Particules essentiellement minérales, renfermant < 30 % de matière organique en poids.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surface_material/material.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surface_material/material.html', 4, NULL, '2012-03-07 19:46:07', NULL),
	(625, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surface_material/material', 'material', 'none', 'UR', 'false', '666666', 'Urban', 'Zone urbaine', '<p>Urban areas. Note that only a few major urban area polygons are included on SLC source maps, therefore, do not use for tabulating total urban coverage.</p>', '<p>Zones urbaines. Note : seuls quelques-uns des principaux polygones de zones urbaines sont illustrés sur les cartes. Dès lors, ne pas utiliser pour la tabulation des zones urbaines.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surface_material/material.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surface_material/material.html', 5, NULL, '2012-03-07 19:46:48', NULL),
	(626, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/texture/texture', 'texture', 'none', 'CL', 'false', '6b83aa', 'Clay Loam', 'Loam argileux', '<p>Soil material that contains 27% to 40% clay and 20% to 45% sand. See also texture, soil.</p>', '<p>Matériau contenant de 27 à 40% d\'argile et de 20 à 45% de sable.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/texture/texture.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/texture/texture.html', 2, NULL, '2012-07-17 14:20:29', NULL),
	(627, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/texture/texture', 'texture', 'none', 'CY', 'false', '6e5fdc', 'Clay', 'Argile', '<p>(1) As a particle-size term: a size fraction less than 0.002 mm in equivalent diameter, or some other limit (geologists and engineers). (2) As a rock term: a natural, earthy, fine grained material that develops plasticity with a small amount of water. (3) As a soil term: a textural class. See also texture, soil.. (4) As a soil separate: a material usually consisting largely of clay minerals but commonly also of amorphous free oxides and primary minerals.</p>', '<p>(1) Granulométrie: fraction granulométrique formée de particules de diamètre équivalent de moins de 0.002 mm ou d\'autres dimensions (géologues et ingénieurs). (2) Minéralogie: matériau naturel, terreux, microgrenu, qui devient plastique par addition d\'une faible quantité d\'eau. (3) Pédologie: classe texturale. Voir texture de sol. (4) Fraction granulométrique: matériau généralement formé surtout de minéraux agrileux mais aussi habituellement d\'oxydes libres amorphes et de minéraux primaires.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/texture/texture.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/texture/texture.html', 1, NULL, '2012-07-17 14:19:25', NULL),
	(628, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/texture/texture', 'texture', 'none', 'KCL', 'false', '586372', 'Stony Clay Loam', 'Loam argileux (KCL)', '<p>More clay than sand or silt, with more than 35% coarse fragments</p>', '<p>Loam argileux : &gt; 35 % de fragments grossiers</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/texture/texture.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/texture/texture.html', 3, NULL, '2012-07-17 14:57:11', NULL),
	(629, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/texture/texture', 'texture', 'none', 'KLM', 'false', 'b77a42', 'Stony Loam', 'Loam (KLM)', '<p>Sand, silt, and clay with more than 35% coarse fragments</p>', '<p>Loam: &gt; 35% de fragments grossiers</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/texture/texture.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/texture/texture.html', 5, NULL, '2012-07-17 15:05:04', NULL),
	(630, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/texture/texture', 'texture', 'none', 'KSD', 'false', 'd8bc04', 'Stony Sand', 'Sable', '<p>Mostly sand, with more than 35% coarse fragments</p>', '<p>Sable : &gt; 35 % de fragments grossiers</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/texture/texture.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/texture/texture.html', 9, NULL, '2012-07-17 15:03:33', NULL),
	(631, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/texture/texture', 'texture', 'none', 'KSL', 'false', 'e26644', 'Stony Sandy Loam', 'Loam sableux', '<p>More sand than clay or silt, with more than 35% coarse fragments</p>', '<p>Loam sableux : &gt; 35 % de fragments grossiers</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/texture/texture.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/texture/texture.html', 7, NULL, '2012-07-17 15:03:06', NULL),
	(632, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/texture/texture', 'texture', 'none', 'KSP', 'false', 'db532e', 'Cobbly Sand', 'Sable caillouteux', '<p>Sand containing appreciable quantities of cobblestones.</p>', '<p>Sable contenant des quantités appréciables de galets.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/texture/texture.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/texture/texture.html', 10, NULL, '2012-07-17 15:04:30', NULL),
	(633, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/texture/texture', 'texture', 'none', 'LM', 'false', '866436', 'Loam', 'Loam', '<p>A relatively equal mixture of sand, silt and clay.</p>', '<p>Classe de texture des sols. Voir aussi texture du sol.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/texture/texture.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/texture/texture.html', 4, NULL, '2012-07-17 15:05:15', NULL),
	(634, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/texture/texture', 'texture', 'none', 'O', 'false', 'ffaaaa', 'Organic', 'Organique', '<p>Soil that has developed dominantly from organic deposits. The majority of Organic soils are saturated for most of the year, unless artificially drained, but some of them are not usually saturated for more than a few days. They contain 17% or more organic carbon, and: (1) if the surface layer consists of fibric organic material and the bulh density is less than 0.1 [with or without a mesic or humic Op less than 15 cm (6 inches) thick], the organic material must extend to a depth of at least 60 cm (24 inches); or (2) if the surface layer consists of organic material with a bulk density of 0.1 or more, the organic material must extend to a depth of at least 40 cm (16 inches); or (3) if a lithic contact occurs at a depth shallower than stated in 1) or 2) above, the organic material must extend to a depth of at least 10 cm (4 inches). See also: Organic Soil Classification.</p>', '<p>Ordre de sols formés principalement de dépôts organiques. La plupart des sols organiques sont saturés pendant presque toute l\'année, à moins d\'être drainés artificiellement, mais certains d\'entre eux ne sont saturés que pendant quelques jours. lls contiennent au moins 17% de carbone organique; de plus, (1) si la couche de surface est composée de matériaux organiques fibriques, d\'une densité apparente de moins de 0,1 [n\'importe si une couche Op mésique ou humique de moins de 15 cm (6 po) est présente ou non], les matières organiques doivent descendre à une profondeur d\'au moins 60cm (24 po): ou (2) si la couche de surface est composée de matériaux organiques d\'une densité apparente de 0.1 ou plus, les matières organiques doivent descendre à une profondeur d\'au moins 40cm (16 po): ou (3) si un contact lithique se présente à une profondeur inférieure à celle indiquée en 1) ou en 2) ci-dessus, les matières organiques doivent descendre à une profondeur d\'au moins 10cm (4 po).</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/texture/texture.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/texture/texture.html', 11, NULL, '2012-07-17 14:55:03', NULL),
	(635, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/texture/texture', 'texture', 'none', 'SD', 'false', 'f7db0c', 'Sand', 'Sable', '<p>A soil particle between 0.05 and 2.0 mm in diameter. Any one of five soil separates: very coarse sand, coarse sand, medium sand, fine sand or very fine sand. See also separates / soil. A soil textural class. See also texture, soil.</p>', '<p> (1) Particule du sol dont le diamètre peut aller de 0.05 à 2.0 mm. (2) Une de cinq fractions du sol: sable très grossier, sable grossier, sable moyen, sable fin et sable très fin. Voir aussi fractions du sol. (3) Classe de texture du sol. Voir aussi texture du sol.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/texture/texture.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/texture/texture.html', 8, NULL, '2012-07-17 14:59:12', NULL),
	(636, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/texture/texture', 'texture', 'none', 'SL', 'false', 'e09045', 'Sandy Loam', 'Sable loameux', '<p>More sand than clay or silt.</p>', '<p>Une classe de texture du sol. Voir aussi la classe, le sol et la texture de sol.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/texture/texture.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/texture/texture.html', 6, NULL, '2012-07-17 15:04:50', NULL),
	(637, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/texture/texture', 'texture', 'none', '#', 'true', 'b2b2b2', 'Not Applicable', 'Ne s\'applique pas', '<p>Rock, ice or urban.</p>', '<p>Eau, glace ou zone urbaine.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/texture/texture.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/texture/texture.html', 12, NULL, '2012-07-17 14:57:28', NULL),
	(638, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'A', 'false', 'ffffaa', 'Brown Chernozem', 'Chernozem brun', '<p>These are soils that occur in the most arid segment of the climatic range of Chernozemic soils and have brownish-colored A horizons.</p>', '<p>Les chernozems brun se rencontrent dans la partie la plus aride de la distribution climatique des sols chernozémiques et ils ont un horizon A de couleur brunâtre.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 1, NULL, '2014-01-06 15:15:17', NULL),
	(639, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'B', 'false', 'ffff00', 'Dark Brown Chernozem', 'Chernozem brun foncé', '<p>These Chernozemic soils have A horizons somewhat darker in color than soils of the Brown Chernozem great group.</p>', '<p>Ces sols chernozémiques ont un horizon A de couleur quelque peu plus foncée que celle des sols du grand groupe des chernozems brun.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 2, NULL, '2014-01-06 15:15:31', NULL),
	(640, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'C', 'false', 'bfbf00', 'Black Chernozem', 'Chernozem noir', '<p>These Chernozemic soils have A horizons darker in color and commonly thicker than soils of the Brown Chernozem and Dark Brown Chernozem great groups.</p>', '<p>Ces sols chernozémiques ont un horizon A de couleur plus foncée et plus épais que les sols des grands groupes des chernozems brun et des chernozems brun foncé.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 3, NULL, '2014-01-06 15:15:42', NULL),
	(641, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'D', 'false', '7f7f00', 'Dark Gray Chernozem/Luvisol', 'Chernozem gris foncé/Luvisol', '<p>Dark Gray Chernozem have Chernozemic A horizons with characteristics indicative of eluviation associated with soils developed under forest vegetation.</p>\r\n<p>Dark Gray Luvisol have the properties specified for the Luvisolic order and the Gray Luvisol great group. They differ from Orthic Gray Luvisols by having an Ah or Ahe horizon 5 cm or more in thickness.</p>', '<p>Les Chernozems gris foncé ont un horizon A chernozémique dont les caractéristiques dénotent de l\'éluviation associée à des sols développés sous couvert forestier.</p>\r\n<p>Les Luvisols gris foncé ont les propriétés générales spécifiées pour l\'ordre luvisolique et le grand groupe des luvisols gris. Ils diffèrent des luvisols gris orthiques par la présence d\'un horizon Ah ou Ahe de 5 cm ou plus d\'épaisseur.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 4, NULL, '2014-01-06 15:15:55', NULL),
	(642, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'E', 'false', 'ffaa56', 'Gray Brown Luvisol', 'Luvisol brun gris', '<p>Soils of this great group have a forest mull Ah horizon and eluvial and Bt horizons as indicated for the order. They occur typically under deciduous or mixed forest vegetation on calcareous materials in areas of mild, humid climate. They occur mainly in the St. Lawrence Lowland.</p>', '<p>Les sols de ce grand groupe de sols ont un horizon Ah de mull forestier, des horizons éluviaux et Bt tels que définis pour l\'ordre luvisolique. Typiquement, ils se retrouvent sous des forêts feuillus ou mélangées sur des matériaux calcaires dans les stations où le pédoclimat est doux et humide. Ils sont présents principalement dans les basses-terres du Saint-Laurent.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 5, NULL, '2014-01-06 15:17:40', NULL),
	(643, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'F', 'false', 'ff7f00', 'Gray Luvisol', 'Luvisol gris', '<p>Soils of this great group have eluvial and Bt horizons as specified for the Luvisolic order. They usually have L, F, and H horizons and may have a degraded Ah or Abe horizon that resembles the upper A horizon of Dark Gray Chernozemic soils.</p>', '<p>Les sols de ce grand groupe de sols ont un horizon éluvial et un horizon Bt tels que définis pour l\'ordre luvisolique. Habituellement, ils ont des horizons L, F et H et ils peuvent avoir un horizon dégradé Ah ou Ahe qui ressemble à la partie supérieure de l\'horizon A des sols chernozémiques gris foncé.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 6, NULL, '2014-01-06 15:17:52', NULL),
	(644, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'G', 'false', 'ffaaaa', 'Brown Solonetz', 'Solonetz brun', '<p>Soils of this subgroup have a solonetzic B horizon as defined for the Solonetzic order and the properties specified for the Solonetz great group. They are associated with grass and forb vegetation and a subarid to semiarid climate. Areas of these soils often have patchy microrelief caused by differential erosion. The B horizon is exposed in some eroded pits. Plant growth in the eroded pits is usually very sparse.</p>', '<p>Les sols de ce sous-groupe ont un horizon B solonetzique, tel que défini pour l\'ordre solonetzique et les propriétés générales spécifiées pour le grand groupe des solonetz. Ils sont associés à une végétation de graminées et d\'herbacées sous un pédoclimat subaride à semi-aride. Les étendues de ces sols ont souvent un microrelief inégal, dû à une érosion différentielle de l\'horizon A. L\'horizon B est exposé dans certaines dépressions érodées. Habituellement, la végétation qui croît dans ces dépressions d\'érosion est très clairsemée.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 7, NULL, '2014-01-06 15:36:17', NULL),
	(645, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'H', 'false', 'ff5656', 'Dark Brown Solonetz', 'Solonetz brun foncé', '<p>Soils of this subgroup have a solonetzic B horizon as defined for the Solonetzic order and the properties specified for the Solonetz great group. They are associated with mesophytic grasses and forbs in a semiarid climate. Areas of Dark Brown Solonetzs often have patchy microrelief caused by differential erosion of the A horizon. However, bare eroded pits are not as common as in areas of Brown Solonetzs.</p>', '<p>Les sols de ce sous-groupe ont un horizon solonetzique tel que défini pour l\'ordre solonetzique et les propriétés générales spécifiées pour le grand groupe des Solonetz. Ils sont associés à une végétation mésophile de graminées et d\'herbacées sous un pédoclimat semi-aride. Les étendues de ces sols ont souvent un microrelief inégal dû à l\'érosion différentielle de l\'horizon A. Cependant, les dépressions érodées et dénudées ne sont pas aussi fréquentes que dans les étendues de solonetz bruns.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 8, NULL, '2014-01-06 15:36:32', NULL),
	(646, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'HG', 'false', '00bfbf', 'Humic Gleysol', 'Gleysol humique', '<p>Soils of this great group have a dark-colored A horizon in addition to the general properties of soils of the Gleysolic order. They occur commonly in poorly drained positions in association with some Chernozemic, Luvisolic, Podzolic, and Brunisolic soils. These soils may have organic surface horizons derived from grass and sedge, moss, or forest vegetation.</p>', '<p>Les sols de ce grand groupe de sols ont un horizon A de couleur foncée en plus des propriétés générales spécifiées pour les sols de l\'ordre gleysolique. Ils se rencontrent généralement dans les stations mal drainées, en association avec certains sols chernozémiques, luvisoliques, podzoliques et brunisoliques. Ils peuvent avoir des horizons de surface organiques dérivés de graminées, de carex, de mousse ou de végétation forestière.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 9, NULL, '2014-01-06 15:28:59', NULL),
	(647, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'HR', 'false', 'ff007f', 'Humic Regosol', 'Régosol humique', '<p>These Regosolic soils have an Ah or dark colored Ap horizon at least 10 cm thick at the mineral surface. They may have organic surface horizons and buried mineral-organic horizons. They do not have a B horizon at least 5 cm thick.</p>', '<p>Ces sols régosoliques ont un horizon Ah, ou Ap de couleur foncée d\'au moins 10 cm d\'épaisseur à la surface du sol minéral. Ils peuvent avoir des horizons organiques de surface et des horizons organo-minéraux enfouis et des couches organiques en surface. Ils n\'ont pas d\'horizon B de 5 cm ou plus d\'épaisseur.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 10, NULL, '2014-01-06 15:34:40', NULL),
	(648, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'I', 'false', 'bf5f00', 'Brunisolic Gray Luvisol', 'Luvisol gris brunisolique', '<p>These soils have the properties specified for the Luvisolic order and the Gray Luvisol great group. They differ from Orthic Gray Luvisols by having in the upper solum, either a Bm horizon at least 5 cm thick with a chroma of 3 or more, or a Bf horizon less than 10 cm thick that does not extend below 15 cm. Such Bm or Bf horizons are thought to have developed in a former Ae horizon. These soils do not have a dark-colored Ah or Ahe horizon 5 cm or more in thickness.</p>', '<p>Ces sols ont les propriétés générales spécifiées pour l\'ordre luvisolique et le grand groupe des luvisols gris. Ils diffèrent des luvisols gris orthiques par la présence, dans la partie supérieure du solum, soit d\'un horizon Bm d\'au moins 5 cm d\'épaisseur avec une saturation de couleur de 3 ou plus, ou d\'un horizon Bf de moins de 10 cm d\'épaisseur qui ne s\'étend pas plus bas que 15 cm de la surface du sol minéral. On pense que ces horizons Bm et Bf se sont développés dans l\'ancien horizon Ae. Ces sols n\'ont pas d\'horizon Ah ou Ahe de couleur foncée de 5 cm ou plus d\'épaisseur.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 11, NULL, '2014-01-06 15:24:53', NULL),
	(649, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'J', 'false', 'ff0000', 'Black Solonetz', 'Solonetz noir', '<p>Soils of this subgroup have a solonetzic B horizon as defined for the Solonetzic order and the properties specified for the Solonetz great group. They are associated mainly with the growth of mesophytic grasses and forbs in a subhumid climate. However, they occur also in areas of discontinuous shrub and tree cover with a ground cover of forbs and grasses. The microrelief associated with differential erosion of the A horizon in areas of Brown and Dark Brown Solonetzs occurs rarely in areas of Black Solonetzs.</p>', '<p>Les sols de ce sous-groupe ont un horizon B solonetzique tel que défini pour l\'ordre solonetzique et les propriétés générales spécifiées pour le grand groupe des solonetz. Ils sont principalement associés à une végétation mésophile de graminées et d\'herbacées sous un pédoclimat sub-humide. Cependant, on les trouve aussi sous des étendues discontinues d\'arbustes et de couvertures d\'arbres avec recouvrement du sol de graminées et d\'herbes. Le microrelief, associé à l\'érosion différentielle de l\'horizon A dans des étendues de solonetz bruns et brun foncé, ne se rencontre que rarement dans les solonetz noirs.</p>', '', '', 12, NULL, '2014-01-06 15:36:50', NULL),
	(650, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'K', 'false', 'bf0000', 'Gray Solodized Solonetz', 'Solonetz solodisé gris', '<p>Soils of this subgroup have a solonetzic B horizon as defined for the Solonetzic order and the properties specified for the Solodized Solonetz great group. They are usually associated with sparse forest vegetation, a subhumid climate, and Eluviated Black Chernozerns or Dark Gray Luvisols developed from parent materials of lower salinity.</p>', '<p>Les sols de ce sous-groupe ont un horizon B solonetzique tel que défini pour l\'ordre solonetzique et les propriétés générales spécifiées pour le grand groupe des solonetz solodisés. Ils sont associés généralement à une végétation de forêt clairsemée, sous un pédoclimat subhumide et à des chernozems noirs éluviés ou à des luvisols gris foncé formés sur des matériaux parentaux de plus faible salinité.</p>', '', '', 13, NULL, '2014-01-06 15:37:16', NULL),
	(651, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'L', 'false', '003f7f', 'Melanic Brunisol', 'Brunisol mélanique', '<p>These are Brunisolic soils having a dark-colored Ah horizon and a relatively high degree of base saturation as indicated by their pH. They occur typically under deciduous or mixed forest vegetation on materials of high base status in areas of boreal to mesic temperature class and humid moisture subclass, but they are not restricted to such environments. Many uncultivated Melanic Brunisols have a forest mull Ah horizon associated with the activity of soil fauna, especially earthworms.</p>', '<p>Ces sols brunisoliques ont un horizon Ah de couleur foncée et un degré de saturation en bases relativement élevé, comme l\'indique leur pH. On les trouve normalement sous une végétation de forêt de feuillus ou mixte, sur matériaux à haute teneur en bases dans les régions où la température du sol est de classe boréale ou mésique et l\'humidité, de sous-classe humide, sans être toutefois restreints à de tels environnements. Plusieurs brunisols mélaniques non cultivés ont un horizon Ah de mull forestier, associé à l\'activité de la faune du sol, surtout des vers de terre.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 14, NULL, '2014-01-06 15:24:18', NULL),
	(652, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'LG', 'false', '007f7f', 'Luvic Gleysol', 'Gleysol luvique', '<p>Soils of this great group have the general properties specified for the Gleysolic order and a horizon of clay accumulation (Btg). They are similar to Luvisolic soils except that they have dull colors or prominent mottling, or both, which indicates strong gleying. They may have organic surface horizons and an Ah horizon. Luvic Gleysols occur commonly on poorly drained sites in association with Luvisolic soils and in depressions in areas of Black and Dark Gray Chernozemic soils.</p>', '<p>Les sols de ce grand groupe possèdent les propriétés générales spécifiées pour les sols de l\'ordre gleysolique et ils ont un horizon d\'argile illuvié (Btg). Ils sont semblables aux sols luvisoliques, sauf qu\'ils montrent des couleurs ternes ou des marbrures marquées, ou les deux, révélatrices d\'une forte gleyification. Ils peuvent avoir des horizons de surface organiques et un horizon Ah. Ils se rencontrent généralement dans les stations mal drainées, en association avec des sols luvisoliques et dans des dépressions, dans les zones de sols chernozémiques noirs et gris foncé.</p>', '', '', 15, NULL, '2014-01-06 15:28:23', NULL),
	(653, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'M', 'false', '56aaff', 'Eutric Brunisol', 'Brunsiol eutrique', '<p>These are Brunisolic soils that have a relatively high degree of base saturation as indicated by their pH and lack a well-developed mineral-organic surface horizon. They occur mainly on parent material of high base status under forest or shrub vegetation in a wide range of climates.</p>', '<p>Ces sols brunisoliques ont un degré de saturation en bases relativement élevé, comme l\'indique leur pH, mais n\'ont pas d\'horizon de surface organo-minéral bien développé. On les trouve surtout sur des matériaux parentaux à contenu élevé en bases, sous une végétation de forêt ou d\'arbrisseaux, dans une grande variété de climats.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 16, NULL, '2014-01-06 15:23:36', NULL),
	(654, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'N', 'false', 'aad4ff', 'Sombric Brunisol', 'Brunisol sombrique', '<p>These are acid Brunisolic soils having a dark-colored Ah horizon and a relatively low base saturation as indicated by their pH. Minor areas of soils of this great group occur in association with the more widely spread Podzolic soils.</p>', '<p>Ces sols brunisoliques acides ont un horizon Ah de couleur foncée et une saturation en bases relativement faible comme l\'indique leur pH. De petites superficies de ce grand groupe se rencontrent avec de plus larges étendues de sols podzoliques.</p>', '', '', 17, NULL, '2014-01-06 15:23:22', NULL),
	(655, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'O', 'false', '3f007f', 'Organic Cryosol', 'Cryosol organique', '<p>These Cryosolic soils have developed primarily from organic material containing more than 17% organic carbon by weight and are underlain by permafrost within 1 m of the surface. They are greater than 40 cm thick, or greater than 10 cm thick over either a lithic contact or an ice layer that is at least 30 cm thick. Landforms associated with Organic Cryosols include palsas, peat polygons, and high-centre polygons.</p>', '<p>Ces sols cryosoliques se sont développés principalement à partir de matériaux organiques qui contiennent plus de 17 % en poids de C organique et qui recouvrent le pergélisol situé à moins de 1 m de la surface. Ils ont plus de 40 cm d\'épaisseur, ou plus de 10 cm d\'épaisseur s\'ils recouvrent soit un contact lithique, soit une couche de glace d\'au moins 30 cm d\'épaisseur. Les formes de terrain associées aux sols cryosoliques organiques sont les palses, les sols polygonaux tourbeux et les sols polygonaux à centre surélevé.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 18, NULL, '2014-01-06 15:18:37', NULL),
	(656, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'P', 'false', '007fff', 'Dystric Brunisol', 'Brunisol dystrique', '<p>These are acid Brunisolic soils that lack a well-developed mineral-organic surface horizon. They occur widely, usually on parent materials of low base status and typically under forest vegetation.</p>', '<p>Ces sols brunisoliques acides n\'ont pas d\'horizon de surface organo-minéral bien développé. On les trouve largement répandus, généralement, sur matériaux parentaux à faible contenu en bases et typiquement sous couvert forestier.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 19, NULL, '2014-01-06 15:23:58', NULL),
	(657, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'Q', 'false', '007f00', 'Humic Podzol', 'Podzol humique', '<p>These soils have a dark-colored podzolic B horizon that contains very little extractable Fe. They occur typically in wet sites so that they are saturated with water during some periods of the year. Characteristically they occur under heath, forest and heath, sphagnum, or western coastal forest vegetation in maritime fringe environments, on some sites at high elevations inland, and in peaty depressions. Under virgin conditions Humic Podzols usually have thick L, F, and H or O horizons underlain by a light-colored eluvial horizon (Ae), an eluvial horizon darkened by humic material, or by a podzolic B horizon, which is usually a Bh. The B horizon may include several kinds of podzolic B subhorizons: Bh, Bhf, and Bf, which may be cemented (ortstein, placic) or friable. The material below the podzolic B horizon may be cemented (duric), compact and brittle (fragipan), or friable.</p>', '<p>Ces sols ont un horizon B podzolique de couleur foncée contenant très peu de Fe extractible au pyrophosphate. Typiquement, on les trouve dans les stations hydriques où ils demeurent saturés d\'eau durant certaines périodes de l\'année. De façon caractéristique, on les retrouve sous la bruyère, la forêt et la bruyère, la sphaigne ou la forêt côtière de l\'Ouest en environnement de littoral maritime, à certains endroits à l\'intérieur des terres en haute altitude et dans des dépressions tourbeuses. À l\'état vierge, les podzols humiques ont habituellement d\'épais horizons L, F et H ou O reposant sur un horizon (Ae) éluvial de couleur pâle, un horizon éluvial assombri par du matériau humique ou sur un horizon B podzolique, habituellement un Bh. L\'horizon B peut inclure plusieurs sortes de sous-horizons B podzoliques - Bh, Bhf, Bf lesquels peuvent être cimentés (d\'ortstein, placique) ou friables. Le matériau sous l\'horizon B podzolique peut être cimenté (durique), compact et cassant (fragipan) ou friable.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 20, NULL, '2014-01-06 15:20:21', NULL),
	(658, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'R', 'false', '7f003f', 'Regosol', 'Régosol', '<p>These Regosolic soils do not have an Ah or dark-colored Ap horizon at least 10 cm thick at the mineral soil surface. They may have buried mineral-organic layers and organic surface horizons, but no B horizon at least 5 cm thick.</p>', '<p>Ces sols régosoliques n\'ont pas d\'horizon Ah ou Ap de couleur foncée de 10 cm ou plus d\'épaisseur à la surface du sol minéral. Ils peuvent avoir des couches organo-minérales enfouies et des horizons organiques en surface mais ils n\'ont pas d\'horizon B de 5 cm ou plus d\'épaisseur.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 21, NULL, '2014-01-06 15:35:25', NULL),
	(659, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'S', 'false', 'aa56ff', 'Static Cryosol', 'Cryosol statique', '<p>These Cryosolic soils have developed primarily in coarse-textured mineral parent materials, or in a wide textural range of recently deposited or disturbed sediments where evidence of cryoturbation is still largely absent, or in both. They may have organic surface horizons less than 40 cm thick.</p>', '<p>Ces sols cryosoliques se sont développés principalement à partir de matériau minéral à texture grossière, ou sur une vaste gamme de texture de sédiments récemment déposés ou perturbésoù les signes de cryoturbation sont totalement absents ou les deux. Ils peuvent avoir des horizons organiques de surface de moins de 40 cm d\'épaisseur.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 22, NULL, '2014-01-06 15:19:06', NULL),
	(660, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'SD', 'false', '7f0000', 'Solod', 'Solod', '<p>Besides an Ae horizon, the soils of this great group have an AB or BA horizon, which appears to have developed through degradation of the upper part of a former solonetzic B horizon. Both the Ae and AB horizons are usually platy. The upper boundary of the solonetzic B horizon is gradual and usually at greater depth than the B horizon of the associated Solonetzs and Solodized Solonetzs.</p>', '<p>En plus d\'un horizon Ae, les sols de ce grand groupe ont un horizon AB ou BA qui semble s\'être développé à la suite de la dégradation de la partie supérieure de l\'ancien horizon B solonetzique. Les deux horizons, Ae et AB, sont généralement lamellaires. La limite supérieure de l\'horizon B solonetzique est graduelle et se trouve à une plus grande profondeur que celle de l\'horizon B des sols solonetz et solonetz solodisés associés.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 23, NULL, '2014-01-06 15:37:32', NULL),
	(661, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'SS', 'false', 'bf0000', 'Solodized Solonetz', 'Solonetz solodisé', '<p>The soils of this great group have a distinct Ae horizon and a hard columnar or prismatic solonetzic B horizon. The Ae horizon is at least 2 cm thick, usually has well-developed platy structure, and its reaction is acid to neutral. It has an abrupt boundary to a strongly expressed, intact, solonetzic B horizon. The Bnt or Bn horizon is hard to extremely hard when dry and usually has a columnar macrostructure with white-capped, coherent columns that break to blocky peds with dark coatings. Usually the Bnt horizon has many clay skins. The C horizon is saline and commonly calcareous.</p>', '<p>Les sols de ce grand groupe ont un horizon Ae distinct et un horizon B solonetzique avec une structure colonnaire ou prismatique à consistance dure à l\'état sec. Habituellement, l\'horizon Ae a au moins 2 cm d\'épaisseur et a une structure lamellaire fortement développée et sa réaction est acide à neutre. Il a une limite abrupte avec un horizon B solonetzique intact et fortement exprimé. L\'horizon Bnt ou Bn est dur à extrêmement dur à l\'état sec et a habituellement une macrostructure colonnaire dont les colonnes liées et coiffées de blanc se fragmentent en peds polyédriques avec des revêtements foncés. Habituellement, l\'horizon Bnt a de nombreux enrobements argileux. L\'horizon C est salin et généralement calcaire.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 24, NULL, '2014-01-06 15:37:58', NULL),
	(662, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'T', 'false', '7f00ff', 'Turbic Cryosol', 'Cryosol turbique', '<p>These are Cryosolic soils that have developed primarily in mineral material and have marked evidence of cryoturbation (Harris et al. 1988). They generally occur on patterned ground, which includes such cryogenic forms as sorted and nonsorted circles, nets, polygons, stripes, and steps in stony or coarse-textured material and nonsorted units such as earth hummocks in medium- and fine-textured materials. The pedon includes all elements of the microtopography in cycles less than 7 m in width. Processes include sorting of different-sized particles and mixing of both mineral and organic material from different horizons. Organic (Oy) or organic-rich, mineral horizons (Ahy) are characteristically present in the region of the permafrost table (upper surface of permafrost layer), and there is generally a buildup of ice in the upper part of the permafrost layer.</p>', '<p>Ces sols cryosoliques se sont développés principalement à partir du matériau minéral et portent des marques évidentes de cryoturbation (Harris et coll., 1988). Ils se trouvent généralement sur des sols structurés qui comportent des formes cryogéniques, comme des réseaux de pierres triées et non triées, disposés en cercle, en polygones, en bandes et en étages, dans les matériaux pierreux ou de texture grossière, et des unités non triées, comme les buttes de terre dans les matériaux de texture moyenne à fine. Le pédon comprend tous les éléments de la microtopographie dans des cycles de moins de 7 m de largeur. Les processus incluent le triage de particules de différentes grosseurs et le mélange des matériaux minéral et organique de différents horizons. Les horizons organiques (Oy) ou minéraux riches en matériau organique (Ahy) sont présents de façon caractéristique dans la zone de pergélisol (surface supérieure de la couche de pergélisol) et il y a généralement formation de glace dans la partie supérieure de la couche de pergélisol.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 25, NULL, '2014-01-06 15:18:52', NULL),
	(663, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'U', 'false', '007f7f', 'Luvic Gleysol', 'Gleysol luvique', '<p>Soils of this great group have the general properties specified for the Gleysolic order and a horizon of clay accumulation (Btg). They are similar to Luvisolic soils except that they have dull colors or prominent mottling, or both, which indicates strong gleying. They may have organic surface horizons and an Ah horizon. Luvic Gleysols occur commonly on poorly drained sites in association with Luvisolic soils and in depressions in areas of Black and Dark Gray Chernozemic soils.</p>', '<p>Les sols de ce grand groupe possèdent les propriétés générales spécifiées pour les sols de l\'ordre gleysolique et ils ont un horizon d\'argile illuvié (Btg). Ils sont semblables aux sols luvisoliques, sauf qu\'ils montrent des couleurs ternes ou des marbrures marquées, ou les deux, révélatrices d\'une forte gleyification. Ils peuvent avoir des horizons de surface organiques et un horizon Ah. Ils se rencontrent généralement dans les stations mal drainées, en association avec des sols luvisoliques et dans des dépressions, dans les zones de sols chernozémiques noirs et gris foncé.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 26, NULL, '2014-01-06 15:28:39', NULL),
	(664, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'V', 'false', '56ff56', 'Ferro-Humic Podzol', 'Podzol ferro-humique', '<p>These soils have a dark-colored podzolic B horizon with a high content of organic C and an appreciable amount of extractable Fe and Al. They occur typically in the more humid part of the region of Podzolic soils under forest vegetation, or forest with heath or moss undercover. Under virgin conditions these soils usually have thick L, F, and H or O horizons; they may have an Ah horizon and usually have a light-colored Ae horizon.</p>', '<p>Ces sols ont un horizon B podzolique de couleur foncée dont la teneur en C organique est élevée et la quantité de Fe et d\'Al extractibles est appréciable. Typiquement, ils se rencontrent dans les parties les plus humides de la région des sols podzoliques, sous une végétation forestière ou sous une forêt avec sous-étage de bruyère ou de mousse. à l\'état vierge, ces sols ont habituellement d\'épais horizons L, F et H ou O; ils peuvent avoir un horizon Ah et habituellement ont un horizon Ae de couleur pâle.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 27, NULL, '2014-01-06 15:19:50', NULL),
	(665, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'W', 'false', '00bf00', 'Humo-Ferric Podzol', 'Podzol humo-ferrique', '<p>These soils have a brownish-colored podzolic B horizon with less organic matter than the B horizon of Ferro-Humic Podzols. They occur widely both in less humid sites of the region of Podzolic soils and in humid sites. Typically they occur under coniferous, mixed, and deciduous forest vegetation but may occur under shrub and grass vegetation. Under virgin conditions these soils usually have L, F, and H horizons and may have an Ah horizon.</p>', '<p>Ces sols ont un horizon B podzolique de couleur brunâtre dont la teneur en matière organique est inférieure à celle de l\'horizon B des podzols ferro-humiques. Ils sont très répandus dans les stations moins humides de la région des sols podzoliques de même que dans les stations humides. Typiquement, on les rencontre sous les forêts de conifères, mélangées ou de feuillus, mais on peut aussi les trouver sous une végétation d\'herbes et d\'arbustes. à l\'état vierge, ces sols ont généralement des horizons L, F et H et peuvent avoir un horizon Ah.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 28, NULL, '2014-01-06 15:20:03', NULL),
	(666, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'X', 'false', 'ffaad4', 'Fibrisol', 'Fibrisol', '<p>Soils of this great group are composed largely of relatively undecomposed fibric organic material. Fibric material is usually classified on the von Post scale of decomposition as classes 1-4. Fibrisols occur extensively in Canada, particularly in peat deposits dominated by sphagnum mosses.</p>', '<p>Les sols de ce grand groupe sont principalement composés de matériau organique fibrique relativement non décomposé. Habituellement, le matériau fibrique se classe de 1 à 4 sur l\'échelle de décomposition von Post. Les fibrisols sont très répandus au Canada, principalement dans les dépôts de ourbe où dominent les mousses de sphaignes.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 29, NULL, '2014-01-06 15:21:30', NULL),
	(667, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'Y', 'false', 'ff56ff', 'Mesisol', 'Mésisol', '<p>Soils of this great group are at a stage of decomposition intermediate between Fibrisols and Humisols. Mesisols have a dominantly mesic middle tier or middle and surface tiers if a terric, lithic, or hydric contact occurs in the middle tier. A mesic layer is an organic layer that fails to meet the requirements of either a fibric or a humic layer. Thus it has a rubbed fiber content ranging from 10% to less than 4070 by volume and has a pyrophosphate index of >3 and <5. Mesic material is usually classified on the van Post scale of decomposition as class 5 or 6.</p>', '<p>Les sols de ce grand groupe sont à un stage de décomposition intermédiaire entre les fibrisols et les humisols. Les mésisols ont un étage intermédiaire à prédominance mésique ou des étages intermédiaire et supérieur, à prédominance mésique, si un contact terrique, lithique ou hydrique se trouve dans l\'étage intermédiaire. Une couche mésique est une couche organique qui ne remplit pas les critères d\'une couche fibrique ou d\'une couche humique. Un horizon mésique a de 10 à 40 % de fibre frottée par volume et son indice au pyrophosphate se situe entre 3 et 5. Habituellement, le matériau mésique est classé 5 ou 6 sur l\'échelle de décomposition von Post.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 30, NULL, '2014-01-06 15:21:45', NULL),
	(668, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', 'Z', 'false', 'ff00ff', 'Humisol', 'Humisol', '<p>Soils of this great group are at the most advanced stage of decomposition of the great groups of Organic soils. Most of the material is humified with few recognizable fibers. Humisols have a dominantly humic middle tier or middle and surface tiers if a terric, lithic, or hydric contact occurs in the middle tier. A humic layer is an organic layer having less than 10% rubbed fiber by volume and a pyrophosphate index of 3 or less. It has a higher bulk density, usually >0.195 Mg m-3, and a lower water-holding capacity than fibric or mesic layers. Humic material usually is classified on the von Post scale of decomposition as class 7 or higher and rarely in class 6. Only minor areas of Humisols are known to occur in Canada.</p>', '<p>Les sols de ce grand groupe sont au stage le plus avancé de décomposition parmi les grands groupes de sols organiques. Une grande partie du matériau est humifiée avec peu de fibres reconnaissables. Les humisols ont un étage intermédiaire à prédominance humique ou des étages intermédiaires et supérieurs à prédominance humique si un contact terrique lithique ou hydrique se trouve dans l\'étage intermédiaire. Une couche humique est une couche organique avec moins de 10 % par volume de fibres frottées et un indice au pyrophosphate de 3 ou moins. Elle a une plus haute densité apparente, généralement > 0,195 Mg m-3 et une plus faible capacité de rétention d\'eau que les couches fibriques et mésiques. Habituellement, le matériau humique est ≥ 7 ou sur l\'échelle de décomposition Von Post; il est rarement dans la classe 6. Au Canada, on ne connaît que de petites étendues d\'humisols.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 31, NULL, '2014-01-06 15:22:12', NULL),
	(669, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', '#', 'true', 'cccccc', 'Water, Rock or Ice', 'Eau, roche ou glace', '<p>Dominant component for some polygons are non-soil (i.e. water, rock, or ice). Analyses involving dominant soil components should take this fact into account.</p>\r\n\r\n', '<p>La composante dominante pour certains polygones sont de categorie non-sol (c.-à-d., de l\'eau, de la glace ou de la roche). Les analyses sur les composantes pédologiques dominantes devraient en tenir compte.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 32, NULL, '2014-01-06 15:39:32', NULL),
	(670, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/soil_development/devel', 'devel', 'none', '*', 'true', '7f7f7f', 'Unknown (urban development)', 'Indéterminée (développement urbain)', '<p>Ecosystems can range from natural systems through to those heavily modified by human activity, such as urbanization.</p>', '<p>Les écosystèmes peuvent être naturels ou fortement modifiés par les activités humaines, en particulier l\'urbanisation.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/soil_development/devel.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/soil_development/devel.html', 33, NULL, '2014-01-06 15:39:45', NULL),
	(671, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'M', 'A', 'false', 'ffffaa', 'Alluvial Deposits', 'Alluvions', '<p>Alluvial Deposits: stratified silt, sand, clay, and gravel; floodplain, delta, and fan deposits; in places overlies and includes glaciofluvial deposits.</p>', '<p>Alluvions : silt, sable, argile et gravier stratifiés; sédiments de plaine d\'inondation, de delta et de cône alluvial; par endroits, surmontent et contiennent des sédiments fluvioglaciaires.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 1, NULL, '2014-01-06 19:17:24', NULL),
	(672, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'C', 'bC', 'false', 'eded0e', 'Colluvial Blocks', 'Blocs de colluvionnement', '<p>Colluvial Blocks: Blocks, and rubble with sand and silt; derived from crystalline bedrock, medium grade metamorphic substrate, and cemented sandstone.</p>', '<p>Blocs de colluvionnement : : blocs et blocaille mélangée avec du sable et du silt; dérivés d\'un substratum cristallin, de roches métamorphosées (degré moyen) et de grès cimentés.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 1, NULL, '2014-01-06 19:03:53', NULL),
	(673, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'GL', 'cL', 'false', '5f00bf', 'Coarse grained (Glacio) Lacustrine', 'Sédiments à grain grossier', '<p>Coarse Grained: sand, silt, and gravel: deposited as deltas, sheet sands and lag deposits.</p>', '<p>Sédiments à grain grossier : sable, silt et gravier; déposés sous forme de deltas, de nappes de sable et de dépôts de déflation.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 1, NULL, '2014-01-06 19:18:25', NULL),
	(674, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'GM', 'cM', 'false', '007fff', 'Coarse grained (Glacio) Marine', 'Sédiments à grain grossier', '<p>Coarse Grained: Sand and gravel: deposited as sheet sands, deltas, and extensive flights of beaches.</p>', '<p>Sédiments à grain grossier : sable, silt et gravier; déposés sous forme de deltas, de nappes de sable et de dépôts de déflation.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 1, NULL, '2014-01-06 19:18:12', NULL),
	(675, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'O', 'E', 'false', '56ffaa', 'Eolian Deposits', 'Sédiments éoliens', '<p>Eolian Deposits: sand and minor silt: dunes, blowouts, and undulating plains: In most places overlies deltaic sediments, coarse lacustrine sediments, or glaciofluvial deposits.</p>', '<p>Sédiments éoliens : sable et un peu de silt; dunes, creux de déflation et plaines onduleuses; reposent habituellement sur des sédiments deltaïques, des sédiments lacustres grossiers ou des sédiments fluvioglaciaires.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 1, NULL, '2014-01-06 19:20:33', NULL),
	(676, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'C', 'fC', 'false', 'bfbf00', 'Colluvial Fines', 'Fines de colluvionnement', '<p>Colluvial Fines: Silt, clay, and fine sand: derived from substrate weakly consolidated shale and siltstone substrate.</p>', '<p>Fines de colluvionnement : silt, argile et sable fin; dérivées de shale et de siltstone faiblement consolidés.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 2, NULL, '2014-01-06 19:04:17', NULL),
	(677, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'GL', 'fL', 'false', 'aa56ff', 'Fine grained (Glacio) Lacustrine', 'Sédiments à grain fin', '<p>Fine Grained: Fine grained silt and clay, locally containing stones: deposited as quiet water sediments.</p>', '<p>Sédiments à grain fin : surtout du silt et de l\'argile contenant par endroits des cailloux; déposés en eau calme.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 2, NULL, '2014-01-06 19:06:57', NULL),
	(678, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'GM', 'fM', 'false', 'aad4ff', 'Fine grained (Glacio) Marine', 'Sédiments à grain fin', '<p>Fine Grained: Dominantly silt and clay, locally containing stones; deposited as a quiet water sediment.</p>', '<p>Sédiments à grain fin : surtout du silt et de l\'argile contenant par endroits des cailloux; déposés en eau calme.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 2, NULL, '2014-01-06 19:11:22', NULL),
	(679, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'GF', 'Gp', 'false', 'ffaa56', 'Glaciofluvial Plain', 'Plaine fluvioglaciaire', '<p>Plain: Sand and Gravel: deposited as outwash sheets, valley trains, and terrace deposits.</p>', '<p>Plaine : sable et gravier; sous forme de nappes d\'épandage fluvioglaciaire, de traînées fluvioglaciaires et de dépôts en terrasse.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 1, NULL, '2014-01-06 19:19:12', NULL),
	(680, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'GF', 'Gx', 'false', 'bf5f00', 'Glaciofluvial Complex', 'Complexe fluvioglaciaire', '<p>Complex: Sand and gravel and locally diamicton: undifferentiated ice contact stratified drift, and outwash; locally includes till and rock.</p>', '<p>Complexe : sable et gravier; diamicton par endroits; sédiments stratifiés non différenciés de contact glaciaire et sédiments d\'épandage fluvioglaciaire; till et roche par endroits.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 2, NULL, '2014-01-06 19:19:02', NULL),
	(681, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'G', 'I', 'true', 'ff00ff', 'Glaciers', 'Glaciers', '<p>Glaciers: Ice and minor morainal debris.</p>', '<p>Glaciers : glace et faible quantité de déblais morainiques.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 1, NULL, '2014-01-06 19:05:30', NULL),
	(682, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'L', 'mL', 'false', 'cbb3e5', 'Lacustrine Mud', 'Boue lacustre', '<p>Lacustrine Mud: Fluid silty clay and clayey silt: deposited as quiet water sediments.</p>', '<p>Boue lacustre : argile silteuse et silt argileux fluides; déposée en eau calme.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 3, NULL, '2014-01-06 19:13:11', NULL),
	(683, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'M', 'mM', 'false', '00bfbf', 'Marine Mud', 'Boue marine', '<p>Marine Mud: Fluid silty clay and clayey silt: deposited as quiet water sediments.</p>', '<p>Boue marine : argile silteuse et silt argileux fluides; déposée en eau calme.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 3, NULL, '2014-01-06 19:20:04', NULL),
	(684, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'M', 'Mv', 'false', '5656ff', 'Lag (Glacio) Marine', 'Résidus de déflation', '<p>Lag: Sand, gravel, and pockets of fine sediment; thin to discontinued sediment veneer and residual lag developed during marine submergence; includes areas of washed till and rock.</p>', '<p>Résidus de déflation : Ssable, gravier et poches de sédiments plus fins; placage mince à discontinu et résidus de déflation mis en place en période de submersion marine; incluent des zones de till et de roche lessivés.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 4, NULL, '2014-01-06 19:21:31', NULL),
	(685, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'O', 'O', 'false', 'cccccc', 'Organic Deposits', 'Sédiments organiques', '<p>Organic deposits: peat, muck and minor inorganic sediments; large bog, fen, and swamp areas where organic fill masks underlying surficial materials; generally > 2m thick</p>', '<p>Sédiments organiques : tourbe, humus et une faible quantité de sédiments non organiques; vastes zones de tourbières (minérotrophes et oligotrophes) et de marécages où les matières organiques masquent les matériaux sous-jacents; épaisseur généralement supérieure à 2 m.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 2, NULL, '2014-01-06 19:02:00', NULL),
	(686, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'R', 'R', 'false', 'f7bebe', 'Undivided', 'Sans division', '<p>Undivided: rock with minor Quaternary deposits.</p>', '<p>Sans division : roches accompagnées d\'un peu de sédiments quaternaires.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 1, NULL, '2014-01-06 19:15:25', NULL),
	(687, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'R', 'Ra', 'false', 'e59999', 'Alpine Complexes', 'Complexes alpins', '<p>Alpine Complexes: rock, colluvium, and till: rock and Quarternary deposits complex in an area, characterized by alpine and glacial landforms.</p>', '<p>Complexes alpins : roche, colluvions et till; complexe de roches et de sédiments quaternaires dans une région, caractérisé par des reliefs alpins et glaciaires.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 2, NULL, '2014-01-06 19:20:58', NULL),
	(688, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'C', 'rC', 'false', '898902', 'Colluvial Rubble', 'Blocaille de colluvionnement', '<p>Colluvial Rubble: Rubble and silt; derived from carbonate and consolidated fine classic sedimentary rock substrate.</p>', '<p>Blocaille de colluvionnement : blocaille et silt; dérivée de roches carbonatées et de roches sédimentaires clastiques consolidées à grain fin.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 3, NULL, '2014-01-06 19:04:40', NULL),
	(689, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'C', 'sC', 'false', '606002', 'Colluvial Sand', 'Sable de colluvionnement', '<p>Colluvial Sand: Sand and gravel; derived from poorly lithified sandstone and conglomerate substrate.</p>', '<p>Sable de colluvionnement : sable et gravier; dérivé de grès et de conglomérat faiblement lithifiés.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 4, NULL, '2014-01-06 19:05:10', NULL),
	(690, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'L', 'sL', 'false', 'ba84f4', 'Lacustrine Sand', 'Sable lacustre', '<p>Lacustrine Sand: Sand and locally gravel; deposited as sheet sands, lags, and beaches.</p>', '<p>Sable lacustre : sable et, par endroits, gravier; déposé sous forme de nappes de sable, de résidus de déflation et de plages.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 4, NULL, '2014-01-06 19:13:49', NULL),
	(691, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'M', 'sM', 'false', '00ffff', 'Marine Sand', 'Sable marin', '<p>Marine Sand: Sand and locally gravel; deposited as sheet sands, lags, and beaches.</p>', '<p>Sable marin : sable et, par endroits, gravier; déposé sous forme de nappes de sable, de résidus de déflation et de plages.</p>', '', '', 5, NULL, '2014-01-06 19:16:27', NULL),
	(692, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'G', 'Tb', 'false', 'aaff56', 'Till Blanket', 'Nappe de till', '<p>Till Blanket: Thick and continuous till.</p>', '<p>Nappe de till : till épais et continu.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 2, NULL, '2014-01-06 19:03:01', NULL),
	(693, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'G', 'Tv', 'false', '00bf00', 'Till Veneer', 'Placage de till', '<p>Till Veneer: Thin and discontinuous till: may include areas of rock outcrop.</p>', '<p>Placage de till : till mince et discontinu; peut inclure de vastes zones d\'affleurement rocheux.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 3, NULL, '2014-01-06 19:03:13', NULL),
	(694, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'R', 'V', 'false', 'bf0000', 'Quaternary Volcanics', 'Volcanites quaternaires', '<p>Quarternary Volcanics: consolidated lava, breccia and tephra: dominantly basaltic and andesitic in composition; includes flows, volcanic piles and cinder cones.</p>', '<p>Volcanites quaternaires : lave, brèche et tephra consolidés; de composition surtout basaltique et andésitique; incluent des coulées, des amas volcaniques et des cônes de scories.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 3, NULL, '2014-01-06 19:15:55', NULL),
	(695, 'http://sis.agr.gc.ca/cansis/nsdb/ecozones/v1/surficial_geology/sfgeology', 'unit', 'M', 'water', 'true', 'ffffff', 'Water', 'Eau', '', '', 'http://sis.agr.gc.ca/cansis/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 'http://sis.agr.gc.ca/siscan/nsdb/ecostrat/zone/v1/surficial_geology/sfgeology.html', 1, NULL, '2014-01-06 19:16:55', NULL),
