	(735, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2/snt/pmchem', 'pmchem', 'none', 'WC', 'false', 'aaffff', 'Weakly Calcareous', 'Faible teneur en calcaire', '<p>&lt; 6 CaCO<sub>3</sub> equivalent (%)</p>', '<p>&lt; 6 CaCO<sub>3</sub> équivalent (%)</p>', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2/snt/pmchem.html', 'http://sis.agr.gc.ca/siscan/nsdb/soil/v2/snt/pmchem.html', 4, NULL, '2013-04-22 15:39:41', NULL),
	(736, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2/snt/pmchem', 'pmchem', 'none', 'VC', 'false', '77ffff', 'Moderately / Very Strongly Calcareous', 'Teneur modérée / très élevée en calcaire', '<p>6 - 40 CaCO<sub>3</sub> equivalent (%)</p>', '<p>6 - 40 CaCO<sub>3</sub> équivalent (%)</p>', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2/snt/pmchem.html', 'http://sis.agr.gc.ca/siscan/nsdb/soil/v2/snt/pmchem.html', 5, NULL, '2013-04-22 15:37:47', NULL),
	(737, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2/snt/pmchem', 'pmchem', 'none', 'EC', 'false', '007f7f', 'Extremely Calcareous', 'Teneur extrême en calcaire', '<p>&gt; 40 CaCO<sub>3</sub> equivalent (%)</p>', '<p> &gt; 40 CaCO<sub>3</sub> équivalent (%)</p>', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2/snt/pmchem.html', 'http://sis.agr.gc.ca/siscan/nsdb/soil/v2/snt/pmchem.html', 6, NULL, '2013-04-22 15:40:04', NULL),
	(738, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2/snt/pmchem', 'pmchem', 'none', 'SA', 'false', '67737f', 'Calcareous and Saline', 'Saline Teneur en calcaire et teneur saline', '<p>Calcareous and Saline</p>', '<p>Saline Teneur en calcaire et teneur saline</p>', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2/snt/pmchem.html', 'http://sis.agr.gc.ca/siscan/nsdb/soil/v2/snt/pmchem.html', 7, NULL, '2012-07-17 17:07:39', NULL),
	(739, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2/snt/pmchem', 'pmchem', 'none', '-', 'true', 'cccccc', 'Not Applicable', 'Ne s\'applique pas', '<p>Not Applicable</p>', '<p>Ne s\'applique pas</p>', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v2/snt/pmchem.html', 'http://sis.agr.gc.ca/siscan/nsdb/soil/v2/snt/pmchem.html', 8, NULL, '2012-07-17 17:05:57', NULL),
	(740, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas', 'hzn_mas', 'mineral', 'A', 'false', '', 'Surface mineral horizon', 'Horizon minéral supérieur', '<p>This mineral horizon forms at or near the surface in the zone of leaching or eluviation of materials in solution or suspension, or of maximum in situ accumulation of organic matter or both. The accumulated organic matter is usually expressed morphologically by a darkening of the surface soil (Ah). Conversely, the removal of organic matter is usually expressed by a lightening of the soil color usually in the upper part of the solum (Ae). The removal of clay from the upper part of the solum (Ae) is expressed by a coarser soil texture relative to the underlying subsoil layers. The removal of iron is indicated usually by a paler or less red soil color in the upper part of the solum (Ae) relative to the lower part of the subsoil.</p>', '<p>Horizon minéral formé, à la surface ou tout près, dans la zone de lessivage ou d\'éluviation de matériaux en solution ou en suspension, ou dans celle d\'accumulation maximale in situ de matière organique, ou dans les deux à la fois. L\'accumulation de matière organique est habituellement exprimée morphologiquement par l\'aspect plus foncé de la couleur de la surface du sol (Ah). Inversement l\'éluviation de la matière organique se manifeste habituellement par une couleur du sol plus claire, généralement dans la partie supérieure du solum (Ae). L\'appauvrissement en argile de la partie supérieure du solum (Ae) se traduit par une texture du sol plus grossière par rapport aux couches sous-jacentes du sous-sol. L\'éluviation en fer se manifeste généralement par une couleur du sol plus pâle ou moins rouge dans la partie supérieure du solum (Ae), par rapport à la partie sous-jacente du sous-sol.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas.html', 'http://sis.agr.gc.ca/siscan/nsdb/soil/v1/slt/hzn_mas.html', 1, NULL, '2012-03-19 14:03:23', NULL),
	(741, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas', 'hzn_mas', 'mineral', 'AB', 'false', '', 'Surface transitional horizon', 'Horizon de transition supérieur', '<p>Gradual transition. The dominance of horizons in the transitional zone may be shown by order, AB or BA, etc. Lower case suffixes may also be added in some instances, e.g., ABg, ABgj, etc.</p>', '<p>Transition graduelle. La dominance des horizons dans une zone de transition peut être montrée par d\'ordre de désignation de l\'horizon, par exemple AB ou BA etc. Dans certains cas, on peut ajouter des suffixes minuscules également, p. ex. ABg, ABgj etc.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas.html', 'http://sis.agr.gc.ca/siscan/nsdb/soil/v1/slt/hzn_mas.html', 2, NULL, '2012-03-19 15:28:07', NULL),
	(742, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas', 'hzn_mas', 'mineral', 'AC', 'false', '', 'Surface transitional horizon', 'Horizon de transition supérieur', '<p>Gradual transition. The dominance of horizons in the transitional zone may be shown by order, AC or BC, etc. Lower case suffixes may also be added in some instances, e.g., ACg, ACgj, etc.</p>', '<p>Transition graduelle. La dominance des horizons dans une zone de transition peut être montrée par d\'ordre de désignation de l\'horizon, par exemple AC ou BC etc. Dans certains cas, on peut ajouter des suffixes minuscules également, p. ex. ACg, ACgj etc.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas.html', 'http://sis.agr.gc.ca/siscan/nsdb/soil/v1/slt/hzn_mas.html', 3, NULL, '2012-03-19 15:29:41', NULL),
	(743, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas', 'hzn_mas', 'mineral', 'B', 'false', '', 'Subsurface mineral horizon', 'Horizon minéral du sous-sol', '<p>This mineral horizon is characterized by enrichment in organic matter, sesquioxides, or clay; or by the development of soil structure; or by a change of color denoting hydrolysis, reduction, or oxidation. In B horizons, accumulated organic matter (Bh) is evidenced usually by dark colors relative to the C horizon. Clay accumulation is indicated by finer soil textures and by clay cutans coating peds and lining pores (Bt). Soil structure developed in B horizons includes prismatic or columnar units with coatings or stainings and significant amounts of exchangeable sodium (Bn) and other changes of structure (Bm) from that of the parent material. Color changes include relatively uniform browning due to oxidation of iron (Bm), and mottling and gleying of structurally altered material associated with periodic reduction (Bg).</p>', '<p>Horizon minéral caractérisé par l\'enrichissement en matière organique, en sesquioxyde ou en argile ou par le développement de la structure du sol, ou un changement de la couleur indiquant l\'hydrolyse, la réduction ou l\'oxydation. Dans les horizons B, l\'accumulation de matière organique (Bh) est communément mise en évidence par des couleurs relativement foncées, en comparaison avec l\'horizon C. L\'accumulation d\'argile est indiquée par des textures de sol plus fines et par des cutanes d\'argile enrobant les peds et remplissant les pores (Bt). La structure du sol qui se forme dans les horizons B comprend les unités prismatiques ou colonnaires avec enrobements ou taches et des quantités significatives de sodium échangeable (Bn) et d\'autres changements de structure (Bm) à partir de celle du matériau parental. Les changements de couleur comprennent la brunification relativement uniforme dû à l\'oxydation du fer (Bm) ainsi que la marmorisation et la gleyification du matériau altéré structuralement, associés à une réduction périodique (Bg).</p>', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas.html', 'http://sis.agr.gc.ca/siscan/nsdb/soil/v1/slt/hzn_mas.html', 4, NULL, '2012-03-19 14:14:41', NULL),
	(744, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas', 'hzn_mas', 'mineral', 'BA', 'false', '', 'Subsurface Transitional Horizon', 'Horizon de transition du sous-sol', '<p>Gradual transition. The dominance of horizons in the transitional zone may be shown by order, AB or BA, etc. Lower case suffixes may also be added in some instances, e.g., BAg, BAgj, etc.</p>', '<p>Transition graduelle. La dominance des horizons dans une zone de transition peut être montrée par d\'ordre de désignation de l\'horizon, par exemple AB ou BA etc. Dans certains cas, on peut ajouter des suffixes minuscules également, p. ex. BAg, BAgj etc.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas.html', 'http://sis.agr.gc.ca/siscan/nsdb/soil/v1/slt/hzn_mas.html', 5, NULL, '2012-03-19 15:31:20', NULL),
	(745, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas', 'hzn_mas', 'mineral', 'BC', 'false', '', 'Subsurface Transitional Horizon', 'Horizon de transition du sous-sol', '<p>Gradual transition. The dominance of horizons in the transitional zone may be shown by order, AC or BC, etc. Lower case suffixes may also be added in some instances, e.g., BCg, BCgj, etc.</p>', '<p>Transition graduelle. La dominance des horizons dans une zone de transition peut être montrée par d\'ordre de désignation de l\'horizon, par exemple AC ou BC etc. Dans certains cas, on peut ajouter des suffixes minuscules également, p. ex. BCg, BCgj etc.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas.html', 'http://sis.agr.gc.ca/siscan/nsdb/soil/v1/slt/hzn_mas.html', 6, NULL, '2012-03-19 16:08:24', NULL),
	(746, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas', 'hzn_mas', 'mineral', 'C', 'false', '', 'Parent mineral horizon', 'Horizon minéral transversal', '<p>This mineral horizon is comparatively unaffected by the pedogenic processes operating in A and B horizons, except the process of gleying (Cg), and the accumulation of calcium and magnesium carbonates (Cca) and more soluble salts (Cs, Csa). Marl, diatomaceous earth, and rock with a hardness ≤3 on Mohs\' scale are considered to be C horizons.</p>', '<p>Horizon minéral comparativement non influencé par les processus pédogéniques agissant dans les horizons A et B, à l\'exception du processus de gleyification (Cg) et de l\'accumulation de carbonates de calcium et de magnésium (Cca) ainsi que de sels plus solubles (Cs, Csa). La marne, la terre de diatomées et le roc de dureté ≤3 sur l\'échelle de Mohs sont considérés comme des horizons C.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas.html', 'http://sis.agr.gc.ca/siscan/nsdb/soil/v1/slt/hzn_mas.html', 7, NULL, '2012-03-19 14:19:01', NULL),
	(748, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas', 'hzn_mas', 'mineral', 'CA', 'false', '', '', '', '', '', '', '', 9, NULL, NULL, NULL),
	(749, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas', 'hzn_mas', 'mineral', 'CB', 'false', '', '', '', '', '', '', '', 10, NULL, NULL, NULL),
	(750, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas', 'hzn_mas', 'organic', 'F', 'false', '', 'Organic horizon partially decomposed', 'Horizon organique partiellement décomposée', '<p>This organic horizon is characterized by an accumulation of partly decomposed organic matter. Some of the original structures are difficult to recognize. The material may be partly comminuted by soil fauna as in moder, or it may be a partly decomposed mat permeated by fungal hyphae as in mor.</p>', '<p>Horizon organique caractérisé par une accumulation de matière organique partiellement décomposée. Certaines des structures originelles sont difficiles à reconnaître. Le matériau peut avoir été partiellement fragmenté par la faune du sol comme dans un moder, ou il peut former un tapis partiellement décomposé, infiltré par des hyphes fongiques, comme dans le mor.</p>', '', '', 1, NULL, '2012-03-20 15:47:09', NULL),
	(751, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas', 'hzn_mas', 'organic', 'FH', 'false', '', '', '', '', '', '', '', 2, NULL, NULL, NULL),
	(752, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas', 'hzn_mas', 'organic', 'H', 'false', '', 'Organic horizon of indiscernible origin', 'Horizon organique d\'origine indiscernable', '<p>This organic horizon is characterized by an accumulation of decomposed organic matter in which the original structures are indiscernible. This horizon differs from the F by having greater humification due chiefly to the action of organisms. It is frequently intermixed with mineral grains, especially near the junction with a mineral horizon.</p>', '<p>Horizon organique caractérisé par l\'accumulation de matière organique décomposée dans laquelle il est impossible de reconnaître les structures originelles. Cet horizon diffère du F par son degré d\'humification plus élevé, dû principalement à l\'action d\'organismes. Il est fréquemment mélangé à des particules minérales, principalement près de son point de contact avec un horizon minéral.</p>', '', '', 3, NULL, '2012-03-20 15:50:04', NULL),
	(753, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas', 'hzn_mas', 'organic', 'L', 'false', '', 'Organic horizon poorly decomposed', 'Horizon organique mal décomposée', '<p>This organic horizon is characterized by an accumulation of organic matter in which the original structures are easily discernible.</p>', '<p>Horizon organique caractérisé par une accumulation de matière organique dans lequel les structures d\'origine sont facilement repérables. </ p>', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas.html', 'http://sis.agr.gc.ca/siscan/nsdb/soil/v1/slt/hzn_mas.html', 4, NULL, '2012-03-19 13:53:14', NULL),
	(754, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas', 'hzn_mas', 'organic', 'LF', 'false', '', '', '', '', '', '', '', 5, NULL, NULL, NULL),
	(755, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas', 'hzn_mas', 'organic', 'LFH', 'false', '', '', '', '', '', '', '', 6, NULL, '2012-03-19 16:17:38', NULL),
	(756, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas', 'hzn_mas', 'organic', 'LH', 'false', '', '', '', '', '', '', '', 7, NULL, NULL, NULL),
	(757, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas', 'hzn_mas', 'organic', 'O', 'false', '', 'Organic horizon from mosses, rushes and woody materials', 'Horizon organique de mousses, de joncs et des matières ligneuses', '<p>This organic horizon is developed mainly from mosses, rushes, and woody materials.</p>', '<p>Horizon organique développé principalement à partir de mousses, de joncs et matériaux ligneux.</p>', '', '', 8, NULL, '2012-03-19 13:56:06', NULL),
	(758, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas', 'hzn_mas', 'other', 'R', 'false', '', 'Rock', 'Couche de roc', '<p>This consolidated bedrock layer is too hard to break with the hands (>3 on Mohs\' scale) or to dig with a spade when moist. It does not meet the requirements of a C horizon. The boundary between the R layer and any overlying unconsolidated material is called a lithic contact.</p>', '<p>Cette couche de roc consolidé est trop dure pour être brisée à la main (> 3 sur l\'échelle de Mohs) ou creusée à la pelle lorsqu\'à l\'état humide. Elle ne rencontre pas les exigences d\'un horizon C. La limite entre la couche R et tout matériau non consolidé la recouvrant s\'appelle un contact lithique.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas.html', 'http://sis.agr.gc.ca/siscan/nsdb/soil/v1/slt/hzn_mas.html', 1, NULL, '2012-03-19 14:32:35', NULL),
	(759, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas', 'hzn_mas', 'other', 'W', 'false', '', 'Water', 'Couche d\'eau', '<p>This layer of water may occur in Gleysolic, Organic, or Cryosolic soils. Hydric layers in Organic soils are a kind of W layer as is segregated ice formation in Cryosolic soils.</p>', '<p>Cette couche d\'eau peut être présente dans les sols gleysoliques, organiques ou cryosoliques. Dans les sols organiques, les couches hydriques sont une sorte de couche W, comme le est la formation de ségrégations de glace dans les sols cryosoliques.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas.html', 'http://sis.agr.gc.ca/siscan/nsdb/soil/v1/slt/hzn_mas.html', 2, NULL, '2012-03-19 14:33:59', NULL),
	(760, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/hzn_mas', 'hzn_mas', 'other', '-', 'false', '', 'Not applicable', '', '', '', '', '', 3, NULL, NULL, NULL),
	(761, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/domsand', 'domsand', 'none', 'VC', 'false', '', 'Very Coarse', 'Très grossier', '<p>The dominant sand fraction class is of type \'very coarse\'.</p>', '<p>La fraction de sable dominante est de catégorie \'très grossier\'.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/domsand.html', 'http://sis.agr.gc.ca/siscan/nsdb/soil/v1/slt/domsand.html', 1, NULL, '2012-03-16 17:46:18', NULL),
	(762, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/domsand', 'domsand', 'none', 'C', 'false', '', 'Coarse', 'Grossier', '<p>The dominant sand fraction class is of type \'Coarse\'.</p>', '<p>La fraction de sable dominante est de catégorie \'grossier\'.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/domsand.html', 'http://sis.agr.gc.ca/siscan/nsdb/soil/v1/slt/domsand.html', 2, NULL, '2012-03-16 17:46:30', NULL),
	(763, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/domsand', 'domsand', 'none', 'M', 'false', '', 'Medium', 'Moyen', '<p>The dominant sand fraction class is of type \'Medium\'.</p>', '<p>La fraction de sable dominante est de catégorie \'moyen\'.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/domsand.html', 'http://sis.agr.gc.ca/siscan/nsdb/soil/v1/slt/domsand.html', 3, NULL, '2012-03-16 17:46:43', NULL),
	(764, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/domsand', 'domsand', 'none', 'F', 'false', '', 'Fine', 'Fin', '<p>The dominant sand fraction class is of type \'Fine\'.</p>', '<p>La fraction de sable dominante est de catégorie \'fin\'.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/domsand.html', 'http://sis.agr.gc.ca/siscan/nsdb/soil/v1/slt/domsand.html', 4, NULL, '2012-03-16 17:46:55', NULL),
	(765, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/domsand', 'domsand', 'none', 'VF', 'false', '', 'Very Fine', 'Très fin', '<p>The dominant sand fraction class is of type \'Very Fine\'.</p>', '<p>La fraction de sable dominante est de catégorie \'très fin\'</p>', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/domsand.html', 'http://sis.agr.gc.ca/siscan/nsdb/soil/v1/slt/domsand.html', 5, NULL, '2012-03-16 17:45:49', NULL),
	(766, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/domsand', 'domsand', 'none', '-', 'true', '', 'Not applicable', 'Ne s\'applique pas', '<p>The dominant sand fraction class is not applicable.</p>', '<p>La fraction de sable dominante ne s\'applique pas.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/domsand.html', 'http://sis.agr.gc.ca/siscan/nsdb/soil/v1/slt/domsand.html', 6, NULL, '2012-03-16 17:49:18', NULL),
	(767, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/crt/cfrag', 'cfrag', 'none', 'D', 'false', 'ff5656', 'More than 65% ', 'Plus que 65%', '<p>More than 65% of the coarse fragment content of the control section.</p>', '<p>Plus que 65% de teneur en fragments grossiers de la section témoin.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/crt/cfrag.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.2/crt/cfrag.html', 1, NULL, '2014-01-15 22:32:39', 'schutp'),
	(768, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/crt/cfrag', 'cfrag', 'none', 'C', 'false', 'ffd4aa', '31 - 65% ', '31 - 65% ', '<p>From 31 to 65% of coarse fragment content of the control section.</p>', '<p>De 31 à 65% de teneur en fragments grossiers de la section témoin.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/crt/cfrag.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.2/crt/cfrag.html', 2, NULL, '2014-01-15 22:32:10', 'schutp'),
	(769, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/crt/cfrag', 'cfrag', 'none', 'B', 'false', 'ffffaa', '10 - 30% ', '10 - 30% ', '<p>From 10 to 30% of coarse fragment content of the control section.</p>', '<p>De 10 à 30% de teneur en fragments grossiers de la section témoin.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/crt/cfrag.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.2/crt/cfrag.html', 3, NULL, '2014-01-15 22:31:55', 'schutp'),
	(770, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/crt/cfrag', 'cfrag', 'none', 'A', 'false', 'c1f48d', 'Less than 10%', 'Moins que 10%', '<p>Less than 10% of coarse fragment content of the control section.</p>', '<p>Moins que 10% de teneur en fragments grossiers de la section témoin.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/crt/cfrag.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.2/crt/cfrag.html', 4, NULL, '2014-01-15 22:31:36', 'schutp'),
	(771, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/crt/cfrag', 'cfrag', 'none', '-', 'true', 'e5e5e5', 'Not applicable', 'Ne s\'applique pas', '<p>Coarse fragment content of the control section is non applicable.</p>', '<p>La teneur en fragments grossiers de la section témoin ne s\'applique pas.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/crt/cfrag.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v3.2/crt/cfrag.html', 5, NULL, '2013-12-04 21:00:21', NULL),
	(772, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/cmp/stoniness', 'stoniness', 'none', '0', 'false', '48aa2a', 'Nonstony', 'Non pierreux', '<p>No stones or too few are present to interfere with cultivation (&lt;0.01% of surface, stones more than 25 m apart).</p>', '<p>Pas ou très peu de pierres (sur moins de 0,01% de la surface) et la distance entre les pierres est de plus de 25m.</p>', '', '', 1, NULL, '2012-07-17 15:24:08', NULL),
	(773, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/cmp/stoniness', 'stoniness', 'none', '1', 'false', 'a6f458', 'Slightly stony', 'Légèrement pierreux ', '<p>Some stones are present that hinder cultivation slightly or not at all (0.01-0.1% of surface, stones 8-25 m apart).</p>', '<p>Quelques pierres sont présentes et elles nuisent légèrement ou pas du tout à la culture du sol (sur 0,01 à 0,1% de la surface du terrain et la distance entre les pierres est de 8 à 25m).</p>', '', '', 2, NULL, '2012-07-17 15:24:24', NULL),
	(774, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/cmp/stoniness', 'stoniness', 'none', '2', 'false', 'f9f993', 'Moderately stony', 'Modérément pierreux ', '<p>Enough stones are present to cause some interference with cultivation (0.1-3% of surface, stones 1-8m apart).</p>', '<p>Il y a assez de pierres pour nuire à la culture du sol (sur 0,1 à 3% de la surface et la distance entre les pierres est de 1 à 8m).</p> ', '', '', 3, NULL, '2012-12-04 20:20:07', NULL),
	(775, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/cmp/stoniness', 'stoniness', 'none', '3', 'false', 'ffaaaa', 'Very stony', 'Très pierreux ', '<p>There are sufficient stones to handicap cultivation seriously; some clearing is required (3-15% of surface, stones 0.5-1m apart).</p>', '<p>Les pierres sont suffisamment nombreuses pour entraver gravement la culture (sur 3 à 15% de la surface du terrain et la distance entre les pierres est de 0,5 à 1m). Un certain épierrement est nécessaire.</p>\r\n', '', '', 4, NULL, '2012-07-17 15:24:59', NULL),
	(776, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/cmp/stoniness', 'stoniness', 'none', '4', 'false', 'fc6262', 'Exceedingly stony', 'Extrêmement pierreux', '<p>The stones prevent cultivation until considerable clearing is done (15-50% of surface, stones 0.1-0.5m apart).</p>', '<p>Les pierres entravent la culture du sol (sur 15 à 50% de la surface du terrain et la distance entre les pierres est de 0,1 à 0,5 m) à moins qu\'un bon épierrement ne soit fait.</p>', '', '', 5, NULL, '2013-07-15 19:17:08', NULL),
	(777, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/cmp/stoniness', 'stoniness', 'none', '5', 'false', 'fc3c3c', 'Excessively stony', 'Excessivement pierreux', '<p>The land surface is too stony to permit cultivation; it is boulder or stone pavement (more than 50% of surface, stones less than 0.1m apart).</p>', '<p>Les pierres sont trop nombreuses pour permettre la culture du sol (sur plus de 50% de la surface du terrain et la distance entre les pierres est moins de 0,1 m). C\'est un terrain pavé de blocs ou de pierres.</p>', '', '', 6, NULL, '2012-12-04 20:20:48', NULL),
	(778, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v3/cmp/stoniness', 'stoniness', 'none', '-', 'true', 'cccccc', 'Not Applicable ', 'Ne s\'applique pas', '<p>Not Applicable</p>', '<p>Ne s\'applique pas</p>', '', '', 7, NULL, '2012-07-17 15:25:51', NULL),
	(779, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v3.2/numeric/missing', 'missing', 'none', '-9', 'true', '', 'Missing value', 'Valeur manquante', '<p>Missing value</p>', '<p>Valeur manquante</p>', '', '', 99999, NULL, NULL, NULL),
	(780, 'http://sis.agr.gc.ca/cansis/nsdb/detailed/index/status', 'status', 'none', 'Not Surveyed', 'false', 'cccccc', 'Not Surveyed', 'Non arpenté', '', '', 'http://sis.agr.gc.ca/cansis/nsdb/detailed/index/status.html', 'http://sis.agr.gc.ca/siscan/nsdb/detailed/index/status.html', 2, NULL, '2012-07-17 13:42:42', NULL),
	(781, 'http://sis.agr.gc.ca/cansis/nsdb/detailed/index/status', 'status', 'none', 'Water', 'false', '3b40e2', 'Water', 'Eau', '', '', 'http://sis.agr.gc.ca/cansis/nsdb/detailed/index/status.html', 'http://sis.agr.gc.ca/siscan/nsdb/detailed/index/status.html', 1, NULL, '2013-12-11 14:11:10', 'schutp'),
	(782, 'http://sis.agr.gc.ca/cansis/nsdb/detailed/index/status', 'status', 'none', 'Not Digital', 'false', 'ff5656', 'Not Digital', 'Non numérique', '', '', 'http://sis.agr.gc.ca/cansis/nsdb/detailed/index/status.html', 'http://sis.agr.gc.ca/siscan/nsdb/detailed/index/status.html', 3, NULL, '2012-07-17 13:43:02', NULL),
	(783, 'http://sis.agr.gc.ca/cansis/nsdb/detailed/index/status', 'status', 'none', 'Not Online', 'false', 'ffaa56', 'Not Online', 'Non disponible en ligne', '', '', 'http://sis.agr.gc.ca/cansis/nsdb/detailed/index/status.html', 'http://sis.agr.gc.ca/siscan/nsdb/detailed/index/status.html', 4, NULL, '2012-07-17 13:42:17', NULL),
	(784, 'http://sis.agr.gc.ca/cansis/nsdb/detailed/index/status', 'status', 'none', 'Incomplete', 'false', 'e5e54e', 'Incomplete', 'Incomplète', '', '', 'http://sis.agr.gc.ca/cansis/nsdb/detailed/index/status.html', 'http://sis.agr.gc.ca/siscan/nsdb/detailed/index/status.html', 5, NULL, '2012-07-17 13:41:58', NULL),
	(785, 'http://sis.agr.gc.ca/cansis/nsdb/detailed/index/status', 'status', 'none', 'Complete', 'false', '5ed15e', 'Complete', 'Complète', '', '', 'http://sis.agr.gc.ca/cansis/nsdb/detailed/index/status.html', 'http://sis.agr.gc.ca/siscan/nsdb/detailed/index/status.html', 6, NULL, '2012-07-17 13:41:33', NULL),
	(786, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2/cmp/rockiness', 'rockiness', 'none', '#', 'true', 'cccccc', 'Not Applicable', 'Ne s\'applique pas', '<p>Not Applicable</p>', '<p>Ne s\'applique pas</p>', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2/cmp/rockiness.html', 'http://sis.agr.gc.ca/siscan/nsdb/dss/v2/cmp/rockiness.html', 7, NULL, '2012-07-17 15:06:56', NULL),
	(787, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2/cmp/rockiness', 'rockiness', 'none', '0', 'false', '48aa2a', 'Nonrocky land', 'Aucun affleurement rocheux', '<p>Bedrock exposures do not interfere seriously with tillage. Exposures, if present, are generally more than 100m apart and cover less than 2% of the surface.</p>', '<p>Les affleurements rocheux n\'affectent pas gravement les travaux du sol. Selon leur position, les affleurements rocheux sont distants de plus de 100m les uns des autres et couvrent moins de 2 % de la surface.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2/cmp/rockiness.html', 'http://sis.agr.gc.ca/siscan/nsdb/dss/v2/cmp/rockiness.html', 1, NULL, '2012-07-17 15:09:50', NULL),
	(788, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2/cmp/rockiness', 'rockiness', 'none', '1', 'false', 'a6f458', 'Slightly rocky land', 'Affleurements rocheux épars', '<p>The bedrock exposures interfere with tillage but not enough to make intertilled crops impracticable. Depending on the pattern and how it affects tillage, rock exposures are roughly 35-100m apart and cover 2-10% of the surface.</p>\r\n', '<p>Les affleurements rocheux nuisent aux travaux du sol, mais pas assez pour rendre les cultures sarclées impraticables. Selon leur position, les affleurements rocheux sont distants d\'environ 35 à 100m les uns des autres et couvrent de 2 à 10% de la surface.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2/cmp/rockiness/rockiness.html', 'http://sis.agr.gc.ca/siscan/nsdb/dss/v2/cmp/rockiness/rockiness.html', 2, '2012-03-01 21:51:03', '2012-07-17 15:08:48', NULL),
	(789, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2/cmp/rockiness', 'rockiness', 'none', '2', 'false', 'f9f993', 'Moderately rocky land', 'Quelques affleurements rocheux', '<p>Sufficient bedrock exposures to make tillage of intertilled crops impracticable, but soil can be worked for hay crops or improved pasture if other soil characteristics are favorable. Rock exposures are roughly 10 - 35m apart and cover 10-25%; of the surface, depending upon the pattern.</p>', '<p>Les affleurements rocheux rendent impraticables les travaux du sol de cultures sarclées, mais si les autres caractéristiques du sol sont favorables, le sol peut être préparé pour les récoltes de foin ou pour le pâturage amélioré. Selon leur position, les affleurements rocheux sont distants d\'environ 10 à 35 m les uns des autres et couvrent environ de 10 à 25 % de la surface</p>', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2/cmp/rockiness.html', 'http://sis.agr.gc.ca/siscan/nsdb/dss/v2/cmp/rockiness.html', 3, NULL, '2012-12-04 20:22:21', NULL),
	(790, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2/cmp/rockiness', 'rockiness', 'none', '3', 'false', 'ffaaaa', 'Very rocky land', 'Nombreux affleurements rocheux', '<p>The rock outcrops make all use of machinery impracticable, except for small machinery. Where other soil characteristics are favorable the land may have some use for native pasture or forests. Rock exposures or patches of soil too thin over rock for use are roughly 3.5-10m apart and cover 25-50% of the surface depending on the pattern.</p>', '<p>Les affleurements rocheux rendent impraticable toute utilisation d\'instruments agricoles, à l\'exception d\'instruments légers. Là où les autres caractéristiques du sol sont particulièrement favorables, la terre peut offrir une certaine possibilité d\'utilisation pour le pâturage naturel ou la forêt. Selon leur position, les affleurements rocheux sont distants d\'environ 3,5 à 10m les uns des autres et couvrent environ de 25 à 50% de la surface.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2/cmp/rockiness.html', 'http://sis.agr.gc.ca/siscan/nsdb/dss/v2/cmp/rockiness.html', 4, NULL, '2012-07-17 15:11:55', NULL),
	(792, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2/cmp/rockiness', 'rockiness', 'none', '4', 'false', 'fc6262', 'Exceedingly rocky land', 'Affleurements rocheux en majorité', '<p>Sufficient rock outcrop or insufficient depth of soil over rock makes all use of machinery impracticable. The land may have some value for poor pasture or forestry. Rock outcrops are less than 3.5m apart and cover 50-90% of the area.</p>', '<p>Les affleurements rocheux sont assez nombreux ou l\'épaisseur du sol sur le roc est insuffisante pour rendre impraticable l\'utilisation des instruments agricoles. La terre peut avoir une certaine valeur pour de maigres pâturages ou pour la forêt. Selon leur position, les affleurements rocheux sont distants de moins de 5m entre eux et couvrent environ de 50 à 90% de la surface.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2/cmp/rockiness.html', 'http://sis.agr.gc.ca/siscan/nsdb/dss/v2/cmp/rockiness.html', 5, NULL, '2012-12-04 20:22:42', NULL),
	(793, 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2/cmp/rockiness', 'rockiness', 'none', '5', 'false', 'fc3c3c', 'Excessively rocky land', 'Affleurements rocheux en majorité', '<p>Land on which over 90% of the surface is exposed bedrock (rock outcrop).</p>', '<p>Les affleurement rocheux couvrent plus de 90% de la surface.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/dss/v2/cmp/rockiness.html', 'http://sis.agr.gc.ca/siscan/nsdb/dss/v2/cmp/rockiness.html', 6, NULL, '2012-12-04 20:23:02', NULL),
	(794, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/reliability', 'reliability', 'none', 'V', 'false', '', 'Very low', 'Très faible', '<p>Compiled from interpretation of LANDSAT data <em>only</em>; no\r\nground data were collected for verification of these areas.</p>', '<p>Polygone compilé <em>uniquement</em> à partir de l\'interprétation de données du LANDSAT; aucune donnée de terrain n\'a été recueillie pour vérification de ces régions.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/reliability.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/reliability.html', 4, '2012-03-05 22:36:54', '2012-03-15 17:48:26', NULL),
	(795, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/reliability', 'reliability', 'none', 'L', 'false', '', 'Low', 'Faible', '<p>Compiled from soil survey maps produced from field traverses at wide intervals (up to 10 km) and without the use of aerial photographs</p>\r\n<center><em>or</em></center>\r\n<p>Compiled from maps produced by inspections using fixed wing aircraft or helicopter and aided by the interpretation of LANDSAT imagery.</p>', '<p>Polygone compilé à partir de cartes de levés pédologiques produites à partir de cheminements réalisés à des intervalles distants (atteignant 10 km) et sans l\'utilisation de photographies aériennes</p>\r\n<center><em>ou</em></center>\r\n<p>Polygone compilé à partir des cartes produites à partir d\'inspections aériennes (aéronef à voilure fixe ou hélicoptère) et de l\'interprétation d\'images LANDSAT.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/reliability.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/reliability.html', 3, '2012-03-06 15:06:20', '2012-03-15 17:48:10', NULL),
	(796, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/reliability', 'reliability', 'none', 'M', 'false', '', 'Medium', 'Moyenne', '<p>Produced from systematic traverses by helicopter and by interpretation of stereoscopic aerial photographs</p>\r\n<center><em>or</em></center>\r\n<p>Compiled from modern soil survey procedures, which include traversing existing accessible roads in wilderness areas, and aided by interpretation of stereoscopic aerial photographs.</p>', '<p>Polygone produit à partir de cheminements systématiques réalisés par hélicoptère et de l\'interprétation de photographies aériennes stéréoscopiques.</p>\r\n<center><em>ou</em></center>\r\n<p>Polygone compilé à partir de méthodes de levés pédologiques modernes qui permettent le cheminement le long des routes des régions sauvages et d\'interpréter les photographies aériennes stéréoscopiques.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/reliability.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/reliability.html', 2, '2012-03-06 15:10:09', '2012-03-15 17:46:10', NULL),
	(797, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/reliability', 'reliability', 'none', 'H', 'false', '', 'High', 'Élevée', '<p>Compiled from modern soil survey maps produced from field traverses at <= 1.6 km intervals and with the aid of stereoscopic aerial photographs.</p>', '<p>Polygone compilé à partir de cartes modernes de levés pédologiques produites au moyen de cheminements réalisés sur le terrain à des intervalles < = 1,6 km et à l\'aide de photos aériennes stéréoscopiques.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/reliability.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/reliability.html', 1, '2012-03-06 15:11:57', '2012-03-15 17:41:44', NULL),
	(798, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/reliability', 'reliability', 'none', '-', 'true', '', 'Not identified', 'Non déterminée', '<p>Reliability was not identified.</p>', '<p>La fiabilité n\'a pas été déterminée.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/reliability.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/reliability.html', 5, '2012-03-06 15:23:16', '2012-03-15 17:48:44', NULL),
	(799, 'tbd', 'tbd', 'none', 'tbd', 'false', '', 'tbd', 'tbd', 'tbd', 'tbd', '', '', 0, '2012-03-06 11:20:49', NULL, NULL),
	(800, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/complexity', 'complexity', 'none', 'H', 'false', 'bf0000', 'High', 'Élevée', '<p>Soil and landscape attributes are highly variable and unpredictable; dominant, subdominant , and inclusion components are present, each of which has been generalized from more than two classes of parent material or soil development, or both; this class indicates extreme oversimplification in any interpretations from the attribute tables.</p>', '<p>Les attributs de sol et de paysage sont très variables et imprévisibles; il y a des composantes dominantes et sous-dominantes, ainsi que des inclusions, chacune ayant été généralisée à partir d\'au moins deux classes de matériau parental ou de développement du sol, ou des deux; cette classe indique qu\'il y a une simplification extrême dans toute interprétation à partir des tableaux des attributs.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/complexity.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/complexity.html', 1, '2012-03-07 13:22:58', '2014-01-06 20:36:38', NULL),
	(801, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/complexity', 'complexity', 'none', 'M', 'false', 'ff7f00', 'Medium', 'Moyenne', '<p>Soil and landscape attributes are moderately variable but predictable; there are generally dominant and subdominant components, each of which usually have been generalized from no more than two classes of parent material or soil development, or both; there may also be an inclusion in the polygon.</p>', '<p>Les attributs de sol et de paysage sont moyennement variables, mais prévisibles; on trouve généralement des composantes dominantes et sous-dominantes, chacune ayant été généralisée habituellement à partir d\'au plus deux classes de matériau parental ou de développement du sol, ou des deux; il peut y avoir aussi une inclusion dans le polygone.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/complexity.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/complexity.html', 2, '2012-03-07 13:24:44', '2014-01-06 20:36:50', NULL),
	(802, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/complexity', 'complexity', 'none', 'L', 'false', 'bfbf00', 'Low', 'Faible', '<p>Soil and landscape attributes within the polygon are uniform for most interpretations; in most cases the polygon has only a dominant component.</p>', '<p>Les attributs de sol et de paysage d\'un polygone donné sont uniformes pour la plupart des interprétations; dans la plupart des cas, le polygone ne comporte qu\'une composante dominante.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/complexity.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/complexity.html', 3, '2012-03-07 13:29:51', '2014-01-06 20:37:01', NULL),
	(803, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/complexity', 'complexity', 'none', '-', 'true', 'cccccc', 'Not identified', 'Non déterminée', '<p>Complexity was not identified.</p>', '<p>La complexité n\'a pas été établie.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/complexity.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/complexity.html', 4, '2012-03-07 13:30:13', '2014-01-06 20:37:10', NULL),
	(804, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/regfm', 'regfm', 'none', 'B', 'false', 'aaffff', 'Tableland (or plateau)', 'Dominée par des hauts plateaux', '<p>Comparatively flat areas of great extent commonly bounded on at least one side by an abrupt escarpment, or may be terminated by mountains; may be dissected by deep valleys and deeply incised rivers; may be tectonic, erosional, or volcanic in origin; may be step-faulted; slopes generally &lt;10%, in some places 10-15%; relief generally &lt;50 m.</p>', '<p>Région très étendue relativement plane, généralement bornée, tout au moins d\'un côté, par un escarpement; ou, peut être bornée par des montagnes; peut être disséquée par des vallées profondes et des rivières profondément encaissées, peut avoir une origine tectonique, érosive ou volcanique; peut comporter des failles en escalier; les pentes sont généralement &lt;10 %, par endroit 10-15 %; la variation du relief est généralement &lt;50 m.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/regfm.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/regfm.html', 1, '2012-03-07 15:11:33', '2014-01-06 15:03:27', NULL),
	(805, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/regfm', 'regfm', 'none', 'H', 'false', 'aaffaa', 'Hilland', 'Dominée par des collines', '<p>Natural elevations rising prominently above the surrounding plain and having a recognizably denser pattern of generally higher knolls or crest lines with an irregular or chaotic surface form composed of upper surface convexity and lower concavity; includes hummocky morainal material, volcanic cones, and conical hills or lava; slopes generally 10 - 30%; relief generally &lt;100 m.</p>', '<p>Relief naturel s\'élevant au-dessus de la plaine avoisinante et présentant des crêtes ou des monticules légèrement plus élevés à surface irrégulière ou chaotique composés de convexités en haut et de concavités en bas; comprend les moraines mammelonnées, les cônes volcaniques et les collines côniques de lave; les pentes varient généralement de 10 à 30 %; la variation du relief est généralement &lt;100 m.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/regfm.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/regfm.html', 2, '2012-03-07 15:15:24', '2014-01-06 15:03:50', NULL),
	(806, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/regfm', 'regfm', 'none', 'M', 'false', 'ffaa56', 'Mountain', 'Dominée par des montagnes', '<p>Erosional and volcanic landscapes with relief (vertical distance between higher and lower parts) &ge;300 m with most of the area comprising valley to summit terrain; slopes generally &gt;30%. In general the terrain has a restricted summit area and steep sides, irregular shape and considerable bare rock surface, or very thin soil cover; occur as a single, isolated feature or in a group forming a long chain or range; major scarps are relatively steep and straight cliff-like slopes of considerable linear extent separating surfaces such as plateaus lying at different levels.</p>', '<p>Forme érosive ou volcanique à relief (distance verticale entre les portions les plus basses et les plus élevées) &ge;300 m, la majeure partie de la zone étant constituée par le terrain situé entre la vallée et le sommet; les pentes sont généralement &gt;30 %. En général, le terrain comporte un sommet étroit et des versants abrupts, est de forme irrégulière et présente des affleurements rocheux considérables ou une couverture de sol très mince; se rencontre en relief isolé ou se présente en groupe formant une chaîne de montagnes; les principaux escarpements sont relativement marqués et de longs versants rectilignes ressemblent à des falaises qui séparent des surfaces comme des plateaux à différentes altitudes.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/regfm.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/regfm.html', 3, '2012-03-07 15:17:00', '2014-01-06 15:04:06', NULL),
	(807, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/regfm', 'regfm', 'none', 'O', 'false', 'bf5f00', 'Organic wetland', 'Dominée par des terres organiques humides', '<p>Areas dominated by organic material &gt;40 cm thick; contains &gt;30% organic matter by weight; occurs in a variety of wetland surface forms.</p>', '<p>Superficies dominées par des matériaux organiques &gt;40 cm d\'épaisseur; renferment &gt;30 % de matière organique en poids, adoptent une diversité de modelés de surface de terres humides.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/regfm.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/regfm.html', 4, '2012-03-07 15:19:42', '2014-01-06 15:04:21', NULL),
	(808, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/regfm', 'regfm', 'none', 'P', 'false', 'ffffaa', 'Plain', 'Dominée par des plaines', '<p>Flat to very gently undulating areas having few or no prominent irregularities; formed by erosional or by depositional (or constructional) processes; include broad continuous, gently sloping piedmont plains extending along and from the base of a mountain, formed by lateral coalescence of a series of separate but confluent alluvial fans; alluvial processes are mainly responsible for the sedimentation; coarse fragments are rounded by transport over relatively long distances; slopes generally &lt;6%; relief generally &lt;10 m; extent generally &gt;5 km in one direction.</p>', '<p>Superficie plane ou très légèrement ondulée n\'ayant aucune irrégularité proéminente, ou très peu; formée par des processus d\'érosion ou d\'accumulation (ou de sédimentation); comporte de grandes plaines de piémont à pente douce qui entourent la base des montagnes, formées par la coalescence latérale d\'une série de cônes alluviaux distincts mais confluents; la sédimentation est essentiellement le fait des phénomènes alluviaux; les fragments grossiers sont arrondis par le transport sur des distances relativement longues; les pentes sont généralement &lt;6 %; la variation du relief est généralement &lt;10 m; l\'étendue est généralement &gt;5 km dans une même direction.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/regfm.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/regfm.html', 5, '2012-03-07 15:22:11', '2014-01-06 15:04:34', NULL),
	(809, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/regfm', 'regfm', 'none', 'S', 'false', 'aa1212', 'Scarp', 'Dominée par des escarpements', '<p>An escarpment, cliff, or steep slope of some extent along the margin of a terrace, bench, plateau, hill, or mesa; a scarp may be of any height.</p>', '<p>Escarpement, falaise ou versant abrupt d\'une certaine étendue en bordure d\'une terrasse, d\'un replat, d\'un plateau, d\'une colline ou d\'une mésa; aucune hauteur n\'est précisée.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/regfm.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/regfm.html', 6, '2012-03-07 15:23:42', '2014-01-06 15:05:17', NULL),
	(810, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/regfm', 'regfm', 'none', 'V', 'false', '3f7f00', 'Valley', 'Dominée par des vallées', '<p>Terrain dominated by major spillways, drainageways, or mountain trenches separated from surrounding landforms by a significant and abrupt break in slope; the valley profile may be V- or U-shaped with an extensive valley floor and flood plain up to about 5 km wide; valley profile may also include eroded terraces and their irregular slope segments.</p>', '<p>Terrain dominé par d\'importants déversoirs, réseaux de drainage ou tranchées montagneuses séparé des reliefs avoisinants par une importante rupture abrupte de pente; le profil de la vallée peut être en V ou en U, le fond de la vallée étant large, et la plaine d\'inondation peut atteindre environ 5 km de largeur; le profil de la vallée peut également comporter des terrasses d\'érosion accompagnées de segments irréguliers de pente.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/regfm.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/regfm.html', 7, '2012-03-07 15:27:05', '2014-01-06 15:05:32', NULL),
	(811, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/regfm', 'regfm', 'none', '#', 'true', 'cccccc', 'Non applicable', 'Ne s\'applique pas', '<p>Urban area.</p>', '<p>Région urbaine.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/regfm.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/regfm.html', 8, '2012-03-07 15:28:26', '2014-01-06 15:05:48', NULL),
	(812, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/regfm', 'regfm', 'none', '-', 'true', '7f7f7f', 'Not identified', 'Non déterminée', '<p>Not identified.</p>', '<p>Non déterminée.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/regfm.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/regfm.html', 9, '2012-03-07 15:29:28', '2014-01-06 15:06:06', NULL),
	(813, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/cmplr', 'cmplr', 'none', 'A', 'false', '', 'Compacted parent material', 'Matériau parental compacté', '<p>Compacted glacial till or other material</p>', '<p>Till glaciaire ou autre matériau tassé</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/cmplr.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/cmplr.html', 1, '2012-03-07 17:22:29', '2012-03-15 16:11:55', NULL),
	(814, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/cmplr', 'cmplr', 'none', 'B', 'false', '', 'Basal Till', 'Till de fond', '<p>Compacted glacial till deposited beneath a moving glacier</p>', '<p>Till glaciaire tassé déposé sous un glacier en progression</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/cmplr.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/cmplr.html', 2, '2012-03-07 17:23:32', '2012-03-15 16:12:29', NULL),
	(815, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/cmplr', 'cmplr', 'none', 'C', 'false', '', 'Compacted material (anthropogenic)', 'Matériau compacté (anthropique)', '<p>Soil material compacted by human activities that adversely affect crop production</p>', '<p>Sol compacté sous l\'effet de l\'activité humaine, ce qui a un effet néfaste sur la production agricole</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/cmplr.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/cmplr.html', 3, '2012-03-07 17:24:33', '2012-03-15 16:16:14', NULL),
	(816, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/cmplr', 'cmplr', 'none', 'D', 'false', '', 'Duric horizon', 'Horizon durique', '<p>See <a href="/cansis/glossary/d/index.html#duric">Duric</a> in the CanSIS glossary.</p>', '<p>Voire <a href="/siscan/glossary/d/index.html#duric">Duric</a> dans le glossaire.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/cmplr.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/cmplr.html', 4, '2012-03-07 17:27:22', '2012-03-15 16:16:46', NULL),
	(817, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/cmplr', 'cmplr', 'none', 'F', 'false', '', 'Fragipan horizon', 'Horizon fragipan', '<p>See <a href="/cansis/glossary/f/index.html#fragipan">fragipan</a> in the CanSIS glossary.</p>', '<p>Voire <a href="/siscan/glossary/f/index.html#fragipan">fragipan</a> dans le glossaire SISCan.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/cmplr.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/cmplr.html', 5, '2012-03-07 17:37:29', '2012-03-15 16:20:05', NULL),
	(818, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/cmplr', 'cmplr', 'none', 'O', 'false', '', 'Orstein horizon', 'Horizon orstein', '<p>See <a href="/cansis/glossary/o/index.html#orstein">orstein</a> in the CanSIS glossary.</p>', '<p>Voire <a href="/siscan/glossary/o/index.html#orstein">orstein</a> dans le glossaire SISCan.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/cmplr.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/cmplr.html', 6, '2012-03-07 17:40:35', '2012-03-15 16:20:33', NULL),
	(819, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/cmplr', 'cmplr', 'none', 'P', 'false', '', 'Placic horizon', 'Horizon placique', '<p>See <a href="/cansis/glossary/p/index.html#placic">placic</a> in the CanSIS glossary.</p>', '<p>Voire <a href="/siscan/glossary/p/index.html#placique">placique</a> dans le glossaire SISCan.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/cmplr.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/cmplr.html', 7, '2012-03-07 17:42:46', '2012-03-15 16:21:02', NULL),
	(820, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/cmplr', 'cmplr', 'none', 'R', 'false', '', 'Rock', 'Roche', '<p>Consolidated bedrock too hard either to break with the hands (>3 on Moh\'s scale) or to dig when moist.</p>', '<p>Affleurement rocheux consolidé impossible à briser avec les mains (>3 sur l\'échelle de dureté de Moh) ou à creuser à l\'état humide.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/cmplr.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/cmplr.html', 8, '2012-03-07 17:44:01', '2012-03-15 16:21:29', NULL),
