	(822, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/cmplr', 'cmplr', 'none', 'L', 'false', '', 'Colluvium', 'Colluvion', '<p>See <a href="/cansis/glossary/c/index.html#colluvion">colluvion</a> in the CanSIS glossary.</p>', '<p>Voire <a href="/siscan/glossary/c/index.html#colluvion">colluvion</a> dans le glossaire SISCan.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/cmplr.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/cmplr.html', 10, '2012-03-07 17:44:47', '2012-03-15 16:24:26', NULL),
