	(837, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/avwat', 'avwat', 'none', '4', 'false', '7f00ff', '150 - 200 mm', '150 - 200 mm', '<p>Available water capacity 150 - 200 mm.</p>', '<p>Capacité de rétention d\'eau 150 - 200 mm.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/avwat.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/avwat.html', 4, '2012-03-07 19:55:23', '2014-01-06 20:20:15', NULL),
	(838, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/avwat', 'avwat', 'none', '5', 'false', '3f007f', '200 - 250 mm', '200 - 250 mm', '<p>Available water capacity 200 - 250 mm.</p>', '<p>Capacité de rétention d\'eau 200 - 250 mm.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/avwat.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/avwat.html', 5, '2012-03-07 19:56:17', '2014-01-06 20:19:59', NULL),
	(839, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/avwat', 'avwat', 'none', '6', 'true', 'cccccc', 'Not applicable', 'Ne s\'applique pas', '<p>Not applicable - solonetzic or saline soils.</p>', '<p>Ne s\'applique pas - sol solonetzique ou salin.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/avwat.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/avwat.html', 6, '2012-03-07 19:57:10', '2014-01-06 20:20:27', NULL),
	(840, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/avwat', 'avwat', 'none', '7', 'true', 'cccccc', 'Not applicable', 'Ne s\'applique pas', '<p>Not applicable - high water table.</p>', '<p>Ne s\'applique pas - nappe d\'eau élevée.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/avwat.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/avwat.html', 7, '2012-03-07 20:00:32', '2014-01-06 20:20:37', NULL),
	(841, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/avwat', 'avwat', 'none', '8', 'true', 'cccccc', 'Not applicable', 'Ne s\'applique pas', '<p>Not applicable - perennially frozen subsoils.</p>', '<p>Ne s\'applique pas - sous-sols gelés en permanence.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/avwat.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/avwat.html', 8, '2012-03-07 20:02:16', '2014-01-06 20:20:53', NULL),
	(842, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/avwat', 'avwat', 'none', '#', 'true', 'cccccc', 'Not applicable', 'Ne s\'applique pas', '<p>Not applicable - water, ice, rock.</p>', '<p>Ne s\'applique pas - eau, glace, roche.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/avwat.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/avwat.html', 9, '2012-03-07 20:05:39', '2014-01-06 20:21:00', NULL),
	(843, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/avwat', 'avwat', 'none', '-', 'true', 'cccccc', 'Not identified', 'Non identifiée', '<p>Water capacity not identified.</p>', '<p>Rétention d\'eau non identifiée.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/avwat.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/avwat.html', 10, '2012-03-07 20:06:18', '2014-01-06 20:21:11', NULL),
	(844, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/watab', 'watab', 'none', '1', 'false', '', '0-2 m', '0-2 m', '<p>Most shallow water table during growing season.</p>', '<p>La nappe d\'eau la plus près de la surface au cours de la saison de croissance des végétaux.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/watab.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/watab.html', 1, '2012-03-07 20:16:52', '2012-03-15 17:52:43', NULL),
	(845, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/watab', 'watab', 'none', '2', 'false', '', '2-3 m', '2-3 m', '<p>Depth to water table, average of 2-3m.</p>', '<p>Profondeur moyenne de la nappe d\'eau de 2-3m.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/watab.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/watab.html', 2, '2012-03-07 20:17:27', '2012-03-15 17:55:52', NULL),
	(846, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/watab', 'watab', 'none', '3', 'false', '', '> 3 m', '> 3 m', '<p>Depth to water table, average of > 3 m.</p>', '<p>Profondeur moyenne de la nappe d\'eau de > 3 m.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/watab.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/watab.html', 3, '2012-03-07 20:17:58', '2012-03-15 17:59:05', NULL),
	(847, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/watab', 'watab', 'none', '4', 'false', '', '0-1 m', '0-1 m', '<p>No difference during growing season</p>', '<p>Aucune différence au cours de la saison de croissance.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/watab.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/watab.html', 4, '2012-03-07 20:21:36', '2012-03-15 18:13:33', NULL),
	(848, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/watab', 'watab', 'none', '5', 'false', '', '1-2 m', '1-2 m', '<p>Depth to water table, average of 1-2 m.</p>', '<p>Profondeur moyenne de la nappe d\'eau de 1-2 m.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/watab.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/watab.html', 5, '2012-03-07 20:22:50', '2012-03-15 18:15:14', NULL),
	(849, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/watab', 'watab', 'none', '6', 'false', '', '0-1 m (frozen)', '0-1 m (gelé)', '<p>0-1 m with perennially frozen subsoil.</p>', '<p>0-1 m avec sous-sol gelé en permanence.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/watab.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/watab.html', 6, '2012-03-07 20:24:33', '2012-03-15 18:17:03', NULL),
	(850, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/watab', 'watab', 'none', '#', 'true', '', 'Not applicable', 'Ne s\'applique pas', '<p>Not applicable (water, ice, rock).</p>', '<p>Ne s\'applique pas (eau, glace, roc).</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/watab.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/watab.html', 7, '2012-03-07 20:25:49', '2012-03-15 18:18:42', NULL),
	(851, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/watab', 'watab', 'none', '-', 'false', '', 'Not identified', 'Non identifiée', '<p>Depth to water table, average not identified.</p>', '<p>Profondeur moyenne de la nappe d\'eau non identifiée.</p>', 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/domsub/watab.html', 'http://sis.agr.gc.ca/siscan/nsdb/slc/v2.2/domsub/watab.html', 8, '2012-03-07 20:29:16', '2012-03-15 18:20:15', NULL),
	(852, 'http://sis.agr.gc.ca/cansis/nsdb/slc/v2.2/numeric/notapplicable8', 'not applicable', 'none', '-8.0', 'true', '', 'Not applicable', '', '<p>Missing value</p>', '', '', '', 99999, NULL, NULL, NULL),
	(853, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/vonpost', 'vonpost', 'none', '01', 'false', '', 'Living moss layer', 'Couche de mousse vivante', '<p>Living moss layer. Usually the surface 2-4 cm. Cannot be considered "peat" as such as it is not yet dead.</p>', '<p>Couche de mousse de vie. Habituellement, la surface 2-4 cm. Ne peut être considéré comme "tourbe" car ce n\'est pas encore mort. </p>', '', '', 1, '2012-11-05 16:18:31', '2012-11-05 16:18:41', NULL),
	(854, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/vonpost', 'vonpost', 'none', '02', 'false', '', 'Plant material is dead', 'Matériel végétal est mort', '<p>The structure and form of the plant material is complete.  The only difference between 01 and 02 is that a 02  peat is not living.  When squeezing, clear to slightly yellowish water is emitted.  The peat sample in the hand is normally bright yellowish orange in colour, especially after squeezing.  The sample is spongy, or elastic; upon squeezing, the compressed sample springs back, and will take little or no shape.</p>', '<p>La structure et la forme de la matière végétale est terminée. La seule différence entre 01 et 02, c\'est un 02 tourbe ne vit pas. Lorsque la compression, à l\'eau claire légèrement jaunâtre est émis. L\'échantillon de tourbe dans la main est normalement jaune-orange de couleur vive, surtout après compression. L\'échantillon est spongieux ou élastique, lors de la compression, les ressorts d\'échantillons comprimés de retour, et aura peu ou pas de forme </p>.', '', '', 2, '2012-11-05 16:20:05', '2012-11-05 16:27:37', NULL),
	(855, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/vonpost', 'vonpost', 'none', '03', 'false', '', 'Plant material very easily distinguishable', 'Matériel végétal très facilement distinguable', '<p>The plant material is still very easily distinguishable, but the individual sphagnum "stalks" are breaking up into pieces, as opposed to continuous lengths of stems, etc.  When squeezing, yellow water with some plant debris (mostly individual leaves is emitted.  The colour of the sample is somewhat darker that a 02 peat.  The sample is still spongy, but less than 02; after squeezing, the peat will spring back to a point where a vague to fairly definite form of the handprint is distinguishable.</p>', '<p>Le matériel végétal est encore très faciles à distinguer, mais les sphaignes individuels "tiges" se brisent en morceaux, par opposition aux longueurs continues de tiges, etc Lorsque la compression, l\'eau jaune avec quelques débris végétaux (feuilles principalement individuels est émis . la couleur de l\'échantillon est un peu plus sombre que la tourbe 02 l\'échantillon est encore spongieux, mais inférieur à 02;.. après la compression, la tourbe va rebondir à un point où une vague de forme assez précise de l\'empreinte de main est distinguable </p>', '', '', 3, '2012-11-05 16:20:05', '2012-11-05 16:27:16', NULL),
	(856, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/vonpost', 'vonpost', 'none', '04', 'false', '', 'Plant material disintegrating', 'Matériel végétal se désintègre', '<p>The plant material is not as easily distinguishable as in 03 because the pieces of peat, as mentioned above, are now disintegrating, therefor one is often dealing with individual stems, branches, and leaves.  When squeezing, light brown to brown water with a lot of debris is emitted.  The sample is not spongy, and upon rubbing, a slightly soapy or humic texture is detected.  Upon squeezing, the sample makes a perfect replica of the handprint, commonly called "brass knuckles".  It should be noted that after squeezing a peat sample, the difference in shape between a 03 and a 04, is that a 03 is "rounded off" whereas a 04 peat has definite "sharp" ridges left by the fingers. No peat escapes the fingers.</p>', '<p>Le matériel végétal n\'est pas aussi faciles à distinguer que dans 03 parce que les morceaux de tourbe, comme mentionné ci-dessus, sont maintenant se désintégrer, à cet effet une traite souvent avec des tiges individuelles, les branches et les feuilles. Lorsque la compression, brun clair à brun eau avec beaucoup de débris est émis. L\'échantillon n\'est pas spongieux, et lors de frottement, une texture légèrement savonneuse ou humique est détectée. Après pressage, l\'échantillon permet une parfaite réplique de l\'empreinte de main, communément appelé "coup de poing". Il convient de noter que, après serrant un échantillon de tourbe, la différence de forme entre un 03 et un 04, c\'est un 03 est "arrondi" alors qu\'un 04 tourbe a définies crêtes "pointus" laissées par les doigts. Pas de tourbe s\'échappe des doigts. </p>', '', '', 4, '2012-11-05 16:20:05', '2012-11-05 16:28:24', NULL),
	(857, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/vonpost', 'vonpost', 'none', '05', 'false', '', 'Some unstructured material is present', 'Certains matériaux non structurés est présent', '<p>The plant material is reaching a stage of decomposition where the individual components (branches, leaves, stem) are starting to breakup, such that some amorphous or unstructured material is present. When squeezing, definitely brown water is emitted.  This water is reaching the point where it can no longer be termed "water", but is a solution.  The sample has a more definite soapy or humic texture, yet roughness is still present.  Upon squeezing a very small amount of the sample escapes between the fingers.</p>', '<p>Le matériel végétal a atteint un stade de décomposition où les composants individuels (branches, feuilles, tige) commencent à rupture, tels que certains matériaux amorphes ou non structurées est présent. Lorsque la compression, l\'eau définitivement brun est émis. Cette eau est d\'atteindre le point où il ne peut plus être appelé «eau», mais c\'est une solution. L\'échantillon a une savonneuse plus précis ou la texture humique, mais la rugosité est toujours présent. Sur serrant une très petite quantité de l\'échantillon s\'échappe entre les doigts. </p>', '', '', 5, '2012-11-05 16:20:05', '2012-11-05 16:29:15', NULL),
	(858, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/vonpost', 'vonpost', 'none', '06', 'false', '', 'Half of the material is unstructured', 'La moitié du matériel est non structurées', '<p>The plant material has decomposed to the extent where almost half of the sample is in an amorphous or unstructured state.  Plant constituents are still distinguishable upon close examination in the hand. upon squeezing, brown to dark brown water is emitted.  The sample is pasty and very malleable.  Upon squeezing, approximately one-third of the peat escapes between the fingers as a paste.</p>', '<p>Le matériel végétal a été décomposée dans la mesure où près de la moitié de l\'échantillon est dans un état amorphe ou non structuré. Constituants de la plante sont encore identifiables à l\'examen attentif dans la main. à presser, brun à brun foncé eau est émis. L\'échantillon est pâteuse et très malléable. Après pressage, environ un tiers de la tourbe s\'échappe entre les doigts comme une pâte. </p>', '', '', 6, '2012-11-05 16:20:05', '2012-11-05 16:30:01', NULL),
	(859, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/vonpost', 'vonpost', 'none', '07', 'false', '', 'Plant material practically indistinguishable', 'Matériel végétal est pratiquement indiscernable', '<p>The original plant material is practically undistinguishable and a very close examination in the hand is needed to see that there are still vague structures present.  If the sample is "worked" in the hand, this structure will disappear.  It should be noted that such things as weed, sedge roots, and Eriophorum fibres are often very resistant to decomposition, and can be present in their "original" state in humified peats up to 07.  Upon gentle squeezing, a small amount of very dark water is emitted.  When the final squeeze is performed, over half of the material escapes the hand.</p>', '<p>Le matériel végétal d\'origine est pratiquement imperceptible et un examen très attentif à la main est nécessaire pour voir qu\'il ya encore des structures vagues actuelles. Si l\'échantillon est «travaillé» dans la main, cette structure va disparaître. Il convient de noter que de telles choses comme les mauvaises herbes, les racines de carex et de fibres de Eriophorum sont souvent très résistantes à la décomposition, et peuvent être présents dans leur état "original" dans tourbes humifiées jusqu\'à 07. Sur légère pression, une petite quantité d\'eau très sombre est émis. Lorsque la compression finale est réalisée, plus de la moitié de la matière échappe à la main. </p>', '', '', 7, '2012-11-05 16:20:05', '2012-11-05 16:30:54', NULL),
	(860, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/vonpost', 'vonpost', 'none', '08', 'false', '', 'No appreciable roots or fibres', 'Pas de racines ou de fibres appréciables', '<p>The only distinguishable plant remains are roots or Eriophorum fibres, when present.  If appreciable amounts of roots or fibres are present, the peat cannot be considered to be a 08, even though the remaining material is such.  The "appreciable amount" of these materials occur when they interfere with the squeezing out of the remaining amorphous material.  If pieces or chips of weed are present in the sample, regardless of the amount, this alone classifies the peat as a 07.  Little or no water is emitted upon gentle squeezing.  The final squeeze results in over two thirds of the peat escaping the hand.</p>', '<p>Les seuls restes de plantes reconnaissables sont des racines ou des fibres Eriophorum, lorsqu\'il est présent. Si des quantités appréciables de racines ou de fibres sont présents, la tourbe peut pas être considéré comme un 08, même si le reste du matériel est telle. La "quantité appréciable" de ces matériaux se produit quand ils interfèrent avec la compression sur le matériau amorphe restante. Si des morceaux ou des copeaux de mauvaises herbes sont présentes dans l\'échantillon, quel que soit le montant, cette seule classe la tourbe comme 07. Eau peu ou pas est émis lors de légère pression. Les résultats définitifs de compression dans plus de deux tiers de la tourbe qui fuient la main.</p>', '', '', 8, '2012-11-05 16:20:05', '2012-11-05 16:35:29', NULL),
	(861, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/vonpost', 'vonpost', 'none', '09', 'false', '', 'Homogeneous amorphous', 'Amorphe homogène', '<p>A very homogenous, amorphous sample containing no roots or fibres. There is no free water emitted upon squeezing, and almost all of the sample escapes the hand.</p>', '<p>A, l\'échantillon amorphe très homogène contenant pas de racines ou de fibres. Il n\'y a pas d\'eau libre émise lors de la compression, et la quasi-totalité de l\'échantillon échappe à la main.</p>', '', '', 9, '2012-11-05 16:20:05', '2012-11-05 16:32:34', NULL),
	(862, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/slt/vonpost', 'vonpost', 'none', '10', 'false', '', 'Pudding-like homogeneous', 'Pudding homogène', '<p>Very rare to non-existent in non-sedimentary peats.  In sedimentary peats, the particle size can be extremely small resulting in "pudding-like" homogenous material.  Upon squeezing, all of the sample escapes the hand.</p>', '<p>Très rare, voire inexistante dans les tourbes non-sédimentaires. En tourbes sédimentaires, la taille des particules peut être extrêmement faible résultant en "pudding" matériau homogène. Après pressage, tous de l\'échantillon n\'échappe à la main.</p>', '', '', 10, '2012-11-05 16:20:05', '2012-11-05 16:35:59', NULL),
	(863, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/rootrestri', 'rootrestri', 'none', '1', 'false', '', 'First layer', 'Première couche', '<p>The growth of plant roots is restricted by the first (uppermost) layer.</p>', '<p>La croissance des racines des plantes est limitée par la première couche (la plus haute). </ p>', '', '', 1, NULL, '2012-11-27 18:13:58', NULL),
	(864, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/rootrestri', 'rootrestri', 'none', '-', 'true', 'cccccc', 'Not applicable', 'Ne s\'applique pas', '<p>Non-applicable (e.g. rock, ice).</p>', '<p>Ne s\'applique pas (roche, glace).</p>', '', '', 11, NULL, '2012-11-27 18:13:58', NULL),
	(865, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/rootrestri', 'rootrestri', 'none', '0', 'false', '', 'No root restricting layer', 'Aucune couche qui limite racines', '<p>The growth of plant roots is not restricted by any soil layer.</p>', '<p>La croissance des racines des plantes n\'est pas limité par une couche de sol.</p>', '', '', 0, NULL, '2012-11-27 18:13:58', NULL),
	(866, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/rootrestri', 'rootrestri', 'none', '2', 'false', '', 'Second layer', 'Deuxième couche', '<p>The growth of plant roots is restricted by the second layer.</p>', '<p>La croissance des racines de la plante est limitée par la deuxième couche.</p>', '', '', 2, NULL, '2012-11-27 18:13:58', NULL),
	(867, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/rootrestri', 'rootrestri', 'none', '3', 'false', '', 'Third layer', 'troisième couche', '<p>The growth of plant roots is restricted by the third layer.</p>', '<p>La croissance des racines de la plante est limitée par la troisième couche.</p>', '', '', 3, NULL, '2012-11-27 18:13:58', NULL),
	(869, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/rootrestri', 'rootrestri', 'none', '4', 'false', '', 'Fourth layer', 'Quatrième couche', '<p>The growth of plant roots is restricted by the fourth layer.</p>', '<p>La croissance des racines des plantes est limitée par la quatrième couche.</p>', '', '', 4, NULL, '2012-11-27 18:13:58', NULL),
	(870, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/rootrestri', 'rootrestri', 'none', '5', 'false', '', 'Fifth layer', 'Cinquième couche', '<p>The growth of plant roots is restricted by the fifth layer.</p>', '<p>La croissance des racines des plantes est limitée par la cinquième couche.</p>', '', '', 5, NULL, '2012-11-27 18:13:58', NULL),
	(871, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/rootrestri', 'rootrestri', 'none', '6', 'false', '', 'Sixth layer', 'Sixième couche', '<p>The growth of plant roots is restricted by the sixth layer.</p>', '<p>La croissance des racines des plantes est limitée par la sixième couche.</p>', '', '', 6, NULL, '2012-11-27 18:13:58', NULL),
	(872, 'http://sis.agr.gc.ca/cansis/nsdb/soil/v1/snt/rootrestri', 'rootrestri', 'none', '7', 'false', '', 'Seventh layer', 'Septième couche', '<p>The growth of plant roots is restricted by the seventh layer.</p>', '<p>La croissance des racines des plantes est limitée par la septième couche.</p>', '', '', 7, NULL, '2012-11-27 18:13:58', NULL),
