	(875, 'http://sis.agr.gc.ca/cansis/nsdb/texture', 'texture', 'none', 'HC', 'false', '', 'Heavy Clay', 'Argile lourde', '<p>Soil material that contains more than 60% clay.</p>', '<p>Matériau du sol contenant plus de 60% d\'argile.</p>', '', '', 1, '2013-02-15 20:10:59', '2013-02-15 20:16:16', NULL),
	(876, 'http://sis.agr.gc.ca/cansis/nsdb/texture', 'texture', 'none', 'C', 'false', '', 'Clay', 'Argile', '<p>Soil material that contains 40% or more clay, less than 45% sand, and less than 40% silt.</p>', '<p>Matériau du sol contenant 40% ou plus d\'argile, moins de 45% de sable et moins de 40% de limon.</p>', '', '', 2, '2013-02-15 20:12:09', '2013-02-15 20:15:58', NULL),
	(877, 'http://sis.agr.gc.ca/cansis/nsdb/texture', 'texture', 'none', 'SiC', 'false', '', 'Silty Clay', 'Argile limoneuse', '<p>Soil material that contains 40% or more clay and 40% or more silt.</p>', '<p>Matériau du sol contenant 40% ou plus d\'argile et 40% ou plus de limon.</p>', '', '', 3, '2013-02-15 20:17:10', '2013-02-15 20:42:16', NULL),
	(878, 'http://sis.agr.gc.ca/cansis/nsdb/texture', 'texture', 'none', 'SiCL', 'false', '', 'Silty clay loam', 'Loam limono-argileux', '<p>Soil material that contains 27 to 40% clay and less than 20% sand.</p>', '<p>Matériau du sol contenant de 27 à 40% d\'argile et moins de 20% de sable.</p>', '', '', 4, '2013-02-15 20:17:10', '2013-02-15 20:43:30', NULL),
	(879, 'http://sis.agr.gc.ca/cansis/nsdb/texture', 'texture', 'none', 'CL', 'false', '', 'Clay loam', 'Loam argileux', '<p>Soil material that contains 27 to 40% clay and 20 to 45% sand.</p>', '<p>Matériau du sol contenant de 27 à 40% d\'argile et de 20 à 45% de sable.</p>', '', '', 5, '2013-02-15 20:17:10', '2013-02-15 20:57:19', NULL),
	(880, 'http://sis.agr.gc.ca/cansis/nsdb/texture', 'texture', 'none', 'Si', 'false', '', 'Silt', 'Limon', '<p>Soil material that contains 80% or more silt and less than 12% clay.</p>', '<p>Matériau du sol contenant 80% ou plus de limon et moins de 12% d\'argile.</p>', '', '', 6, '2013-02-15 20:17:10', '2013-02-15 20:49:06', NULL),
	(881, 'http://sis.agr.gc.ca/cansis/nsdb/texture', 'texture', 'none', 'SiL', 'false', '', 'Silt loam', 'Loam limoneux', '<p>Soil material that contains 50% or more silt and 12 to 27% clay, or 50 to 80% silt and less than 12% clay.</p>', '<p>Matériau du sol contenant de 50% ou plus de limon et de 12 à 27% d\'argile, ou bien 50 à 80% de limon et moins de 12% d\'argile.</p>', '', '', 7, '2013-02-15 20:17:10', '2013-02-15 20:49:39', NULL),
	(882, 'http://sis.agr.gc.ca/cansis/nsdb/texture', 'texture', 'none', 'L', 'false', '', 'Loam', 'Loam', '<p>Soil material that contains 7 to 27% clay, 28 to 50% silt, and less than 52% sand.</p>', '<p>Matériau du sol contenant de 7 à 27% d\'argile, de 28 à 50% de limon et moins de 52% de sable.</p>', '', '', 8, '2013-02-15 20:17:10', '2013-02-15 20:50:20', NULL),
	(883, 'http://sis.agr.gc.ca/cansis/nsdb/texture', 'texture', 'none', 'SC', 'false', '', 'Sandy clay', 'Argile sableuse', '<p>Soil material that contains 35% or more clay and 45% or more sand.</p>', '<p>Matériau du sol contenant 35% ou plus d\'argile et 45% ou plus de sable.</p>', '', '', 9, '2013-02-15 20:17:10', '2013-02-15 20:51:08', NULL),
	(884, 'http://sis.agr.gc.ca/cansis/nsdb/texture', 'texture', 'none', 'SCL', 'false', '', 'Sandy clay loam', 'Loam sablo-argileux', '<p>Soil material that contains 27 to 40% clay and less than 20%sand.</p>', '<p>Matériau du sol contenant de 20 à 35% d\'argile, moins de 28% de limon et 45% ou plus de sable.</p>', '', '', 10, '2013-02-15 20:17:10', '2013-02-15 20:52:13', NULL),
	(885, 'http://sis.agr.gc.ca/cansis/nsdb/texture', 'texture', 'none', 'SL', 'false', '', 'Sandy loam', 'Loam sableux', '<p>Soil material that contains either 20% or less clay, with a percentage of silt plus twice the percentage of clay that exceeds 30, and 52% or more sand; or less than 7% clay, less than 50% silt, and between 43% and 52% sand. </p>', '<p>Matériau du sol contenant soit 20% ou moins d\'argile, avec un pourcentage de limon plus deux fois celui de l\'argile supérieur à 30, et 52% ou plus de sable, soit moins de 7% d\'argile, moins de 50% de limon et entre 43% et 52% de sable. </p>', '', '', 11, '2013-02-15 20:17:10', '2013-02-15 20:52:59', NULL),
	(886, 'http://sis.agr.gc.ca/cansis/nsdb/texture', 'texture', 'none', 'LS', 'false', '', 'Loamy sand', 'Sable loameux', '<p>Soil material that contains at the upper limit 85 to 90% sand, and the percentage of silt plus 1.5 times the percentage of clay is not less than 15, at the lower limit it contains not less than 70 to 85% sand, and the percentage of silt plus twice the percentage of clay does not exceed 30. </p>', '<p>Matériau du sol contenant au plus 85 à 90% de sable et un pourcentage de limon, plus 1,5 fois le pourcentage d\'argile égal ou supérieur à 15; à l\'autre limite, ce matériau ne contient pas moins de 70 à 85% de sable, et le pourcentage de limon plus le double du pourcentage d\'argile n\'excède pas 30.</p>', '', '', 12, '2013-02-15 20:17:10', '2013-02-15 20:53:35', NULL),
	(887, 'http://sis.agr.gc.ca/cansis/nsdb/texture', 'texture', 'none', 'S', 'false', '', 'Sand', 'Sable', '<p>Soil material that contains 85% or more sand; the percentage of silt plus 1.5 times the percentage of clay does not exceed 15. coarse sand (sable grossier) 25% or more very coarse and coarse sand, and less than 50% any other one grade of sand.</p>', '<p>Matériau du sol contenant 85% et plus de sable; le pourcentage du limon plus 1,5 fois le pourcentage d\'argile n\'excède pas 15.</p>', '', '', 13, '2013-02-15 20:17:10', '2013-02-15 20:55:25', NULL),
