INSERT INTO `webapplications` (`id`, `name`, `group_en`, `group_fr`, `subgroup_en`, `subgroup_fr`, `sortation`, `title_en`, `title_fr`, `doc_en`, `doc_fr`, `domain`, `testing_domain`, `path`, `wadl_path`) VALUES
	(1, 'vector', 'Data Access', 'Accès aux données', 'NSDB', 'BNDS', 1, 'Vector Data', '', 'This web application generates custom data extracts from vector datasets in the NSDB.  It outputs a variety of formats including JSON, GDAS, and KML.', '', 'sis.agr.gc.ca', 'website.gis.agr.gc.ca', 'services/vector', 'services/vector/wadl.xml'),
	(5, 'lsrs_rest', 'Interpretations', 'Interprétations', 'LSRS', 'BNDS', 8, 'LSRS Calculator (REST)', '', 'This web application calculates a Land Suitability Rating System (LSRS) value for a given soil polygon and climate scenario.', '', 'lsrsdev.gis.agr.gc.ca', 'lsrs.gis.agr.gc.ca', '/lsrs', '../lsrs_rest/wadl.xml'),
	(6, 'soils', 'Data Access', 'Accès aux données', 'NSDB', 'BNDS', 4, 'Soil Attributes', 'Données de sol', 'This web application generates json and html files containing soil name and soil layer data based on the contents of the Soil Name and Soil Layer tables.  It includes a set of requests that indicate valid combinations of soil codes, modifiers, and profile identifiers.', 'Cette application web génère des fichiers JSON et html contenant le nom du sol et des données de la couche de sol en fonction du contenu de les tables nom du sol et couches du sol. Il comprend un ensemble de demandes qui indiquent des combinaisons valides de codes de sol, des modificateurs, et les identificateurs de profil.', 'sis.agr.gc.ca', 'website.gis.agr.gc.ca', 'soils', 'soils/wadl.xml'),
	(8, 'tjs', 'Data Access', 'Accès aux données', 'NSDB', 'BNDS', 5, 'Table Joining Service (TJS)', 'Table Joining Service (TJS)', 'This service is an implementation of the OGC TJS v1.0 standard  (http://opengeospatial.org/standards/tjs).  It allows retrieval of data in GDAS format from a server.', 'Ce service est une implémentation de la norme  TJS v1.0 de OGC (http://opengeospatial.org/standards/tjs). Il permet la récupération des données en format GDAS à partir d\'un serveur Web.', 'sis.agr.gc.ca', 'website.gis.agr.gc.ca', 'services', 'services/tjs/wadl.xml'),
	(9, 'lsrs', 'Interpretations', 'Interprétations', 'NSDB', 'BNDS', 7, 'LSRS Calculator', '', 'This service calculates a Land Suitability Rating System (LSRS) value for a given soil polygon and climate scenario.', '', 'lsrs.gis.agr.gc.ca', 'lsrs.gis.agr.gc.ca', '/lsrs', '../lsrs/wadl.xml'),
	(10, 'texture', 'Interpretations', 'Interprétations', 'NSDB', 'BNDS', 18, 'Soil Texture Class Calculator', '', 'This service indentifies the soil texture in response to sand,silt,clay percentages.', '', 'sis.agr.gc.ca', 'website.gis.agr.gc.ca', 'services/texture', 'services/texture/wadl.xml'),
	(11, 'cssc3', 'Documentation', 'Documentation', 'Soil Science', 'La science du sol', 101, 'CSSC3 Taxonomy', 'SCCS3 Taxonomie', 'This web application creates different views of the Canadian System for Soil Classification, 3rd edition (CSSC3).', 'Ce service crée des vues différentes du Système canadien de classification des sols, 3e édition (SCCS3).', 'sis.agr.gc.ca', 'website.gis.agr.gc.ca', 'taxa/cssc3', 'services/cssc3/wadl.xml'),
	(12, 'pars', 'Utilities', '', 'Vector', '', 200, 'Polygon Attribute Reallocation', '', 'This web application applies a Polygon Attribute Reallocation Table (PART) to an input data set, in order to allocate data from an input table to the relevant polygon coverage.', '', 'services.gis.agr.gc.ca', 'website.gis.agr.gc.ca', 'services/pars', 'services/pars/wadl.xml');
