INSERT INTO `webappqueryparams` (`id`, `webappmethod_id`, `name`, `sortation`, `datatype`, `required`, `doc_en`, `doc_fr`) VALUES
	(321, 51, 'polygons', 42, 'xsi:string', 0, 'A list of polygon identifiers that should be included in the KML file.  \r\nThe list of poly_ids shall be comma-separated (e.g. "bc5001,bc5002,bc5003").  Precludes the use of the "polygonrange" and "polygonset" parameters.', ''),
	(322, 51, 'polygonrange', 41, 'xsi:string', 0, 'The range of polygon identifiers that should be included in the KML file.  \r\nThe range of poly_ids shall take the form "minimum..maximum" (e.g. "bc0001..bc0043").  Precludes the use of the "polygons" and "polygonset" parameters.', ''),
	(323, 51, 'polygonset', 40, 'xsi:string', 0, 'A predetermined set of polygons available from the server from the "polygonset" resource, that should be included in the KML file.  Precludes the use of the "polygons" and "polygonrange" parameters.', ''),
	(334, 51, 'dataset', 10, 'xsi:string', 1, 'Indicates the dataset containing the attribute that should be used to theme the map.  This parameter must match the name of a dataset found in the "list_datasets" method.  Must be used in conjunction with the "attribute" parameter.', ''),
	(335, 51, 'attribute', 20, 'xsi:string', 1, 'Indicates the attribute that should be used to theme the map.  This parameter must match the name of one of the attributes in the dataset defined by the "dataset" parameter.', ''),
