	(369, 51, 'value', 30, 'xsi:string', 0, 'Identifies a query restriction to be applied when populating the data content of the response.  Relevant and required only for component data where "Columnset/FrameworkKey/@relationship" = "many".  When present, data content for each framework key shall be the percentage of the polygon occupied by the identified value.  For the special case where "value" = "dominant" the response shall be the dominant value for each Key.', 'Identifie une restriction requête doit être appliquée lors du remplissage du contenu des données de la réponse. Valable uniquement pour les données de composants où «relation ColumnSet/FrameworkKey/@relationship» = «many». Lorsqu\'ils sont présents, le contenu de données pour chaque clé de cadre est le pourcentage du polygone occupée par la valeur identifiée. Pour le cas particulier où la «valeur» = «dominant» la réponse est la valeur dominante pour chaque touche.'),
